INSERT INTO manuscripts VALUES(1,1,'Harley MS 2','Harley','4th quarter of the 12th century-2nd half of the 13th century',1175,1299,'This manuscript contains ten parts written in England during the 2nd half of the 12th century or the 1st half of the 13th century. Most likely they were once part of different manuscripts (as suggested by a quire mark (‘III’) on f. 257v).A (? late) 13th-century table of contents that lists all their contents indicates that the different parts were joined together soon after their production. These parts may have been written and bound together at the Augustinian abbey of Thornton-on-Humber in Lincolnshire, which certainly owned the manuscript by the 14th or 15th century.In the early 16th century, the manuscript was selected by Henry VIII for acquisition for the Royal Library and was possibly annotated by him.The manuscript contains saints’ Lives, sermons and an incomplete copy of theGesta Pontificum Anglorum(Deeds of the Bishops of the English) by the Benedictine monk William of Malmesbury (b. c. 1080, d. 1143). The Life of St Edmund by Eustace of Faversham is linguistically interes...','Origin:?Thornton Abbey, Midlands, England.Provenance:The Augustinian abbey of St Mary, Thornton-on-Humber, founded in 1139 as a priory (an abbey since 1148): its ownership inscription, added in the 15th century on a parchment rectangle pasted on to f. 1* recto: ‘Historia de gestis pontificum Anglorum. constat monasterio beate marie de thornton super humbream’ (see Ker,Medieval Libraries(1964), p. 189); perhaps its table of contents on f. 1*verso, added in the 13th century; perhaps its pressmark ’33. A. 2’ on f. 1* recto; the manuscript is listed in an early 16th-century inventory of Thornton Abbey’s books (see below).? ‘William Fawne’, owned in 1525: his name inscribed on f. 1* recto (‘Wylliam Fawne anno domini Mccccc xxv’): a \'William Fawne\' is named as executor in the will of Nicholas Fawne, Vicar of Skendleby (Lincolnshire), drawn up in 1547 (see Maddison,Lincolnshire Wills(1888), p. 64).The Royal Library, acquired between (?) 1525 and 1530: the manuscript can be identified with the \'Libellus de gestis pontificum anglorum\' that is listed in a 16th-century inventory of Thornton Abbey’s books, probably created by the antiquary John Leland (b. c. 1503, d. 1552) before 1536. Henry VIII (b. 1491, d. 1547) read the inventory and marked those manuscripts which he desired for the Royal Library with a cross: the selected manuscripts include Thornton Abbey’s copy of theGestis Pontificum Anglorum(see Liddell, \'\'Leland\'s\' Lists’ (1939), p. 91). At the Royal Library, the manuscript’s passages on councils, the authority of bishops and the Pope, and consanguinity in marriage were examined by scholars for theCollectanea satis copiosa(The Sufficiently Abundant Collections): a collection of learned texts compiled in 1530-1531 that justified Henry VIII\'s independence from Rome. Carley suggests that Harley MS 2’s copy of the Constitutions of Clarendon of 1164, listed to explain the cause of Thomas of Canterbury’s exile and martyrdom, may have been the immediate source for the articles that are quoted from the Constitutions in theCollectanea(see Carley, ‘William of Malmesbury’ (2009), p. 140 (no. 132)). The marginal notes that highlight passages throughout the manuscript were added in the Royal Library, possibly by Henry VIII himself: e.g. the passage on consanguinity in marriage on f. 130r (see Carley, ‘Marks in Books’ (1997), p. 591 n. 25). The manuscript left the Royal Library at an unknown point in time.The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','English, MiddleLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100063647159.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100063647161.0x000001/full/147,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002045830',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(2,1,'Harley MS 12','Harley','2nd half of the 11th century-1st half of the 12th century',1050,1149,'This manuscript consists of two parts. The first part (ff. 1r-140v) was written in the 2nd half of the 11th century. The second part (ff. 141r-143v) was written in the 1st half of the 12th century.Contents:f. 1*recto: \'Joh[ann]es Levita\'; added in the (?) 16th century.ff. 1r-140v: John the Deacon of Rome,Vita Gregorii Magni(Bibliotheca Hagiographica Latina3641–2).f. 140v: Pseudo-Gregory,Versus sancti Gregorii papae, beginning: \'Versus sancti Gregorii papae. Quos fecit sabbato ante ramis palamarum. Virgo parens. hac luce deumque virumque creavit [...] Et mortem iussit mortuus ipse mori.’ff. 141r-143v:Vita S. Katherinae, divided into in twelve lessons for Matins, with responsories and Anglo-Norman neumes. ‘Maxentius Imperator anno regni sui tricesimo quinto residens’.Decoration:New books open with three-line initials (first six), while chapters open with two-line initials, both alternating between green and red; occasionally with simple penwork, e.g. ff. 34v–35r, 81v–82v. Red elements...','Origin:Durham or Winchester (Part 1); England (Part 2).Provenance:Durham or Winchester, probably produced part 1 (ff. 1r-140v) of the manuscript: according to Watson,The Library of Sir Simonds D\'Ewes(1966), p. 208 (A.289); and Gneuss and Lapidge,Anglo-Saxon Manuscripts(2014), nos 411.6 and 411.7; this part includes a hand identified in several books of a likely Durham origin (see Robinson,Catalogue(2003), no. 127).Thomas Dackomb (d. c. 1572), rector of St Mary Colebrook, owned part 1 (ff. 1r-140v) and perhaps part 2 (ff. 141r-143v) as well: his ownership inscription on f. 1r: ‘Liber d[omi]ni Thomae dakomb’ Rector de colbrok a[nno] d[omi]ni 1543’; followed by a note about his payment for the manuscript: \'Empt[us] p[re]c[ium] xxij d\' (see Watson, ‘Thomas Dackomb’ (1963), pp. 208-213; Wright,Fontes Harleiani(1972), p. 122).Sir Simonds d\'Ewes (b. 1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton: inscribed on f. 1r: \'2\'; and on f. 141r: \'Vita S[ancte] Catherinae edita: sed vetustissimu[m] hoc exemplar\'; recorded in his catalogues as A.289 and B.63 (Watson, TheLibrary of Sir Simonds D\'Ewes(1966), pp. 137 and 292); and listed by Edward Bernard (Bernard,Catalogi librorum(1697), II, p. 386, no. 9923 (63)) as having belonged to him in 1697: \'Vita Gregorii Magni per Jo. Levitam\' (see also Wright,Fontes Harleiani(1972), p. 131).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450.The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100058108095.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058108097.0x000001/full/142,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002045840',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(3,1,'Harley MS 46','Harley','4th quarter of the 12th century',1175,1199,'ff. 1r-v:Capitulareferring to quires and folios of the manuscript.ff. 3r-4r: Preface on the Gospels, excerpted from Genesis, beginning: ‘Fecit deus duo magna luminaria’ff. 4r-6v: Glossed prologue to the Gospel of St Matthew, beginning: ‘Mattheus ex iudea sicut in ordine’; gloss on the prologue (f. 4v): \'Nomen libri evangelium grece\'.ff. 7r-94r: Glossed Gospel of St Matthew, beginning: \'Liber generacionis Ihesu Christi filii David\'; beginning of the gloss: \'Planior esset sensus\'.f. 95r-v: Glossed prologue to the Gospel of St Mark, beginning: \'Marcus evangelista dei\'; beginning of the gloss: \'Quatuor sunt qualitates\'.ff. 96r-152r: Glossed Gospel of St Mark, beginning: \'Initium evangelii Ihesu Christi filii Dei\'; beginning of the gloss: \'Nota quod hoc testimonium\'.Decoration:Five large initials in gold and sometimes silver with penwork decoration in red, blue, and green, some with acanthus leaves or zoomorphic features at the beginning of prologues and books (ff. 3r, 4r, 7r, 95r, 96r)....','Origin:England.Provenance:The cathedral church of St Peter, York: 14th-century inscriptions, ‘de Thesauraria Eborum ecclesie’, (f. 1* recto; ‘Eborum’ retouched) and ‘Lib’ s[ancti] Petri Ebor’’ (f. 3r; ‘Petri’ erased but legible under UV light).Henry Savile of Banke (1568–1617), collector of manuscripts: the Savile cypher (f. 3r); no. 59 in his catalogue.Sir Simonds d\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton (see Wright,Fontes Harleiani(1972)): inscribed \'Symonds D\'Ewes (f. 2r).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Watson,The library of Sir Simonds d\'Ewes(1966)).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100056056646.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056056648.0x000001/full/168,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002045874',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(4,1,'Harley MS 59','Harley','2nd or 3rd quarter of the 12th century',1125,1174,'This manuscript preserves the work known asHistoria Iosephi de Bello Iudaico et Excidio Urbis Hierosolymitanae(The History of Josephus on the Jewish Wars and the Destruction of the City of Jerusalem), a 4th-century adaptation of Josephus\' (b. 37, d. 100)Jewish Wars.The work was attributed to Hegesippus, which may have been a misspelling of ‘Josephus’.Contents:ff. 2r-73v: Pseudo-Hegesippus,Historia Iosephi de Bello Iudaico et Excidio Urbis Hierosolymitanae, beginning: ‘Quaecunque scriptura complexa est’.[ff. 74r-75v are blank].Decoration:3 large initials in blue or in red, with reserved designs and penwork decoration alternating between green and brown (ff. 2r, 36r, 46r). 3 large initials in red with penwork decoration in blue or in blue with penwork decoration in red (ff. 2r, 26r, 54v). Numerous small initials in red or green with penwork decoration in the alternate colour (ff. 33v-73v), one in blue with penwork decoration in red (f. 38v). Numerous initials in red or green, occasion...','Origin:England.Provenance:The Augustinian abbey of Holy Cross, Waltham, Essex, founded in 1177: inscribed with library\'s press-mark (\'xlv. al[mario] supp[rioris]\' on f. 1r in a 14th-century script (seeThe libraries of the Augustinian canons, ed. by Webber and Watson (1997), p. 428).Henry Norbridge of Ilford, owned in the 16th century: inscribed with his name \'Henricus Norbrgge of Hilford\' in a 16th-century script (f. 75r).Unknown 16th- or 17th-century English owner: inscribed with the initials ‘P. W.’ in a late 16th-early 17th century hand (f. 2r).Sir Simonds D\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton: inscribed with number \'52\' (f. 2r), recorded in his catalogue (see Watson,The Library of Sir Simonds D\'Ewes,p. 123).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Wright,Fontes Harleiani, p. 131).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100059466858.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059466860.0x000001/full/155,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002045887',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(5,1,'Harley MS 82','Harley','12th century-14th century',1100,1399,'This composite manuscript contains three parts that were separately produced:I: ff. 1r–3v (Register);II: ff. 4r–34v (Martyrology);III: ff. 35r–104v (Voyage d\'outre mer).The martyrology was written in the 12th century at the Benedictine abbey of St Mary the Virgin in Reading. The first part of Harley MS 82, containing a register for the abbey, was added to the Martyrology in the early 13th century. The manuscript may have belonged to the abbey until its dissolution in 1538. It was then owned by Sir Simonds D’Ewes (b. 1602, d. 1650), who also owned a copy ofVoyage d’outre mer, what is now the third part of Harley MS 82. The two manuscripts may have been joined together either in the library of D\'Ewes family or that of Robert Harley.Contents:ff. 1r–3v: Three leaves from a register of Abbot Nicholas of Whapelode (r. 1305–28), containing entries for 1305–11.ff. 4r–34v: Usuard, Martyrology, organized by calendar (January through December, ff. 4r–32v) with a second section by the church ye...','Origin:England.Provenance:Sir Simonds D’Ewes (b. 1602, d. 1650), 1st baronet, diarist and antiquary: the joined first two parts of Harley MS 82 and part three are both recorded his catalogue (Watson,The Library of Sir Simonds D’Ewes(1966), p. 201 (A.864), p. 318 (no. X.7).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450.The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Greek, AncientLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100059470229.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059470231.0x000001/full/141,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002045910',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(6,1,'Harley MS 101','Harley','1150-1180',1150,1180,'This manuscript was produced at the Benedictine abbey of St Mary the Virgin in Reading. It was produced in a stylistic period of manuscript production at the abbey that has been dated to between 1150 and 1180. Many of the abbey’s manuscripts from this period contain patristic writings, which is indicative of the perceived importance of writings by the Church Fathers for biblical interpretation (Coates,The Reading Abbey Collections(1999) pp. 58-59). This manuscript contains the commentary on the Song of Songs by the Greek theologian Origen (b. 184/185, d. 253/254). It also contains a manual for monks and clerics,De institutione clericorum(On the Education of the Clergy) by the Benedictine monk Hrabanus Maurus (d. 856).Contents:ff. 1r–93v: Origen, translated by Rufinus of Aquileia (b. c 345, d. 411),Commentary on the Song of Songs, beginning \'Epithalamium origenis super cantica canticorum\'.ff. 94r–118v: Hrabanus Maurus,De institutione clericorum, beginning \'Incipit prefacio rabani mau...','Origin:England, S. (Reading).Provenance:The Benedictine abbey of St Mary, Reading, Berkshire, founded in 1125: listed in its late-12th century book list as \'Epithalamium Origenis super Cantica Canticorum, ubi etiam est liber Rabani Mauri, de institutionibus clericorum\' (Sharpe and others,English Benedictine Libraries(1996), p. 437 (no.B71.112)); an early 13th-century inscription, \'Hic est liber sancte marie de Rading’ on f. 1* recto. This manuscript belongs to the \'Second phase\' of manuscript production at Reading which took place from the 1150s to the 1170s (see Coates, The Reading Abbey Collections (1999) p. 59.)Sir Simonds d\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton (see Wright 1972): inscribed \'16\' in his hand (f. 1r), and no. 221 in his list in Add. 22918 (see Watson, Fontes Harleiani, (1966), p. 124).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Watson, Fontes Harleiani, (1966), pp. 56-61).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100059297570.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059297572.0x000001/full/171,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002045929',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(7,1,'Harley MS 104','Harley','1st quarter of the 13th century',1200,1224,'This English manuscript from the 1st quarter of the 13th century (beforec. 1225 and after 1206 or 1215) was probably written for a clerical audience since it contains works that would have helped priests in explaining biblical texts to the laity and instructed them in their duties of pastoral care. The manuscript\'s biblical works are theExpositio Libri Duodecim Prophetarum(Commentary on the Books of the Twelve Minor Prophets) by Stephen Langton (b. c. 1150, d. 1228), Archbishop of Canterbury; theAllegoriae Novi Testamenti(Allegories of the New Testament) by Richard of St-Victor (d. 1173?), theologian and prior of the Canon Regulars of the abbey of St Victor at Paris; andDe Oratione Dominica(On the Lord\'s Prayer) by Richard of St-Victor (d. 1173). The manuscript includes a work that would have helped priests emphasise the importance of the Mass:De Missarum Mysteriis(On the Mysteries of the Mass) by Pope Innocent III (b. 1160, d. 1216). It also includes an important work on the clergy...','Origin: England.Provenance:An English clergyman (as suggested by the manuscript\'s contents), owned in the 1st quarter of the 13th century: written beforec. 1225, but after 1206 or 1215: the explicit to the commentary on the minor prophets reads \'edita a venerabili cantuariensis ecclesie pontifice Stephano de longedune\'; Stephen Langton was elected archbishop of Canterbury in 1206, see Christopher Holdsworth, \'Langton, Stephen (c.1150-1228))\',Oxford Dictionary of National Biography(Oxford: Oxford University Press, 2004) [http://www.oxforddnb.com/view/article/16044, accessed 1 Aug 2007]; the sermon of the Fourth Lateran Council (1215) has been written on an added leaf, but perhaps not long after the manuscript\'s production.An unknown 15th-century owner: Chapter 7 of Stephen Langton\'s commentary on the Book of Micah, added by several hands writing in a 15th-century script on ff. 122r-123v. Perhaps added also some of the marginal annotations throughout the manuscript, including a medical annotation (commenting on the text) about cold sores on f. 75v: ‘papule pus febres in labijs apparentes sunt signum sanitatis’.An unknown 17th-century owner: a table of contents and titles added in a 17th-century script on ff. 1*v, 2r, and 165r.Sir Simonds d\'Ewes (b. 1602, d. 1650), 1st Baronet, diarist, antiquary, and friend of Sir Robert Cotton: acquired by him for 15s. in 1625 (see Watson,The Library of Sir Simonds D\'Ewes(1966), pp. 133 (A267), 275 (E40), 294 (B114), and 305 (B239)); listed by Edward Bernard as having belonged to d\'Ewes in 1697: see Edward Bernard,Catalogi librorum manuscriptorum Angliae et Hiberniae, 3 vols (Oxford: Sheldonian, 1697), II, p. 387 (no. 997): \'Stephani de Langton Cantuariensis Archiepiscopi Expositio 12 Prophetarum. Petrus Comestor. in lib. Evang. & II. Lib. Pastoralis S. Greg.\'.Sir Simonds D’Ewes (d. 1722), 3rd Baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Watson 1966).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st Earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd Earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), Duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100059913789.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059913791.0x000001/full/154,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002045932',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(8,1,'Harley MS 105','Harley','2nd or 3rd quarter of the 12th century',1125,1174,'This manuscript is a compendium of saints’ lives related to Canterbury. A main part is dedicated to St Augustine of Canterbury and St Mildred including their lives, miracles and the translation of their relics written by Goscelin of St Bertin. It includes also Goscelin\'sLibellus contra Inanes Sanctae Virginis Mildrethae Usurpatores(Tract against the inane usurpers of St Mildred), written as a result of the dispute between the Augustinian priory of St Gregory, Canterbury and the Benedictine abbey of St Augustine, where Goscelin was a monk. Seven lives of archbishops of Canterbury who were beatified followed this treatise. In addition to those texts, excerpts are also included from other works such as Cassiodorus\'sHistoria Tripartitaand Bede\'sHistoria Ecclesiasticaon St Augustine or St Lawrence.Contents:ff. 3r-37v: Goscelin of St Bertin,Historia Maior de Adventu Sancti Augustini,(Life and Miracle of St Augustine of Canterbury), preceded bycapitula(ff. 3r-5v), beginning: \'Incipit liber...','Origin: Canterbury, Southeastern England.Provenance:The Benedictine abbey of St Augustine, Canterbury: evidence of the contents (lives of saints related to the abbey); evidence of the script and the decoration, according to Dodwell,The Canterbury School of Illumination 1066-1200(1954); inscription regarding the translation of St Midred with the names of abbots Aelfstan and Roger with the date 1269: \'Clauditur hoc saxo Mildretha sacerrima virgo/ Cuius nos pretibus adiuvet ipse deus Amen / Verbi incarnati M [erased] xxx. Ego Aelfstanus Abbas transtuli corpus beate virginis de Insula taenet et hoc in loco honorifice condidi/ Ego Abbas Rogerus II ipsum corpus sub testimonio bonorum virorum inspexi. et iterato decencius in hoc loco collocavi. anno gratie Mcclxix mense maii\', written by a late 13th-century English hand (f. 136v).Added, extract from theHistoria maior de adventu Sancti Augustiniwritten by a 13th-century English hand (ff. 65v-67r).Sir John Cotton (b. 1621, d. 1702), 3rd baronet: inscription that it belonged to him with the date 20 March, 1665, written by Sir Simonds d\'Ewes, beginning: \'Ex escambio amici mei super honoratissimi Roberti Cottonis militis et baronetti\', exchanged this manuscript for St Augustine\'s charters owned by D\'Ewes (f. 1r).Sir Simonds d\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton: inscribed \'Simonds D\'Ewes 1625 Mar. 22\' and \'Volumine sive Tomo 65\' with Hebrew letters (f. 1v); added description of the contents (f. 2r); with his arms in the centre of the covers; added headings and rubrics (e. g., f. 8r); notes (e. g., f. 15r).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Watson,The Library of Sir Simonds D\'Ewes(1966).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100056033210.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056033212.0x000001/full/153,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002045933',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(9,1,'Harley MS 107','Harley','2nd or 3rd quarter of the 11th century',1025,1074,'Contents:ff. 1r-71v: Ælfic,Grammar and Glossary, imperfect;ff. 71v-72v: A grammatical dialogue on declensions;f. 72v: A short text beginning, ‘[Christu]s regnat. Crist rixað\', ending, \'Imperator. Casere’;f. 72v: A Latin glossary of names of birds (20 lines) and fish (2 lines) (f. 72v).','Origin:England, S. E. (Kent?).Provenance:? Kent: evidence of the Old English spelling (see Ker,Catalogue(1957), no. 227).? 14th century: text in Latin added (f. 1* r-v).17th-century: a parchment leaf with a portion of a charter or deed in Latin added (f. 73).Sir Simonds d\'Ewes (b.1602, d. 1650), 1st baronet, diarist, and antiquary: owned (see Wright,Fontes Harleiani(1972), p. 131).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Watson,Sir Simonds D\'Ewes(1966), p. 304).Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','English, OldLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100058107225.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058107227.0x000001/full/156,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002045935',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(10,1,'Harley MS 110','Harley','975-1050',975,1050,'Contents:ff. 3r-22v: Prosper,Epigrammata ex sententiis S. Augustini; with Old English glosses [Clavis Patrum Latinorum, no. 526].ff. 22v-24v: ? Prosper or Paulinus of Nola,Poema coniugis ad uxorem; with Old English glosses [Clavis Patrum Latinorum, no. 531].ff. 25r-53r: Isidore of Seville,Synonymorum de lamentatione animae peccatricis;with Old English glosses [Clavis Patrum Latinorum, no. 1203].The manuscript contains a few additions:ff. 1r-1v, 56r-56v: A fragment of a Gradual written around the mid 11th-century.f. 2r: A text with Latin conjugations, beginining: \'Malus peior pessimus . Mala peior pessima. Malum peius pessimum. Mali peioris pessimi\'; written in a 12th-century hand with a later addition.ff. 54v-55v: Small sections of musical notation and text in a 13th-century hand.','Origin:? Canterbury or ? Winchester.Provenance:? The Benedictine abbey of Christ Church, Canterbury: Temple,Anglo-Saxon Manuscripts 900-1066(1976), no. 19 [ff. 3r-56r].? Winchester, Old Minster: see Gneuss and Lapidge,Anglo-Saxon Manuscripts(2014), no. 416 [ff. 1r-1v, 56r-56v].Sir Simonds D’Ewes (b. 1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton: added his commentary to the 16th- or 17th-century title inscription \'Epigrammata Prosperi\' on f. 1r: \'exemplar vetustissimum et magni aestimandum etsi Liber sit editus inter opera eiusdem et Isidori Ispalensis Archiepiscopi synonima\'; added his number \'17\' to f. 3r; and listed in his catalogues as A.257 and B. 186 (see Watson,The Library of Sir Simonds D\'Ewes(1966), pp. 130-131 [A.257], 300 [B.186]; Wright,Fontes Harleiani(1972), pp. 131-37).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450; according to a receipt in Additional MS 70478 (Portland Papers) [formerly Loan 29/254 packet 2] (see Watson,The Library of Sir Simonds D’Ewes(1966), pp. 60, 91 n. 308;Diary, ed. by Wright and Wright (1966), p. xviii n. 3).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','English, OldLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100060440080.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100060440082.0x000001/full/109,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002045938',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(11,1,'Harley MS 203','Harley','4th quarter of the 12th century',1175,1199,'Composite volume consisting of two booklets (ff. 1–28, 29–98).ff. 1r–26r: Innocent III,De Officio Missae(The Office of the Mass).ff. 26r–28v: Commentary on the Apostles’ Creed and Lord’s Prayer, ‘Credo in deum patrem omnipotentem\'.ff. 29r–52v: Anselm of Canterbury,De Incarnatione Verbi(On the Incarnation of the Word).ff. 40r–47v: Anselm of Canterbury,Proslogion(Discourse on the existence of God).ff. 47v–52v: Anselm of Canterbury, Letters.ff. 53r–60r: Anselm of Canterbury,De Conceptu Virginali et Originali Peccato(On the Virgin Birth and Original Sin).ff. 60r–65r: Anselm of Canterbury,De Libertate Arbitrii(On free will).ff. 65r–75r: Anselm of Canterbury,De Casu Diaboli(On the fall of the Devil).ff. 75r–94r: Anselm of Canterbury,Cur Deus Homo(Why God became a Man).ff. 94r–98v: Anselm of Canterbury,De Veritate(On Truth).Decoration:Large initial in green with pen-flourished decoration in red (f. 26r). Initials in red or green, some with penwork decoration in the other colour. Rubrics in...','Origin:North-West France.Provenance:?The Benedictine abbey of Notre-Dame-du-Bois, St Pierre, at Saint-Evroult-sur Ouche: the style of the decoration of one of the initials (f. 40r) with small motif found so far only in manuscripts from the abbey, according to unpublished notes of Michael Gullick.Added, 13th century, note on the Eucharist (f. 28v).Erased inscription (f. 1r); see Watson,The Library of Sir Simonds D\'Ewes(1966).Henry Savile (b. 1568, d. 1617), of Banke, scholar, medical practitioner and collector of manuscripts: identifiable with no. 153 in his library catalogue, now Add. 35213, f. 25 (see Watson,The Library of Sir Simonds D\'Ewes(1966); Watson,The Manuscripts of Henry Savile of Banke(1969); Wright,Fontes Harleiani(1972)).Sir Simonds D\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton (see Watson,The Library of Sir Simonds D\'Ewes(1966), Wright,Fontes Harleiani(1972)): acquired in 1625 from the Savile collection for 3s; his name and notes (ff. 1, 29; see Watson,The Library of Sir Simonds D\'Ewes(1966)).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Add. 70478 (formerly Loan 29/254 packet 2); Watson,The Library of Sir Simonds D\'Ewes(1966); Wright and Wright,The Diary of Humphrey Wanley(1966)).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100056035130.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056035132.0x000001/full/151,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046031',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(12,1,'Harley MS 225','Harley','4th quarter of the 12th century',1175,1199,'ff. 3r–78r: Geoffrey of Monmouth,De Gestis Britonum(Historia Regum Britanniae),including 15th-century annotations.ff. 78v–79v:Epistre de Sibille(Epistle to Sibille),with the heading: ‘Ceste lepistre de Sibille Ffraunce’, prophecy in Old French added in the mid-14th century, beginning: \'La lupart evassaillant la Roiaume de Ffraunce serra tiel et si fier\'.Decoration:One large initial in blue, with light brown, red and green (f. 3r).Large initials in light brown, red, green or blue, occasionally with reserved line or minor penwork decoration in the same or an alternate colour. Rubric (f. 41r) and line fillers in red.Quire marks and quire signatures (consecutive letters).','Origin:England.Provenance:Guido de Waynflete (fl. 14th century), Augustinian friar: inscribed, 14th century \'Liber Fratris Guydonis de Waynflete ordinis sancti Augustini\' (f. 79v, erased).Added, drafts of charters and notes from the 14th century, reused as flyleaves (ff. 2r–v, 81r–84v).Added, early 14th century: text in French, entitled \'Ceste lepistre de Sibille\' (ff. 78v-79v).Added, 15th century, title partly erased \'Liber cron[icorum] Angliae\' (f. 1v).Added, 15th century, pen trials in Middle English and Latin (f. 1v).Added, 15th century, numerous annotations throughout theHistoria regum Brittaniae,written by a same scribe, who also added headings (e. g., ff. 3r, 9r,14v).Added, 15th century: \'Robert Clopton\' and three other names with the years when each was mayor of London (on a piece of parchment fragment that is now pasted on f. 1r) (Watson,The Library of Sir Simonds D\'Ewes(1966)).Sir Simonds D\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton (see Wright,Fontes Harleiani1972): inscribed number \'39\' (f. 3r) and the title (f. 1v) (see Watson,The Library of Sir Simonds D\'Ewes(1966)).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Watson,The Library of Sir Simonds D\'Ewes(1966)).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','French, OldLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100056035227.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056035229.0x000001/full/126,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046053',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(13,1,'Harley MS 234','Harley','Late 12th century',1160,1199,'This 12th-century French manuscript contains the Gospel of John with commentary by Church Fathers and medieval authorities (Glossa Ordinaria) added to its margins and between the text\'s lines.ff. 1r–56r: The Gospel of John, with marginal and interlinearGlossa Ordinaria, imperfect at the beginning.[f. 56v is empty].Decoration:1 large decorated initial in red with arabesque motifs (f. 2r). 1 large initial in red (f. 46r).','Origin:France.Provenance:George Carew (b. 1555, d. 1629), baron Carew of Clopton and earl of Totnes: inscribed with his marks (top of f. 1r) (see Watson,The Library of Sir Simonds D\'Ewes(1966), p. 211).Sir Simonds d\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton (Wright,Fontes Harleiani(1972), p. 131).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450.The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100059308516.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059308518.0x000001/full/161,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046062',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(14,1,'Harley MS 261','Harley','4th quarter of the 12th century-1st quarter of the 13th century',1175,1224,'This late 12th- or early 13th-century manuscript may have been produced by the cathedral priory of St Andrew in Rochester, but was certainly at the priory in the 13th or 14th century and may have remained there until the priory was dissolved in 1540. The manuscript contains theGesta regum Anglorum(Deeds of the Kings of the English) andGesta pontificum Anglorum(Deeds of the Bishops of the English) by William of Malmesbury (b. c. 1090, d. in or after 1142), historian, man of letters, and Benedictine monk. It also includes the popularTractatus de Purgatorio Sancti Patricii(Treatise on Saint Patrick\'s Purgatory) by Henry of Saltrey (fl. c. 1184), a monk at the Cistercian monastery of Sawtry (Cambridgeshire). The manuscript originally included an additional section (ff. 173-223), containing theLiber Exceptionum(Book of Exceptions) by Richard of Saint-Victor (d. 1173), that was separated from the manuscript in the 17th century, and is now Harley MS 23 (it is listed in the 13th-century tab...','Origin:Rochester, South-eastern England.Provenance:The cathedral priory of St Andrew, Rochester; perhaps owned by Alexander, precentor of Rochester in the early 13th century: his ownership inscription in a 13th- or 14th-century century script on f. 4r: \'Liber de claust[ro] Roffens[is]. Alexand[er] p[re]ce[ntor]\' (for this type of ownership inscription and its reliability seeEnglish Benedictine Libraries, ed. by Sharpe and others (1996), pp. 465-467; seeibid. p. 526 for information on Alexander, the precentor); perhaps no. 120 (\'Hystoria Willelmi Malmesburiensis\') in the library catalogue of 1202 (the entry is identified with this manuscript in Ker,Medieval Libraries(1964), p. 161; and Richards, \'Texts and Their Traditions\' (1988), p. 35; but not inEnglish Benedictine Libraries, ed. by Sharpe and others (1996), p. 512 (B79.120)). The manuscript contains several additions indicating that the manuscript was annotated at the cathedral priory: a 13th- or 14th-century note about Lanfranc (d. 1089), Archbishop of Canterbury, and Gundulf (d. 1108), Bishop of Rochester, that refers to the cathedral priory of St Andrew on f. 2r; a (?) 13th-century list of works with shelfmark references on f. 3v that refers to other extant works from the cathedral priory: e.g. ‘de sanctorum corporibus qui in anglia requiescunt’, extant in Harley MS 3680 (f. 177v); the list also refers to an account of the flooding of the river Medway at Rochester (‘De fluvio medewey [a] que Roffensam praeterfluit libro 2 c 66’). The 13th- and 14th-century memoranda (ff. 1v-2r), tables of contents (ff. 2r, 3v), Latin poem (f. 3r), list of texts (f. 3v), indices (ff. 103v-106v), list of monastic foundations (ff. 106v-107v), and marginal notes throughout the manuscript, were probably also added at the cathedral priory. The \'Robertus\' who inscribed his name twice on f. 2v may have been a monk at the cathedral priory; perhaps his annotation on f. 2r (\'The[se] [...]\') and f. 151r: \'To the Ryg[ht]\'), in a 15th- or 16th-century script.W. P., owned in the 16th or 17th century: inscribed with these initials (f. 4r).Sir Simonds d\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton: annotated the list of contents (f. 2r) and added no \'13\' (f. 4r); the manuscript is recorded in his catalogue as no. A278 (see Watson,The Library of Sir Simonds D\'Ewes(1966), p. 135 (A278)).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450.The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100059309165.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059309167.0x000001/full/145,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046089',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(15,1,'Harley MS 283','Harley','1524-1546',1524,1546,'Contents:ff. 1r-375r: A large collection of more than two hundred letters and papers in English, French, and Latin relating to state affairs, mostly from the reign of King Henry VIII (originals and transcripts).Includes letters by Henry VIII (with his signature), Mary Tudor, Jane Seymour, and others, including George Brooke, Thomas Cranmer, Richard Cromwell, John Dudley, John Dymock, Henry Howard, Hugh Latimer, Thomas More, William Paget, Cuthbert Tunstall, Stephen Vaughan, Thomas Wolsey, Edward Wotton, Nicholas Wotton, Thomas Wriothesley, dated to 1524-1546.Decoration:Coats of arms in brown ink on ff. 71v and 155r.','Origin:England.Provenance:Ralph Starkey (d. 1628) of Darley Hall in Oulton, owned the manuscript: items 5, 23-25, 28, 31, 36, 44-56, 74, 78-80, and 145 are in his hand, which also appears on items 2-4, 7, 11-22, 29-30, 33-35, 37-39, 42, 57-61, 64-65, 73, 75, 81, 144, and 181 [the items are as listed in theCatalogue of the Harleian Manuscripts(1808), I, pp. 112-20] (Watson,The Library of Sir Simonds D\'Ewes(1966), p. 323); acquired from him in 1628 by Sir Simonds D’Ewes (Wright,Fontes Harleiani(1972), p. 314).Sir Simonds D’Ewes (b. 1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton: f. 9v (item 6*) is in his hand, which also appears on ff. 70r-72r (items 27-29), 95 (item 40), 99v (item 42), 102 (item 44), 126v (item 57), 148 (item 69), and 292 (item 159) [the items are as listed in theCatalogue of the Harleian Manuscripts(1808), I, pp. 112-20]; listed in his catalogues as A.142 (Watson,The Library of Sir Simonds D\'Ewes(1966), p. 323; Wright,Fontes Harleiani(1972), p. 131).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450.The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','EnglishFrenchLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100166883098.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100166959933.0x0002fc/full/148,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046111',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(16,1,'Harley MS 303','Harley','1532-1533',1532,1533,'This manuscript contains a series of patents granted by Henry VIII (r. 1509–1547), King of England, to Anne Boleyn as Marquess of Pembroke. It was made for her after she was created Marquess of Pembroke on 1 September 1532, but before she became Queen of England in March 1533. The parchment, silk and gold of the document cost 18 shillings, equivalent to a month\'s wages for a craftsman (seeHenry VIII(2009), no. 138).Another manuscript made for Anne Boleyn is now Harley MS 6561.Contents:ff. 1-35v: Patents granted to Anne Boleyn as Marquess of Pembroke, between September 1532 and March 1533.Decoration:1 large historiated initial in colours and gold enclosing the imperial falcon of Anne Boleyn, followed by display script in gold (f. 1r). \'Champ\' initials in colours and gold (ff. 2r, 3r, 4r, 13r, 15v, 17r, 23v, 24r, 31r).','Origin:England, S. E. (probably London).Provenance:Made for Anne Boleyn (b. c. 1500, d. 1536), Queen of England, second consort of Henry VIII, after she was created Marquess of Pembroke on 1 September 1532, but before she became queen in March 1533: her heraldic device of an imperial falcon (f. 1r) (see Carley,The Books of King Henry VIII(2004), pp. 125-26).The Old Royal Library: 1542 Westminster inventory no. 99 (f. 1r).Sir Simonds D\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton (see Wright,Fontes Harleiani(1972), p. 131).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Watson,The Library of Sir Simonds D\'Ewes(1966), no. A344).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts. Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100165167720.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165510642.0x000047/full/152,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046131',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(17,1,'Harley MS 334','Harley','2nd quarter of the 15th century',1425,1449,'f. 2* verso: ‘A medecyne for the stomok’, Middle English, late 14th century.ff. 1r–107v: Gautier de Metz,L’image du monde(Le livre de clergie en roumans).f. 108r–v: Pen trials, 15th century, including the opening section of a charter.Decoration:1 large miniature in colours, gold, and silver (f. 1r). 11 miniatures in colours (ff. 2v, 3r, 5r, 6r, 7r, 21r, 25r, 25v, 26v, 29r, 33v). 45 tinted drawings in colours (ff. 11r, 37r, 39r, 40v, 44r, 45r, 45v, 47r, 52v, 53r, 55v, 57r, 58r, 58v, 59r, 61r, 62v, 63v, 64v, 65v, 68, 68v, 69v, 71v, 72v, 73v, 75r, 75v, 76, 76v, 77r, 78r, 83v, 86v, 91r, 94v, 95v, 99r, 100r, 102r, 104r, 104v, 105r, 106r, 107v). 16 diagrams in colours (ff. 35v, 37v, 38r, 41v, 42v, 43r, 43v, 79v, 81r, 83r, 84r, 85v, 86r, 87v, 88v, 89v). The flourished initials are Parisian, c. 1430–40, however some miniatures seem to have been executed by English artists, according to François Avril. The images of God have been deliberately defaced (e.g. f. 6r).','Origin:France, Central (Paris) and England.Provenance:Johannes Martyn: his name inscribed in the early 16th century (f. 108v).Thomas Jordin (Jorden): his name inscribed, in the 16th or 17th century (on a piece of paper pasted onto f. 1*).Sir Thomas Twysden (Twisden) (b. 1602, d. 1683), 1st baronet, judge, and politician: an inscription in his hand, according to a note in the manuscript by Sir Frederic Madden (pasted onto f. 3*).Sir Simonds d\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton.Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450. The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','English, MiddleFrench, Old','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100057740087.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057740089.0x000001/full/146,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046162',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(18,1,'Harley MS 337','Harley','12th century-14th century',1100,1399,'This composite manuscript consists of five different parts bound together in the early modern period.ff. 1r–11r: Cartulary owned by the Benedictine abbey of St Augustine, Canterbury; fragmentary (12th century).ff. 12r–31v: William of Waddington,Manuel de Pechiez(The Textbook of Sins),including a series of shields painted around 1314; fragmentary (early 14th century).ff. 32r–53v: Sentences on Scripture, mainly deriving from Origen\'s Homilies, but also including excerpts from Gregory the Great\'sMoralia in Job,Julian of Toledo and Serlo of Savigny (early 13th-century).ff. 54r-65v: Innocent III,De contemptu mundi; fragmentary (13th century).ff. 66r–71v:Expositio super Missam,a liturgical commentary on the Roman Mass.f. 72r: Pseudo-Hippocrates,Capsula Eburnea(late 12th century).f. 72v: Pseudo-Hippocrates,Indicia valetudinum(late 12th century).','Provenance:Sir Simonds d\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton: his binding and arms (see Wright,Fontes Harleiani(1972)); he wrote the heading \'Registrum MS Monasterii SS. Petri et Pauli Cantuariensis\' (f. 1r).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Watson,The Library of Sir Simonds D\'Ewes(1966)).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Anglo-NormanLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100059910194.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059910196.0x000001/full/145,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046165',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(19,1,'Harley MS 402','Harley','2nd half of the 12th century',1150,1199,'This 12th-century manuscript contains twelve collections of excerpts from, or attributed to: the Church Fathers St Ambrose (b. c. 340, d. 397), St Jerome (b. 347, d. 420), St John Chrysostom (b. c. 349, d. 407), St Augustine (b. 354, d. 430), St Gregory the Great (b. c. 540, d. 604), and St Isidore of Seville (b. c. 560, d. 636); and other authorities, including Pope Miltiades (d. 314), Cassiodorus (b. c. 485, d. c. 580), Bede the Venerable (b. 673, d. 735), Hrabanus Maurus (b. c. 780, d. 856), Haimo of Auxerre (d. c. 865), ‘Remigius’ – possibly Remigius of Auxerre (b. c. 841, d. 908) – Hugh of Saint-Victor (b. c. 1096, d. 1141), Pope Gregory VII (b. c. 1015, d. 1085), William of Champeaux (b. 1070, d. 1121) and Gilbert de la Porrée (b. 1085, d. 1154). The manual also includes biblical sources and excerpts from the statutes of the Fourth Council of Carthage (e.g., on divination). An excerpt from theDecretum Gratiani(f. 102v) that appears to be taken from a commentary by Pope Alexand...','Origin:England or France.Provenance:Sir John Doddridge (b. 1555, d. 1628), judge, son of Richard Doddrige, merchant of Barnstaple: given to his nephew Richard Dunaeus according to an inscription recording the gift (f. 1* verso).Richardus Dunaeus (?Downe) (b. 1600), of Devon, Wadham College, Oxford, owned in 1620: an inscription recording the gift from his maternal uncle (f. 1*v).Mrs Downe, of Barnstaple, Devon (?related to Richardus Dunaeus): owned until 1658, inscribed by Sir Edward Harley \'bought of Mrs Downe at Barstaple [sic] 1658\' followed by his signature (f. 1* verso).Sir Edward Harley (b. 1624, d. 1700), politician and parliamentarian army officer, of Brampton Bryan, Hereford, father of Robert Harley: bought from Mrs Downe in 1658, inscription in his hand recording the purchase (f. 1*v).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100065012830.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100065012832.0x000001/full/146,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046230',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(20,1,'Harley MS 436','Harley','Middle of the 13th century',1230,1270,'Contents:ff. 1*r-v: a letter in the hand of George Hickes (b. 1642, d. 1715), bishop and antiquary, addressed to Humfrey Wanley (b. 1672, d. 1726), recording his gift of the manuscript to Robert Harley (b. 1661, d. 1724).f. 2*r: a note concerning the ownership of the manuscript by the Earl of Pembroke in 1658.f. 3*r: a parchment fragment, inscribed with a note in a 16th-century hand, \'Diuers olde graunts made before The Conquest and some since written in the Saxon and latyne tonge\'.ff. 1r–91v: Cartulary of Wilton Abbey, with copies of approximately 36 royal and other charters granted to the Benedictine nunnery of Wilton, Wiltshire. The volume opens with a copy of a charter dated 948 concerning 10 hides of land in Knoyle, Wiltshire, granted by King Eadred (c. 923–955). Most of the charters date to the 10th century; the latest is dated the 10th year of King John, i.e. 1208/9 (ff. 28v–29v).ff. 2*v and 3*v are blank.Decoration:Initials in blue with red pen-flourishing. Plain initials in...','Origin:Abbey of St Mary the Virgin and St Edith, of Benedictine nuns, Wilton, England.Provenance:The Herbert family, earls of Pembroke: most likely came into its posession at the dissolution of the monasteries; owned by Philip Herbert, 5th earl of Pembroke in 1658 (note, f. 2*r), and Thomas Herbert, the 8th earl in 1695.George Hickes (b. 1642, d. 1715), bishop of the nonjuring Church of England and antiquary: inscribed, \'Liber Georgii Hickesii S.T.P.\' (f. 1r); letter in his hand to Humfrey Wanley recording the gift of the manuscript to Robert Harley (f. 1*r).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','English, OldLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100165168727.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165767599.0x0000b7/full/148,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046264',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(21,1,'Harley MS 491','Harley','1st quarter of the 12th century',1100,1124,'Contents:ff. 1r–2v: Two leaves from a Mass lectionary, probably written in Lotharingia, mid-11th-century (see Gneuss,Anglo-Saxon Manuscripts(2003)).ff. 3r–46v: William of Jumièges,Gesta Normannorum ducum(Deeds of the Norman Dukes).ff. 47r–48v: Two leaves from a mortuary roll for Turgot of Durham, from 1115–1117. Turgot of Durham (b. c.1050, d. 1115), author and bishop of St Andrews, died at Durham on 31 August 1115: the roll is therefore datable to between September 1115 and 1117 and is the earliest datable English obituary roll known; the present fragment bears tentitulior subscriptions, including those from St Mary\'s and St Vincent\'s at Laon, St Cross at Waltham, and Saint-Laumer at Blois (ff. 47r-48v) (see Harrison,\'The Mortuary Roll of Turgot of Durham\' (2004)).Decoration:Initials in red with occasional foliate decoration, and small initials highlighted in red (ff. 1r-28v).','Origin:North-western France.Symeon of Durham (fl. c.1090-1128), Benedictine monk and historian: written for him and under his supervision in Normandy by two Continental scribes toward the end of the first decade of the 12th century; the first eight lines of text (f. 3r), and corrections and quire signatures are in his hand (see Gullick, \'The Two Earliest Manuscripts of the Libellus de Exordio\' (1998)).Provenance:The Benedictine cathedral priory of St Cuthbert, Durham: listed in a mid-12th-century and the 1395 library catalogues (seeCatalogi veteres1838); ownership inscription, early 14th century \'Liber sancti Cuthberti de Dunelm\' (f. 1r; pastedown); ownership inscription, early 15th century (f. 3r; see Watson,Medieval Libraries of Great Britain(1987)). According to a mid-12th-century catalogue of Durham priory library, originally this manuscript was bound together with another tract, entitled \'Descripcione regnorum diversorum in Anglia antiquitus\': seeCatalogi veteres(1838); Harrison, \'The Mortuary Roll of Turgot of Durham (d. 1115)\' (2004).Robert Brakenbyri (d. 1391), monk at Durham: inscribed \'Liber Roberti de Brakenbyri\' (f. 3r; see Wright,Fontes Harleiani(1972)).Thomas Swalwell (d. 1539), monk a Durham: annotated by him.John Stow (b. 1524/5, d. 1605), historian and antiquary: the author\'s name in his hand (f. 2r; see Watson,The Library of Sir Simonds D\'Ewes(1966)).Sir Richard St George (b. 1554/5, d. 1635), herald: his inscription \'Ricardus S. Georgii Norry. Fero et spero\', therefore datable to between 24 January 1607, when he was created Norroy King of Arms, and 28 September 1616, when he was knighted (f. 2r; see Watson, \'Sir Simonds D\'Ewes\'s Collection of Charters\' (1962); Harrison, \'The Mortuary Roll of Turgot of Durham (d. 1115)\' (2004)).Sir Simonds d\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton (see Wright,Fontes Harleiani(1972)).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Add. 70478 (formerly Loan 29/254 packet 2); Watson,The Library of Sir Simonds D\'Ewes(1966)).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100056057230.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056057232.0x000001/full/152,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046319',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(22,1,'Harley MS 526','Harley','late 9th-14th century',890,1399,'This manuscript contains five parts:Bede\'s verseVita S Cuthberti(Bibliotheca Hagiographica Latina2020), copied in northern France at the end of the 9th century (ff. 1-27);avitaof Bede, copied in France or England in the first half of the 12th century (ff. 28-36v);the only surviving, imperfect copy of theVita Ædwardi Regis, from England in the first half of the 12th century (ff. 38-57);a 13th-century fragment of the end of Ailred of Rievaulx\'svitaof Edward the Confessor and a copy of the papal commissioners\' report on the miracles of Hugh, Bishop of Lincoln (ff. 58-67v);Vita Adae et Evae, copied in England in the 14th century (ff. 68-77).','Provenance:Sir Simonds d\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary: he inscribed \'Edit\' per Henricum Canisium in Antiquis Lectionibus: sed vetustissimum hoc exemplar et optimi usus\' (f. 27v). His number 5 is on f. 1; his number 43 is on f. 28r; signature is on f. 67*r; and his title page is f. 58.Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Watson,Library(1966)).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','English, OldLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100060440765.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100060440767.0x000001/full/160,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046355',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(23,1,'Harley MS 549','Harley','3rd quarter of the 12th century',1150,1174,'Contents:ff. 1v-57v: Boethius (b. c. 480, d. 524),De institutione arithmetica(On the Principles of Arithmetic), with a preface, incipit: \'In dandis et accipiendis muneribus\'.The manuscript contains a few later additions:ff. 58r-58v: An unidentified religious poem, added in the late 12th century.Decoration:Two zoomorphic initials, outlined in black, with some gold, red, blue and green on a light-brown ground (ff. 1v, 21r). Numerous initials in red or blue, occasionally with a reserved line and penwork decoration in the same or, rarely, in the other colour. Rubrics and letters following the zoomorphic initial (f. 1v) in red. 1 diagram (multiplication table for 1 through 10) decorated with fish and animals in colours and gold (f. 14r). Other tables and diagrams in red, green, blue and light brown, one with animal heads (f. 24r), occasionally with some penwork decoration.An added drawing of a man rowing a boat, in which a lady with a gaming board sits, late 12th or early 13th century (f...','Origin: England or Northern France.Provenance:An unidentified library: its press-mark (?) \'.o.xiii.\', in a (?) 13th-century script (f. 1v).\'John\', unidentified: his name inscribed \'constat Johannis\', in a 15th-century script (f. 58v); added a Middle English note about his presence at Westminster during Easter: \'In the begynnyng of the weke of Ester y was at Westemester\'; possibly also owned a 12th-century Psalter from Norwich Cathedral, now Durham, Ushaw Collge, MS 7, which features a similar ownership inscription: \'Iste liber constat Johannis mylys\'.\'Rogerus Bedford\', unidentified: his name inscribed in a 15th-century script (f. 57r); perhaps added a verse on the Cardinal directions \'Eyst oryens / West occidens / Boriens north / South petit auster\' (f. 58v); a roundel with a decorated border, inscribed \'A Roundell is my Trust\'; and the verse \'Eyste ori west occi boriens / north south petit auster\', inscribed at its centre (f. 59r); part of a poem that can also be found in Lansdowne MS 762, f. 99r.John Dee (b. 1527, d. 1609), mathematician, astrologer, and antiquary: his marks (ff. 1r, 2r); probably his manuscript C. 114; acquired in 1626 by Sir Simonds D\'Ewes (see Watson,The Library of Sir Simonds D\'Ewes(1966)).Sir Simonds D’Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton, included in the catalogue if his library (Add. MS 22918) as manuscript 894 (see Watson,The Library of Sir Simonds D\'Ewes(1966)).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Watson,The Library of Sir Simonds D\'Ewes(1966)).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), Duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100056057854.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056057856.0x000001/full/149,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046378',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(24,1,'Harley MS 603','Harley','1st half of the 11th century',1000,1049,'Psalter, known as the \'Harley Psalter\', imperfect. The illustration of the manuscript is copied from the Utrecht Psalter (Utrecht, Universiteitsbibliotheek, MS 32). The text is mostly the Roman version, except Psalms 100-105 which are Gallican (see Abbot Gasquet and Edmund Bishop,The Bosworth Psalter(London: Bell and Sons, 1908)).Losses to text:After f. 28, Psalm 49:7 (tibi) to Psalm 51 (malitia)After f. 33, Psalm 62 to Psalm 64:1 (proficisci) After f. 45, Psalm 83:5 (laudabunt) to Psalm 89:14 (exultavimus)After f. 49, Psalm 98 to Psalm 99After f. 173, Psalm 143:8 to endDecoration:1 full-page drawing in colours of the Trinity in a mandorla, supported by four angels (f. 1r). 112 drawings in brown ink or with colours, on most pages, each preceding the Psalm illustrated. The cycle begins with a full page drawing on f. 1v. Large historiated initial in colours of an archbishop kneeling before Christ at the beginning of Psalm 1 (f. 2r). Initials in red, green, or blue with penwork decorat...','Origin:England (Canterbury).Provenance:Christ Church, Canterbury (?): ff. 28r-49v are written by a scribe identified by T. A. M. Bishop as Eadui Basan, who worked at Christ Church Canterbury (see discussion Temple 1976); see also Noel 1995 pp. 2-3, who states that three of the artists or scribes can be identified as working on other manuscripts made at Christ Church, or the Benedictine abbey of St. Augustine, Canterbury (see Ker 1964); iconographic evidence of an initial with an archbishop wearing a pallium (f. 2r).Aelfric (d. 1005), Archbishop of Canterbury, perhaps commissioned by him and subsequently bequeathed to Wulfstan, Archbishop of York in 1003 or 1004 (see discussion inLe Grand Atelier2007).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st Earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd Earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta, née Cavendish Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), Duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100165169769.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165763425.0x000093/full/165,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046432',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(25,1,'Harley MS 612','Harley','between 1435 and 1457',1435,1457,'This manuscript contains a collection of texts from and about St Birgitta of Sweden, divided into 14 books, and copied by Thomas Colyngbourn for the Bridgettine abbey of St Saviour, St Mary the Virgin and St Bridget of Syon [Syon Abbey], Isleworth, Middlesex. It is one of three surviving Latin manuscripts in England to contain the eighth book of Bridget\'sLiber Celestis Revelacionum[The Heavenly Book of Revelations], and the only one to feature additional revelations, collected by Peter of Alvastra, known as the \'Revelaciones extravagantes\'.Contents:ff. 2r-133r: Birgitta of Sweden,Liber Celestis Revelacionum, Books I-VIII; including the prologues and the appendix \'ad pontifices\'; with the \'Revelaciones extravagantes\'.ff. 133r-160v: Alfonso Fernández Pecha [Alfonso of Jaén],Celeste Viridarium[Heavenly Pleasure Garden]; a life of the Virgin Mary compiled from St Birgitta\'s revelations for meditation.ff. 160v-169v: Birgitta of Sweden,Regula Sancti Salvatoris[The Rule of St Saviour].ff. ...','Origin:South-East England or Vadstena, Sweden.Scribe:Written by Thomas Colyngbourn for the Bridgettine abbey of St Saviour, St Mary the Virgin and St Bridget of Syon, Isleworth, Middlesex between 1435 and 1457: written in his hand (see Gillespie,Syon Abbey(2001), p. 241). A colophon on f. 302r in which the manuscript\'s contents are verified for two brothers of Syon Abbey is dated to 1427. The colophon, however, seems to be a copy from an earlier work. The manuscript\'s inclusion of Geoffrey of Byland\'s defence suggests that it was produced after 1435, and a reference to the manuscript in Thomas Gascoigne (d. 1458),Liber Citivitatum, written between 1433 and 1457, provides aterminus ante quemof 1457 (see Hagan Gilroy,The Reception of Bridget of Sweden\'s Revelations(1999), pp. 32-33).Provenance:The Bridgettine abbey of St Saviour, St Mary the Virgin and St Bridget of Syon, Isleworth, Middlesex, founded by King Henry V in 1415 and dissolved in 1539: two strips from the Syon binding, containing the manuscript\'s title, have been pasted on f. 1r; featuring a colophon on f. 302r in which Peter, notary public of Linköping, certifies that the text is an accurate copy of the original manuscript in the monastery of Vadstena for John Hartman, and Robert Bell and Thomas Stevinton, two brothers at Syon Abbey who were visiting Vadstena; recorded in its catalogue as \'M.64\' (see Bateson,Catalogue of the Library of Syon Monastery(1898), pp. 107-108 [M.64]; Watson,The Library of Sir Simonds D\'Ewes(1966), p. 191 [A.789]; and Gillespie,Syon Abbey(2001), pp. 240-241 [M.64]).Sir Simonds D’Ewes (b. 1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton, acquired around 1626: wrote his number \'83\' at the top of f. 2r; listed in his catalogues as A.789 [\'St Bugett\'] and B.75 [\'Liber immensae magnitudinis\'] (see Watson,The Library of Sir Simonds D\'Ewes(1966), pp. 191 and 292; Wright,Fontes Harleiani(1972), p. 131).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450; according to a receipt in Add MS 70478 (Portland Papers) [formerly Loan 29/254 packet 2] (see Watson,The Library of Sir Simonds D’Ewes(1966), pp. 60, 91 n. 308;Diary, ed. by Wright and Wright (1966), p. xviii n. 3).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100161512807.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100162043205.0x00025f/full/147,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046441',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(26,1,'Harley MS 624','Harley','1100-1643',1100,1643,'This manuscript contains three different parts gathered by Sir Simonds d\'Ewes (b. 1602, d. 1650), 1st baronet, diarist and antiquary. Two of these parts were written and compiled by him between c. 1639-1643, they consist of chronicles related to the history of Britain (ff. 1v-83r; 145r-217r). An imperfect Passionale written at the Benedictine cathedral priory of Christ Church, Canterbury (1st half of the 12th century), has been inserted between the modern texts (ff. 84r-123v).Contents:f. 2r: A title-page.f. 2v: A table of contents.ff. 4r-20v: Anonymous,Chronica de veteribus Brittanis et Anglo-Saxonibus(Chronicle on the Old Britons and Anglo-Saxons).ff. 21r-35v:Chronica monasterii de Pipwell(Chronicle of the Monastery of Pipewell).ff. 36r-53r: Pseudo-Nennius,Historia Brittonum(History of the Britons).ff. 53v-64v: Gildas (fl. early 6th century),De gestis Brittonum(On the Deeds of the Britons).ff. 64v-67v: Henry of Huntington (b. 1084, d. 1155),Historia Anglorum(History of the English)...','Provenance:Sir Simonds d\'Ewes (b.1602, d. 1650), 1st baronet, diarist and antiquary (see Wright,Fontes Harleiani1972): inscribed \'Simonds D\'Ewes\' (ff. 1v, 161, 217), his binding and arms, his added texts (ff. 1-82, 99* and ff. 145-217); (a date of 1639 on f. 145 and 1643 on f. 217), a strip of parchment added by Sir Simonds d\'Ewes on which the capital letters \'PAS\' (probably for Passionale) have been written in blue and red inks (f. 99*r) (see Watson,The Library of Sir Simonds d\'Ewes(1966)).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Watson,The Library of Sir Simonds d\'Ewes(1966)).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100066415306.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100066415308.0x000001/full/141,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046453',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(27,1,'Harley MS 628','Harley','2nd or 3rd quarter of the 12th century',1125,1174,'This 12th-century manuscripts contains a Psalter withGlossa Ordinaria. Its style of decoration (Channel style) indicates that it was produced in England or France.Contents:ff. 1v-227r: The Book of Psalms withGlossa Ordinaria.ff. 227r-238r: Canticles of Isaiah, Hezekiah, Anna, Moses (Exodus), Habacuc, Moses (Deuteronomy), with glosses.ff. 238r-241r: The Athanasian Creed (Quicumque Vult).The manuscript contains two additions:f. 1r: A 17th-century title page: ‘PSALTERIUM UNA CUM Glossa quae dicitur Ordinaria Et duabus alijs Cantica itidem S. Scripturae ut Esaiae Ezechiae Annae etc. et Symbolum Athanasij’.f. 242r: A 15th- or 16th-century table of contents: ‘Codex iste continet’.[ff. 241v, 242r, and 242v are empty].Decoration:3 large initials marking the threefold division of the Book of Psalms (Psalms 1, 51, and 101): 1 large puzzle initial in red, blue and gold containing foliate decoration (including a white rose) in colours painted over the original initial (f. 1v) in the 17(?)thcent...','Origin: England or Northern France.Provenance:William Crashawe (bap. 1572, d. 1625/6), Church of England clergyman, religious controversialist and poet: his table of contents on f. 242r (see Watson,The Library of Sir Simonds D’Ewes(1966), p. 277; Wright,Fontes Harleiani(1972), pp. 119, 384).Sir Simonds d\'Ewes (b. 1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton: possibly acquired from Crashaw in 1626 together with Harley MS 105 and Harley MS 207; title-page added and initial overpainted for him (ff. 1r, 1v; see Watson,The Library of Sir Simonds D’Ewes(1966), p. 277; Wright,Fontes Harleiani(1972), pp. 131, 384).Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Add MS 70478 (formerly Loan 29/254 packet 2).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100059467266.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059467268.0x000001/full/150,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046457',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(28,1,'Harley MS 633','Harley','4th quarter of the 12th century',1175,1199,'This manuscript contains theLiber pontificalis(the Book of the Popes), a collection of biographies of popes from St Peter until Pope Clement III (b. 1130, d. 1191), attributed to Anastasius Bibliothecarius (b. c. 810, d. c. 878). It also contains theDecretales Pseudo-Isidorianae(Pseudo-Isidorian Decretals), a set of medieval forgeries composed in the 9th century.ff. 1r-2r: A list of popes from St Peter to Lucius II (d. 1145), followed by details regarding each papacy, with the names only for popes from Eugene III (d. 1153) to Gregory VIII (d. 1187): the names of Urban III (d. 1187) and Gregory VIII (d. 1187) have been written by a different hand.ff. 4r-71r: Pseudo-Anastasius Bibliothecarius,Liber pontificalis, beginning: ‘Beatissimo Damaso Ieronimus’, preceded by the incipit: ‘Incipit liber pontificalis in quo continentur acta beatorum pontificum urbis rome\'. The texts incorporate several papal decretals from theCollectio Lanfranci(The Collection of Lanfranc). According to Thompson,...','Origin: England.Provenance:\'Brian Stapleton\', perhaps Sir Brian Stapleton (d. 1519) of Suffolk, or Brian Stapleton (b. 1534, d. 1606) of Carlton, Yorkshire: his name inscribed \'liber Briani Stapletoni\' (f. 1*recto; see also f. 90v). This name also appears in Stowe MS 32, f. 1r, and in Oxford, Bodleian Library, Barlow MS. 37, f. iii recto.William Camden (b. 1551, d. 1623), antiquary: added list of contents (f. 3v).Sir Simonds D\'Ewes (b. 1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton, see Wright,Fontes(1972), p. 131.Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450.The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100059468560.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059468562.0x000001/full/155,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046462',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(29,1,'Harley MS 649','Harley','1st quarter of the 12th century',1100,1124,'This early 12th-century manuscript contains a collection of biblical commentaries and homilies by the Benedictine monk Bede (b. 672/3, d. 735), and theVita Sancti Radegundis(Life of St Radegund) by Venantius Fortunatus (b. c. 530, d. c. 600/609), a poet at the Merovingian court. The manuscript was owned by and perhaps also produced at the Benedictine abbey of St Mary and St Benedict at Ramsey (Cambridgeshire) since it contains a 15th-century ownership inscription from the abbey. Two of the manuscript’s flyleaves contain an unidentified theological work that, according to an inscription, is a lecture by Henry of Saltrey (fl. c. 1184) on the ‘sentencias’, perhaps theSententiae(Sentences) of Peter Lombard (b. c. 1096, d. 1160). Ramsey abbey\'s access to the lecture may be explained by the monastery\'s close proximity to the Cistercian abbey at Sawtrey.Contents:f. 1v: A table of contents.ff. 2r-98r: Bede,In Canticum Canticorum Expositio(Commentary on the Song Of Songs): ff. 2r-8r: Book I ...','Origin: ?Ramsey, Eastern England.Provenance:Robert of Beeston (Beeston, Norfolk?), owned in the 13th or 14th century: his name inscribed in a 13th- or 14th-century script: \'iste liber est domini Roberti fratris / Willelmi de bestone\' (f. [260]); perhaps a monk at the Benedictine abbey of St Mary and St Benedict at Ramsey (Cambridgeshire).Robert Gotham, monk at the Benedictine abbey of St Mary and St Benedict at Ramsey, owned in the 15th century: his name inscribed in a 15th-century script: \'liber rameseye Roberti Gotham\' (f. 258v); for this type of inscription see Sharpe,English Benedictine Libraries(1996), p. 327. Gotham\'s name is inscribed twice more in the same hand on f. 258v. Inscribed apparently in the same hand are the names of \'Johannes Eney iiii\'; ‘Johannes Clopton vj’ ; ‘Ricardus Chefforthe’; ‘Henricus lichefeld’, \'Johannes Clopton vi\', \'Ricardus Chefforthe\' and \'Henricus Lichefeld\' (f. 258v); a list of names (‘Johannes’ (5x); ‘Robertus’; ‘Ricardus’; ‘Laurentius’); and a citation from Bede, Homily XXIX (‘quid nobis inter hec . fratres karissimi restat agendum’) on f. 258v.Sir Simonds D\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton (see Wright,Fontes Harleiani(1972)): the manuscript is recorded in his catalogue (Watson,The Library(1966), pp. 166 (A.165), 20 (B.30)); a letter in his hand (f. [259]); his foliation.Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450.The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100059468932.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059468934.0x000001/full/144,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046478',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(30,1,'Harley MS 651','Harley','3rd quarter 12th century-4th quarter 14th century',1150,1399,'This composite manuscript consists of three parts that were separately produced in England. The first part (ff. 4-177) was produced in the third quarter of the 12th century, most likely at the Benedictine abbey of St Mary the Virgin, Reading (Berkshire). It contains a collection of chronicles assembled and edited by Robert de Torigni (b. c. 1110, d. 1186), Norman chronicler, prior of Bec Abbey, and abbot of Mont Saint-Michel, Normandy.The second part (ff. 178-191) was produced in the 15th century at the Benedictine abbey of St Mary the Virgin, Glastonbury (Somerset). It mainly contains lists related to ecclesiastical jurisdictions.The third part (ff. 192r-196v), produced in the 15th century in England, contains a chronicle, lists of kings, and a Middle English account of a miracle at the shrine of Our Lady of Grace in Ipswich dated to 1516.ff. 4r–57v: Eusebius of Caesarea (b. c. 260, d. 339), Bishop of Caesarea,Chronici Canones(Chronological Canons), translated by St Jerome (b. 347,...','Provenance:Sir Simonds d\'Ewes (b.1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton (see Wright,Fontes Harleiani(1972), p. 131): bound for him in 1645 for 3 s. and clasped for 1 s. (segments from this binding with his armorial stamp pasted inside covers). D\'Ewes inscribed \'Volumine sive Tomo 60\' (f. 1v) and the number \'78\' on f. 4r; added a table of contents (f. 2r), edited the 15th-century table of contents (f. 3v), foliated the manuscript (up to the present f. 194r), and probably inscribed one text (ff. 177v–184v) (see Watson,Sir Simonds D\'Ewes(1966), p. 113 (no. A155)). At or by this time were added ff. 192–196 with further texts in different 14th-, 15th- and 16th-century hands: D\'Ewes foliated the manuscript up to the present f. 194r.Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450 (see Watson,Sir Simonds D\'Ewes(1966), pp. 61-62).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','English, MiddleLatin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100064570095.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100064570097.0x000001/full/141,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046480',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(31,1,'Harley MS 652','Harley','9th century',800,899,'This early 12th-century manuscript from the Benedictine abbey of St Augustine, Canterbury, consists of a homiliary with 119 sermons for the period between Holy Saturday and the fourth Sunday after Epiphany. The main structure of the homiliary derives from the reconstructed collection of Paul the Deacon (b. c. 720, d. 799)\'s homiliary, but it includes also an interpolated selection from St Gregory the Great (b. c. 540, d. 604), Smaragdus of Saint-Mihiel (d. c. 830), Hrabanus Maurus (d. 856), and Bede the Venerable (b. c. 673, d. 735)\'s homily for the Ember fast in Trinity. It is followed by a series of lections on lives of saints connected to St Augustine\'s (ff. 209v-216v).A fragment of the homiliary attributed to Alan of Farfa (d. 769) was added to the beginning of the manuscript (ff. 1*-4*) probably before the 15th century, based on the 15th-century press-mark of St Augustine\'s abbey written on f. 4* recto. It was written in North East France in the 2nd or 3rd quarter of the 9th ce...','Origin: Canterbury, Southeastern England.Provenance:The Benedictine abbey of St Augustine, Canterbury, founded in 598: liturgical evidence and lections at the end for St Mildred, St Adrian, St Honorius, St Lawrence, St Justus, St Theodore, all related to Canterbury; 15th-century pressmark from Canterbury \'D.x.g.ii\' (f. 4*)\'; perhaps added the four leaves (ff. 1*-4*) that are from a 9th-century manuscript from Northern France.The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100058540020.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058540022.0x000001/full/144,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046481',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(32,1,'Harley MS 658','Harley','4th quarter of 12th-1st half of the 13th century',1175,1249,'This manuscript contains a miscellany of study aids for the Bible, bound together with a collection of scientific, poetic and theological diagrams. It includes the Gospel of St John with glosses, theCompendium Historiae in Genealogia Christi(A Compendium of History in the Genealogy of Christ) by Peter of Poitiers (d. 1215) and the Commentary on the Old Testament Books of Joel and Nahum by Richard of St Victor (b. 1110, d. 1173).Contents:ff. 3r-32r: The Gospel of St John with marginal and interlinear glosses by Gilbert of Poitiers (b. 1076, d.1154).f. 32v: Six theologicalquestionesin a 13th-century hand.ff. 33r-38v: Peter of Poitiers,Compendium Historiae in Genealogia Christi.ff. 39r-121v: A series of diagrams on theological and scholastic themes followed by a collection of theological and computistical tracts, including, among other texts, a Commentary on the Patriarchs, sermons and a collection of materials for the composition of sermons (ff. 42v-52r), an anonymous computistical tr...','Origin: England or France.Provenance:Ricardus Hutton, rector of Albury in Surrey in 1513: inscribed with his name (ff. 3r, 33r, 57r, 122r, 138r) (see Wright,FontesHarleiani(1972), pp. 201-02).William Camden (b. 1551, d. 1623), antiquary: inscribed title and table of contents (ff. 1r, 2r).Sir Simonds D\'Ewes (b. 1602, d. 1650), 1st baronet, diarist, antiquary, and friend of Sir Robert Cotton: inscribed no. \'81\' (f. 1r) and foliated the manuscript.Sir Simonds D’Ewes (d. 1722), 3rd baronet and grandson of the former: inherited and later sold the D’Ewes library to Robert Harley on 4 October 1705 for £450.The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100059469793.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059469796.0x000001/full/161,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046487',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(33,1,'Harley MS 863','Harley','2nd half of the 11th century-12th century',1050,1199,'This manuscript contains a Psalter (ff. 8r-123v) that was written by scribes who also produced manuscripts made for Leofric, bishop of Exeter (from 1046 to 1072 (see Lapidge,Anglo-Saxon Litanies of the Saints(1991) no. 23). The manuscript also includes a 12th-century Kalendar with many later additions.Contents:ff. 1r-6v: Kalendar with numerous added obits in margins, written in the 12th century.f. 7v: Anonymous, verses about a miracle performed at Exeter. The heading \'In festo reliquarum Exoniensis ecclesie ad processionem\' is a slightly later addition. The verses are preceded by an extract of thePictor in Carminewritten by the scribe who wrote the previous heading.ff. 8r-108v: The Gallican version of the Psalms with Canticles with a continuous interlinear Old English gloss to the Canticle \'Quicumque vult\' (ff. 107r-v).ff. 108v-111v: Litany, for the use of Exeter.ff. 111v-123v: Prayers followed by offices with neumes response.The manuscript contains a later addition:f. 7r: Anonymous...','Origin: Exeter, Southwestern England.Provenance:The Cathedral priory of St Peter, Exeter, founded in 1050: a 12th-century Kalendar with entries related to Exeter, and numerous obits added in the 13th and 14th centuries, including that of the lawyer and chancellor of Exeter cathedral, Henry de Bracton (d. 1268) (f. 5v); verses added by an early 14th-century hand refer to the Cathedral priory: \'In festo reliquiarum Exoniensis ecclesiae ad processionem\' (f. 7v); a feast for the relics of St Peter of Exeter (23 May) \'Festum reliquiarum ecclesie beati Petri Exon[iensis]\', added in the 14th century (f. 3r); the inclusion of the feast of St Thomas Becket provides aterminus post quemof 1173 (f. 6v); evidence from the script and litany; perhaps made for Leofric, Bishop of Exeter (r. 1046-1072) and given by him to the cathedral (see Lapidge,Anglo-Saxon Litanies of the Saints(1991) no. 23). The Exeter litany features the earliest attestation of the cult of Pope Leo IX and St Bardo, bishop of Mainz (see Bishop,Liturgica Historica(1918) pp. 406-08); perhaps added numerous inscriptions and pen-trials of the 13th century and 14th century, particularly Latin verses such as \'O Maria maris stella\' (f. 1*r) and a note on \'Feria VI\' (ff. 1*r-v).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library','English, OldLatin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100059910513.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059910515.0x000001/full/155,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046692',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(34,1,'Harley MS 865','Harley','4th quarter of the 11th century',1075,1099,'Contents:f. [ii] verso: A table of contents.ff. 1r-4v: Ambrose (b. c. 339, d. 397),De Mysteriis(On Mysteries), beginning imperfectly due to the lack of the opening folio.ff. 4v-16v: Ambrose,De Sacramentis(On the Sacraments).ff. 16v-18v: Pseudo-Eusebius of Emesa (Eusebius Gallicanus),De corpore et sanguine Christi(On Christ\'s body and blood), beginning: \'Liber sermo Isidori episcopi de corpore et sanguine Christi in Pascha. Magnitudo celestium beneficiorum angustias humane mentis excedit\'; Homily from the Eusebius Gallicanus sermon collection.ff. 18v-69v: St Jerome (b. c. 347, d. 420),Contra Jovinianum(Against Jovinian), beginning: \'Incipit liber beati Ieronimi presbiteri contra Iovinianum hereticum. Pauci ad modum dies sunt.\'ff. 70r-90r: Pseudo-Augustine,Hypomnesticon contra Pelagianos et Caelestiano(Hypomnesticon against the Pelagians and Celestians), beginning: \'Adversarii catholice fidei dum contra regulam veritatis diabolicis armis pugnare nituntur\'.The manuscript contains a lat...','Origin:St Albans.Provenance:The Benedictine abbey of St Alban, St Albans, founded in 793; probably copied from a manuscript of the Benedictine Cathedral Priory of Holy Trinity or Christ Church, Canterbury, that was recorded in St Albans\' library catalogue compiled between 1284-1331 (see Montague Rhodes James,The Ancient Libraries of Canterbury and Dover(1903), pp. 21-22 no. 53; and Chisholm,The Pseudo-Augustinian Hypomnesticon(1967)); the 12th-century table of contents (f. [ii] verso) and the running headers were added by a scribe who has been identified in other manuscripts from St Albans; fragments from a letter of monks of St Albans to Pope Boniface IX, relating to the election of the abbot of St Albans, after the death of the abbot John V (John de la Moote), 11 November 1401 (ff. 1*, 91r) (see Thomson,Manuscripts from St Albans Abbey(1982), I, p. 92); added, occasional corrections and notes in various 12th-century hands (ff. 19r-69v).\'John Berymore\' (fl. 16th century), unidentified: ownership inscription \'John Berimor oueth this boke\', written by a 16th-century hand (f. [ii] verso).Edward Stillingfleet (b. 1635, d. 1699), bishop of Worcester and theologian (see Wright,Fontes Harleiani(1972)).Edward Stillingfleet (b. 1661, d. 1708), physician and Church of England clergyman, son of the former; in 1707 acquired by Robert Harley (see Wright,Fontes Harleiani,(1972)).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100056059068.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056059070.0x000001/full/144,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046694',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(35,1,'Harley MS 874','Harley','c 1340-1370',1335,1370,'English version of the Apocalypse/Revelation of St John, with a prose commentary following each section of the text.f. 1*r: Added paper leaf with Frederic Madden\'s notes about the manuscript, citing Harley 1203, Harley 171, and Royal 17 A XXVI.f. 1v: Pen trials, 15th century.f. 2r–v: Prologue to the Apocalypse: \'Seint poule þapostle seiþ þat alle ƿoo þat willen …\' (written at the top of f. 2r, ‘Ad omnea principia tibi salua dico maria’).ff. 2v-31r: Apocalypse with prose commentary: ‘Ich John ȝoure broþer …’.f. 31v: \'St Michael III\', from theSouth English Legendary,ending imperfectly: a catchword at the bottom of the leaf indicates that at least one quire is missing.f. 32r: Pen trials, 15th century.Decoration:Simple red initials. Paraphs in red ink at the head underlining the commentary. Spaces left blank for the rubrication.','Origin: England.Provenance:Edited by two main scribes. The first scribe who had edited the first part of the text is nearly contemporary with the text, the other is slightly later (see Elis Fridner,An English Fourteenth Century Apocalypse version(1961), p. ii).Inscription in a late 14th-century hand \'Ric Schepard presbyter\' (f. 1r).Inscriptions and pen-trials by two late 14th-century or early 15th-century hands (ff. 1v; 32r).Inscription in a cursive and neat hand followed by the date \'1563\' (f. 13r).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts. Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','English, MiddleLatin','Parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100058663460.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058663462.0x000001/full/143,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046703',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(36,1,'Harley MS 913','Harley','Mid 14th century',1330,1370,'Contents:ff. 1v-2r: A theological tract.f. 3r-6v: The Land of Cokaygne (\'Fur in see bi west Spaygne / Is a lond ihote Cokaygne\').f. 6v:Bissop lorles, kyng redeles(Abuses of the age).ff. 7r-8v:Hail seint Michel wiþ þe lange sper(Satire on the people of Kildare).ff. 9r-10r:Swet ihesu hend and fre(A homily by Friar Michael Kildare).ff. 10r-12r: A poem in Latin, beginning: \'Quondam fuit factus festus\'.ff. 12r-13r:Hore sompnolentium adversus capitulum, beginning: \'Fratres nolumus vos ignorare\'.ff. 13v-14v:Missa de potatoribus,beginning: \'Introibo ad altare Bachi\'.f. 14v: A quotation attribured to Bede, beginning: \'Sacerdos qui est sive mortali peccato et in bono\'.f. 15r: A tract on morality.f. 15v: Proverbs in Latin and French, beginning: \'Folie set que en force sa fie\'.f. 15v:Ad extrahendum salem de potagio(Directions for desalinating drinking water).ff. 16r-20r:Þe grace of godde and holi churche(The grace of God and Holy Church, ‘A Sarmun’).ff. 20r-21v:Þe grace of ihesu fulle of miȝte,...','Origin: S. E. Ireland (probably Waterford).Provenance:? A Franciscan convent in Waterford: see Cartlidge, \'Festivity, order, and community\' (2003); Benskin, The style and authorship of the Kildare Poems\' (1989), p. 57; and Roberts,Guide to Scripts(2005), p. 169.George Wyse, mayor of Waterford in 1561: \'Iste liber pertinet ad me Georgii Wyse (f. 2v).Possible note relating to ownership (f. 29r).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','English, MiddleFrench, OldLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100161517925.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100162142572.0x000081/full/148,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046742',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(37,1,'Harley MS 1117','Harley','c 1000',990,1015,'This manuscript includes material for the cult of St Cuthbert as well as poems and offices for other English churchmen and saints and for St Benedict. Bede\'s Lives of Cuthbert are glossed in Latin and Old English, in a hand which seems to be contemporary with the main text.The manuscript includes:f. 1r: verses on Edward the Martyr;ff. 2r-42r: Bede\'s proseVita sancti Cuthberti(orVita sancti Cudbercti;Bibliotheca Hagiographica Latina, no. 2021);f. 42v: blank;ff. 43r-44r: office for Vespers on St Cuthbert\'s feast day with musical notation;f. 44v: blank;ff. 45r-62v: Bede\'s metricalVita sancti Cuthberti(orVita sancti Cudbercti;Bibliotheca Hagiographica Latina, no. 2020);f. 62v: verses on Wigbeorht;ff. 63r-65r: office for St Benedict with musical notation;ff. 65r- 66v: office for St Guthlac, with musical notation.Decoration:Large interlace initials with animal heads in brown and red (ff. 2r, 4r, 45r); title page with a rectangular border in red, green, and blue (f. 3v); large initials in ...','Origin:England (Christ Church Cathedral, Canterbury?).On the basis of script and decoration, some scholars have associated this manuscript with Canterbury and, more specifically, with Christ Church (see Temple,Anglo-Saxon Manuscripts(1975), no. 30 (vii); Bishop, \'Notes\' (1959-63), pp. 421-22; Stokes,English Vernacular(2014), p. 71). The manuscript also contains an epigram (f. 62v), but this seems to have been copied into the manuscript from an earlier (now lost) Psalter and does not seem to describe the circumstances of the manuscript\'s own production: \'Iusserat ecclesiae Wigbeorhtus scribere nabla hoc abbas huius; cunctos rogitat qui hic psallere captant utque sui memores cantus cumulamine constent, quo Deus omnipotens sibi crimina cuncta relaxet\' (\'Wigbeorht, the abbot of this church, ordered this psalter (?) to be written. He asks those who begin to chant their Psalms that they remember him through the abundance of their song, whereby God Omnipotent may forgive them their sins\', ed. and trans. by Lapidge,Anglo-Latin(1996), p. 75). No figure named Wigbeorht is recorded in any surviving sources from England until Domesday Book, but the abbot in the epigram has been linked to an Anglo-Saxon abbot of Fritzlar who died in 747 (see Lapidge,Anglo-Latin Literature(1996), p. 75).Two exemplars have been proposed for the texts in MS Harley 1117: Cotton MS Vitellius A XIX (which possesses a similar proseVita sancti Cuthberti: see Colgrave,Two Lives(1940), pp. 46-47; Rollason, \'St Cuthbert\' (1989), p. 418), and Bibliotheca Apostolica Vaticana Reg. lat. 204 (see Barker-Benfield,St Augustine\'s(2008), III, p. 1818). The production of both Cotton Vitellius A XIX and Bibliotheca Apostolica Vaticana Reg. lat. 204 has been attributed to the Benedictine abbey of St Augustine, Canterbury.Provenance:Verses on Edward the Martyr added in the early 11th century (f. 1r).John Anstis the elder (b. 1669, d. 1744), herald and antiquary: gave to Robert Harley together with other manuscripts, according to an inscription (f. 1v).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','English, OldLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100058107312.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058107314.0x000001/full/151,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002046946',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(38,1,'Harley MS 1229','Harley','4th quarter of the 12th century - 1st quarter of the 13th century',1175,1224,'This Cistercian missal was written in England around 1200, possibly at the Cistercian abbey St Mary the Virgin at Waverley (Surrey): the abbey, founded in 1128, was the first Cistercian monastery in England. The missal’s size indicates that it was probably intended for use at the high altar. The manuscript appears to be missing a section since the collects for the feast of St Thomas of Canterbury at the beginning of the book to which are referred on f. 125r (‘Require proprias collectas in principio libri’) are now lacking.Contents:ff. 1r-111r:Temporale, beginning with the first Sunday of Advent.ff. 111v-121r: Preface for the feasts of the Nativity, Epiphany, Easter Sunday, the Ascension, Pentecost, the Trinity, Apostles, feasts of the Virgin Mary, and the Holy Cross; the Preface of the Apostles, Common Preface and the Canon of the Mass.ff. 121r-207r:Sanctorale, St Stephen-Thomas the Apostle.ff. 207r-226v: Collects and Secrets, sometimes with lections, for the dedication of a church,...','Origin: ? Waverley Abbey, Southeastern England.Provenance:? The Cistercian abbey of St Mary the Virgin, Waverley, near Farnham (Surrey), founded in 1128 from L\'Aumône Abbey by William Giffard (d. 1129), bishop of Winchester, possibly produced the manuscript and owned it until its dissolution in 1536: this is indicated by the inclusion of St Swithun on 15 July (ff. 159r-160v), a Winchester saint. Waverley was the only Cistercian house in Winchester at this time (see Watson,Catalogue(1979), no. 641; nevertheless, Watson did not consider the evidence strong enough to include this manuscript in his Supplement to Ker’sMedieval Libraries of Great Britain: A List of Surviving Books; see Preston, ‘Mixed Blessings’ (1997), p. 52 n. 12). Evidence for the date: aterminus post quemis provided by the inclusion of St Malachy (3 November) in theSanctorale(f. 195r); he was canonised in 1190 and his feast was first celebrated at Clairvaux in 1192; aterminus ante quemis provided by the feast of St Bernard of Clairvaux (27 August): originally the manuscript did not include the collects that were ordered by the Cistercian General Chapter in 1202; these were added later on a parchment strip (f. 171r); Francis of Assisi, canonised in 1226, has been added to the margin of f. 188r. Perhaps the abbey added the additional prayers (ff. 111r, 172v, 227r, 227v) and annotations throughout the manuscript.An unknown 15th- or 16th-century English owner: his name ‘John’ inscribed twice on f. 227v; perhaps also added a recipe for a cold on f. 227v: ‘for the Kold take Red ment’.The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100062816232.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100062816234.0x000001/full/149,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047058',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(39,1,'Harley MS 1246','Harley','3rd quarter of the 12th century',1150,1174,'Contents:f. 1v: A table of content of the collection of sermons contained in this manuscript.ff. 2r-141r: A collection of 63 homilies mainly excerpted from the commentaries on the Four Gospels by the Church Fathers and Doctors of the Church, arranged for the liturgical year, beginning with Bede\'s commentary on the Gospel of St Mark: \'Principium evangelii Ihesu Christi [...] Conferendum est hoc evangelii Marci principium\'; ending with St Ambrose\'s commentary on the Gospel of St Luke.Decoration:Decorated initials in blue, green, red or light brown, frequently with reserved lines, geometric or arabesque motifs in the same or one or more alternate colour. A few simple initials in red or green. Rubrics in red. Quire signatures. Guide script for rubricator in outer margins (e.g., f. 102v).','Origin: Reading, Southeastern England.Provenance:Probably written at the Benedictine abbey of St Mary, Reading in the 3rd quarter of the 12th century, according to Coates,English Medieval Books(1999), pp. 47, 52, 59 (assigned to Reading on the basis of the script).The Benedictine priory of St Peter, Leominster, Herefordshire (a cell of Reading): recorded in the inventory of books at Leominster of c. 1192 as one of two sermon collections \'Due omeliarii diversorum tractatorum utrosque incipiente Beda\' (see Sharpe,English Benedictine Libraries(1996), B75.12); partly erased ownership-inscriptions \'Iste liber [...] in com[munitatem] Herff[ordensis] (f. 1r), and a anathema written by the same 13th-century hand (141r).Added, 15th-century drawings in crayon (margins of ff. 38v, 83v, 84r, 88r).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056033316.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056033318.0x000001/full/150,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047075',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(40,1,'Harley MS 1251','Harley','c 1430-c 1440',1425,1445,'Contents:f. 1: Added paper fragment of a printed 15th- or 16th-century book concerning canon law, inscribed on the recto with a book curse in Middle English verse, ‘Thys boke ys one and godes kors ys anoder they that take the ton god gef them the toder’ (DIMEVno. 5660-3), late-15th/16th century.f. 2r: Added ownership inscriptions (see Provenance).ff. 4r-6v: Added preparatory prayer before confession in Latin, beginning, \'Conditor celi et terre rex regnum et dominus dominantium\', late-15th/16th century.ff. 7r-16v: Calendar, with the following English saints: Thomas Becket (twice), Wulstan, David, Cedd, Edward the Confessor (twice), Richard of Cirencester, Alphege, Dunstan, Aldhelm, Augustine of Canterbury, Edmund (3 times), Translation of Richard, Translation of Edward the Confessor, Alban, Ethelreda, ordination of Thomas Becket, Swytun, Kenelm, Arnulf, Oswald, Cuthburga, translation of Cuthbert, Frideswide; with added entries for St Bridget and the dedication of Syon Abbey (f. 13r) ...','Origin:Rouen, France.Provenance:John, Duke of Bedford (b. 1389, d. 1435): his portraits? (ff. 41r, 51r, 109r), his obit added in the calendar, \'Obiit Johannes dux bethford[ie] m.iiii.xxxv.\' (f. 12v), and the arms in the miniature for the Office of the Dead adapted to represent his funeral (f. 148r); Bedford\'s badge of an eagleargentcrowned and beakedorperched on a rootoradded on both of these folios.Syon Abbey, House of Bridgettines, Isleworth (?): Added entry for the dedication of the Bridgettine Abbey of Syon (20 October) and St Bridget (7 October) in the calendar, 16th-century (f. 13r).Eleanor Worcester, probably to be identified with Eleanor, Countess of Worcester (b. in or after 1481, d. by 1549), daughter of Edward Sutton, 5th Lord Dudley; married to Charles Somerset (b. 1460, d. 1526), 1st Earl of Worcester, son of Henry Beaufort, 3rd Duke of Somerset; and subsequently to Leonard Grey (d. 1541), Lord Deputy of Ireland: \'Thys boke ys myne eleanor Worcester...\' (f. 184v) and \'E Worcester\' (f. 185r) and several inscriptions in English, in the same16th-century hand (ff. 1r, 37v, 53r, 182r-183r, 184v-185r).Added fragment of a printed book as a flyleaf, 15/16th century (f. 1).Inscribed, \'Thomas Catcher / 26\', 16th century (f. 2r).Inscribed in pencil: \'W Stephens\', 18th? century (f. 2r).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st Earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd Earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), Duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','EnglishEnglish, MiddleFrenchLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100172078624.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100172197151.0x000175/full/170,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047080',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(41,1,'Harley MS 1321','Harley','1225-1275',1225,1275,'Contents:Chansons de Geste from the cycles of William of Orange (Guillaume d\'Orange): and Aimeri de Narbonne (Aymeri de Nerbonne)ff. 4r-38v: Bertrand de Bar-sur-Aube,Girart de Vienne(Girard deViane), 5,560 lines, lacking 1 leaf at the beginning that perhaps contained a miniature;ff. 38v-120v:Aimeri de NarbonneandNarbonnais, 12,850 lines;ff. 121r-175r:Siége de Barbastre, 8,400 lines;ff. 176-217v:Guibert d\'AndrenasandMort d\'Aimeri, 1,560 lines.Chansons from these cycles are also found in Royal 20 B xix and Royal 20 D xi .Single folios are lacking after ff. 3, 191, 217, and 8 folios are lacking after f. 26.ff. 3 and 218 are medieval parchment flyleaves, originally part of an 11th-century Sacramentary;ff. 1-2, 219-220 are early modern flyleaves from two French 17th-century charters or chancery manuscripts.Decoration:One miniature and two historiated initials in colours with gold of Aimeri kneeling in front of Charlemagne (f. 38v), Aimeri feasting at Narbonne (f. 121r), and Guibert stand...','Origin: France, N.Provenance:Nicolas Joseph Foucault (b. 1643, d. 1721), marquis de Magny, statesman and archaeologist: his book-plate with the legend \'EX BIBLIOTHECA / NICOLAI JOSEPH FOUCAULT / COMITIS CONSISTORIANI\' with his arms [sable] a lion rampant, dexter, crowned [argent], as supporters two lions [argent]; a couronne de marquis surmounting the shield (f. 1v; see Wright,Fontes Harleiani(1972)).Thomas Ballard, bookseller and book auctioneer in London; his sale, 20 February 1720/21, lot 192, bought for Edward Harley possibly through Nathaniel Noel (see Wright and Wright,Diary(1966); Wright,Fontes Harleiani(1972)).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts, inscribed as usual by their librarian, Humfrey Wanley, ‘23 Februarij, 1720/21’ (f. 4r).Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','French, Old','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100057738028.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057738030.0x000001/full/138,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047150',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(42,1,'Harley MS 1334','Harley','2nd half of the 12th century',1150,1199,'This manuscript preserves the work known asHistoria Iosephi de Bello Iudaico et Excidio Urbis Hierosolymitanae(The History of Josephus on the Jewish wars and the Destruction of the City of Jerusalem), a 4th-century adaptation of Josephus (b. 37, d. 100)\'sJewishWarsattributed to Hegesippus, a name which may have been a misspelling of ‘Josephus’.Contents:ff. 1r-91v: Pseudo-Hegesippus:Historia Iosephi de Bello Iudaico et Excidio Urbis Hierosolymitanae, lacking parts of the last chapter (5.53), beginning: ‘Incipiunt quinque libri Egesippi natione Iudei de excidio Iudeorum’.Decoration:One large arabesque initial in red, green and light brown (f. 68r). Two large initials in light brown or green with penwork decoration in alternate colours and with some red (f. 1r). Two large initials in red or in light brown with minor penwork decoration in the same colour and one with a reserved line (ff. 31v, 43v). Simple initials in red, blue, green or light brown. Display script in red, green and ligh...','Origin: England.Provenance:\'James Pearse\', unidentified: his name (\'Liber Jacobi Pearse\') inscribed in a 17th-century script (f. 1r).\'Vincent Pearse\', unidentified: his name (\'Vincent Perce\') inscribed in a 17th-century script (f. 3v).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100059307472.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059307474.0x000001/full/140,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047163',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(43,1,'Harley MS 1629','Harley','2nd half of the 13th century',1250,1299,'Contents:Les Prophecies de Merlin, is a prose compilation of romance material from Arthurian sources, together with original political prophecies relating to Italian events of the eleventh, twelfth, and thirteenth centuries. The text, originating in Venice circa 1276, is primarily a series of political prophecies, as related by Merlin to various fictional scribes, and the amount of romance material embedded around these prophecies varies among the 20 extant manuscripts. The earliest manuscript, Rennes, Bibliotheque Municipale, MS 593, dated to 1303, attributes the text to Maistre Richart d’Irlande and claims that it is a translation commissioned by Emperor Frederick II, although scholars agree that the author must have been a Venetian. Between 1324 and 1330, the French work was translated into Italian by Paolino Pieri, a Florentine chronicler.The present manuscript consists of three incomplete portions of the text (misbound, in that the first surviving quire, which should have prece...','Origin: France, N.Provenance:Inscribed \'ffowlke ap Thomas\', \'thomas ap ?M ap Robert\', early 16th century? (f. 33r).Lloyd (son of David Lloyd), Wales, end of 16th century: inscribed \'ffowlke ap d[avi]d lloyd est possessor\' (f. 33), inscription in the ?same hand (f. 30v).Henry Worsley (b. 1675, d. 1747), scholar and manuscript collector, envoy at the Court of Portugal (1714-21) and governor of Barbados (1721-31): donated by him to Robert Harley together with other manuscripts from Worsley\'s collection (now Harley 1585-1747, 1811, 1812) before December 1712 (see Wright,Diary(1966)).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','French','A parchment codex, 70 folios','https://bl.digirati.io/iiif/ark:/81055/vdc_100057738104.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057738106.0x000001/full/157,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047459',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(44,1,'Harley MS 1700','Harley','4th quarter of the 12th century-1st quarter of the 13th century',1175,1224,'This manuscript contains the Twelve Minor Prophets of the Old Testament with prologues and commentary in interlinear and marginal glosses.Contents:f. 1* recto: A prologue to the Book of Amos, Chapter 2 (‘Prefatio Jeronimi in Amos propheta super secundum librum’).ff. 1r-1v: A prologue to the books of the Twelve Minor Prophets.ff. 2r-25r: The Book of Hosea.ff. 25r-38r: The Book of Joel.ff. 38r-57r: The Book of Amos.ff. 57r-60r: The Book of Obadiah.ff. 60r-65v: The Book of Jonah.ff. 66r-76r: The Book of Micah.ff. 76r-81r: The Book of Nahum.ff. 81v-87v: The Book of Habakkuk.ff. 87v-92v: The Book of Zephaniah.ff. 92v-96v: The Book of Haggai.ff. 97r-114r: The Book of Zechariah.ff. 114r-118v: The Book of Malachi.ff. 119r-120v : The Book of Zechariah 11.1-12.2 (identical to ff. 109r-110r).f. 120v: A list of the kings of Israel and a list of the kings of Juda, with marginal glosses.[f. 1*verso is blank].Decoration:1 large initial in colours and gold with foliate motifs in a green frame with ...','Origin: England or France.Provenance:Unknown 12th- or 13th-century owners: an added prologue to the Book of Amos in an English (?) 12th- or 13th-century hand (f. 1* recto); titles of the books of the Twelve Minor Prophets added in the upper margin throughout the manuscript; the title of the hymn ‘Sancti spiritus assit nobis gratia’ added to the lower margin of f. 119r.Henry Worsley (b. 1675, d. 1747), scholar and manuscript collector, envoy at the Court of Portugal (1714-21) and governor of Barbados (1721-31); donated by him to Robert Harley together with other manuscripts from Worsley\'s collection (now Harley 1585-1747, 1811, 1812) before December 1712 (see Wright,Fontes Harleiani(1972), pp. 361-62).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056033330.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056033332.0x000001/full/168,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047531',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(45,1,'Harley MS 1712','Harley','12th century',1100,1199,'Contents:This manuscript consists of Petrus Comestor\'s sermons (ff. 17r-233v), and was produced at the very end of the 12th century.Contents:ff. 3r-16r: Table of contents and indexes.ff. 17r-233v: Petrus Comestor,Sermones(Sermons).The manuscript contains later additions:ff. 3r-16r: table of contents and indeces to sermons have been added later, in the 2nd quarter of the 15th-century.Decoration:Large initial in colours and gold, with foliate tendrils extending into the margins (f. 4r).ff. 3r-16r: Numerous initials in blue with red pen-flourishing including foliate motifs. Coloured initials in red or blue. Capitals marked in red. Cadels in brown and red ink.ff. 17r-233v: Large arabesque initial in yellow with red penwork decoration (f. 17r).Initials in green or red with red pen-flourishing (ff. 163v, 166r, 169r, 175r, 177v, 179v, 181v, 183r, 187v, 188r, 190r, 212v, 214r, etc.).Coloured initials in red, yellow or green, sometimes extending into a leaf pattern in the same colour (e.g., ...','Origin: England.Provenance:An unidentified late-14th century owner: added a table of contents (f. 1r).The Augustinian abbey of St John the Evangelist in Haughmond, Shropshire: 15th-century ownership inscription \'Liber iste est monasterij s[an]c[t]i Joh[ann]is evangeliste de Haghmond\' (f. 17r); added 15th-century foliation.An unidentified owner: added a marginal sketch of a fleur-de-lys (f. 45r).An unidentified ?15th-century owner: added a drawing in brown ink of a sleeping figure directly related to the sleep of the soul referred to in the text (f. 50r).An unidentified 15th-century owner: added verses beginning: \'Sunt tria que vere faciunt me sepe dolere\' (f. 233v).An unidentified late-15th-century owner: added English notes (ff. 136v, 137r); \'gentyll man\' (f. 137r).An unidentified 16th-century owner: inscribed \'Feste Nicholao Wakeman\' (f. 137r).Several unidentified owners: added inscriptions in 16th/17th century hands (ff. 2v, 16v, 234r).An unidentified owner: inscribed \'floruit anno D. 1182\' in a post-medieval hand (f. 17r).An unidentified owner: Inscribed \'Jo. Heynes\' in a 17th-century hand (f. 3r) (see Wright,Fontes Harleiani(1972)).Henry Worsley (b. 1675, d. 1747), scholar and manuscript collector, envoy at the Court of Portugal (from 1714-21) and governor of Barbados (from 1721-31): donated by him to Robert Harley together with other manuscripts from Worsley\'s collection (now Harley MS 1585-1747, 1811, 1812) before December 1712 (see Wright and Wright,The Diary of Humphrey Wanley(1966) and Wright,Fontes Harleiani(1972)).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056033404.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056033406.0x000001/full/165,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047543',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(46,1,'Harley MS 1717','Harley','1st half of the 13th century',1200,1249,'This manuscript contains theChronique des ducs de Normandie(Chronicles of the Dukes of Normany), which is believed to have been composed by Benoît de Sainte-Maure (fl. 1160-70) while he was in the service of Henry II and Eleanor of Aquitaine. TheChroniquebegins with Creation and ends with the death of Henry I.Contents:ff. 1r-250r: Benoît de Sainte-Maure,Chronique des ducs de Normandie.f. 250v: Added Prophecy of the Eagle, or of Merlin Silvester, 13th century, in Latin.f. 251v. \'Parti de mal e a bien aturne\': Song of six verses, with music to the first, written in a French hand. The notes are quasi-square on a stave of four red lines, with the C signature.Decoration:9 large historiated initials in colours and gold occasionally with dragons. Large decorated initials in colours and gold with interlace and animal heads, dragons, foliate decoration, fighting animals, etc. (ff. 1r (including dragon), 23r, 61r, 154v, 156v, 160r, 166v, 174v (with a fabric curtain), 218r, 236r). Initials in ...','Origin: France, N. W. (Normandy?) or England.Provenance:Added Prophecy of the Eagle, or of Merlin Silvester, 13th century, in Latin (f. 250v).Inscribed, 15th century, price \'xxvi s. viii d.\' (on a piece of parchment pasted onto f. [ii]).?The collegiate church of St. John of Beverley, Yorkshire, 15th century: inscribed \'s[an]c[t]i Beverlaci\' (f. 252).Added Prophecy of Merlin, 15th century, in English (ff. 249v-250).Added inscriptions in 15th-16th-century hands (ff. 251v-252).Thomas Lorde, 16th century: inscribed with his name (f. 252).Erased inscription, post-medieval (f. 244).Henry Worsley (b. 1675, d. 1747), scholar and manuscript collector, envoy at the Court of Portugal (1714-21) and governor of Barbados (1721-31); donated by him to Robert Harley together with other manuscripts from Worsley\'s collection (now Harley 1585-1747, 1811, 1812) before December 1712 (see Diary 1966).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts. Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','French','Parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100057740026.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057740028.0x000001/full/138,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047548',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(47,1,'Harley MS 1725','Harley','Early 16th century',1500,1540,'This volume contains an extensive collection of letters and other Latin works by Hildegard von Bingen (b.c. 1098, d. 1179), a German Benedictine abbess, polymath and medieval mystic. The volume is an early 16th-century copy of the Wiesbaden Codex, also known as the \'Riesencodex\' (now Wiesbaden, Hess.LB, Hs. 2), a giant manuscript of Hildegard\'s collected works, made around 1200.Contents:ff. 1r-5v: A Latin table of contents, comprising 287 items.ff. 6r-330v: Hildegard von Bingen,Collectio epistolarum, a collection of her letters, interspersed with several of her other Latin works, including:ff. 159r-172r:Liber Questionum, beginning, \'Matri sanctissimae Hildegardi Guibertus\'.ff. 210r-219r:Vita sancti Roberti dilectissimi patroni nostri, beginning, \'Nam ut in vera visione video\'.ff. 260r-268v:Explanatio Regulae sancti Benedicti, beginning, \'Et ego paupercula feminea forma\'.ff. 273v-286v:Vita sancti Disibodi episcopi, beginning, \'In mistica quoque visionis ut Deus voluit\'.ff. 287r-330v:...','Origin:Germany.Provenance:Henry Worsley (b. 1675, d. 1747), scholar and manuscript collector, envoy at the Court of Portugal (1714-21) and governor of Barbados (1721-31): donated by him to Robert Harley together with other manuscripts from Worsley\'s collection (now Harley MSS 1585-1747, 1811, 1812) before December 1712 (see Wright,Fontes Harleiani(1972), pp. 360-62).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724 ), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts forms one of the foundation collections of the British Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100165165560.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165344376.0x000297/full/145,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047556',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(48,1,'Harley MS 1764','Harley','2nd quarter of the 15th century-3rd quarter of the 15th century',1425,1474,'This manuscript contains the only known surviving copy of the earlier Middle English translation ofLe Chevalier de la Tour Landryby Geoffroy de la Tour Landry (b. before 1330, d. between 1402 and 1406), known asThe Knight of the Tower. This copy of the text is imperfect, with a catchword on f. 54v indicating the original presence of at least one additional quire. Geoffroy compiled the original French work as an instructional guide for his daughters at court. The later Middle English translation was printed by Caxton in 1484.A copy of the original French text is now Royal MS 19 C VII.For an edition of the Middle English translation based on this manuscript, see Wright, ed.,Book of the Knight of La Tour-Landry(1868).Contents:ff. 1r-54v:The Knight of the Tower, an anonymous Middle English translation ofLe Chevalier de La Tour Landry, by Geoffroy IV de la Tour-Landry, imperfect at the end; the text beginning, \'In the yere of the incarnacion of oure lord MliijClxxj as I was in a gardin a...','Origin:England.Provenance:Inscribed, 16th/17th century: \'James by the grace of god king of England, France and Irland and of Scotland defender of the fayt etc\' (f. 37r).Paul Durant, early 17th century: inscribed, \'Paulus Durant\' (f. 2r) (see Wright,Fontes Harleiani(1972), p. 141).David Kellie, early 17th century: inscribed \'Dauid Kellie\' (ff. 2r, 16r, 49v); inscribed, \'Dust is lighter then a feather yet the wind more light then a feather\' (f. 16r), and \'David by (see Wright,Fontes Harleiani(1972), p. 208).George Hickes (b. 1642, d. 1715), bishop of the nonjuring Church of England and antiquary: inscribed, \'Given by Mr. Hickes\' (f. 1*r).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish Harley, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library: old British Museum press mark: \'93. B. 8\' (f. 1*r).','English, Middle','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100165166117.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100175353410.0x00006d/full/145,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047595',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(49,1,'Harley MS 1772','Harley','9th century-11th century',800,1099,'Contents:This manuscript consists of the Pauline Epistles and the Epistle of James, the Epistles of Peter, the Epistles of John and the Book of Revelation or the Apocalypse. It includes also several 11th-century additions (mainly charms) related to medicine (see Provenance).ff. 1r-118r:Epistule Sancti Pauli(the Pauline epistles), preceded by a prologue (ff. 1r-2v), beginning of the prologue: \'Primum quaeritur quemadmodum post evangelia\' followed by the Epistle to the Romans (ff. 2v), preceded by theargumentum,beginning (f. 2v): \'Romani ex Iudaeis gentilibus que crediderunt\'; theVersus Damasi,an epigram attributed to Damasus has been interpolated between the end of theargumentumand the beginning of the Prologue of the Epistle to the Romans (ff. 3v-4v); thecapitulaof the Epistle to the Romans (ff. 4v-6r) followed by the Prologue of the Epistle to the Romans (f. 6v); the first Epistle to Corinthians (ff. 24v-44r), preceded bycapitula(ff. 24v-26v) and the prologue (f. 26v); the second E...','Origin: Reims, Northeastern France.Provenance:Inscribed in runes \'Ego Iusueus Hac/si indignus diacon[us]/ [h]anc librum quem / ad opus peculiare/ uolo off[erre] s[an]c[t]o\' (f. 6v), according to a transcription by Derolez,Runica manuscripta(1954), p. 405.Corrections, glosses and notes added in the 10th and early 11th centuries (ff. 64r, 71r, 112v).Additions and neumes, a passage from the Disticha Catonis and Eclogues I, 1 (f. 38v), and glosses (f. 88v); see Bischoff,Katalog der festländischen Handschriften des neunten Jahrhunderts(2004), p. 112, mo. 2442.Added, charms in the margin written by 11th-century hands including the Latin palindrome pagan charm \'Sator arepo\' used to protect women in labour (f. 88v); three charms beginning: \'Ad pedanam/ Domine Christe qui [...]/ mafri Adam ad ima/ginem tuam\'; \'Aporeos capit [..]/pit adque parav[it ?]\'; \'Contra mal[em?] / malanum\' (f. 64r) followed by the names of the Evangelists written within a cruciform diagram together with other four words; charms in circular diagrams with the five vowels, beginning: \'Ad sorbis et ita consorbis ... maglia\'; \'Macula. in nomine patris\' (ff. 88v, 125v); \'Sator arepo tenet opera rotas\' in circular diagrams, with the five vowels and the letter \'b\' written in an inner circle (f. 88v); charms written in the upper margin \'Ne glorie ne glorie ne glorie ? [..] a in ripa mare sedebat macula de ocu/lo famula dei sit est alba cristus\' (ff. 122v-123r); \'obmu[s..] / facere [...]/atis / malicie [in different ink and hand\', repeated in the lower border by a third hand \'obmustis cere faciatis / malicie\' (f. 125). The Latin seems to turn into Frankish.Added, 11th-century memorandum of days unpropitious for bleeding; beginning: \'Cave multum ne in is tribus diebus sanguinem minuas aut pocionem sumas\' (f. 112v).The French Royal Library, Paris: former MS 3938, probably taken by Aymon in 1707, see Léopold Delisle,Le Cabinet des Manuscrits de la Bibliothèque Impériale [Nationale]: Étude sur la formation de ce dépôt3 vols. (Paris: Imprimerie Nationale, 1868-1881), I, p. 331.Jean Aymon (b. 1661, d. 1734), of the Hague, French theologian and legal adviser: bought by Harley through an intermediary, Philip Stubbs (b. 1665, d. 1738), clergyman, archdeacon of St Albans and educationist according to C. E. Wright and R. C. Wright,The Diary of Humfrey Wanley(London: The Bibliographical Society, 1966), i, p. xxiii; C. E. Wright,Fontes Harleiani(1972), pp. 56-57, 266, 401.The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056033924.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056033926.0x000001/full/133,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047603',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(50,1,'Harley MS 1915','Harley','4th quarter of the 12th century',1175,1199,'This manuscript is closely related to the readings of the New Testament as it includes a concordance on the four Gospels written by Zacharias of Besancon (d. 1157). It is followed by Bede\'s commentary on the Acts of Apostle, including hisretractatio,a treatise in which he underlined his own mistakes in a previous commentary on the Acts of Apostle. The manuscript includes also another Bede\'s text related to the Acts of Apostle, theNomina Regionum atque Locorum de Actibus Apostolorum(The Names of the Regions and Places in the Book of Acts),a geographical dictionary on the places and regions cited in Acts. The eschatological part of the manuscript includes a commentary on Apocalypse by Victorinus of Pettau and an anonymous commentary on Apocalypse.Contents:ff. 1v-6r: A table of chapters of the four Gospelsff. 6v-8v: The Eusebian canon tables.ff. 9r-164v: Zacharias of Besançon,De concordia evangelistarum(On the concordance of Gospels) with glosses copied by the same scribe,preceded by a...','Origin: Northern France or England.Provenance:Added inscription, late 16th century, citing Conrad Gessner (b. 1516, d. 1565), humanist and naturalist (f. 1r).Nathaniel Paris (fl. 1664), stationer in Little Britain, London: owned until 1672, purchased from him by Mr Samuel Knott from Devon (f. 1r).Samuel Knott (d. 1687), rector of Combe Raleigh, Devon (1661-1668), antiquary and collector of manuscripts: acquired by him on 3 March 1672 (inscription, f. 1r).Robert Burscough (b. 1650/51, d.1709), prebendary of Exeter in 1701, archdeacon of Barnstaple in 1703, rector of Cheriton Bishop in 1705: sold by his widow on 17 May 1715 to Robert Harley, along with other manuscripts (f. 1r) (see Wright,Fontes Harleiani(1972), 87-88 andDiary of Humphrey Wanley(1966)).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts, inscribed as usual by their librarian, Humfrey Wanley ‘17 May 1715’ (f. 1r).Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100063299806.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100063299808.0x000001/full/160,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047746',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(51,1,'Harley MS 1916','Harley','1st half of the 12th century',1100,1149,'This 12th-century manuscript contains an incomplete version of the commentary on Gospel of St John and the First Epistle of St John by the Church Father St Augustine of Hippo (b. 354, d. 430). The manuscript\'s first leaf has been removed and bound into Harley MS 5958 (f. 87). It contains a list of periscope readings for the Gospel of St John and an inscription that explains how a monastic community, probably that of Glastonbury Abbey, should select passages for reading in the refectory during the liturgical season of Lent.Contents:ff. 2r-180r: St Augustine,Tractatus in evangelium Iohannis(Commentary on St John’s Gospel), lacking the first part (I.1-7), beginning: ‘Quomodo omnia per ipsum facta sunt et sine ipso factum est nichil’.ff. 180r-207r: St Augustine,In epistulam Iohannis ad Parthos tractatus(Commentary on the First Epistle of St John), beginning: ‘Meminit sanctitas vestra evangelium secundum Iohannem’.Decoration:One large initial in red with red penwork decoration of foliage...','Origin: ? Glastonbury, Southwestern England.Provenance:? The Benedictine abbey of Glastonbury of St Mary the Virgin, founded in 712: the first leaf of this manuscript is bound in Harley MS 5958, f. 87. In the lower margin of this leaf is a 13th-century inscription \'lector refectorii\' (the reader in the refectory) after which has been added \'scilicet Abbatiae Glastoniensis\' (that is, of Glastonbury Abbey) by Humfrey Wanley, Edward Harley\'s librarian (see Ker, Medieval Libraries (1964), p. 91 n. 9); The lower part of f. 207r is ripped, just on the last line of text. A colophon containing provenance information may have been entered there, and later cut out.An unknown 16th-century owner: his coat of arms on f. 70v and marginal notes (see, for instance, f. 185v), and a drawing of a shark on f. 195v.? \'William ffollet\', unidentified, c. 1600: his name (\'by me William ffoll[e]t\') inscribed (f. 207v).? \'John Knot\', unidentified, c. 1600: his name (\'John knot his [...]\') inscribed (f. 207v).? Henry Morgan, unidentified, c. 1600: his name is in a fragment of a 16th-century indenture (f. 1r).Samuel Knott (d. 1687), rector of Combe Raleigh, Devon (1661-1668), antiquary and collector of manuscripts: his notes in pencil (ff. 3v, 125r) (see Wright,Fontes Harleiani(1972), p. 211).Robert Burscough (b. 1651, d. 1709), prebendary of Exeter in 1701, archdeacon of Barnstaple in 1703, rector of Cheriton Bishop in 1705: sold by his widow on 17 May 1715 to Robert Harley, along with other manuscripts (see Wright,Fontes Harleiani(1972), p. 87-88).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts, inscribed as usual by their librarian, Humfrey Wanley, ‘17 Maij 1715’ (Harley MS 5958, f. 87v).Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100059307807.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059307809.0x000001/full/133,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047747',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(52,1,'Harley MS 1918','Harley','1st half of the 12th century',1100,1149,'Contents:ff. 1r-3r: Bede,Homiliae inEvangelia, Homilia in Vigilia Paschalis,beginning: \'In Sancto Sabbato secundum Mattheum. Que luscecit in primam (sic) sabbati [...] Omelia Venerabilis Bede presbiteri, de eadem lectione. Vigilias nobis hujus sacratissime noctis\', ending: \'qui vivit et regnat cum Patre in unitate Spiritus Sancti Deus per omnia secula seculorum. Amen\'.ff. 3r-4v: Pope Leo the Great,Sermo in Sancto Sabbato, beginning: \'Sermo Beati Leoni Papae in Sancto Sabbato. Totum quidem, dilectissimi, Paschale sacramentum\'.ff. 4v-6r: St Gregory the Great,Homilia in Die Paschalis, beginning: \'In die Paschale, secundum Marcum lectio IX [Gospel of St Mark 1:7]. Maria Magadalene et Maria Iacobi et Salome [...]. Omelia lectionis eiusdem Beati Gregorii. Multis vobis leccionibus fratres karissimi\'.ff. 6r-6v: Pseudo-Saint Maximus of Turin,Sermo in Resurrectione Domini,beginning: \'Sermo beati Maximi episcopi in resurrectione Domini, lectio prima. Non immerito fratres hodierna die psalmus h...','Origin: Northwestern France or England.Provenance:The Benedictine abbey of St Mary, Glastonbury, Somerset: probably listed in its 1247/48 catalogue, no. 39 (see Sharpe,English Benedictine Libraries(1996)); 16th-century inscription \'Ex Abbatia Glasconiensis nam scripseret quidam folio finali: Robertus Wottone mo[nachus] Glasconis (f. 1r).Robert Wottone, monk of Glastonbury, 16th century: inscription (f. 1r; see above), added small parchment leaf inscribed \'Robertus Wottone\' (f. 191v).John Long, of Dorchester, in Dorset, matriculated at Pembroke College, Oxford, 1 July 1664, aged 18: inscription recording his gift to Samuel Knott in 166[?] (f. 1r; see below).Samuel Knott (d. 1687), rector of Combe Raleigh, Devon (from 1661-1668), antiquary and collector of manuscripts: partially effaced inscription \'\'Bought of Mr John Long of Dorchester . . . of which I gave . . . 18 of November 166[?] . . . I have . . . this booke is mine Sam. Knott\' (f. 1r).Robert Burscough (b. 1650/51, d.1709), prebendary of Exeter in 1701, archdeacon of Barnstaple in 1703, rector of Cheriton Bishop in 1705: sold by his widow on 17 May 1715 to Robert Harley, along with other manuscripts (see Wright,Fontes Harleiani(1972), pp. 87-88;The Diary of Humfrey Wanley(1966)).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts, inscribed as usual by their librarian, Humfrey Wanley ‘17 May 1715’ (f. 1r).Added 18th-century list of biblical readings quoted in the homilies of the manuscript (ff. 190r-v).Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056034372.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056034374.0x000001/full/164,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047749',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(53,1,'Harley MS 1924','Harley','2nd or 3rd quarter of the 12th century',1150,1174,'Contents:ff. 1r-48v: Bede,Vita Sancti Cuthberti(Life of St Cuthbert), preceded by a prologue (ff. 1r-2v) andcapitula(ff. 2v-3v), ending at chapter 42: \'et involutum novo amictu corpus levique in theca reconditum supra pavimentum sanctuarii composuerunt\' (f. 48v). Chapters 41 and 44-46 are lacking.ff. 49r-71r: A compilation of seven posthumous miracles of St Cuthbert that includes excerpts fromHistoria de Sancto Cuthberto(History about St Cuthbert).An 8th miracle follows the compilation and is written by a different but contemporary hand. This last miracle involves two Norwegian monks, beginning: \'Quale miraculum post dicessum vestrum acciderit\' (ff. 70v-71r).Decoration:Large inhabited initial in red, with washes in green, blue, and yellow (f. 4r). Large initial in brown with penwork foliate decoration in red, and washes in blue, green, and yellow (f. 1r). Initials in red or blue. Small initials in brown. Rubrics in red.','Origin: Normandy, Northwestern France or England.Provenance:The Benedictine cathedral priory of St Cuthbert, Durham: letter mark \'D\' (f. 1); an erased 14th-century ownership inscription (f. 1r, upper margin); originally bound together with Oxford, Bodleian, Digby MS 41 ( ff. 91, 91*, 92, 101) from Durham, which contained a list of Durham relics; listed in its catalogue according to Watson,Medieval Libraries of Great Britain(1987), p. 30.Thomas Gascoigne (b. 1403, d. 1458), theologian and university administrator: notes in his hand throughout, notably \'IHC\' M[aria]\' (e. g., ff. 11-13, 70-71passim).? Durham College (now Trinity College), Oxford: in Oxford, according to Thomas Gascoigne\'s notes (see Ker, \'Membra Disiecta\', (1938)); possibly listed in its catalogue (see Watson,Medieval Libraries of Great Britain(1987), p. 54).?Richard Bell (b. c. 1410, d. 1496), monk of Durham, later bishop of Carlisle: ?his notes on Bede\'sLife of St Cuthbertand other texts (e. g., 13r, 71r), (see Sharpe,A Handlist of the Latin Writer in Great Britain(2001), p. 459).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts.Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d.1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056035068.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056035071.0x000001/full/153,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002047755',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(54,1,'Harley MS 2340','Harley','1st half of the 15th century',1400,1449,'This pocket-sized manuscript contains a collection of three Middle English treatises on the subject of hawking, including a version of the so-called \'J. B. Treatise\'. The text contains a hierarchy of hawks and owners (including the line, \'A kesterell for a knafe\', f. 50r) as well as a final section, listing collective nouns for different types of birds. This copy of the work only gives the author\'s initials in the colophon (\'J. B.\'). Previously, the authorship of the treatise has been attributed to Julianna Berners (fl. 1460), prioress of the Benedictine nunnery of Sopwell, St Albans, but this has since been disputed.For a further discussion of the \'J. B. Treatise\' and its authorship, see Scott-Macnab,The J. B. Treatise(2003), pp. 1-6; and Boffey, \'Berners [Bernes, Barnes], Juliana (fl. 1460), supposed author and prioress of Sopwell\',Oxford Dictionary of National Biography.Contents:ff. 1r-22v:The Booke of Hawkyng after Prince Edwarde Kynge of Englande, a treatise in Middle English, ...','Origin:England.Provenance:Inscribed ?15th century, \'Richard\' (f. 57r).Inscribed ?16th century, \'Thomas\' (f. 56r), and \'Thomas ?Angrishe\' (f. 57r).George ?Warnesfend: inscribed ?16th century, \'George ?warnesfend It is his booke\' (f. 1r).Reverend Peter Needham (b. 1682, d. 1731), classical author: sold to the Harleys in 1719 (see the inscription below on f. 1*r).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts: inscribed by their librarian, Humfrey Wanley, ‘Praesentem Codicem Domino meo D. D. Vir per eruditus Petrus Nedham S. T. P. 12 die Octobris, A. D. 1719’ (f. 1*r).Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','English, Middle','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100186243602.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100186381832.0x000077/full/157,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002048171',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(55,1,'Harley MS 2388','Harley','2nd half of the 15th century',1450,1499,'This theological manuscript may consist of two parts (ff. 1r-37v and ff. 38r-112v) that were produced separately and joined at a later point in time. The manuscript contains Middle English theological treatises and poems and Latin sermons. Among its contents is a the unique copy of theMirrour for Maydenes(ff. 4r-7v) which provides spiritual advice to women who want to dedicate themselves to a life of contemplation.Contents:ff. 1r-4r:Of Three Arrows on Doomsday, beginning imperfectly: \'cleping of þe dom. where of crist spekith in his gospel seying þus\'.ff. 4r-7v:Mirrour for Maydenes, beginning: \'Here begynnith a se[n]tence þe wych ys a mirror for maydenes þat wolden be cristis spouse and forsake to be wedded to mannis flessh\'.ff. 7v-20r:The Five Wiles of King Pharaoh, beginning: \'Here sueþ a prologue of a ful nobly tresyse þat tellith of þe .v. wylis þat king pharaoh dede to þe Children of Israel to kepe hem in his lond. by wych ys wyttly undirstronden. þe wilis of the fende\'.ff. 20r...','Origin:England.Provenance:John Batteley (b. 1647, d. 1708), Church of England clergyman and antiquary: sold to Edward Harley with the rest of his collection through his nephew John Batteley on 5 November 1723 (Diary, ed. by Wright and Wright (1966), II, p. 263 n. 1; Wright,Fontes Harleiani(1972), p. 67).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts, inscribed as usual by their librarian, Humfrey Wanley \'5 die Novembris, A.D. 1723\' (f. 1r).Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','English, MiddleLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100165166507.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165527602.0x0000e1/full/164,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002048219',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(56,1,'Harley MS 2407','Harley','2nd half of the 15th century',1450,1499,'Contents:f. 1v: Names of herbs related to individual planets, beginning: \'Herba Saturni / Anglice Affodill\'.f. 2r: Verses on lunar cycles following the days of the week.f. 2r: Recipe, beginning: ‘To make Mustard to bere […]\'.f. 2v: Middle English poem on Mercury, beginning: \'And thou wedde Mercury to Mercury wyth hyr wife\' (see NIMEV 3253 and DIMEV 5102-3).f. 2v: Description of a herb, beginning: \'ysuard he ys for a bon breth / to drenke the jese of hem\'.f. 2v: A note: \'Macrocosimus - maior mundis / Microcosimus - minor mundis\'.f. 2v: Marginal notation of a sequence of numbers \'110111000001100111101000100110;\' this sequence is also recorded on p. 31 of the notebook of Thomas Shakshaft (b. 1731, d. 1821) as \'An Experement betwects the English and french by 10,\' which is held by the Birmingham Central Library (accession number 5564711R41). The sequence refers to the 10-man variant of the Josephus Problem.f. 3r: Middle English medical recipe, entitled ‘For a Flyxe’, beginning: \'Take ho...','Origin:England.Provenance:John Dee (b. 1527, d. 1609), mathematician, astrologer and antiquary: the text \'Joannis Dee Testamentum, ad Jo.Gwynn transmissum, anno 1568\' on f. 69r is inscribed in his hand.John Gwynn, vicar of Llanidloes, 1568 (f. 69r).Elias Ashmole (b. 1617, d. 1692), astrologer and antiquary, owned the manuscript between 1652 and 1667: copied texts and images from Harley MS 2407 into his alchemical miscellany,Theatrum chemicum britannicum(1652). Ashmole includes the text and drawings of ff. 75r-89v (pp. 213-226), and copies the illustration from f. 16v (p. 350); his added table of contents, dated \'Jan 12 67\' (ff. 1r, 1v); inscribed in the same hand on f. 75v: \'Mr. Ashmole 212\', which corresponds with Ashmole\'sTheatrum chemicum britannicum,p. 212 (not in Wright,Fontes Harleiani(1972)).John Batteley (b. c.1646, d. 1708), Church of England clergyman and antiquary; bought in 1723 through his nephew, John Batteley, by Edward Harley, along with other manuscripts (seeDiary, ed. by Wright and Wright (1966), II, p. 263 n. 1; Wright,Fontes Harleiani(1972), p. 67).The Harley Collection, formed by Robert Harley (b. 1661, d. 1724), 1st earl of Oxford and Mortimer, politician, and Edward Harley (b. 1689, d. 1741), 2nd earl of Oxford and Mortimer, book collector and patron of the arts, inscribed as usual by their librarian, Humfrey Wanley ‘5 die Novembris, A.D. 1723’ (f. 1r).Edward Harley bequeathed the library to his widow, Henrietta Cavendish, née Holles (b. 1694, d. 1755) during her lifetime and thereafter to their daughter, Margaret Cavendish Bentinck (b. 1715, d. 1785), duchess of Portland; the manuscripts were sold by the Countess and the Duchess in 1753 to the nation for £10,000 (a fraction of their contemporary value) under the Act of Parliament that also established the British Museum; the Harley manuscripts form one of the foundation collections of the British Library.','English, MiddleLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100057740056.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057740058.0x000001/full/148,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002048238',NULL,'2026-01-28 04:23:24');
INSERT INTO manuscripts VALUES(57,1,'Royal MS 1 A XIV','Royal','1150-1200',1150,1200,'This manuscript contains the four Gospels in English, in the Anglo-Saxon or Wessex version, with flyleaves from a Latin missal of the 13th century. The Gospels are arranged as follows: Mark (ff. 3r-32r); Matthew (ff. 33r-82r); Luke (ff. 83r-133v); John (ff. 135r-174v) and were probably copied separately as each begins on a new quire with blank pages at the end. Some words have English glosses on f. 142r-v and Latin glosses on f. 144r-146v.Decoration:1 initial in green with penwork decoration in red (f. 3r), and 1 initial in red with penwork decoration in green (f. 83r), and 2 initials in red on green grounds (ff. 33r, 135r), at the beginning of Gospels. Initials in green, red or brown.','Origin: England (W).Provenance:Added leaves from a Missal, 13th century (ff. 1, 2, 175).The Benedictine abbey of Christ Church, Canterbury: Christ Church pressmark \'D[istinctio] xvi Gra[dus] iiii (f. 3r); listed in Henry of Eastry\'s catalogue of Christ Church library, of 1337-38 as \'Textus iv evangeliorum anglice\' (See Ker, 1959, p. 316).Thomas Cranmer (b. 1489, d. 1556), Archbishop of Canterbury: inscribed \'Thomas Cantuarien[sis] (f. 3r).John Lumley, 1st Baron Lumley (b. c. 1533, d. 1609), collector and conspirator: inscribed with his name (f. 3r); listed in the 1609 catalogue of his collection, no. 903 (seeThe Lumley Library, 1956); passed to Henry, Prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, Old','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100174220924.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100175272080.0x00015f/full/158,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002105738',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(58,1,'Royal MS 1 A XVIII','Royal','1st quarter of the 10th century',900,924,'Contents:ff. 4r-11v: The Eusebian Canon tables.ff. 12r-66r: The Gospel of St Matthew, preceded by a preface (ff. 12r-13r).ff. 66r-99r: The Gospel of St Mark, preceded by a preface (ff. 66r-67r) and capitula (ff. 67r-68r).ff. 99v-159v: The Gospel of St Luke, preceded by capitula (ff. 99v-104v), a preface((ff. 104v-105v), and a table of Hebrew names with their interpretation \'Item incipit interpretatio nominum de Luca\' (ff. 106r-v).ff. 159v-192v: The Gospel of St John, preceded by capitula (ff. 159v-161r), and a preface (ff. 161r-v), imperfect.ff. 193r-194r: The Epistle of St Jerome (b. c. 347, d. 420) to Damasus.ff. 194r-196r:Prologus quattuor Evangeliorum(Prologue to the Four Gospels), St Jerome\'s prologue to his commentary on St Matthew.ff. 196r-196v: The Epistle of Eusebius (b. c. 260, d. 339) to Carpianus, imperfect because of the loss of a leaf.f. 197r: Prologue to the Gospel of St Matthew, imperfect.ff. 197r-199v: Capitula of the Gospel of St Matthew.Decoration:Canon tables dec...','Origin: Western France.Provenance:A scriptorium in Brittany: see Bischoff, Katalog, II (2004), pp. 123-24 (no. 2491).Æthelstan [Athelstan] (b. 893/4, d. 939), king of England; possibly given by him to St Augustine\'s Abbey, Canterbury: inscribed in a possible imitation of Anglo-Saxon square minuscule (see Keynes, \'King Athelstan\'s Books\' (1985), pp. 165-70): \'Hunc codicem Ædelstan rex devota / mente Dorobernensi tribuit ecclesie / beato Augustino dicate et quisquis / hoc legerit omnipotenti pro eo pro/que suis fundat preces\' (f. 3v).The Benedictine abbey of St Augustine, Canterbury, founded in 598: suggested by the inscription on f. 3v (see Ker,Medieval Libraries(1964), p. 44).(?) Humfrid, unidentified: his name (\'Umfridus me fecit\') inscribed in a 14th-century script (f. 3r).\'Thomas Lee\': inscribed with his name, 15th century (f. 8v).\'John Birchyton\': inscribed with his name, 15th century (f. 8v).\'John Hinstyde [or Lynstyde]\': inscribed with his name, 15th century (f. 8v).\'N. Hersth\': inscribed with his name, 15th century (f. 60r).John Leland (b. c.1503, d. 1552), poet and antiquary, inscribed with his name: \'Joannes Lelandus / Æthelstanus erat nostre pars maxima cure. / Cuius nota mihi bibliotheca fuit. / Illo sublato sexcentos amplius annos. / Pulvere delitui squalidus atque situ. / Nunc pietas sed me superas revocavit ad auras. / Henrici digno restituique loco\' (f. 3v).Henry VIII (b. 1491, d.1547), king of England and Ireland, probably appropriated by him at the dissolution of St Augustine\'s Abbey (see Leland\'s inscription above).John Lumley, 1st baron Lumley (b. c. 1533, d. 1609), collector and conspirator: inscribed with his name (f. 4r); listed in the 1609 catalogue of his collection, no. 303 (seeThe Lumley Library,(1956)); his library acquired by Henry, prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library: included in the catalogue of 1666, Royal Appendix 71, f. 3; and in the 1698 catalogue of the library of St James\'s Palace (seeCatalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\'), no. 7905).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056061555.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056061557.0x000001/full/148,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002105742',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(59,1,'Royal MS 1 B XI','Royal','12th century-13th century',1100,1299,'Contents:ff. 2r-v: St Jerome,Epistula ad Damasum papam(Epistle to Pope Damasus), beginning imperfectly: \'addita sunt. Igitur hec presens prefaciuncula\'.ff. 2v-5r: St Jerome,Prologus Quattuor Evangeliorum(Preface to St Jerome\'s commentary on the Gospel of St Matthew), beginning: \'Plures fuisse qui evangelia scripserunt\'.ff. 5r-v: Eusebius,Epistula ad Carpianum.ff. 5v-43v:Evangelium secundum Sanctum Mattheum(The Gospel of St Matthew) preceded by a prologue (ff. 5v-6v) andcapitula(ff. 6v-8v).ff. 44r-69r:Evangelium secundum Sanctum Marcum(The Gospel of St Mark), preceded by a prologue (ff. 44r-v) andcapitula(ff. 44v-45v).ff. 70r-112r:Evangelium secundum Sanctum Lucam(The Gospel of St Luke), preceded by a prologue (ff. 70r-v) andcapitula(ff. 71r-v).ff. 112v-145r:Evangelium secundum Sanctum Iohannem(The Gospel of St John), preceded by a prologue (ff. 112v-113r) andcapitula(ff. 113r-v).ff. 145v-146v: Thirteenth-century records of the revenues of St Augustine\'s Abbey, Canterbury have been i...','Origin: Canterbury, Southeastern England.Provenance:The Benedictine abbey of St Augustine, Canterbury: includes records of the revenues of the abbey, 12th century (ff. 145v-147v).Rubrics added in the margins in a 14th-century hand.Verses in Latin and Ancient Greek with a Latin verse written by an early-modern hand and Hebrew letters in the upper margin (f. 1v).John Theyer (bap. 1598, d. 1673), antiquary: included in the catalogue of his library left to his grandson Charles Theyer (b. 1651) (seeCatalogi librorum manuscriptorum Angliae et Hiberniae, 3 vols (Oxford: Sheldonian, 1697), II, no. 6433).Robert Scott (b. c. 1632, d. 1709/10), London bookseller: included in the catalogue of John Theyer’s manuscripts in his possession, assessed in 1678 by William Beveridge and William Jane, Royal Appendix, 70, no. 301.Charles II (b. 1630, d.1685), king of England, Scotland, and Ireland: purchased from Scott together with over 300 other manuscripts from Theyer\'s library.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Greek, AncientHebrewLatin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100057897925.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057897927.0x000001/full/127,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002105755',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(60,1,'Royal MS 1 D III','Royal','Mid 11th century',1030,1070,'Contents:ff. 1r–7r: Eusebian canon tablesff. 7v–8r: ‘Exultet’, added in a later hand (an English Caroline minuscule of the end of the 11th century). Hartzell,Catalogue(2006), no. 169 identifies it as the ‘Norman’ version of the melody, written in Anglo-Norman neumes. Omits section 7.ff. 9v–11r: Jerome,Praefatio in Euangelio(CPL 0591 E (A)); the first words have not been copied, for which space is left on f. 9r with a B for the rubric, ‘Beato papae damaso hieronymus.’ The list of Gospels is arranged as a table on f. 10v.ff. 11r–13r: Jerome,Commentarii in euangelium Matthaei(CPL 0590), preface, ending incomplete, ‘Plures fuisse qui euangelia scripserunt … ecclesiasticis uiuis carendis [rectecanendas].’ff. 13r–14r: Eusebius, Epistle to Carpianus, ‘Ammonius quidem’, with Gospels arranged as a table on f. 13v.f. 14r–v: Pseudo-Jerome, Epistle to Pope Damasus I, ‘Sciendum etiam nequis ignarum’ff. 14v–166v: The four Gospels. Each is preceded by the usual prologue and (except in the case of ...','Origin:Canterbury. Belonged to and probably written for Godgifu or Goda (d. c.1049), sister of Edward the Confessor.Provenance:The Benedictine priory of St Andrew, Rochester. ‘Textus de ecclesia Roffensi per Godam Comitissam’, with pressmark ‘.III.’ (f. 9r). After the grant of Godgifu’s manor of Lambeth to Rochester by William Rufus, the book was removed there, and it is recorded in the list of books copied or acquired by Alexander, precentor, soon after 1201, edited by Sharpe and others,English Benedictine Libraries(1996, B81.20). Subsequently pawned and then redeemed by Prior Helyas,c.1200: see Thorpe,Registrum Roffense(1759), pp. 119, 122.The Old Royal Library (the English Royal Library). Westminster inventory number ‘no. 200’ (f. 1r), included in the inventory of books in the Upper Library at Westminster of 1542, edited in Carley,Libraries of King Henry VIII(2000), H2.643.','Latin','Parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100058102553.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058102555.0x000001/full/137,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002105769',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(61,1,'Royal MS 1 E VII','Royal','late 10th century-16th century',980,1599,'This exceptionally large codex is the first of two volumes of the only surviving Bible from late Anglo-Saxon England and the second of only two largely complete, surviving Bibles from England before 1066 (the other being the Codex Amiatinus, now Florence, Biblioteca Medicea Laurenziana, Amiatino 1). In addition to the Old and New Testaments, these volumes include tables of chapters for most books of the Bible and several of Jerome’s prefaces and letters. The text and orthography was systematically corrected by a hand from Christ Church Canterbury shortly after the Norman Conquest, some 15th-century supply leaves have been added for the beginning of the Book of Genesis, and some early modern supply leaves have been added to cover the minor prophets at the end of the codex. The second volume of the Bible has also been digitised, and is available at [http://www.bl.uk/manuscripts/FullDisplay.aspx?ref=Royal_MS_1_E_VIII].Decoration: miniature of God creating the world with a compass (f. 1...','Origin: Southern EnglandProvenance:Christ Church Cathedral, Canterbury: corrected and annotated in the late 11th century and 12th century (see Marsden, \'Biblical Manuscripts\' (2012), p. 425), possibly in the same hand of one of the hands in Cambridge, Trinity College, B. 1. 17 and Cambridge, Trinity College, B. 3. 9 (see Webber, \'Script\' (1995), pp. 155-56) and as a corrector of in Arundel155, which has a Christ Church origin and provenance (see Dumville (1991), p. 47); probably to be identified with a \'Biblia bipartita in infirmaria in duobus voluminibus\' inTituli librorum de libraria ecclesiae Christicompiled under Henry of Estria (1284-1331), Cotton Galba E IV (see James,Ancient Libraries(1903) no. 321, p. 51).Added supply leaves covering Genesis in the second half of the 15th century (ff. 2r-9v)Added supply leaves covering Obadiah 19-21, Jonah, Micah, Nahum, Habakkuk, Zephaniah, Haggai, Zechariah, Malachi, Baruch, Esdras III and IV in a 16th-century imitation of Caroline Minuscule (ff. 185-208).Robert Lenton: inscribed with his name on a slip of paper inserted between ff. 34 and 35, 16th century (f. 34*).Henry Fitzalan, 12th earl of Arundel (b. 1512, d. 1580), magnate: inscribed with his name, \'Arundel\' (f. 2r).John Lumley, 1st baron Lumley (b. c. 1533, d. 1609), collector and conspirator: inscribed with his name (f. 2r).Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: perhaps to be identified with \'Biblia Latina usque ad cap. 16 Esaiae\' in the 1698 catalogue of the library of St James\'s Palace (see Bernard,Catalogi librorum(\'1697\'), no. 7723).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','1 parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100058103267.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058103269.0x000001/full/132,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002105787',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(62,1,'Royal MS 2 A XVI','Royal','c 1540-1541',1535,1541,'The manuscript includes a Psalter with three Canticles, known as the Psalter of Henry VIII. The text is preceded by the dedicatory letter by Jean Mallard (ff. 1v-2v), who wrote and probably illuminated the manuscript, incipit: \'Regium istud Davidis\'. Mallard\'s other works include Royal MS 7 D XIII and Royal MS 20 B XII. In the manuscript Henry VIII is depicted as king David and Jean Mallard compares him to David in the dedicatory letter preceding the Psalter. As indicated by the many marginal notes added in the King’s own hand, the volume became Henry VIII\'s personal copy of the Psalms.Decoration:8 miniatures in colours and gold: the royal coat of arms, at the beginning of Mallard\'s dedicatory letter (f. 1v), and at the beginning of Psalms: f. 3, Henry VIII as David reading in his bedchamber (Psalm 1); f. 30r, David and Goliath (Psalm 26); f. 48r, battle scene (Psalm 38); f. 63v, Henry VIII and his court jester William Sommers (Psalm 52); f. 79r, Henry as David kneeling in prayer am...','Origin: England (London).Provenance:Jean Maillart (or Mallard), a French poet at the court of Francis I and then at the court of Henry VIII, mentioned as the \'orator in the French tongue\' in the king\'s household accounts 1539-41 (see Carley 2000, p. xlvii), written and illustrated by him for Henry VIII: inscribed \'Johannes Mallardus regius orator, et a calamo / Regi Angliae, et Francie Fidei deffensori invictis[simo]\' (Jean Maillart, royal orator: from his pen to the most invincible king of England and France, and defender of the faith) (f. 2r).Henry VIII (b. 1491, d. 1547), king of England and Ireland: addressed to him in the dedicatory letter (ff. 1r-2v); the royal arms of Henry VIII with the devise, \'Honny soet quy mal y pense\' (f. 1v); his portraits (ff. 3r, 30r, 63v, 79r), and marginal Latin annotations in his hand.The Old Royal Library (the English Royal Library): included in the Upper Library at Westminster, Westminster inventory number, no. 1283.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','176 folios.','https://bl.digirati.io/iiif/ark:/81055/vdc_100165176982.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165698400.0x000161/full/169,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002105805',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(63,1,'Royal MS 2 A XX','Royal','late 8th to 12th century',790,1199,'This manuscript consists of a decorated prayerbook with extracts from the Gospels, liturgy, apocrypha, and glosses. Its text and decoration link it to a group of Southumbrian prayerbooks known as the \'Tiberius Group\'. In particular, its script and contents are related to those in Harley MS 2965 (the Book of Nunnaminster), Harley 7653 (the Harley Prayerbook), and Cambridge, Cambridge University Library MS Ll.1.10 (the Book of Cerne). Several of the prayers pertain to the body, physical ailments, or healing. In the mid- to late tenth century, a series of collects were added in the margins of the text which metion Benedict of Nursia and seem to pertain to a monastic community.The manuscript contains:ff. 2r-11v: extracts from the Gospels;f. 11v: the Lord\'s Prayer;f. 12r: the Apostle\'s Creed;f. 12r-v: an apocryphal letter of Christ to Abgar, king of Edessa;f. 13r-v: two short prayers, beginning \'Deus omnipotens et dominus noster Iesus Christus\', and \'Benedicat me dominus et custodiat\';f....','Origin: Kingdom of Mercia (now western and central England), late 8th or early 9th century. Its script and decoration resemble Mercian charters and artworks according to Brown,Book of Cerne(1996), p. 164-68. Some of the prayers\' focus on healing and bodily ailments may indicate that the book was made for a physician: see Brown,Book of Cerne(1996), p. 152. The text contains only masculine pronouns and endings, but its focus on cures for female bleeding may indicate that it was made for a double house or a female community: see Sims-Williams,Religion(1990), p. 280.Provenance:Added annotation symbol resembling a rune-like dotted \'Y\', dating from the Anglo-Saxon period, also found in Harley 7653, indicating a probable shared provenance.Added interlinear glosses (ff. 11v-15, 19, 22, 24, 45v), titles to a series of prayers (ff. 29-38), and marginal notes (ff. 12v, 44) in Anglo-Saxon square minuscule, 10th century.? Ædulf aelteow: name inscribed and erased (ff. 10v, 24v).? Maere Berhtelm, Ælfwynne, and his daughter Brynhild: names inscribed and erased (f. 13v).Added marginal collects from the late tenth century which emphasize St Benedict, apparently written for a monastic community.The Benedictine cathedral priory of St. Mary, Worcester: an addition mentioning the Seven Sleepers, Blasius, and Cassius by a 12th-century Worcester scribe (f. 52); perhaps to be identified with the \'Precationes quaedam charactere saxonico quarto\' in Young\'s catalogue of Worcester manuscripts (Young,Catalogus(1944), no. 309).John Theyer (bap. 1598, d. 1673), antiquary: inscribed with his name \'Ioannes Theyer\', with a dated note of 1649 (f. 11v); his monogram (f. 42r), and numerous annotations; perhaps to be identified with \'Liturgia antiquissima\' in the catalogue of his library left to his grandson Charles Theyer (see (Bernard,Catalogi librorum(1697), II, no. 6393).? Charles Theyer (b. 1651): inherited (Bernard,Catalogi librorum(1697), II, no. 6393).Robert Scott (b. c. 1632, d. 1709/10), London bookseller: included in the catalogue of John Theyer\'s manuscripts in his possession, made in 1678 by William Beveridge and William Jane, Royal Appendix, 70, no. 160.Charles II (b. 1630, d.1685), king of England, Scotland, and Ireland: purchased from Scott together with other 311 manuscripts from Theyer\'s library.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldGreek, AncientLatin','1 parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100101103325.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100101103327.0x000001/full/153,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002105809',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(64,1,'Royal MS 2 B V','Royal','mid-10th century-mid-11th century',940,1070,'The main text of the this manuscript consists of a Psalter, in the Roman version, with 12 canticles and some Old English glosses in the same hand as the manuscript. Between the late 10th and mid-11th century, further prayers, proverbs, and notes on topics ranging from Christ\'s incarnation to the number of bones, teeth, and veins in humans were added.Contents:f. 1r-v: prayer invoking the protection of the Virgin Mary, St Machutus, and St Eadburh,11th century (f. 1r-1v);ff. 1v-6r: Hours to the Virgin, 11th century;f. 6r: proverbs with Old English translation, 11th century;f. 6v: prayer for sins (\'Oratio pro peccatis\') in Old English, 11th century (f. 6v);f. 7r-v: added preface to the Psalter, beginning \'David filius jesse\' with a note beginning \'Primus psalmus nulli assignatus est\', 11th century;ff. 8r-171r: Roman Psalter with glosses;ff. 171v-186v: various canticles;ff. 187r-190r: added text entitled \'De kimoda incarnatione divini\', late 10th or 11th century;ff. 190r-v: added thunder...','Origin: Southern England, mid-10th century: Worcester, Winchester, Glastonbury, and Abingdon have all been proposed as possible origins for the main body of the Psalter (for a summary of the arguments see, Sisam,Salisbury(1959), pp. 52-55; Roberts,Guide to Scripts(2005), p. 122; Grestch,Intellectual Foundations(1999), p. 267). The main text of Psalter, the titles, and the glosses to the Psalms were added by a single scribe, perhaps the same scribe as Royal MS 4 A XIV, a manuscript which includes Jerome\'s and Pseudo-Jerome\'s commentary on the Psalms. It is possible that Royal MS 4 A XIV was intended as a companion volume to this Psalter, given their related contents (see Ker,Catalogue(1957), p. 320).Provenance:? Nunnaminster, Winchester, 11th century: added prayer mentions the Blessed Virgin Mary, St Machutus, and St Eadburh, a former nun of the Nunnaminster whose cult seems to have centered on that house (ff.1 r-v). Alternatively, the reference to Machutus could suggest a connection to the New Minster, Winchester: Machutus appears in a list of relics added to the New Minster in the New Minster Liber Vitae (see Stokes,EnglishVernacular Minuscule(2014), p. 67; Stowe MS 944, f. 55v).Added Hours to the Virgin, 11th century (ff. 1v-6).Added proverbs with Old English translation, 11th century (f. 6).Added \'Oratio pro peccatis\' in Old English, 11th century (f. 6v).Added preface to the Psalter, beginning \'David filius jesse\' with a note beginning \'Primus psalmus nulli assignatus est\', 11th century (f. 7r-7v).Added prayers in Old English, beginning \'Myn drihten god aelmihtig\' (ff. 190v-192) and \'Min drihten aelmihtig god si þe wuldor 7 þonc\', 11th century (192-196v).Added note on three Friday fasts in Old English, 11th century (f. 196v).Added Old English translation of a prayer by Alcuin entitled \'Confessio et oratio\' with an instruction beginning \'man mot hine gebiddan swa he maeg\', 11th century (ff. 197-198).Added Old English lemmata with Latin glosses in the margins, 11th century (f. 1)Added Old English marginal (ff. 41, 50, 50v, 55v, 60, 60v, 61v, 63v, 64, 80v, 107v, 153) and interlinear glosses (ff. 19v, 85v, 86, 145), 11th century.Added Old English glosses, 12th century (ff. 9, 29v, 62v, 69).The Benedictine abbey of Christ Church, Canterbury: Christ Church pressmark \'r\' with a title \'Psalteriu[m] s[anc]ti Jeronimi glosatu[m]\', 12th century (f. 8) and Christ Church script, 11th century (ff. 197-198, according to Ker, 1957).Thomas Cranmer (b. 1489, d. 1556), archbishop of Canterbury, inscribed with his name (f. 8).John Lumley, 1st baron Lumley (b. c. 1533, d. 1609), collector and conspirator (b. c. 1533, d. 1609): inscribed with his name (ff. 1, 8); listed in the 1609 catalogue of his collection, no. 719 (see The Lumley Library, 1956): passed to Henry, prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library: included in the catalogue of 1666, Royal Appendix 71, f. 3v; and in the 1698 catalogue of the library of St James\'s Palace (see Catalogi librorum manuscriptorum Angliae et Hiberniae (Oxford: Sheldonian, \'1697\'), no. 7746)).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','1 parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100058104810.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058104812.0x000001/full/157,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002105816',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(65,1,'Royal MS 2 D XIII','Royal','Early 14th century',1300,1325,'ff. 1r-51v: Apocalypse (Revelation); the upper half of each folio contains a miniature and beneath is the accompanying text in Latin, followed by the parallel commentary in Anglo-Norman French verse.Decoration:102 half-page miniatures in drawings tinted with colours and silver, appearing on each page. Initials in blue with red pen-flourishing, or in red with blue pen-flourishing. The subjects of the miniatures are:f. 1r: The angel appearing to John on Patmos with rabbits and deer (Revelation 1:1-3);f. 1v: John and the seven churches (Revelation 1:4-11);f. 2r: The Lord enthroned with worshippers;f. 2v: The Vision of Christ with a sword in his mouth and the seven candlesticks (Revelation 1:12-20);f. 3r: John writing to the Bishop of Ephesus (Revelation 2:1-7);f. 3v: John writing to the Bishop of Smyrna (Revelation 2:8-11);f. 4r: John writing to the Bishop of Pergamos (Revelation 2:12-17);f. 4v John writing to the Bishop of Thyatira (Revelation 2:18-29);f. 5r: John writing to the Bisho...','Origin: England.Provenance:The Old Royal Library (the English Royal Library): perhaps in the catalogue of 1666, Royal Appendix 71, f. 14r. Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Anglo-NormanLatin','Parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100057738927.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057738929.0x000001/full/152,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002105853',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(66,1,'Royal MS 2 E XIII','Royal','4th quarter of the 10th century',975,999,'The manuscript is bound together with Royal MS 2 E XIV.Contents:ff. 1r-1v: Prologue of Pseudo-Jerome,Breviarium in psalmos(Short Commentary on the Psalms), beginning: \'Incipit Breviarium Sancti Hieronimi praesbiteri in psalterio. Proxime cum Origenis psalterium, quod encheridion ille vocabat\'.ff. 1v-121v: Pseudo-Jerome,Breviarium in psalmos.Psalms 1 to Psalms 50, beginning: \'Beatus vir qui non abiit in consilio impiorum\' Ending: \'dignum tibi acceptabile que prepares holocaustum\'.Decoration:Large initial in red with display script, at the beginning of the prologue (f. 1r), and smaller initials in red, some with penwork decoration, with semi-uncial rubrics, at the beginning of the commentaries to the Psalms.','Provenance:An unknown 11th-century owner: added notes and pen trials in an 11th-century script (f. [i] recto).Thomas Cranmer (b. 1489, d. 1556), archbishop of Canterbury: inscribed with his name (f. 1r).For later provenance information see Royal MS 2 E XIII-XIV.','Latin','Part of Royal MS 2 E XIII-XIV','https://bl.digirati.io/iiif/ark:/81055/vdc_100057811193.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057811195.0x000001/full/144,200/0/default.jpg','https://searcharchives.bl.uk/catalog/041-003320215',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(67,1,'Royal MS 2 E XIV','Royal','4th quarter of the 10th century',975,999,'The manuscript is bound with Royal 2 MS E XIII.Contents:ff. 1r-136r: Pseudo-Jerome,Breviarium in psalmos(Short Commentary on the Psalms), beginning at the end of Psalms 50 \'Vel multi habent cor contricum\' to Psalm 100.Decoration:Small initials in red, some with penwork decoration, with semi-uncial rubrics, at the beginning of the commentaries to the Psalms.','Origin: England.Provenance:Thomas Cranmer (b. 1489, d. 1556), archbishop of Canterbury, inscribed with his name (f. 1r).John Lumley, 1st baron Lumley (b. c. 1533, d. 1609), collector and conspirator: listed in the 1609 catalogue of his collection, no. 866 (seeThe Lumley Library, (1956)); passed to Henry, prince of Wales.For later provenance information see Royal MS 2 E XIII-XIV.','Latin','Part of Royal MS 2 E XIII-XIV','https://bl.digirati.io/iiif/ark:/81055/vdc_100056062651.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056062653.0x000001/full/144,200/0/default.jpg','https://searcharchives.bl.uk/catalog/041-003320216',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(68,1,'Royal MS 4 A XIV','Royal','late 8th to middle of 10th century',790,960,'This manuscript contains three parts:ff. 1*-2*: a fragment of a late ninth- or early tenth-century Continental Missal. For technical reasons, these folios are labelled flyleaf 1c and flyleaf 2 in the viewer to enable them to display in the correct order;ff. 1r-106v: a mid-10th century collection of St Jerome\'s and Pseudo-Jerome\'s works on music and a homily of Origen, possibly intended as a companion volume to the Psalter now Royal 2 B V (see Gretsch,Intellectual Foundations, p. 288);ff. 107r-108v: one of the earliest fragments of Felix\'sVita Guthlaci, copied in the late eighth or early ninth century and later bound upside down in the present codex.Decoration: 1 decorated initial in red and brown ink, at the beginning of St Jerome on the Psalms (f. 1r), added rubric in red (f. 1r), and smaller initials in brown ink at the beginning of chapters.','Origin, ff. 1*-2*: Italy or France, late 9th or early 10th centuryOrigin, ff. 1r-106v: ? Southern England, mid-10th century: this manuscript has been variously localized to Worcester, Winchester, Abingdon, and Glastonbury (see Dumville,English Caroline(1993), p. 14 n. 33). It may have been created as a companion volume for the Royal Psalter (Royal 2 B V), which seems to have been created at the same scriptorium, possibly even by the same scribe (see Conner, Anglo-Saxon Exeter (1993), p. 57.)Origin, ff. 107r-108v: Southern England (see Lowe,Codices(1972), no. 216)Provenance:? Worcester: inscribed a charm in Old English, beginning, \'Wenne wenne wenchichenne\' in a 12th-century hand (f. 106v).? The Benedictine cathedral priory of St. Mary, Worcester: included in Patrick Young\'s catalogue of the Worcester library (seeCatalogus librorum manuscriptorum bibliothecae Wigorniensis made in 1622-1623 by Patrick Young, Librarian to King James I, ed. by J. Atkins and N. R. Ker (Cambridge: Cambridge University Press, 1944, no. 5).John Theyer (bap. 1598, d. 1673), antiquary: marginal notes in his hand (ff. 1, 4v, 106v); included in the catalogue of his library left to his grandson Charles Theyer (b. 1651) (see E. Bernard,Catalogi librorum manuscriptorum Angliae et Hiberniae, 3 vols. (Oxford: Sheldonian, \'1697\'), II, no. 6399).Robert Scott (b. c. 1632, d. 1709/10), London bookseller: included in the catalogue of John Theyer’s manuscripts in his possession, made in 1678 by William Beveridge and William Jane (Royal Appendix, 70, no. 84).Charles II (b. 1630, d.1685), king of England, Scotland, and Ireland: purchased from Scott together with other 311 manuscripts from Theyer\'s library.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','1 parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100058105058.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058105060.0x000001/full/138,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002105989',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(69,1,'Royal MS 4 D II','Royal','c 1175-c 1225',1170,1230,'This manuscript is the second volume of a set of glossed Gospels; other manuscripts are Royal 4 D. i and Royal 4 D. iii (St Matthew and St John). The fourth volume that would have included the gloss for St Luke is missing.Contents:ff. 1r-62r: Gospel of St Mark, with theGlossa Ordinaria.Decoration:Two foliate initials in colours and gold, at the beginning of the prologue to St Mark and of the Passion (ff. 1r, 48r). One initial with dragons and human masks in medallions in colours and gold, at the beginning of St Mark (f. 2v). Initials in red with blue pen-flourishing, or in blue with red pen-flourishing throughout the main text. Small initials and paraphs, some with penwork decoration, in red or blue, throughout the gloss. At the bottom of each external columns signs written by or for the scribe.','Origin: Northern France or England.Provenance:Unknown 13th- and 14th-century owners: Added chapter numbers in Roman numerals with a pencil in the (?) 13th century (e.g., f. 48r); added early 13th-century notes (f. 59r); inscribed \'Marcus Glosatus\' in a 14th-century cursive hand (f. 1r).The Old Royal Library (the English Royal Library): included in the 1698 catalogue of the library of St James\'s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\', but 1698?), no. 7777).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056063145.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056063147.0x000001/full/140,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106019',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(70,1,'Royal MS 4 E IX','Royal','4th quarter of the 12th century',1175,1199,'This manuscript consists of Peter Lombard (b. c. 1100, d. 1160)\'s Gloss on the Pauline Epistles orMagna glossatura. Peter Lombard developed the text in Paris in the second quarter of the 12th century during his teaching activities. It became one of the required readings of the faculty of Theology.This manuscript shows the most widespread layout of Peter Lombard\'s gloss. It has the biblical text written in a large Gothic book script and the gloss written in a smaller Gothic script on the same page, in two or three columns and in alternate lines.The format of the manuscript, and the quality of the parchment and decoration, suggest that this manuscript was intended for a wealthy abbot or bishop or a well-off scholar (see Frońska,Royal Manuscripts(2005)).Contents:ff. 1r-202r: Pauline Epistles with Peter Lombard\'sMagna glossatura in epistolas Pauli(Gloss on the Pauline Epistles).Decoration:The large foliate initial inhabited \'P\' with small lions (f. 1r) at the beginning of the Prologue h...','Origin: ? Paris, Ile-de-France.Provenance:Unknown 14th-century owners: added notes in a late 14th-century English hand (e. g., f. 46r); added early 14th-century pencil notes and chapter numbers throughout in margins.? Henry VIII (b. 1491, d.1547), king of England and Ireland: probably entered in the Royal Collection at the time of the Dissolution, or slightly earlier; may have been kept at Hampton Court or Greenwich libraries because of the absence of Westminster inventory numbers.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056063395.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056063397.0x000001/full/139,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106039',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(71,1,'Royal MS 5 B XV','Royal','12th century',1100,1199,'This composite manuscript contains four parts (ff. i recto-48v [Part 1]; ff. 49r-56v [Part 2]; 57r-64v [Part 3]; and 65r-133v [Part 4]) that were produced between the 4th quarter of the 11th century and the 2nd quarter of the 12th century (see \'Provenance\' for the dating of the separate parts). It contains theological works by St Augustine of Hippo (b. 354, d. 430); Autpert Ambrose (d. 784), abbot of St Vincent in Volturno at Rocchetta; John Chrysostom (b. c. 349, d. 407); and Fulcher of Chartres (b. 1059, d. 1127). It also includes readings from the miracles of St Liudhard (d. c. 603), bishop and chaplain to Queen Bertha of Kent. The parts were all produced at the Benedictine abbey of St Augustine at Canterbury where they were joined together, at least, by the end of the 14th century: the manuscript has been listed in a catalogue of the abbey’s library that was compiled between 1375 and 1420 (seeSt Augustine\'s Abbey, Canterbury, ed. by Barker-Benfield (2008), pp. 527-28).Contents:P...','Origin: Canterbury, Southeastern England.Provenance:The Benedictine abbey of St Augustine, Canterbury: the manuscript is included in a catalogue of the abbey\'s library (no. 358, with the shelfmark \'D. 4. G. 3\') that was written at the end of 15th century (see James,The Ancient Libraries(1903), p. 223). The manuscript\'s different parts were all written at the abbey: parts 1 (ff. i-48) and 2 (ff. 49-56) are from the 1st quarter of the 12th century; Part 3 (ff. 57-64) is from the last quarter of the 11th century [written by a scribe from St Augustine whose work has also been identified in other manuscripts]; and Part 4 (ff. 65-133) is from the 2nd quarter of the 12th century, after 1127. The parts were bound together by, at least, the late 14th century (seeSt Augustine\'s Abbey, Canterbury, ed. by Barker-Benfield (2008), pp. 527-28 (no. 358)).John Joscelyn (b. 1529, d.1603), Old English scholar, Church of England clergyman, and secretary to archbishop Matthew Parker: a note in his hand concerning Crusades extracted from Simeon of Durham and Henry of Huntingdon (f. 134r).The Old Royal Library (the English Royal Library): red seal of a ship, 17th century (f. i recto); included in the 1698 catalogue of the library of St James’s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\', but 1698?), no. 8658). Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100062418435.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100062418437.0x000001/full/135,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106069',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(72,1,'Royal MS 5 E XI','Royal','1st quarter of the 11th century',1000,1024,'This manuscript contains theDe laudibus virginitatis(On the Praise of Virginity) a didactic work in 60 chapters extolling virginity, composed by Aldhelm of Sherborne (d. 709). Two leaves (ff. 116-117) have been replaced in the 11th century and now function as flyleaves.Contents:ff. 3r-7v: A table of chapters for Aldhelm,De Laudibus virginitatis.ff. 7v-8r: Preface to theDe laudibus virginitatis.ff. 9r-119v: Aldhelm,De Laudibus virginitatiswith numerous Latin and Old English interlinear glosses, added in the 1st quarter and middle of the 11th century (see Ker,Catalogue of Manuscripts Containing Anglo-Saxon(1957). Syntactic marks or glosses using a system of dots and dashes have been used throughout (e.g., ff. 11r, 12v).The manuscript contains a number of additions:f. [iv] recto: Two strips of parchment have been pasted on a paper flyleaf showing earlier titles in capitals with interlocked letters referring to theDe laudibus virginitatisand its author.f. [v] recto. A fragment of the sc...','Origin: Canterbury, Southeastern England.Provenance:The English Royal Library: included in the 1698 catalogue of the library of St James\'s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\', but 1698?), no. 7881).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100062418926.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100062418928.0x000001/full/142,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106105',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(73,1,'Royal MS 5 E XIII','Royal','Late 9th century',860,899,'Contents:ff. 1r-9r: Pseudo Jerome,Canon in Ebreica: \'[Can]on in ebreica, regula in greca, [ae]quitas [in lati]na\'.ff. 9r-15v: Sermons: \'De reddendis decimis et primitivis que dominus precepit. Primus homo qui dedit primam et primitivam Domino suo pro suo peccato...-... et de omnibus insidis diabuli, cui gloria in secula secularum"\'f. 11r: \'Quia dum quisque temptatur vitis\'.ff. 16r-51v: Cyprian,Ad Quirinum testimonia: \'Bone opere et elemosina et misericordia. Apud Esaiam exclama, inquid, in fortitudine\'.ff. 52r-68v: Excerpts from theCollectio canonum Hibernensis.ff.69r-79r: Pseudo-Bede,De remedis peccatorum,a penitential attributed to Bede: \'De remediis peccatorum paucisima hæc que sequntur\'.f. 79r: A fragment of Saint Boniface\'sEditio: \'Quomodo possumus penitentiam ...\'.f. 79r-v: fragment of the Council of Compiegne (the first two canons) relating to marriage within degrees of consanguinity.ff. 79v-80r: a fragment of the apocryphal Book of Enoch, the only known, extant manuscript fr...','Origin: France, W. (Brittany)Provenance:The Benedictine cathedral priory of St Mary, Worcester: included in Patrick Young\'s catalogue of the Worcester library, no. 333 (see Young,Catalogus librorum manuscriptorum bibliothecae Wigorniensis made in 1622-1623,ed. by J. Atkins and N. R. Ker (Cambridge: Cambridge University Press, 1944), no. 333.Corrections in a 10th-century English hand of the (e.g., f. 80v).Press-mark R/cxcii altered to R/xxvii in a 14th-century hand (f. 100v).John Theyer (bap. 1598, d. 1673), antiquary, included in the catalogue of his library left to his grandson Charles Theyer (b. 1651): see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae, 3 vols. (Oxford: Sheldonian, \'1697\', but 1698?), II, no. 6393.Robert Scott (b. c. 1632, d. 1709/10), London bookseller: included in the catalogue of John Theyer’s manuscripts in his possession, appraised in 1678 by William Beveridge and William Jane, Royal Appendix, 70, no. 181.Charles II (b. 1630, d.1685), king of England, Scotland, and Ireland: purchased from Scott together with other 311 manuscripts from Theyer\'s library.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','Parchment codex, 100 folios.','https://bl.digirati.io/iiif/ark:/81055/vdc_100058105181.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058105183.0x000001/full/161,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106107',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(74,1,'Royal MS 5 F III','Royal','c. 900',885,915,'This manuscript contains an early, imperfect copy of the prose version of Aldhelm\'sDe virginitate, with foliate and interlace initials and later, eleventh-century glosses. An imperfect table of chapters (f. 1 begins at chapter 13) and a prologue precede the text. Chapter 39 is omitted both in the table of chapters and the text. This manuscript seems to have been written in Mercia in the late ninth or early tenth century. The margins of the manuscript have been cropped to varying extents on different folios, and sometimes lines of text or possibly initials seem to have been excised from the middle of folios.Decoration: initials with interlace, zoomorphic, and foliate details throughout.','Origin: Kingdom of Mercia (now western and central England): script and decoration resemble other Mercian manuscripts.Provenance:Added glosses, 11th century (ff. 2v, 3r).Various inscriptions, 11th century (ff. 1, 7, 8, 17).\'Hacun eor\': name inscribed (f. 17); possibly refers to Hákon (fl. 1016-1029), earl (see Stokes,English Vernacular Minuscule(2014), p. 38).Added inscriptions, names, 12th century (ff. 1r, 7, 8r, 16v).The Benedictine cathedral priory of St. Mary, Worcester: included in Patrick Young\'s catalogue of the Worcester library (seeCatalogus librorum, ed. by Atkins and Ker (1944), no. 253).John Theyer (bap. 1598, d. 1673), antiquary: notes in his hand (e.g., ff. 2v, 20v, 22v); included in the catalogue of his library left to his grandson Charles Theyer (b. 1651) (see Bernard,Catalogi librorum(1697), II, no. 6394).Robert Scott (b. c. 1632, d. 1709/10), London bookseller: included in the catalogue of John Theyer’s manuscripts in his possession, made in 1678 by William Beveridge and William Jane, Royal Appendix, 70, no. 143.Charles II (b. 1630, d.1685), king of England, Scotland, and Ireland: purchased from Scott together with other 311 manuscripts from Theyer\'s library.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','1 parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100101103333.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100101103335.0x000001/full/158,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106119',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(75,1,'Royal MS 6 A VI','Royal','4th quarter 10th century- 1st half of 11th century',975,1049,'This manuscript contains:ff. 1r-4v: flyleaves taken from a 13th century manuscript, two of them are commentaries on the Song of Salomon and the other are from a theological treatise. Note that ff. 1 and 4 are bounded upside down.ff. 5r-9r: Aldhem\'s letter to Heahfrid,Epistola ad Heahfridum,with interlinear and marginal glosses. Aldhem (b. 639, d. 709), bishop of Sherborne, was an alumnus of the school of Theodore and Hadrian in Canterbury. This letter was written to dissuade a certain Heahfrith from studying in Ireland. Aldhem also parodied Irish Latin to demonstrate the superiority of English learning to that of the Irish.ff. 9v-109r: Aldhem,De laudibus Virginitatiswith interlinear and marginal glosses. The glosses are mainly in a hand similar to that of the text (see Neil R. Ker,Catalogue of manuscripts containing Anglo-Saxon,p. 322). Syntactic marks or glosses using a system of dots and dashes have been used. There is a list of chapters on ff. 9v-12v. Chapter 39 is included in th...','Origin: England, S. E. (Christ Church, Canterbury?)Provenance:Latin and Old English glosses, mostly in a contemporary hand, some in a slightly later hand (ff. 42v-46). Some are the same as glosses found in Royal 5 E XI and Salisbury Cathedral 38, a manuscript from Canterbury (see Neil Ker,Catalogue of manuscripts containing Anglo-Saxon,1957).The Benedictine cathedral priory of Christ Church, Canterbury: lines on the death of Henry of Blois (d. 1171) added in the late 12th century (f. 109v) by a scribe of Christ Church, Canterbury.4 parchment flyleaves (ff. 1-4) have been taken from three 13th century manuscripts containing the Songs of Solomon and a theological treatise (see Warner and Gilson,Catalogue of Western Manuscripts in the Old Royal and King’s Collections(1921), p. 129).The Old Royal Library (the English Royal Library): perhaps included in the catalogue of 1666 (see Carley,The Libraries of King Henry VIII,2000, p. xxxvi n. 48).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','A parchment codex, 109 folios.','https://bl.digirati.io/iiif/ark:/81055/vdc_100058105339.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058105341.0x000001/full/126,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106140',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(76,1,'Royal MS 6 A VII','Royal','1st quarter of the 11th century',1000,1024,'This manuscript contains theVita Sancti Gregorii Magni(Life of St Gregory the Great) by John the Deacon of Rome (b. c. 825; d. 880).Contents:ff. 2r-3r: A preface for theVita Sancti Gregorii Magni, beginning: \'Incipit Vita Gregorii papae urbis Romae. Beatissimo ac felicissimo domino Iohanni sanctae catholice et apostolice Romanae ecclesiae...\'ff. 3r-v: A table of chapters of the first book.ff. 4r-25v: First book of theVita Sancti Gregorii Magni.ff. 25v-27r: Table of chapters of the second book.ff. 27r-58v: Second book of theVita Sancti Gregorii Magni.ff. 58v-59v: Table of chapters of the third book.ff. 60r-100r: Third book of theVita Sancti Gregorii Magni.ff. 100r-103v: Table of chapters of the fourth book.ff. 103v-162v: Fourth book of theVita Sancti Gregorii Magni. The explicit is followed by an alphabet in Caroline minuscule and capital letters.The manuscript contains a few additions:f. 1r: An extract of an antiphon with Anglo-Norman neumes and later musical notations, beginning \'O...','Origin: Worcester, Southwestern England.Provenance:Unknown 11th- and 12th-century owner: added notated responsory from an antiphon in the late 11th or early 12th century (f. 1r); added Gregory the Great\'s prefatory letter to the homilies on Ezekiel, late 12th century (f. 1r); added a marginal drawing of two human figures in the (?) 12th century (f. 123r).An unknown 14th-century English owner: added annotations in a 14th-century semi-cursive English hand throughout (e. g., ff. 13v; 23vpassim).The Benedictine cathedral priory of St Mary, Worcester, founded in 680: included in Patrick Young\'s catalogue of the Worcester library, no. 36 (seeCatalogus librorum manuscriptorum bibliothecae Wigorniensis made in 1622-1623 by Patrick Young, Librarian to King James I, ed. by J. Atkins and N. R. Ker (Cambridge: Cambridge University Press, 1944), and noted by John Leland (seeJ. Lelandi antiquarii de rebus Britannicis Collectanea: Cum Thomæ Hearnii præfatione notis et indice ad editionem primam, 6 vols (Farnborough: Gregg International Publishers, 1970), IV, p. 160).John Theyer (bap. 1598, d. 1673), antiquary: included in the catalogue of his library left to his grandson Charles Theyer (b. 1651): see E. Bernard,Catalogi librorum manuscriptorum Angliae et Hiberniae, 3 vols. (Oxford: Sheldonian, \'1697\', but 1698?), II, no. 6423.Robert Scott (b. c. 1632, d. 1709/10), London bookseller: included in the catalogue of John Theyer’s manuscripts in his possession, made in 1678 by William Beveridge and William Jane, Royal Appendix, 70, no. 77.Charles II (b. 1630, d. 1685), king of England, Scotland, and Ireland: purchased from Robert Scott together with other 311 manuscripts from Theyer\'s library.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056064710.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056064712.0x000001/full/149,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106141',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(77,1,'Royal MS 6 B VI','Royal','1st quarter of the 12th century',1100,1124,'This manuscript was written by two scribes (ff. 1-22 and ff. 23-126), according to Waller, \'The Library, Scriptorium and Community\' (1980), p. 314. The second hand (Rochester scribe 4) also wrote Royal MS 5 B IV and Royal MS 15 A XXII, according to Waller.This manuscript consists of two texts of St Ambrose, a Father of the Church, theDe Mysteriis,a dogmatic work on baptism, confirmation and Eucharist intended for catechumen, and theDe Sacramentis,which consists of six sermons whose content is similar to theDe Mysteriis,including instructions for prayers, and the Canon of the Mass. It includes other works related to sacraments written by St Ivo of Chartres (b. c. 1040, d. c. 1116), bishop of Chartres and defender of the Gregorian reform, and by St Bruno of Segni (d. 1123), abbot of the Benedictine abbey of Monte-Cassino and bishop of Segni.Contents:ff. 2r-8v: St Ambrose,De Mysteriis(About Mysteries),beginning: \'Incipit liber beati Ambrosii Mediolanensis archiepiscopi de Misteriis siv...','Origin: Rochester, Southeastern England.Provenance:The cathedral priory of St Andrew, Rochester: late 12th-century ownership inscription \'Hic est liber sancti Andree de Rovecestria\', preceded by a table of contents written by the same hand; a 14th-century ownership inscription \'Liber de claustro Roffensi per Andrem monachum\' (f. 2r). \'Liber de claustro Roffens[i] per Andr[eam] mona[chu]m\', 14th century (f. 2); probably written and illuminated there after 1114: includes a letter of Ivo of Chartres concerning the election in 1114 of Ralph d\'Escures, bishop of Rochester, as archbishop of Canterbury (f. 125v); included in the Rochester library catalogues of 1122/23, no. 44, and of 1202, no. 30 (see Sharpe,English Benedictine Libraries(1996)).Added, early 13th-century theological distinctions (ff. 126v, 127v).The Old Royal Library (the English royal library): Westminster inventory number \'no. 630\' (f. 2), included in the inventory of books in the Upper Library at Westminster of 1542; note in the hand of the royal librarian, Patrick Young, [Junius] (b. 1584, d. 1652) (f. 46v); red seal of a ship, 17th century (f. 1); included in the 1698 catalogue of the library of St James’s Palace (see [Edward Bernard], Catalogi librorum manuscriptorum Angliae et Hiberniae (Oxford: Sheldonian, \'1697\', but 1698?), no. 8651).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056065175.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056065177.0x000001/full/143,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106156',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(78,1,'Royal MS 6 B VII','Royal','2nd half 11th century-12th century',1050,1199,'This manuscript contains the prose version of Aldhelm\'sDe virginitate(imperfect, missing chapter 39), with Latin and Old English glosses. A list of relics held at Exeter Cathedral was added in a 12th century hand (ff. 54v-55r).Decoration: Historiated initials with foliate decoration (f. 1r) and a human and a beast in foliate decoration (f. 4r), in red, blue, and black. Display capitals in red, blue, green, and black (ff. 1r, 3v-4r, 53r). Marginal sketch of a head (f. 6v) and a fish (f. 21r).','Origin: EnglandProvenance:Exeter: list of relics added in the 12th century (ff. 54v-55r). The list is close to one which claims to describe relics given by King Æthelstan to a church in Exeter, contained in Oxford, Bodleian Library, MS Auct. D. 2.16.Later medieval inscriptions added (ff. i, 22v).The Old Royal Library (the English Royal Library): Westminster inventory number \'no. 63 \' (f. 1r), included in the inventory of books in the Upper Library at Westminster of 1542 (f. 24).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','1 parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100058107792.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058107794.0x000001/full/162,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106157',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(79,1,'Royal MS 6 B VIII','Royal','11th century-12th century',1000,1199,'This manuscript comprises texts written at different times, ff. 1v-26r was written in the 1st quarter of the 11th century and probably decorated in Canterbury.Alcuin\'s epistle to Pope Leo III (ff. 27v-28v) and the first part of hisDe fide sancte et individue Trinitatis(On the faith of the holy and indivisble Trinity) (ff. 28v-38r) were written by a different scribe (see Gneuss,Anglo-Saxon Manuscripts(2001), no. 467). In his Epistle to Pope Leo III written in 801, Alcuin asked Pope Leon to absolve him from his sins. TheDe fide sancte et individue Trinitatisis a theological treatise written in Tours around 801-802 and dedicated to Charlemagne. At Charlemagne\'s request Alcuin wrote a treatise on the Trinity in order to correct the errors of the heresy of adoptionism, a doctrine stating that Christ was adopted by God.TheDe fide sancte et individue Trinitatiswas continued by a later English scribe (ff. 39r-57r) of the last quarter of the 11th century, who also copied theDe anime ratione(...','Origin: ?Canterbury, Southeastern England.Provenance:The Benedictine abbey of St Augustine, Canterbury: probably written and decorated there (ff. 2v-57r) (see Temple,Anglo-Saxon Manuscripts 900-1066(1976) and Gneuss,Anglo-Saxon Manuscripts(2001)).Added, numerous maniculae of several periods (throughout).Added, notes written by a 14th-century English scribe (ff. 1r, 74v).Added, scholastic marginal notes (lower margins) written in a 14th-century cursive script (ff. 33v-34r).Added, in the lower margin \'ab Aliquino magistro\' written by a 14th-century scribe (f. 73v).Added, rubrics by 14th-century scribes (e. g., ff. 31v; 33v; 38v).John Lumley, 1st baron Lumley (b. c. 1533, d. 1609), collector and conspirator: inscribed with his name (f. 1v); listed in the 1609 catalogue of his collection, no. 509 (seeThe Lumley Library, 1956); passed to Henry, prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library: in the 1698 catalogue of the library of St James\'s Palace (seeCatalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\'), no. 7922, 7923).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056065462.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056065464.0x000001/full/144,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106158',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(80,1,'Royal MS 6 C VI','Royal','12th century-13th century',1100,1299,'This manuscript was originally the second volume of a two-volume set containing the book of Job and Gregory the Great\'sMoralia in Job.The first volume of this set was probably Royal MS 13 C IV, which includes theMoralia in Job,books 1-16 but which was written by a different hand. A part of a later copy of the book of Job (ff. 1r-5v), written by an early 13th-century hand, has been associated with the original volume at an early period, as the 14th-century ownership inscription on f. 1r testifies (see Provenance). Lanfranc\'s (b. c. 1010, d. 1089) notes have been added at the end in the second half of the 12th century (f. 259r).Contents:ff. 1r-5v: The book of Job (24:20-42:16), imperfect beginning: \'Non sit in recordatione sed conteratur quasi lignum infructuosum\', added in the 13th century.ff. 6r-258v: Gregory the Great, Moralia in Job (books 17-35), beginning: \'Quotiens in Sancti viri historia per novum volumen enodare mysterium typice expositionis aggredimur\'.Book 17 (ff. 6r-15r); ...','Origin: Rochester, Southeastern England.Provenance:The cathedral priory of St Andrew, Rochester, given by Ralph d\'Escures, bishop of Rochester (from 1108-1114), and archbishop of Canterbury (from 1114-1122): inscribed \'Quarta pars moralium Gregorii, incipit per R. Archiepiscopum de claustro Roffensi\' (f. 1r); 14th-century owner inscription: \'Liber de claustro Roffensis per Radulfum archiepiscopum\' (f. 6r); cited in the Rochester library catalogues of 1123, no. 45, and of 1202, no. 24 (see Sharpe,English Benedictine Libraries(1996)).Added, second half of the 12th century, Lanfranc\'s notes on theMoralia in Job(f. 259r).William Fressel, prior of Rochester (from 1509-1532): 15th-century notes related to a charter promulgated by him (f. 260r).The Old Royal Library (the English Royal Library): Westminster inventory number \'no. 548\' (f. 1r), included in the inventory of books in the Upper Library at Westminster of 1542; in the catalogue of 1666, Royal Appendix 71, f. 6v; in the 1698 catalogue of the library of St James’s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\', but 1698?), no. 7931 or 7932); and in the Catalogue of 1666, Royal Appendix 71, f. 6v.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100059911875.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059911877.0x000001/full/166,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106171',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(81,1,'Royal MS 6 C X','Royal','12th century',1100,1199,'This manuscript consists of Gregory the Great\'sSymbolum fidei dictatum a beato Gregoriofollowed by Gregory the Great\'sRegistrum epistolarum.TheRegistrum epistolarum(Register of Letters) is a collection of Gregory\'s letters in 14 books: one for each year of his pontificate. It includes more than eight hundred epistles. Here some epistles are missing and others have been copied in a different book rather than in the one in which they belong. The single scribe who copied this manuscript also wrote a part of Royal MS 2 C III and Royal MS 5 D I.Contents:f. 2r: Gregory the Great,Symbolum fidei dictatum a beato Gregorio,a work which often is prefixed to Gregory\'sRegistrum epistolarum,beginning: \'Credo in Unum Deum omnipotenten, Patrem et Filium et Spiritum Sanctum, tres personas\'.ff. 2r-198v: Gregory the Great,Registrum epistolarumin 14 books, imperfect, beginning: \'Registri Beato Gregorii Papae Urbis Romae. Liber primus. Incipit mense septembri, indictione VIIII, Gregorius servus servorum...','Origin: ?Rochester, Southeastern England.Provenance:Inscribed in an early 13th-century hand, \'Hic desunt due epistole\' (f. 198v).The cathedral priory of St Andrew, Rochester, given by Alexander Glanville, prior (from 1242-1252): early 14th-century ownership inscription, \'Liber de claustro Roffensi per Alexandrum priorem\' (f. 2r); cited in the catalogues of the Rochester library of 1123 and 1202, and also in the earlier fragmentary catalogue from the 12th century.Inscribed, 15th-century pressmark: \'D\' (f. 199r).Added early 16th century, partial table of content of Gregory the Great\'sRegistrum epistolarum,book 1 (f. 1r).The Old Royal Library (the English Royal Library): Westminster inventory number \'no. 755\' (f. 2r), included in the inventory of books in the Upper Library at Westminster of 1542; in the catalogue of 1666, Royal Appendix 71, f. 18 or f. 5r; and in the 1698 catalogue of the library of St James\'s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\', but 1698?), no. 7929.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100059472683.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059472685.0x000001/full/137,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106175',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(82,1,'Royal MS 7 C IV','Royal','2nd or 3rd quarter of the 11th century',1025,1074,'This manuscript contains theLiber scintillarum(Book of Sparks): aflorilegiumof extracts from the Bible and the Church Fathers written around 700 by a Benedictine monk of the abbey of Ligugé, Defensor of Ligugé. It also includes Old English interlinear glosses. The quires containing theLiber scintillarumhave been bound incorrectly (for the right order see Rhodes,Defensor\'s Liber scintillarum(1889)). It is followed by aflorilegiumentitledPauca de vitiis et peccatis(Little on the Vices and Sins) that includes extracts from Ecclesiasticus and Isidore of Seville (d. 636)\'sSententiae(Sentences).Contents:ff. 1r-100v: Defensor of Ligugé,Liber scintillarumwith interlinear Old English glosses.ff. 100v-106r: Anonymous,Pauca de vitiis and peccatis(imperfect), including Old English interlinear glosses to the Bible (ff. 100v-102r) and Isidore\'sSententiae(ff. 102r-106r).The manuscript contains a number of additions:f. iv: An alphabet from \'A\' to \'G\' linked to Roman numerals written by an early 15t...','Origin: Canterbury, Southeastern England.Provenance:The Benedictine priory Christ Church, Canterbury, founded in 597: inscribed, 13th-century, \'De claustro Christi cantuarie\' and \'Liber scintillarum\' (f. 1r); included in the catalogue of Henry of Eastry (d. 1331), prior of Christ Church, Canterbury, as no. 246 (see M. R. James,The Ancient Libraries of Canterbury and Dover(Cambridge: University Press, 1903), p. 45).An unknown 12th- or 13th-century English owner: added quotations from the Early Middle EnglishPoema morale, \'elde me is bestolen on er [...] Ne maeg ic geseo before me [..] for he may se a mows [...]\', added in the 12th or 13th century (f. 106v).\'Frater T. Asceford\': his name inscribed in a 15th-century script (f. 106v).Unidentified 14th- or 15th-century owners: added Latin quotations, a drawing of a head, and of a shield with unidentified arms, 15th-16th century (f. 106v).John Apsley of Thakeham, Sussex (d. 1587): inscribed, \'Johannes Apsley de Thakeham me possidet et per viginti annos possidebat: 1567, fol. 19\' (f. 19r); note in his hand (f. 40r).John Lumley, 1st baron Lumley (b. c. 1533, d. 1609), collector and conspirator: inscribed with his name (f. 1r); listed in the 1609 catalogue of his collection, no. 597 (seeThe Lumley Library, (1956)); passed to Henry, prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library: in the 1698 catalogue of the library of St James\'s Palace (seeCatalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\' but 1698), no. 8250); the St James\'s Palace library pressmark \'Scrin. 25\' (f.1v).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, MiddleEnglish, OldLatin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100054149545.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100054149547.0x000001/full/134,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106227',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(83,1,'Royal MS 7 C XII','Royal','c 700 to 2nd half of 12th century',695,1200,'This volume includes three parts:ff. 2-3 are fragments of canon tables from a seventh- or eighth-century Gospel book, in Latin;ff. 4-218 contain an early copy (possibly written in the 990s) of the first series of Ælfric\'sCatholic Homilies, in Old English;ff. 219-231 contain twelfth-century copies of extracts from Gregory of Tours,Gesta Francorum, and fromSermo de Sabbato Pasche,Gospel of Nicodemus, extracts from Cassiodorus Senator,Expositio Psalmorum, in Latin.','Provenance:Thomas Wolsey (b. circa 1470, d. 1530), royal minister, archbishop of York, and cardinal: inscribed \'T. Car[dina]lis Ebor[acensis]\' (f. 2r).Robert Beale, perhaps to be identified with Robert Beale (b. 1541, d. 1601), clerk to the Council c. 1572-1601: a inscribed with his name (f. 4r).The Old Royal Library (the English Royal Library): in the 1698 catalogue of the library of St James’s Palace (see Bernard,Catalogi librorum(1697), no. 8199); St James’s Palace library pressmark, \'Scrin. XIV.I\' (f. 1v).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','Parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100060441469.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100060441471.0x000001/full/143,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106235',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(84,1,'Royal MS 7 D II','Royal','2nd quarter of the 12th century',1125,1149,'Contents:ff. 3r-9v: Anonymous,Liber de Philosophia Salomonis(On the Philosophy of Solomon), a compilation on the divisions of philosophy, including three different systems of classification, beginning with an extract of the prologue of Origen\'s commentary on theCanticle of Canticlesrelated to sciences: \'Hanc ergo triplicem divine philosophie formam etiam in istis sanctis et beatissimis viris arbitror presignatam\'.ff. 10r-11v: Isidore of Seville,Etymologiae,extract from Book 1 chapter 27.ff. 11v-18v: Fulgentius Mythographus,Expositio sermonum antiquorum.ff. 18v-19v: An incomplete glossary (A to C) of unusual words of Greek origin including interlinear glosses in Latin.ff. 20v-22v: Preparation of pigments and alchemical recipes, beginning: \'Aurum mollire ut in eo sigillium facias\'.ff. 23r-64v: Cassiodorus Senator,De animapreceded bycapitula(f. 23r).ff. 65r-66r: A homily on the entry of Christ into Jerusalem.ff. 66r-73v: A lesson on the Gospel of St Matthew with an interpretation of He...','Origin: Canterbury, Southeastern England.Provenance:The Benedictine abbey of St Augustine, Canterbury: inscribed \'Liber cassiodori de anima\', with the shelfmark \'Cum A. / Dist[inctio] vi. Gra[adus] i.\', 14th century (f. 1v); included in the catalogue of St Augustine\'s abbey of the end of 15th century, no. 415 (seeSt Augustine\'s Abbey,(2008)).Added lists of contents, 14th century (f. 1v, 2v).John Dee (b. 1527, d. 1609), mathematician, astrologer, and antiquary: inscribed with his name \'Joannes Dee\' (f. 3r); included in the catalogue of his library, no. 166.Added list of contents, 16th/17th century (f. 2v).The Old Royal Library (the English Royal Library): red seal of a ship, 17th century (f. 1*); included in the 1698 catalogue of the library of St James\'s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\', but 1698), no. 8642).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100057898825.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057898827.0x000001/full/158,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106242',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(85,1,'Royal MS 7 D X','Royal','1545',1545,1545,'The manuscript includes a collection of prayers translated into Latin, French and Italian by Princess, afterwards Queen, Elizabeth when she was twelve years old; preceded by a Latin dedication to Henry VIII (ff. 1r-5r). This preface preface dated 30 December 1545 and addressed from Hertford is the only extant letter from Elizabeth to her father, incipit: \'Precationes seu meditationes quibus mens commovetur ad omnes perturbationes... per Nobilis. et Pientis. D. Catharinam Anglie, Francie Hibernique reginam collecte et per D Elizabetam ex anglico converse.\'','Origin: England (London).Princess Elizabeth, the future Elizabeth I (b. 1533, d. 1603), Queen of England and Ireland: translated by her into Latin French and Italian and presented to her father Henry VIII as a New Year\'s present in 1546; perhaps to be identified with a prayerbook seen by Philip Julius, Duke of Stettin-Pomerania in the \'Queen\'s cabinet\' at Whitehall in 1602 (see von Bülow,Diary,1982); passed to the Old Royal library (the English Royal library), but not regorded in the old catalogues.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English','Parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100165177811.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165687118.0x0000eb/full/135,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106250',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(86,1,'Royal MS 7 D XXIV','Royal','10th century-17th century',900,1199,'Contents:f. 1r: An added fragment of an ecclesiastical writ in a 16th-century hand, bound upside down.ff. 2r-81v: Guitmund of Aversa,De Corporis et Sanguinis Christi, beginning \'Ad rem his temporibus necessariam\'. Imperfect, ending \'in hoc mundo carnalis conuersatio\'. Copied in a 12th-century hand.ff. 82r-162v, 166r-168v: A mid-10th-century, glossed copy of Aldhelm\'sDe virginitateand Aldhlem\'sEpistola ad Ehfridum(letter to Heahfrith), imperfect.ff. 163r-165v: Early modern supply leaves of part of Aldhelm\'s letter to Heahfrith, with corrections in the hand of Patrick Young.Syntactic marks or glosses using a system of dots and dashes have been used.','Provenance:John Lumley, 1st baron Lumley (b. c. 1533, d. 1609), collector and conspirator: inscribed with his name (f. 1); listed in the 1609 catalogue of his collection, no. 399 (seeThe Lumley Library, ed. by Jayne and Johnson (1956)); passed to Henry, prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library: in the 1698 catalogue of the library of St James\'s Palace (seeCatalogi librorum(\'1697\'), no. 399).Patrick Young (b. 1584, d. 1652), librarian and scholar: added 17th-century transcription of the letter of Aldhelm to Ehfridus, with corrections in the hand of Patrick Young (ff. 163-165).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100062970053.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100062970055.0x000001/full/177,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106264',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(87,1,'Royal MS 7 E VI','Royal','12th century-13th century',1100,1299,'This manuscript consists of two distinct parts bound together at an unknown period. The first part (ff. 2r-203v) contains a martyrology with local addition for the Benedictine abbey of Christ Church, Canterbury and other confraternities including the rule of St Benedict (ff. 74r-93v). Several folios have been removed: a table of the epacts (used to find a date in the lunar calendar from the date in the solar calendar) for each year is now Cotton MS Claudius C VI (ff. 170r-203r); the original leaf containing a list of benefactors was removed and renewed by a new one containing the martyrdom of St Thomas Becket (f. 73r), the list of benefactors is now Cotton MS Galba E III (f. 32r); the end of the homilyDe virgine martyreand the homilies for the dedication of Christ Church and the octave are now Cotton MS Claudius C VI (f. 168r), along with Lanfranc\'sConstitutiones(ff. 168v-196).The second part, dating to the 3rd quarter of the 13th century, consists of part of the New Testament (ff. ...','Provenance:John Lumley, 1st baron Lumley (b. c. 1533, d. 1609), collector and conspirator: probably to be identified with \'Martyrologium manuscript. Divi Benedicti regulae manuscript\' in the 1609 catalogue of his collection, no. 629; Cotton Nero C IX, ff. 19-21 inscribed with Lumley\'s name and titles \'m[a]rtilogiu[m] novu[m] and \'Regula s[an]c[t]I Benedicti\', but bearing a Christ Church shelfmark \'D VII Ga II\' (f. 20), perhaps were originally flyleaves of Royal 7 E VI (seeThe Lumley Library(1956)); passed to Henry, prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library: included in the catalogue of 1666, Royal appendix 71, f. 2v; and in the 1698 catalogue of the library of St James\'s Palace (seeCatalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\', but 1698?), no. 7796 and 7880).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100062971421.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100062971423.0x000001/full/148,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106272',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(88,1,'Royal MS 7 F VI','Royal','3rd quarter of the 12th century',1150,1174,'Contents:ff. 1r–178v: Paterius,Liber testimoniorum veteris testamenti,parts 1 and 3, preceded by a prologue (ff. 1r-v), beginning of the prologue: \'In nomine Sancte Trinitatis incipit liber testimoniorum veteris testamenti quem Paterius de opusculis sancti Gregorii pape cum summo studio excerpi curavit. Incipit Prologus. Dum beatissimi atque apostolici Gregorii pontificis nostri\'; beginning of the text (f. 2v): \'Virtutes angelice que in divino amore\'; every chapters is preceded by a prologue.Part 1 (ff. 2v-116v) ends: \'Quod eius erga proximum caritas contradicat. Explicit de libro Salomonis\'; it is followed by an homily (ff. 117r-v) by Ambrosiaster, beginning: \'Dignum est fratres et congruum ut gaudia nostra\'; followed by an extract from the Song of Solomon (from the Song of Songs) (ff. 117v-118v), beginning: \'\'Osculetur me osculo oris sui\'; the part 3 of Paterius\'sLiber testimoniorum veteris testamentipreceded bycapitula(ff. 118v-119r),beginning imperfectly, where chapter 1 is lack...','Origin: Cirencester, Southwestern England.Provenance:The Augustine abbey of the Blessed Virgin Mary, Cirencester: ownership inscription \'Cirencestrie\', usually on the first or last page of a quire (ff. 1r, 33r, 57r, 80r, 104r, 125r, 139r, 153r, 169r).A lost inscription, \'Liber est Marie de Cirencestre, D. Andree abbatis secundi eiusdem loci tempore scriptus per manum Walteri canonici et diaconi, D. Adam de Lamora tunc cantore\' is noted by Casley (see David Casley,A Catalogue of the Manuscripts of the King’s Library(London, 1734)).The Old Royal Library (the English Royal Library): included in the catalogue of 1666, Royal Appendix 71 (f. 15v) and in the 1698 catalogue of the library of St James’s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae, 3 vols. (Oxford: Sheldonian, \'1697\', but 1698?), II, no. 8189).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056066712.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056066714.0x000001/full/153,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106282',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(89,1,'Royal MS 7 F VIII','Royal','4th quarter of the 13th century',1200,1299,'This manuscript, containing philosophical and mathematical treatises chiefly by Roger Bacon (b. c. 1220, d. c. 1292), is thought to be the earliest copy of several of Bacon\'s texts (including theDe multiplicatione specierum) and was most likely produced in Oxford in the last quarter of the thirteenth century by at least three different scribes (Lindberg,Roger Bacon\'s Philosophy of Nature(1983), pp. 1xxv-lxxvi). The present item is the second of two volumes, the first being Royal MS 7 F VII, which were probably originally bound together and subsequently separated while in Oxford in the middle of the 16th century; see the description for Royal MS 7 F VII.Contents:ff. 1r-2v: Two leaves of a Gradual, in an English hand (c. 1400).ff. 3r-11v: A Baconian text on the multiplication of species claiming to be part of theCompendium studii theologie, beginning \'Dato prologo istius quinte partis huius voluminis quod voco compendium studii theologie\'.ff. 11v-12r: Note on the comet of 1264 (also f...','Origin: England, S. (?).Provenance:William Herbert (or Herebert) (d. c. 1333-1337), 43rd regent master and lector in theology, Franciscan Convent, Oxford: marginal annotations, possibly in his hand throughout.The Franciscan Convent, Hereford: possibly given by William Herbert while bound with Royal MS 7 F VII: inscription (now effaced), \'Iste liber est de ordine fratrum minorum concessus W. Herebert qui eum ad ordinem procuravit\' (f. 13r) (seeCatalogue of Western Manuscripts in the Old Royal and King’s Collections(1921), pp. 202-03, and Ker,Medieval Libraries of Great Britain(1964), p. 100).John Lumley, 1st baron Lumley (b. c. 1533, d. 1609), collector and conspirator: inscribed with his name (f. 3r); listed in the 1609 catalogue of his collection, no. 774 (The Lumley Library(1956), no. 2181).John Prideaux (b. 1578, d. 1650), bishop of Worcester from 1641 to 1650, regius professor of divinity at Exeter College, and chaplain of Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his name inscribed (f. 3r).John Theyer (bap. 1598, d. 1673), antiquary: inscribed with his name on f. 3r; included in the catalogue of his library, left to his grandson Charles Theyer (b. 1651): see E. Bernard,Catalogi librorum manuscriptorum Angliae et Hiberniae, 3 vols. (Oxford: Sheldonian, \'1697\', but 1698?), II, 6375.Robert Scott (b. c. 1632, d. 1709/10), London bookseller: included in the catalogue of John Theyer’s manuscripts in his possession, made in 1678 by William Beveridge and William Jane, Royal Appendix, 70, no. 16.Charles II (b. 1630, d.1685), king of England, Scotland, and Ireland: purchased from Scott together with the other 311 manuscripts from Theyer\'s library.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex.','https://bl.digirati.io/iiif/ark:/81055/vdc_100165177858.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165671292.0x000183/full/174,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106284',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(90,1,'Royal MS 8 B XI','Royal','2nd half of the 10th century',950,999,'Contents:ff. 1r–143r: Paschasius Radbertus,Liber de corpore et sanguine domini,‘Paschasius radbertus placido suo salutem.Dilectissimo filio et uice christi… ut ad illa resurrectionis gaudia quantotius venire valeamus.Explicit liber de corpore domini quem ratbertus abba composuit’.ff. 143v–145r: Extract from a discourse on the Eucharist, also known from Royal 7 C. vii; most of the text follows Gezon de Saint-Pierre,De corpore et sanguine Christi,40 (Patrologia Latina, 137, col. 391B–D), but it begins differently: ‘Fuit namque iudas cum ceteris discipulis in conuiuio domini … et magis ac magis adsemutantur qui non ęquo animo communicare festinant.’ff. 145v–146r: Pen trials (including of initials) added in the 12th century, with proverbs on the relationship of sin, love, and friendship: ‘¶ Caro nostra propter sentiantiam primi hominis ad terram redit. ¶ Qui facit peccatum⸵ servus est peccati. ¶ Ire amantium⸵ redintegratio est amoris. ¶ Omnia transibunt⸵ preter amare deum. ¶ Multi sunt ...','Origin: The Benedictine cathedral priory of St Mary the Virgin, Worcester: (?) Bishop,English Caroline Minuscule(1971), no. 18 attributes the scribe to this house; colophon, ‘Qui istum librum legat precat pro anima sistan me scripsit amen’ (f. 145r).Provenance:Henry Jackson (b. 1585/6, d. 1662), clergyman and literary editor: ‘Liber Henrici Jacksoni oxoniensis, Collegii Corporis Christi. MDC. Maii .xxi. liberati’ (f. 145r).John Theyer (bap. 1598, d. 1673), antiquary, included in the catalogue of his library left to his grandson Charles Theyer (b. 1651): see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae, 3 vols. (Oxford: Sheldonian Theatre, \'1697\', but 1698?), ii, no. 6477.Robert Scott (b. c. 1632, d. 1709/10), London bookseller: included in the catalogue of John Theyer’s manuscripts in his possession, appraised in 1678 by William Beveridge and William Jane, Royal Appendix, 70, no. 201.Charles II (b. 1630, d.1685), king of England, Scotland, and Ireland: purchased from Scott together with other 311 manuscripts from Theyer\'s library.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','Parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100058105842.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058105844.0x000001/full/121,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106323',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(91,1,'Royal MS 8 C III','Royal','4th quarter of the 10th century',975,999,'Contents:f. 1v: a parchment flyleaf with a table of contents by a cursive 17th century hand.. Above it, the first five letters of the alphabet as a pen trial, in a 12th-13th centuries-hand;ff. 2r-6v: Pseudo Jerome,De diversis generibus musicorum(the first words are missing). Beginning: \' tibi dardane de aliis generibus musicorum sicut res docet\'. Ending: \'spiritaliter ac mystice intellegenda sunt\';ff. 6v-26r: Exposition of the Mass. Beginning: \'Primum in ordine missae\'. Ending: \'quam in his etiam verbis ultimam commendavit apostolus\';ff. 26r-50v: Theodulf of Orleans,De ordine baptismi.Beginning: \'Reverentissimo atque carissimo fratri peregi et si non sollerti efficacia\'. Ending: \'et que bona sunt retinenda finit\';ff. 50v-53r:De baptismo,florilegia of the baptismal office. Rubric: \'De babtismo (sic) officio ac misticis sensibus eorumque auctoribus nominatim designates et De ordine venientium ad fidem eiusdemque misterii supra memoravi. Item.\' Beginning: \'Oratio quasi oris ratio\'. End...','Origin: England, S. E. (Canterbury?)Provenance:? The Benedictine abbey of St Augustine, Canterbury (see Bishop, \'Notes on Cambridge Manuscripts\', 1957, pp. 335-336 and Dumville,English Caroline,1993, p. 151 but Barker-Benfield,St Augustine\'s abbey, Canterbury,2008 considers the evidence inconclusive).Addition of running titles by a cursive hand of the 14th century: ff. 2r, 26r, 61r, 82r.John Lumley, 1st baron Lumley (b. c. 1533, d. 1609), collector and conspirator: inscribed with his name (f. 2); listed in the 1609 catalogue of his collection, f. 94 (see Sears Jayne and Francis R. Johnson,The Lumley Library, 1956); passed to Henry, prince of Wales.Patrick Young [Junius] (b. 1584, d. 1652), royal librarian and scholar: notes in his hand (ff. 42, 49).Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library: in the 1698 catalogue of the library of St James\'s Palace (seeCatalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\'), no. 8624).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','Parchment codex, 120 folios.','https://bl.digirati.io/iiif/ark:/81055/vdc_100058106015.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058106017.0x000001/full/144,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106335',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(92,1,'Royal MS 8 E IV','Royal','4th quarter of the 12th century',1175,1199,'Contents:This manuscript contains the Epistles of Ennodius (d. 521) from book 1 to 9 and some extracts from theOpusculaand theDictiones.The texts are largely corrupted and abridged. The manuscript also includes a series of anonymous epistles (ff. 50r-55r), perhaps in order to provide examples in thears dictaminis,according to Polak,Medieval and Renaisance Letter Treatises(1994), p. 344.These epistles were probably written in an Italian context because most of the cited names are Italian (see Warner,Catalogue of Western Manuscripts(1921)).The lower margins of ff. 1-8 have been trimmed off. These folios were once separated, possibly after the fire of 1731, and they were formerly numbered Royal Appendix 8, ff. 19-26.ff. 1r-50r: Magnus Felix Ennodius,Dictiones(Discourses),Epistule(Letters) and extracts fromOpuscula,imperfect,out of order, and in some cases abridged, especially in the earlier part.It begins with the first discourse,Dictio in natali Laurentium, for the consecration of Law...','Origin: England.Provenance:The Cistercian abbey of St Mary, Rievaulx, Yorkshire (founded in 1131), based on the style of the script, see Richard Sharpe and James Willoughby,Medieval Libraries of Great Britain(Oxford: The Bodleian Libraries, 2015) http://mlgb3.bodleian.ox.ac.uk/mlgb/book/4629/?search_term=Royal%208%20E.iv&page_size=500 [accessed 26 October 2016]; probably written by one of the same scribes as Royal MS 8 D XXII from Rievaulx (according to unpublished notes of Michael Gullick); perhaps the copy seen by John Leland (d. 1552) at Rievaulx and cited in Leland\'s catalogue of 1536-40.Henry Savile of Banke, Yorkshire (b. 1568, d. 1617), collector of manuscripts: his shorthand inscription (f. 1) (see Warner and Gilson,Catalogue of Western Medieval Manuscripts(1921)).Patrick Young [Junius] (b. 1584, d. 1652), royal librarian and scholar: marginal notes in his hand refering to the edition by Andreas Schottus, 1611 (ff. 40v, 41v, 42 r-v).The Old Royal Library (the English Royal Library): possibly included in the catalogue of 1666, Royal Appendix 71, f. 20v.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100063228362.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100063228364.0x000001/full/137,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106375',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(93,1,'Royal MS 8 E XV','Royal','3rd quarter of the 9th century',850,874,'This 9th-century manuscript consists of a collection of 66 letters by Alcuin of York (d. 804). Its contents are similar to those of St Gallen, Stiftsbibliothek, Cod. 271.Contents:ff. 1v-80v: Alcuin,Epistulae(Letters).A collection of 66 letters, preceded bycapitula(ff. 1v-2v), beginning with an epistle to Æthelhard (d. 805), bishop of Canterbury: \'Pio patri et sanctae sedis praesulli Aedilhardo archiepiscopo humilis levita Albinus salute. Audiens vestrae salutationis verba dulcissima et prosperitatis vestrae sanitatem multis per necessariam\'; ending with an epistle addressed to his Anglo-Saxon friends for recommending Fordrad, a priest (ff. 80r-v): \'Fraternae dilectionis amicis per diversas nominum dignitates Albinus conservus in Christo vester salutem\'; ends: \'Qui est via vita et veritas vobis viam vestrae salutis ostendere et veritatem aeternae gloriae tribuere et beatissimam vitam concedere dignetur\'.The manuscript contains a later addition:f. 1r: a 10th-century extract from a cha...','Origin: ? Arras, Northern France.Provenance:? The Benedictine abbey of Saint-Vaast, Arras, founded in 667: based on the script, according to Steigmann and Wemhoff,Kunst und Kultur(1999); and Bischoff,Katalog(2004).? The Benedictine abbey of Saint Bertin, Saint-Omer, founded in the 7th century: a 10th-century extract from a charter, partly for the use of the altar of Saint Omer (see Bischoff,Katalog(2004).John Bridges (b. 1535/6, d. 1618), Bishop of Oxford: erased inscription possibly in his hand, \'ex dono Jo. Bridges\' (f. 1r) (see Warner and Gilson,Catalogue(1921)).Winchester Cathedral, founded in 642: given by John Bridges, according to Ker,Books, Collectors and Libraries(1985).Patrick Young (b. 1584 d. 1652), librarian and scholar: his annotations and corrections throughout (e. g., ff. 5v, 10r; 45r).The Old Royal Library (the English Royal Library): in the 1698 catalogue of the library of St James’s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\', but 1698?), no. 8664).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100065009187.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100065009190.0x000001/full/141,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106386',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(94,1,'Royal MS 10 A XIII','Royal','4th quarter of the 12th century',1175,1199,'This manuscript consists of theExpositio in Regulam Sancti Benedicti,a commentary on the Rule of St Benedict composed by Smaragdus (b. c. 760, d. c. 830), abbot of the Benedictine abbey of Saint-Mihiel in Lotharingia, soon after the Synod of Aachen (816-817) and St Benedict of Aniane\'sConcordia regularum,together with a miniature of St Dunstan foliated as f. 2, now kept separately as Royal MS 10 A XIII/1.Contents:f. 2: A miniature of St Dunstan, kept separately.ff. 3r-25v: Smaragdus of Saint-Mihiel,Expositio super PrologumRegule Sancti Benedicti(Commentary on the Prologue of the Rule of St Benedict), beginning (f. 3r): \'Incipit prologus in expositionem regule beati Benedicti. Cum turbas populorum (sic) cernerem monachorum in beati regula Benedicti [...]. Incipit Expositio super prologum regule Beati Benedicti patris monachorum. Obsculta hec nos ortantis beati verba sunt\'.ff. 26r-156v: Smaragdus of Saint-Mihiel,Expositio in Regulam Sancti Benedicti,preceded bycapitula(ff. 26r-27r), b...','Origin: Canterbury, Southeastern England.Provenance:The Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury: inscribed [under erasure] \'Liber Ricardi ...ham monachi\' and \'ecc[lesi]e xp[ist]I cantuar[ie]\', with a title \'Expo[s]it[i]o s[anc]ti du[n]stani sup[er] regula[m] s[anc]ti B[e]n[e]d[ic]ti\', 14th century (f. 1r), and a shelfmark \'D. III. g. XII\' with a title \'Expositio su[per] Reg[u]lam beati Benedicti. nova\', 12th century (f. 2r); a reference sign on f. 1r repeated on f. 3r; included in the early 14th-century catalogue of Henry of Eastry (d. 1331), prior of Christ Church, Canterbury, no. 139.Added foliation and chapter numbers, 14th century, throughout. The same hand has added to the table of chapters the number of folios of every chapter (ff. 26r-27r).Thomas Cranmer (b. 1489, d. 1556), archbishop of Canterbury: inscribed with his name (f. 3r).John Lumley, 1st Baron Lumley (b. c. 1533, d. 1609), collector and conspirator: inscribed with his name (f. 2r); listed in the 1609 catalogue of his collection, no. 319 (seeThe Lumley Library, (1956)); his library acquired by Henry, prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library: in the catalogue of 1666, Royal Appendix 71, f. 4v.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100062969627.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100062969629.0x000001/full/169,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106495',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(95,1,'Royal MS 10 A XIII/1','Royal','4th quarter of the 12th century',1175,1199,'This manuscript is part of Royal MS 10 A XIII, now kept separately.Contents and Decoration:A prefatory miniature of St Dunstan (f. 2) is painted on a singleton and is now kept separately from the manuscript containing Smaragdus,Expositio in Regulam Sancti Benedictiand mounted in double-sided glass.f. 2r: Inscribed title \'Expositio su[per] Reg[u]lam beati Benedicti. nova\' with a reference sign repeated at the beginning of the text (f. 3r), a shelfmark, \'D. III. g. XII, an ownership inscription of John Lumley, and an offset of a miniature from f. 2v.f. 2v: Miniature of Dunstan as a bishop, writing a commentary of the Rule of Saint Benedict, with an inscription \'S[an]c[tu]s Dunstanus\'.','Origin: Canterbury, Southeastern England.Provenance:The Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury: inscribed [under erasure] \'Liber Ricardi ...ham monachi\' and \'ecc[lesi]e xp[ist]I cantuar[ie]\', with a title \'Expo[s]it[i]o s[anc]ti du[n]stani sup[er] regula[m] s[anc]ti B[e]n[e]d[ic]ti\', 14th century (Royal MS 10 A XIII, f. 1r), and a shelfmark \'D. III. g. XII\' with a title \'Expositio su[per] Reg[u]lam beati Benedicti. nova\', 12th century (Royal MS 10 A XIII, f. 2r); a reference sign on f. 1r repeated on f. 3r; included in the early 14th-century catalogue of Henry of Eastry (d. 1331), prior of Christ Church, Canterbury, no. 139.Added foliation and chapter numbers, 14th century, throughout. The same hand has added to the table of chapters the number of folios of every chapter (Royal MS 10 A XIII, ff. 26r-27r).Thomas Cranmer (b. 1489, d. 1556), archbishop of Canterbury: inscribed with his name (Royal MS 10 A XIII, f. 3r).John Lumley, 1st Baron Lumley (b. c. 1533, d. 1609), collector and conspirator: inscribed with his name (Royal MS 10 A XIII, f. 2r); listed in the 1609 catalogue of his collection, no. 319 (seeThe Lumley Library, (1956)); his library acquired by Henry, prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library: in the catalogue of 1666, Royal Appendix 71, Royal MS 10 A XIII, f. 4v.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100059472438.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059472440.0x000001/full/150,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-003352710',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(96,1,'Royal MS 10 D VIII','Royal','2nd half of the 13th century',1250,1299,'This manuscript contains a thirteenth-century copy of Gratian\'sDecretum, a comprehensive compilation of canon law that includes decisions of Church councils, papal bulls, and excerpts from the Fathers of the Church, which was first composed in Bologna between 1139 and 1158. In addition to theDecretum, the volume also includes theGlossa ordinaria, a systematic textual commentary in the form of marginal glosses that was composed by the Italian canonist Bartholomew of Brescia (d. 1258), and theHistoriae super libro Decretorum(Stories concerning the book of decrees), written by the same author. The latter work is a compilation of biblical stories collected by Bartholomew, which illustrate points of canon law, arranged under the appropriatedistinctionesorcausae.The manuscript was not originally made for an English patron, but a number of added glosses throughout the volume suggest that it had arrived in England by the fourteenth century. It later came into the posssession of Howel Kyffin...','Origin: Southern and Central France (probably Paris).Provenance:The Bari Atelier, a workshop active in Paris in the 3rd quarter of the 13th century: responsible for the manuscript\'s decoration (seeRoyal Manuscripts(2011), no. 106).An unidentified English owner, 14th century: added marginal glosses in a minute English hand throughout the manuscript.Howel Kyffin, probably to be identified with the dean of St Aspah (1381-1384): inscribed \'nota r[e]ductiones ystoria[rum] decreto[rum] s[ecun]d[u]m Barth[olomeum] Brix[iensem]. Howel Kyffin\' (f. 345r).\'Cowley\', 15th century: inscribed, \'Cowley: / Qui timet deu[m] faciet bonum\' (ff. ii recto, 349r). A similar ownership inscription appears in a copy of Gregory the Great\'sMoralia in Job, now Royal MS 6 D VII (f. 299r).A letter of a prior of Belvoir, a cell of St Albans to the prior of St Albans, now Royal MS 14 B LI, found in the manuscript, dating to the late 15th century.The Old Royal Library (the English Royal Library): Westminster inventory number \'no. 984\' (f. 1), acquired by the Upper Library at Westminster after the inventory of 1542; in the catalogue of 1666, Royal Appendix 71, ff. 9, 9v, or 10; and in the catalogue of the library of St James’s Palace (see Bernard,Catalogi librorum manuscriptorum Angliae et Hiberniae(1697), no. 8373 or 8386).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100161520597.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100162028970.0x0002bb/full/126,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106538',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(97,1,'Royal MS 12 C XII','Royal','c 1320-1340',1315,1340,'Contents: This manuscript consists of eight originally independent units or booklets, each containing from one to four quires. See Hathaway,Fouke le Fitz Waryn(1975), p. xliv-xlvii on how this manuscript was compiled.The contents include:ff. 1r-v, Office in honour of Thomas, Earl of Lancaster, beheaded in 1322; verses on the corruption of the law courts;ff. 2r-3v, Charters of Edward I and Henry III;ff. 4r-6v, Hymns, prayers, verses and proverbs in Latin and French;f. 7r-v, Macaronic satirical verses in Latin, French and English; medical notes in Latin and French;ff. 8r-10v, Arithmetical and other puzzles in Latin;ff. 11r-13r, Recipes in Anglo-Norman French;ff.13r-16v, Prophecies in Latin, including an account of a false prophet in the East and Merlin Silvester (f. 15v);ff. 17r-32v,Speculum Ecclesieof Edmund Rich, Archbishop of Canterbury (reigned: 1234-1240); a tract on the Mass in French;ff. 33r-60v, Romance ofFulk le Fitz-Warin, in French (the only known manuscript of this text);f...','Origin: England, Central (Hereford).Provenance:John Lumley, 1st baron Lumley (b. c.1533, d. 1609), collector and conspirator: inscribed with his name (f. 1r); listed in the 1609 catalogue of his collection, no. 2039 (seeThe Lumley Library, 1956); passed to Henry, prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library.The Old Royal Library (the English Royal Library): included in the catalogue of 1666, Royal Appendix 71 (f. 11r).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Anglo-NormanEnglishFrenchLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100057740410.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057740412.0x000001/full/138,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106725',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(98,1,'Royal MS 12 C XXIII','Royal','Late 10th century-early 11th century',960,1099,'This manuscript contains a collection of texts, especially riddles, all copied and decorated in Southern England (possibly at Christ Church, Canterbury) in the late 10th or early 11th century. It includes:f. 1r: blank apart from some library numbers and markings;ff. 1v-79v: Julian of Toledo\'sPrognosticon futuri saeculi, with Latin glosses and an Old English gloss. In between folio 1 and folio 2, there an unfoliated leaf has been inserted with a circular hole cut out in its lower corner to accomodate a circle of red wax which has been added to f. 2r;ff. 79v-103v: verse riddles by Aldhelm, with prose and verse prologues, with Latin and Old English glosses, some of which were written by the same scribe as the main text;ff. 104r-113v: verse riddles by Symphosius, with glosses;ff. 113v-121v: verse riddles by Eusebius, with glosses;ff. 121v- 127r: verse riddles by Tatwine, with glosses;ff. 127r-132r: Pseudo-Smaragdus\'sOpus monitorium;ff. 132r-137r: Pseudo-Smaragdus\'s monitory poems;ff. 13...','Origin: ? Christ Church Canterbury, Canterbury: the manuscript\'s Anglo-Caroline Script has been associated with that produced at Christ Church, Canterbury (see Bishop, \'Notes\' (1959—63), p. 42).Provenance:? The Benedictine Abbey of St Mary, Glastonbury: possibly noted in the catalogue of Glastonbury abbey of 1247/48, no. 263 as \'Libri pronosticorum iiº. In altero sunt enigmata sancti Aldelmi vetusti\' (seeEnglish Benedictine Libraries(1996), B39.263); noted by John Leland in his list of books in Glastonbury abbey, before 1533 (seeJoannis Lelandi(1970), IV p. 154). Such an entry could also refer to the contents of Cambridge, University Library, Gg. 5. 35 (1567), or to a lost exemplar; however, the former manuscript seems to have been copied at St Augustine\'s Canterbury and to have remained there when Leland saw it in the sixteenth century (Carley, \'Two Pre-Conquest Manuscripts\' (1987), pp. 202-03;Joannis Lelandi, ed. T. Hearne (1774) iv, pp. 7-8).Later medieval glosses throughout.Patrick Young (b. 1584, d. 1652), librarian and scholar: glossed throughout; collated with Royal 15 A XVI (see note on Royal 15 A XVI, f. 59v).Thomas Howard, 14th earl of Arundel, 4th earl of Surrey, and 1st earl of Norfolk (b. 1585, d. 1646), art collector and politician: probably to be identified with a manuscript in his possession collated with Royal 15 A XVI, and mentioned in a note by Patrick Young, reading \'hunc librum / collatum esse ad ms / codicem co/mitis Arun/dell\' (Royal 15 A XVI, f. 59v).An old number \'109\' (f. 1).The Old Royal Library (the English Royal Library): Royal seal of a ship, 17th century (f. 2); included in the 1698 catalogue of the library of St James\'s Palace (see [Bernard],Catalogi librorum, no. 8660).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','1 parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100058099710.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058099712.0x000001/full/151,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106736',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(99,1,'Royal MS 12 D IV','Royal','1st half of the 12th century',1100,1149,'Contents:This manuscript consists of a calendar followed by computus tables and works related to the reckoning of time: Helperic of Auxerre,De computo, Bede the Venerable,De temporum rationeand Bede the Venerable,Epistola ad Wicthedum de aequinoctio vel de paschae celebratione.Helperic\'s treatise on the computus derives from the second family of manuscripts of this text, which was produced after the Conquest (1066) and has some Norman connections, according to McGurk, \'Computus Helperici\' (1974).This manuscript was perhaps the exemplar from which Royal MS 12 F II was copied, see Sharpe and Willoughby,Medieval Libraries of Great Britain(2015).Contents:ff. 4v-15r: A calendar with computus material (ff. 11r-15r); it does not include saints\' feasts.ff. 17r-35v: Helperic of Auxerre,De computo(On the computus), preceded by a prologue (ff. 17r-v) andcapitula(ff. 17v-18r); beginning of the prologue: \'Incipit prologus Albrici de compoto Lune. Cum fratribus adolescentioribus nostris quedam ca...','Origin: Canterbury, Southeastern England.Provenance:The Benedictine cathedral priory of Christ Church, Canterbury: its pressmark, \'Beda de temporibus novus. D. iii. G. ii.\' (f. 2r); a 13th-century title \'Beda de temporibus\' (f. 1r); a 13th-century table of contents \'Hec continentur in hoc volumine, .b. Albericus de compoto lune/ .a. Kalendarium et tabule/ Beda de temporibus/ Epistola Bede de equinoctio\' (f. 3v).John Childerley (b. 1565, d. 1645), scholar of St John\'s College, Oxford, clergyman and preacher to the English Merchant Adventurers: inscribed: \'Liber Ioannis Childerley collegii divi Ioannis Oxonie socii\' (f. 2r).John Theyer (bap. 1598, d. 1673), antiquary: his inscription \'Liber Joh[ann]is Theyer Jun[ioris] and a pressmark \'25\' (f. 2r); his inscription \'Lib[er] Ioh[ann]is Theyer de Cowpershill iuxta Glauc\'\' (f. 4r); inscription in his hand about the Copernican system and William Gilbert (d. 1603), natural philosopher and physician, \'Stare negas terra[m], nobis miracula narras\' (f. 2r); collated Bede\'s works in margins with the Basel edition of 1563; wrote a table of contents related to Bede\'sDe temporum ratione(f. 131r); wrote the old foliation throughout; included in the catalogue of his library left to his grandson Charles Theyer (b. 1651): see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae, 3 vols. (Oxford: Sheldonian, \'1697\', but 1698?), II, no. 6474.Robert Scott (b. c. 1632, d. 1709/10), London bookseller: included in the catalogue of John Theyer’s manuscripts in his possession, made in 1678 by William Beveridge and William Jane, Royal Appendix, 70, no. 122.Charles II (b. 1630, d.1685), king of England, Scotland, and Ireland: purchased from Scott together with another 311 manuscripts from Theyer\'s library.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100065008040.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100065008042.0x000001/full/160,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106741',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(100,1,'Royal MS 12 D XVII','Royal','mid-10th century',940,955,'This manuscript contains texts pertaining to medical remedies, diagnoses, charms, and a prognostic text about the Dog Days (ff. 54v-55v). The text is divided by tables of contents into three books. According to a Latin colophon, the first two books were compiled for a certain Bald by Cild (f. 109r). This colophon probably refers to an exemplar of the current manuscript. The third book, sometimes known as \'Leechbook III\', appears to have been copied from a separate exemplar, and some of its contents overlap with the first two books.The manuscript contains:ff. 1r-6v: Table of Contents to Book I;ff. 6v-58v: Book I;f. 49r: remedy added in the margin in the 11th century;ff. 58v-64v: Table of Contents to Book II;ff. 65r-108v: Book II;ff. 109r-111r: Table of Contents to Book III;ff. 111r-127r: Leechbook III (ends imperfectly).','Origin: ? Winchester, mid-10th century: written by same scribe as the copyist of the Old English Bede in Cotton MS Otho B XI and as a scribe of the third batch of entries in the A version of the Anglo-Saxon Chronicle in Cambridge, Corpus Christi College, MS 173, who copied the annals from 924 to 946 and year numbers to 955 (Ganz, \'Square Minuscule\' (2012), p. 189). A six-line verse colophon between book II and book III states that \'Bald habet hund [hunc] libru[m] cild que[m] conscribere iussit\' (\'Bald owns this book, which he ordered Cild to write/compile\'), (f. 109r). Bald probably owned an exemplar of parts of this manuscript; the colophon probably does not refer to the present manuscript.Provenance:Added Latin inscriptions and musical notation, 12th or 13th century (e.g., f. 125v).Strip of binding, inscribed \'Medicinale anglicum\' in a 13th century hand (f. i).The Old Royal Library (the English Royal Library): Westminster inventory number \'no. 139 \', (f. 1) and included in the inventory of books in the Upper Library at Westminster of 1542 (f.26).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','1 parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100101103280.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100101103282.0x000001/full/151,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106754',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(101,1,'Royal MS 12 E XX','Royal','1st half of the 12th century',1100,1149,'Contents:ff. 1r-32r: A commentary on Hippocrates,Aphorismattributed to Aptalio and based on an early translation of Hippocrates\'s work dating to the 6th century, beginning: \'Incipit expositio Aptalionis in .vii. libros Aforismorum Ypocratis. Vita brevis ars autem prolixa, tempus vero velox\'.ff. 33r-111v: An anonymous compilation known as \'pre-Gariopontean ensemble\' according to Langslow,The Latin Alexander(2006), pp. 94-95. It includes the two books of Galen,De arte curativaad Glauconem(Therapeutics to Glaucon),preceded by the prologue (ff. 33r-35v), Book 1 (ff. 35v-56r), preceded bycapitula(f. 35v), Book 2 (ff. 56r-68r) preceded bycapitula(ff. 56r-v); Pseudo-Galen,Ad Glauconem liber tertius(ff. 68r-82r), preceded bycapitula(ff. 68r-v);Liber Aurelii(ff. 82r-90v), an anonymous early epitome of the work of Caelius Aurelianus on acute illnesses, titled here asAd Glauconem liber quartuspreceded bycapitula(ff. 82r-v);Liber Esculapii(ff. 90v-107r), an anonymous epitome of the work of Cael...','Origin: ?Canterbury or Rochester, Southeastern England.Provenance:?The Benedictine cathedral priory of Christ Church, Canterbury: its style of decoration, according to Boase,English Art(1957), pp. 44, 63.?The cathedral priory of St Andrew, Rochester: its style of decoration, according to Dodwell,The Canterbury School(1954), p. 74.Added, charms including one with Old-English words written by a contemporary 12th-century hand (f. 162v).Added, notes and annotations written by a late 12th-century hand throughout (e. g., ff. 40v, 73r).Added pen trial in the margins (ff. 110v-111r).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056059358.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056059360.0x000001/full/162,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106774',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(102,1,'Royal MS 13 A X','Royal','10th century-12th century',900,1199,'Contents:This manuscript consists of two parts (ff. 1-62; 63-103) probably bound together in the early modern period (see Provenance).Part one is from the 4th quarter of 12th century.ff. 1r-53r:Vita SanctiJohannis Eleemosynarii(Life of St Johannes Eleemosynarius).ff. 53r-55v:Passio Sancti Albani(Passion of St Alban).ff. 55v-61v:Vita Sancti Runwoldi(Life of St Runwold).Part 2 is from 2nd half of the 10th century.ff. 63r-98r: Bili of Aleth,Vita Sancti Machuti(Life of St Malo).ff. 98r-103v:Homelia in natale Sancti Machutis(Homily for the feast of St Malo).ff. 104r-107v: Eutropius,Breviarium Historiae Romanae(imperfect).','Origin: England.Provenance:John Lumley, 1st baron Lumley (b. c. 1533, d. 1609), collector and conspirator: inscribed with his name (ff. 1r, 63r); listed in the 1609 catalogue of his collection, nos. 1299, 1506 (seeThe Lumley Library,(1956)); passed to Henry, prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library.The Old Royal Library (the English Royal Library): in the catalogue of 1666, Royal Appendix 71 (ff. 18, 18v) and in the 1698 catalogue of the library of St James’s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae, 3 vols (Oxford: Sheldonian, \'1697\', but 1698?), II, nos. 7921, 8267 and 8255).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100059911176.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059911178.0x000001/full/145,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106822',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(103,1,'Royal MS 13 A XI','Royal','11th century-12th century',1000,1199,'Contents:ff. 1r-12v: Helperic of Auxerre,Computuspreceded by a prologue (f. 1r) andcapitula(f. 1v).ff. 12v-13r:Dies Egyptiaci(Egyptian days).ff. 13r-14r: Computus material includingCiclus annalis, De horis mensiumandDe singulis horis in die quomodo mensurantur cum pedibuswith a table of moveable feasts (f. 13r) and anorologiumdiagram.ff. 14r-28r: Bede the Venerable,De natura rerum(ff. 14r-22r) followed by Bede,De temporibus(ff. 22r-28r).ff. 28r-29v:Epistola Petosiris de sphera vite et mortis(Sphere of the life and death), beginning: \'Pitoris (sic) Necnepso regi salutem. De his que a me ad humane vite\' followed by tables (ff. 28v-29r) and two circular diagrams (f. 29v).ff. 30v-103v: Bede the Venerable,De temporum rationepreceded by a prologue (ff. 30v-31r).ff. 104r- 105r: Pseudo-Hyginus,Excerptum de astrologia(an abstract of the Aratus Latinus).ff. 105v-113r: Abbo of Fleury,Excerptio Abbonis ex Hygino de figuratione signorum.ff. 113r-115v: Abbo of Fleury,De differentia circule et sph...','Origin: Northern France or Central France or England.Provenance:Added leaf (trimmed) containing a fragment of a register of letters [Close Roll ?] of Edward I (b. 1239, d. 1307), king of England and lord of Ireland, and duke of Aquitaine, for March 1301 beginning on the verso and including: letters to the sheriffs of Oxford and Worcester concerning provisions for the royal household for the king\'s coming to Woodstock [and Evesham], written at Medborne, 8 March; a letter to the bishop of Lincoln, repeating a former request sent by Hue de Val-Laumosnier, signed at Ockham, 8 March; a letter to John de Tingewyke, keeper of Whittlewood forest, written at Medborne, 9 March; a letter to Gautier de Beauchamp, \'seneschal\', perhaps to be identified with Guy de Beauchamp, 10th earl of Warwick (b. c. 1272, d. 1315), written at Harrington, 9 March; a letter to the \'Official deuerwike\' [York], in favour of his chaplain Gilbert de Grim[esby] recommending him for the \'chancerye a Bercleye\' resigned by William de Hameltone [date cut away]; a letter asking to prepare a manor of Woodstock for the king, signed on Friday, 17 March; a letter to Alice [widow of John] de Montfort concerning her case against the executors of William de Beauchamp, 9th earl of Warwick (b. 1238, d. 1298), written at Northampton, 10 March; a letter to the sheriff of Leicester concerning payments for goods supplied for the royal household, written at Northampton, 10 March; a letter to Edward his son, requesting him to give the church of Bangor in the diocese of Chester, vacant by the death of [Da]vid de la Poele, to William de la Poele, written at Northampton, 10 March; a letter to all sheriffs, etc., in favour of Wautier (Walter) de Canterbury, \'vadlet de nostre botillerie\', ordered to procure wine and beer for the royal household [date excised], 14th century (ff. 150r-150v).Inscribed \'Ja. Bonin\', 14th century (f. 145v).Inscribed \'De libris J. de Longolio\', 15th century (f. 149v).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056059709.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056059711.0x000001/full/137,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106823',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(104,1,'Royal MS 13 A XV','Royal','3rd quarter of 10th century',950,974,'This manuscript contains Felix\'s life of St Guthlac (Bibliotheca Hagiographica Latina3723) without its prologue. Latin and Old English glosses and corrections were added later, in the 11th century.Decoration: Large initials throughout.','Origin: Southern England (? Worcester Cathedral or the Benedictine abbey of Ramsey), mid- to late 10th century: the body of the text was written by two scribes, one who wrote in Caroline minuscule and one who wrote in Anglo-Saxon vernacular minuscule (ff. 1r-8v, 36r-38v). The Anglo-Saxon vernacular text may have been written after the Caroline minuscule: ff. 36-38 may have been inserted into the manuscript after the main text was written, and the writer of these folios may have spaced out his words to ensure that the end of his text matched up with the start of the Caroline minuscule text on f. 39r (see Colgrave,Felix\'s Life(1956), p. 29). The scribe of the Caroline minuscule is perhaps the same as the scribe of Royal MS 8 B XI and Worcester, Cathedral Library, F.91 (see Dumville,English Caroline Script(1993), p. 54).Provenance:11th century: Latin and Old English glosses and corrections added.John Dee (1527-1609), mathematician, astrologer, and antiquary: the astronomical symbol of Jupiter, associated with manuscripts in his collection, inscribed (f. 1r).John Lumley, 1st baron Lumley (b. c. 1533, d. 1609), collector and conspirator: his name was inscribed and erased (f.1r); perhaps listed in the 1609 catalogue of his collection, f. 253 (see The Lumley Library, 1956); passed to Henry, prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library.The Old Royal Library (the English Royal Library): included in the catalogue of 1666, Royal Appendix 71, (f. 6v) and in the 1698 catalogue of the library of St James’s Palace (see Bernard,Catalogi(\'1697\'), II, no. 8099).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','1 parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100101103286.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100101103288.0x000001/full/149,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106827',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(105,1,'Royal MS 13 A XXII','Royal','4th quarter of the 11th century',1075,1099,'Contents:This manuscript consists of theHistoria Langobardorum(History of the Lombards) by Paul the Deacon (d. 799) followed by an excerpt from the Frechulf of Lisieux\'s Chronicle describing the Ethiopian conquest including Moses\'s birth, and a poem relating to the preservation of the Benedictine abbey of St Bertin, St Omer. The scribe who copied the main part of the manuscript (ff. 2v-71r) may have written Royal MS 13 A XXIII (Mauritius, a monk of the abbey of Mont Saint-Michel), according to Alexander,Norman illumination(1970).ff. 2r-69r: Paul the Deacon,Historia Langobardorum,in six books with marginal glosses written by an early 12th-century scribe. Book 1 (ff. 2r-13r), preceded bycapitula(ff. 2r-v), beginning: \'Septemtriunalis plaga quanto magis ab estu solis remota est\'; Book 2 (ff. 13r-21v), preceded bycapitula(ff. 13r-v), beginning: \'Igitur cum circum quaque frequentes Langobardorum victorie personarent\'; Book 3 (ff. 21v-31v), preceded bycapitula(ff. 21v-22r), beginning: \'Ig...','Origin: Mont Saint-Michel, Western France.Provenance:The Benedictine abbey of Mont Saint-Michel, Normandy, France: written by Mauritius, a monk of the abbey, who signed a part of Avranches MS 58, (ff. 2v-71r), according to Alexander,Norman illumination(1970), pp. 78-79.The Benedictine abbey of St Augustine, Canterbury: early 14th-century title to which has been added a contemporary owner inscription, \'Historia Longobardor[um], Liber Sancti Aug[ustini] Can[tuariensis], cum. A\' (f. 1v); a 15th-century press-mark \'Di. x. Gra. ii\' (f. 1v); cited in its 15th-century catalogue (see Ker,Medieval Libraries of Great Britain(1964)).The Old Royal Library (the English Royal Library): Westminster inventory number \'no. 1136\' (f. 2r), present in the Upper Library at Westminster after the inventory of 1542; in the catalogue of 1666, Royal Appendix 71, f. 20 and in the 1698 catalogue of the library of St James\'s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\', but 1698?), no. 8351.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056060355.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056060358.0x000001/full/156,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106834',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(106,1,'Royal MS 13 A XXIII','Royal','4th quarter of the 11th century',1075,1099,'Contents:This manuscript contains a chronicle written by Ado of Vienne (d. 874), archbishop of Vienne, focusing on the relationships between Frankish kings and Bavarians. It also includes lists of emperors and dukes of Normandy in addition to a genealogy of Frankish kings. This manuscript may have been the exemplar of Cambridge, Corpus Christi College MS 290 containing Ado\'s Chronicle, according to Ker,Medieval Libraries of Great Britain(1964).ff. 1v-94v: Ado of Vienne,Chronicon sive Breviarium de sex mundi aetatibus,beginning: \'Incipit Chronicon Odonis Abbatis. Breves temporum per generationes et regna\', ending: \'adversa primum molestatus et de honestatus iniuria moritur\'.ff. 94v-96r: A list of Roman emperors from West and East, from Augustus (reigned from 27 BC to 14 AD) to Constantine V (reigned from 741 to 775).ff. 96r-v: A list of dukes of Normandy, from Rollo (d. c. 930) to Richard III of Normandy (d. 1028), including entries relating to the founding of Mont Saint-Michel Abbey...','Origin: Mont Saint-Michel, Western France.Provenance:The Benedictine abbey of Mont Saint-Michel, Normandy, France: entries related to it in the list of the dukes of Normandy (ff. 96r-v); typical Mont Saint-Michel decoration (see Alexander,Norman Illumination at Mont St Michel 966-1100(1970)).The Benedictine abbey of St Augustine, Canterbury: added corrections by an English scribe, c. 1100; title and ownership inscription written by a 14th-century hand, \'Cronica Odonis Abbatis de librario Sancti Augustini [Canterbury], cum. A\' (f. 1r); medieval press mark: \'D. x. Gra. p[rimo]\' (f. 1r); cited in its 15th-century catalogue (see Sharpe and Willoughby,Medieval Libraries of Great Britain(2015) http://mlgb3.bodleian.ox.ac.uk/mlgb/book/1542/?search_term=Royal%2013%20A.xxiii&page_size=500 [accessed 29 September 2016]); ? fragments of a work on scholastic theology from the 13th century are inscribed on the flyleaves, which were used as pastedowns (ff. [101], [102]); a chain mark (f. [101]) suggesting that the manuscript was chained in a library.The Old Royal Library (the English Royal Library): Westminster inventory number \'no. 1004\' (f. 1), acquired by the Upper Library at Westminster after the inventory of 1542; in the catalogue of 1666, Royal Appendix 71, f. 19v and in the 1698 catalogue of the library of St James\'s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\', but 1698?), no. 8349).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A Parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056060626.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056060628.0x000001/full/154,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106835',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(107,1,'Royal MS 13 C V','Royal','11th century',1000,1099,'This manuscript contains a copy of Bede,Historia Ecclesiastica Gentis Anglorum. It is missing the final leaf of the text. Folios 1-2 are mid-11th century supply leaves. Folio 225 is a later medieval flyleaf, formed of a fragment which includes part of 2 Kings, starting at 2 Kings 23:3.Decoration: initials in red and black (throughout); numbers in red (throughout); initials in red and green (f. 225r-v); sketch of a pot or goblet (f. 115r); sketch of an animal (f. 168r).','Origin: England (? Worcester): This manuscript may have been written by the same scribe as Corpus Christi College, MS 448, part II (see Bishop,English Caroline(1971), p. 20 n. 1).Provenance:Later medieval annotations throughout.The Benedictine abbey of St Peter, Gloucester: inscribed \'Liber monasterii S. Petri Glouc.\' (f. 2r).Peter Hanley (d. 1472), abbot of St Peter\'s, Gloucester: inscribed \'per Richardum Hanley abbatem\' (f. 1r).Added ? 16th century note on Bede (f. 1r).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English','1 parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100058107491.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058107493.0x000001/full/146,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106861',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(108,1,'Royal MS 13 D IX','Royal','3rd quarter of the 14th century',1350,1374,'This manuscript contains a copy of the collection of saints’ lives known as theSanctilogiumorSpeculum legendarum, thatGui de Châtres, abbot of the Benedictine abbey of Saint-Denis (1326-1342), compiled around 1320 by extending Usuard’sMartyrologiumwith materials from theLegenda aureaof Jacobus de Voragine and theSpeculum historialeof Vincent of Beauvais. Gui organised it according to the liturgical year for usage at his monastery. The work consists of twelve books with materials for feast days of saints organised by month, with a thirteenth book with additional saints lives, and a fourteenth book with feasts of the temporal cycle. Gui separated the sanctoral and temporal cycles in theLegenda aureaandSpeculum historialein order to create a work that was more practical for liturgical use. This copy of theSanctilogiumwas perhaps produced at the Benedictine abbey of St Albans, but certainly donated by its abbot John Whethamstede (1420-40 and 1452-64) to Redbourn Priory, a nearby situate...','Origins: England, S. (St Albans?).Provenance:The Benedictine abbey of St Albans: Donated by John Whethamstede, abbot of St Albans, to Redbourn Priory, first half of the 15thcentury: ex dono inscription (f. 1v): \'Hunc librum providit venerabilis / pater dompnus Joh[ann]es Wheth[a]mstede / abbas monasterii s[an]c[t]i Albani sacre theo/logie professor prioratui Redburne et / monachis ibidem cursum capientib[us]/ Quem qui alienaverit anathema sit\'; with the title \'Sacrilogiu[m] guidonis abb[at]is sive / speculu[m] legandar[um]\' (f. 1v).The Benedictine priory of Redboun, first half of the 15thcentury: above-cited inscription.The Old Royal Library (the English Royal Library): Westminster inventory number \'no. 846\' (f. 3r), included in the inventory of books in the Upper Library at Westminster of 1542; in the select list of works noted by John Bale, c. 1548, no. 92; in the catalogue of 1666, Royal Appendix 71, f. 18r; and in the 1698 catalogue of the library of St James\'s Palace (see Edward Bernard,Catalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, 1697), no. 8244).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','Parchment manuscript','https://bl.digirati.io/iiif/ark:/81055/vdc_100165176225.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165700904.0x0002cb/full/157,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106881',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(109,1,'Royal MS 13 D VI','Royal','2nd quarter of the 12th century',1125,1149,'This manuscript is the first volume of a two volume-set containing Flavius Josephus (b. 37, d. c. 98)\'sAntiquitates Iudicae(Antiquities of the Jews). It is preceded by an excerpt on Flavius Josephus from St Jerome (b. c. 347, d. 420)\'sDe viris illustribus(On Illustrious Men). The second volume is Royal MS 13 D VII and contains the last books (books 15-20) of theAntiquitates Iudicaeand also includes Josephus\'sDe bello iudaico(On the Jewish War). The manuscript was written by Scribe A of the Benedictine abbey of St Albans between c. 1120-1140 (see Thomson,Manuscripts from St Albans Abbey(1983), no. 37).Contents:f. 1r: Excerpt on Josephus Flavius from St Jerome,De virisillustribus,beginning: \'Josephus Mathie filius ex Ierosolimis sacerdos, a Vespasiano captus\', ending: \'et usque hodie Christianorum gens ab hoc sortita vocabulum non deficit\'.ff. 1r-218v: Josephus Flavius,Antiquitates iudaicae(Books 1-14), preceded by a prologue (ff. 1r-2r). The prologue, beginning (f. 1r): \'Prologus inc...','Origin: St Albans, Eastern England.Provenance:The Benedictine abbey of St Alban, St Albans, founded in 793: its 13th-century ownership inscription with anathema in red ink, \'Hic est liber Sancti Albani quem qui ei abstulerit aut titulum deleverit anathema sit. Amen\'.The Old Royal Library (the English Royal Library): Westminster inventory number \'no. 1158\' (f. 1r), acquired by the Upper Library at Westminster after the inventory of 1542; in the catalogue of 1666, Royal Appendix 71, f. 17v; and in the 1698 catalogue of the library of St James’s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\', but 1698?), no. 8337).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056060931.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056060933.0x000001/full/151,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106878',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(110,1,'Royal MS 13 D VII','Royal','2nd quarter of the 12th century',1125,1149,'Contents:This manuscript is the second volume of a two volume-set containing Josephus Flavius\'sAntiquitates Iudicae.The first volume is Royal MS 13 D VI and contains books 1-14 of the work written by Josephus. This manuscript consists of the last books, 15-20, and includes Josephus\'sDe Bello Iudaico.It is one of the eight manuscripts in Thomson\'s group I dated by him to c. 1120-1140 (see Thomson,Manuscripts from St Albans Abbey(1983), no. 37). According to Thomson, it was written by scribe A working at St Albans at that time. Other manuscripts attributed to this scribe are: Oxford, Bodleian Library, Bodley 752 and Oxford, Christ Church 115.Contents:f. 1*v: In the lower margin has been added in red and green interlocked letters: \'Incipiunt Capitula quinti decimi libri antiquitatis Iudaicae historiarum\'.ff. 1r-83r: Josephus Flavius,Antiquitates iudaicae, books 15-20. Each book is preceded bycapitula,beginning: \'Tempus annorum decem et octo. Sosius quidem et Herodes qualiter Ierusolima...','Origin: St Albans, Eastern England.Provenance:Added, late 12th-century marginal guides (from f. 85v, throughout).The Benedictine abbey of St Albans: early 13th-century ownership inscription with anathema, \'Hic est liber sancti Albani quem qui ei abstulerit vel fraudem commiserit aut titulum deleverit anathema sit. Amen\' (f. 1r).Thomas Wolsey (b. 1470/71, d. 1530), royal minister, archbishop of York, and cardinal: 16th-century \'TC\' monogram, perhaps for Thomas Cardinalis (see Carley,The Libraries of King Henry VIII(2000), p. xxxiii) (f. 1r).The Old Royal Library (the English Royal Library): Westminster inventory number \'no. 394\' (f. 1r), included in the inventory of books in the Upper Library at Westminster of 1542; in the catalogue of 1666, Royal Appendix 71, f. 7v; and in the 1698 catalogue of the library of St James’s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\', but 1698?), no. 8338).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100056061197.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100056061199.0x000001/full/141,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106879',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(111,1,'Royal MS 14 B III','Royal','1553-1578',1553,1578,'A roll of maxims about pride, created for Jane Lumley (1537-78), Baroness Lumley, daughter of Henry FitzAlan (1512-80), 19th earl of Arundel. Monograms JOANNA LVMLEIA.Dated to between Jane’s marriage to John Lumley (d. 1609), 1st Baron Lumley, by 1553 and her death in 1578.A similar roll, possibly in the same hand, was made for Jane\'s father, Henry FitzAlan, earl of Arundel, and is Royal MS 14 B II.Decoration:Decorated capitals in red, gold, teal and purple.Gold headings.Red, teal and yellow pen flourishes.','Origin:England.Provenance:Jane Lumley, Baroness Lumley, between 1537 and 1578.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English','1 roll','https://bl.digirati.io/iiif/ark:/81055/vdc_100176155473.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100178532573.0x000001/full/61,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106920',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(112,1,'Royal MS 14 B VI','Royal','c 1300-c 1340',1295,1345,'Contents: A roll chronicle containing the genealogy of the Kings of England from the Heptarchy to Edward I (b. 1239, d. 1307), king of England from 1272, in the form of a diagram of interconnected roundels with royal portraits in colours and gold, and an accompanying commentary. Incipit: \'Par ceste figure desuz len puit savoir\'; explicit \'en lan de grace m. e. (sc. et) cc. (sic) e si fu entere a Westmoster\'. Includes an addition of roundels drawn in pen of Edward II (b. 1284, d. 1327), king of England from 1308, and Edward III (b. 1312, d. 1377), king of England from 1327, with a record of his declaration as the rightful heir to the French throne in 1340; incipit: \'La mere ceti Edward\'; explicit: \'quatrona ses armes\'.Face of the roll:Membrane 1: The Heptarchy and the royal genealogy from Egbert to Alfred.Membrane 2: The royal genealogy from Æthelred to Edmund I.Membrane 3: The royal genealogy from Ædred to Æthelred II.Membrane 4: The royal genealogy from Edmund II to Harthacnut.Memb...','Origin: England (East Anglia?).Provenance:Added text and outlined drawings of a continuation of the chronicle from Edward II to Edward III, ending with Edward III\'s declaration as the king of France in 1340: \'Edward se fit apelez roy / de f[r]a[n]ce et dangleterr[e] et q[ua]trona ses armes\'.Henry VIII (b. 1491, d. 1547), king of England and Ireland, perhaps to be identified with the \'Le role des roys d\'Angleterre\', or \'Rotulus regum Anglie\', in the list of books at Richmond Palace of 1535, no. 15 or 17.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Anglo-NormanFrench','1 roll','https://bl.digirati.io/iiif/ark:/81055/vdc_100161518345.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100162142984.0x000001/full/110,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106925',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(113,1,'Royal MS 14 B XIX','Royal','1525-1526',1525,1526,'This roll contains the household expenses of Princess Mary (the future Mary I, r. 1552-1558), daughter of King Henry VIII (r. 1509-1547) and Catherine of Aragon (b. 1485, d. 1536). The account covers a one-and-a-half-year period from 1 July 1525 to 31 December 1526 (17 and 18 Henry VIII), when Mary was nine or ten years old.The roll includes the payments made by Peter Burnell, Treasurer of the Chamber, to the princess’ almoner, to cover her oblations, the expenses of her councillors on commissions beyond the court, the expenses of messengers and apparel of footmen, as well as expenditure on cloth, velvet and other items for the wardrobe. It also records the wages and fees of councillors, the payments made on buildings and repairs at Ludlow and Bewdley in the manor of Tyknell (Wales), and the wages of the Mary\'s female companions, Mistress Anne Rede, Mary Victorin, Mary Danet and Mary Fitzharberte. The payments made by the Treasurer amounted to a total of £1192 6s. 5d.The roll also c...','Origin:England.Provenance:Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English','1 roll','https://bl.digirati.io/iiif/ark:/81055/vdc_100177688887.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100178261484.0x000001/full/111,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106938',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(114,1,'Royal MS 14 B XXVI','Royal','1525-1526',1525,1526,'The roll contains the household expenses of Princess Mary (the future Mary I, r. 1552-1558), daughter of King Henry VIII (r. 1509-1547) and Catherine of Aragon (b. 1485, d. 1536). The account lists the expenses of several household departments, comparing the expenditure made in October and other months (now lost) of 1525 with the expenses made during the same period in 1526 (17 and 18 Henry VIII), when Mary was nine years old.The expenses are listed according to the different departments of Mary\'s household, including: the cellar and buttery, the spicery, the acatery and kitchen, the poultry, the scullery, the saucery and pastry, the woodyard and the stable. It also includes a section on the payments of wages of gentlemen and yeomen. The items bought for Mary’s household included wine, ashen cups, empty pipes, wax, spice, linen, meat, fish, pasture, coals, herbs and wood.In total, the expenditure of Princess Mary’s household in October (and other months) of the 17th year of Henry VI...','Origin:England.Provenance:Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English','1 roll','https://bl.digirati.io/iiif/ark:/81055/vdc_100177810226.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100178257973.0x000001/full/115,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002106949',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(115,1,'Royal MS 14 E II','Royal','1473-1483',1473,1483,'Contents:ff. 1r-294v: Jean de Courcy,Le chemin de Vaillance, beginning: \'La glorieuse trinite Trois persones en vnite\', ending: \'Pardonnez moy car ie songoye\'.ff. 295r-331v: Christine de Pisan,L\'Epistre Othea,beginning: \'Othea, deesse deprudence, Quy les bons adresse en vaillance\'.ff. 332r-335v: Alain Chartier,Le breviaire des nobles.\'Cy commence le breviaire des nobles\', beginning: \'[J]e Noblesse, dame de bon vouloir, Royne des preux, princesse des haulz fais\'.ff. 335v-337r:Les complaintes des IX malheureux et des IX malheureuses.Beginning: \'[V]ous quy voulez par ce present arroy scavoir le cas des malheureux humains\'.ff. 338r-354r: Ramón Lull,Libre del Orde de cavayleriain an anonymous French translation, beginning: \'Cy commence le livre de lordre de chevallerie\'.Decoration:4 large miniatures in colours and gold, with full borders, at the beginning of books (f. 1r, 77r, 194r, 250r). 10 smaller miniatures in colours and gold, with partial borders (ff. 30r, 51v, 103v, 123r, 133r, 14...','Origin: Netherlands, Bruges.Provenance:Edward IV (b. 1442, d. 1483), king of England and lord of Ireland: the royal arms of England surmounted by a crowned helm with mantling in Edward\'s colours of red and blue, surrounded by the Garter (ff. 1r, 77r, 194r, 250r), with two escutcheons bearing the royal arms differenced by labels of three or five points for his sons (f. 1), and a lozenge bearing a white rose of the York family, with a Yorkist badge \'Dieu et mon droit\' (ff. 1r, 30r, 77r, 103v, 145r, 163v, 194r, 218r, 250r, 295)r; made for him in the Southern Netherlands, probably c. 1479- c. 1480: record of payment to the foreign merchant Philip Maisertuell for books and record of books in the Great Wardrobe Accounts of 1480 (see McKendrick,The Romuléon and the Manuscripts of Edward IV, 1994).The Old Royal Library (the English Royal Library): included in the list of books at Richmond Palace of 1535, no. 26; and in the Catalogue of 1666, Royal Appendix 71, f. 13, as \'31.2. Chemin de Vaillance en vers. Traittié Oth[ea] avec Gloses. Breviaire des Nobles. Chevalerie\'.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','French, Middle','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100057740420.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057740422.0x000001/full/145,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107003',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(116,1,'Royal MS 15 A II','Royal','3rd quarter of the 16th century',1550,1574,'This manuscript contains a copy ofEvagoras, one of theOrationesof the Ancient Greek rhetorician Isocrates (b. 436, d. 338 BC), in a Latin translation composed by Jane Lumley (b. 1537, d. 1578), Baroness Lumley and written in her own hand. The manuscript is a presentation copy, described in Lumley\'s dedicatory epistle as a New Year\'s gift for her father Henry FitzAlan (b. 1512, d. 1580), 19th Earl of Arundel.Other extant translations completed by Jane Lumley include a copy of Isocrates’Archidamus(now Royal MS 15 A I) and her commonplace book, also written in her hand and containing translations of Isocrates’ other Orationes and Euripides’ playIphigenia at Aulis(now Royal MS 15 A IX).Contents:ff. 1r-3r: A dedicatory epistle from Jane Lumley to her father Henry FitzAlan, 19th Earl of Arundel, written in Latin, beginning, \'Cicero pater honoratissime illustris orator...\'ff. 4r-31r: Isocrates,Evagoras, translated from Greek into Latin by Jane Lumley, beginning, \'Quum videbam te, O Nicocle...','Origin:England.Provenance:Jane Lumley (b. 1537, d. 1578), Baroness Lumley: written by her and intended as a New Year\'s gift for her father Henry FitzAlan (b. 1512, d. 1580), 12th Earl of Arundel, as explained in the dedicatory epistle (ff. 1r-3r); completed after her marriage to John Lumley (c. 1550), as the title uses her married name, Euagoras oratio quarta Isocratis ad Nicoclem regem Cypri versa e graecis in Latina per Dominam Lumleyam\' (f.. 4r); formed part of her father\'s collection before it became part of the Lumley Library.John Lumley (b. c. 1533, d. 1609), 1st Baron Lumley, collector and conspirator: listed in the 1609 catalogue of his collection, no. 1743 (seeCatalogue of the Library of John Lumley(1956), p. 206); his library acquired by Henry Frederick, Prince of Wales.Henry Frederick (b. 1594, d. 1612), Prince of Wales and eldest child of James I: his collection became part of the Royal Library; included in the catalogues of 1661 (Royal Appendix 86, [check]) and 1666 (no. 9 in the \'third press against the chimney\'; Royal Appendix 71, f. 20v) and in the 1698 catalogue of the library of St James\'s Palace (seeCatalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\'), no. 8504).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100172082266.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100172199179.0x00003f/full/174,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107009',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(117,1,'Royal MS 15 A IX','Royal','3rd quarter of the 16th century',1550,1574,'This volume is a commonplace book containing theOrationesof the Ancient Greek rhetorician Isocrates (b. 436, d. 338 BC), in a Latin translation composed by Jane Lumley (b. 1537, d. 1578), Baroness Lumley, and written in her hand. Two of the orations are prefaced by dedicatory epistles to her father, Henry FitzAlan (b. 1512, d. 1580), 19th Earl of Arundel, and were intended as New Year gifts.The manuscript also contains Lumley\'s English translation ofIphigenia at Aulis, by the Greek playwright Euripides (b.c. 480, d.c. 406 BC). The text is the first known dramatic work to be written by a woman in English, and the first known translation of a Classical play into English by any hand.Other extant translations completed by Jane Lumley include copies of Isocrates\'ArchidamusandEvagoras(now Royal MSS A I and II).Contents:f. 1r: An inscription, \'The doinge of my Lady Lumley dowghter to my L. Therle of Arundell\', and the autograph signature of John Lumley (b.c. 1533, d. 1609), 1st Baron Lumle...','Origin:England.Provenance:Jane Lumley (b. 1537, d. 1578), Baroness Lumley: inscribed, \'The doinge of my Lady Lumley dowghter to my L. Therle of Arundell\' (f. 1r); the manuscript written in her hand and featuring dedicatory epistles to her father; completed after her marriage to John Lumley (c.1550),as she signs one of the epistles using her married name, \'Filia tua tibi deditissima / Joanna Lumleya\' (f. 4v); formed part of her father\'s collection before it became part of the Lumley Library.John Lumley (b.c. 1533, d. 1609), 1st Baron Lumley, collector and conspirator: inscribed with his name (f. 1r); listed in the 1609 catalogue of his collection, no. 1920 (seeCatalogue of the Library of John Lumley(1956), p. 222); his library acquired by Henry Frederick, Prince of Wales.Henry Frederick (b. 1594, d. 1612), Prince of Wales and eldest child of James I: his collection became part of the Royal Library; included in the catalogues of 1661 (Royal Appendix 86, f. 28v) and 1666 (Royal Appendix 71, f. 20v), and in the 1698 catalogue of the library of St James\'s Palace (seeCatalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\'), no. 8504).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','EnglishLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100172082348.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100172196026.0x0000d5/full/169,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107016',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(118,1,'Royal MS 15 A VII','Royal','2nd half of the 13th century-1st half of the 14th century',1250,1349,'This manuscript contains a collection of Latin works, probably arranged as part of a school curriculum. They include the unfinished epic poem, theAchilleid, by the Greco-Roman author Publius Papinius Statius (b.c. 45, d.c. 96); a popular collection of proverbial wisdom, known as theCatonis Disticha; Avianus\' collection of LatinFabulae(Fables); the elegies of Maximianus (fl. 6th century); and Claudian\'sDe Raptu Prosperpinae(On the Rape of Proserpina). An added quire at the end of the volume contains the Anglo-LatinRomulus, a fable collection closely connected with the Anglo-Norman French translations of Aesop\'sFablesmade by Marie de France (fl. 1160-1215).Collections of similar medieval school texts include Add MS 10090, Add MS 21213, and Royal MS 15 A XXXI.Contents:ff. 1v-7v:CatonisDisticha(Distichs of Cato), a collection of proverbial wisdom in Latin prose, with interlinear glosses and marginal notes; the preface beginning, \'Cum animaduerterem quam plurimos homines...\'; the text, b...','Origin:England or France.Provenance:The Old Royal Library (the English Royal Library): the Royal seal of a ship, 17th century (f. 1r); listed in the 1698 catalogue of the library of St James’s Palace (seeCatalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\'), nos. 8614, 8615).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100174688006.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100175312648.0x0000a9/full/166,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107014',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(119,1,'Royal MS 15 A XVI','Royal','9th century-10th century',800,999,'Contents:ff. 2r-57r: Juvencus (fl. c. 330),Evangelia(Gospels).ff. 59v-73v: Aldhelm (d. 709), bishop of Sherborne,Enigmata(Riddles), imperfect.f. 73v: An extract from Bede the Venerable (b. c. 673, d. 735),De arte metrica(On the Metrical Art),chapter 25.ff. 74v-83v: Martin the Irishman (b. 819, d. 875),Scholica graecarum glossarum,imperfect.Numerous Latin glosses and two Old English glosses (ff. 73, 76v).','Provenance:This manuscript was probably compiled at the end of the 10th century: two leaves and several lines of part 1 (ff. 7, 59, 67) were lost and replaced by a 10th-century English hand and on the same parchment as the second part (ff. 2r-73v) (see Warner and Gilson,Catalogue of Western Manuscripts in the Old Royal and King’s Collections(1921), p. 146).The Benedictine abbey of St Augustine, Canterbury, founded in 598: possibly in its library during the Anglo-Saxon period (see Dumville, \'English Libraries Before 1066\' (1994), p. 207); in its library in the 13th century and perhaps used as a monastic schoolbook (see Rella, \'Continental manuscripts acquired for English centers\' (1980), p. 112 ); inscribed in a 14th-century hand: \'Liber sancti Augustini Cantu[ariensis]\' (f. 1r); a table of contents written by three different 14th- and 15th-centuries hands \'Juvencus cum A [...] et enigmata Aldelmi/ Scolica glosarum\' (f. 1r); a 14th-century shelfmark D.xi.Gii (f. 1r); included in the late 15th-century library catalogue of the library of St Augustine\'s abbey, no. 1438 (see James,The Ancient Libraries of Canterbury and Dover(1903), no. 1438 and Barker-Benfield,St Augustine\'s Abbey, Canterbury(2008), no. BA I.1438).Patrick Young (b. 1584, d. 1652), librarian and scholar: his notes in margin (ff. 59v-61v): one of his notes refers to another manuscript (Royal 12 C XXIII) collated with this one and owned by the earl of Arundel: \'\'Hunc librum / collatum esse ad ms / codicem co/mitis Arun/dell\' (f. 59v).? Thomas Howard, 14th earl of Arundel, 4th earl of Surrey, and 1st earl of Norfolk (b. 1585, d. 1646), art collector and politician: owned Royal 12 C XXIII collated with this manuscript (see Patrick Young\'s note above).The Old Royal Library (the English Royal Library): seal of a ship (f. 1r) and Westminster inventory number \'no. 413\' (f. 2); included in the inventory of books in the Upper Library at Westminster of 1542 (f. 30r) and in the 1698 catalogue of the library of St James’s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae(Oxford: Sheldonian, \'1697\', but 1698?), no. 8611.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100059911348.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059911350.0x000001/full/151,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107025',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(120,1,'Royal MS 15 B XII','Royal','1st half of the 10th century',900,949,'This manuscript consists of Juvenal\'sSaturae(Satires) with interlinear and marginal glosses (ff. 3r-59v), written in the 1st half of the 10th century in Central France.This volume also includes two flyleaves (ff. 1-2) from another manuscript probably written in Fleury in the last quarter of the 9th century. These two leaves contain a fragment from theCommentarii in Somnium Scipionis(Commentary on Cicero\'sDream of Scipio).Other fragments from this manuscript are: Leyde, Bibliotheek der Rijksuniversiteit MS Vossius Lat. 12β (ff. 24v-26v); Leyde, Bibliotheek der Rijksuniversiteit MS Vossius Lat. F. 122. Macrobe\'s commentary on Cicero\'sDream of Scipiowas formerly preceded by Cicero\'sDe senectute(On Old Age), fragment of which is now Leyde, Bibliotheek der Rijksuniversiteit MS Vossius Lat. 12β, ff. 24v-26v (see Barker-Benfield,The Manuscripts of Macrobius\' Commentary on theSomnium Scipionis(1976) and Bischoff,Katalog(2004)).Contents:ff. 1r-2v: Fragment from Macrobe\'sCommentarii in Somniu...','Origin: ?Fleury, Central France.Provenance:?The Benedictine abbey of Fleury: perhaps acquired from here by François Daniel but not identifiable in the catalogue of 1552.François Daniel of Orleans, baillif of the Benedictine abbey of Fleury and brother of Pierre Daniel (b. 1531, d. 1604), scholar and bibliophile: erased inscription, \'Ex libris Francisci Danielis Aurelii\' (f. 59v), (see Warner and Gilson,Catalogue(1921)); their library acquired by Jacques Bongars in 1604.Jacques Bongars, diplomat and scholar, (b. 1554, d. 1612): inscribed with his name (f. 3r).The Old Royal Library (the English Royal Library): in the catalogue of 1666, Royal Appendix 71, (f. 20) and in the 1698 catalogue of the library of St James’s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae, 3 vols (Oxford: Sheldonian, \'1697\', but 1698?), II, nos 8506, 8507); this manuscript was consulted by Richard Bentley (b. 1662, d. 1742), philologist and classical scholar: a reference to the Leiden 1628-edition written in his hand (f. 1r).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100059472453.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059472455.0x000001/full/133,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107054',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(121,1,'Royal MS 15 B XIX','Royal','10th century-11th century',900,1099,'A composite manuscript of three separate sections not bound together before the 17th century:Contents:ff. 1r-35v: Poems of Sedulius and in praise of Sedulius.ff. 36r-199v: A miscellany of 60 short tracts, in a wide variety of disciplines. Musical settings of the following passages, expressed by neumes: \'Ad boreæ partes\', from \'Versus De Cœlestibus Signis Prisciani,\' lines 1-3, and 5 (f. 125v); \'Decessit autem vitio stomachi\', from \'Vita Persii Flacci.\'( f. 128r). A glossary of Greek words occurring in the prefaces and commentaries of St Jerome for the books of the Old Testament (f. 85v) and the names and shapes of the Greek letters, with the numbers each signifies (f. 126r).ff. 200r-205v: The poems of Symposius and St Boniface.Decoration:See separate parts.','Provenance:The Old Royal Library (the English Royal Library): Royal seal of a ship, 17th century (f. 1r); included in the catalogue of 1666, Royal Appendix 71, (f. 20r) and in the 1698 catalogue of the library of St James’s Palace (see [Edward Bernard],Catalogi librorum manuscriptorum Angliae et Hiberniae,3 vols. (Oxford: Sheldonian, \'1697\', but 1698?), II, nos. 8517, 8613 and 8643).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Greek, AncientLatin','Parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100059911485.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100059911487.0x000001/full/147,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001614761',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(122,1,'Royal MS 15 B XXII','Royal','1st half of the 11th century',1000,1049,'Contents:ff. 2v–3r: Greek numbers and alphabets.ff. 5r–70v: Ælfric, Grammar, ‘Incipit praefatio huius liber.Ego Ælfricus ut minus sapiens has excerptiones … leoðcræfte’ (ends imperfectly). Old English glosses are written interlinear above Latin phrases.f. 71r: Remainder of the text copied in a 16th-century hand.ff. 71v–72r: Fragment of a charter used as flyfleaves, alleging misdemeanours in Sandon, Essex, 1540.Decoration:New sections open with three-line initials in red. Headings in red rustic capitals. First letter of each sentence coloured in red.','Origin: England.Provenance:Matthew Parker (b. 1504, d. 1575), archbishop of Canterbury: inscribed, ‘hic liber scriptus ante conquestum’ (f. 1v) and ‘finis’ (f. 71r), a hand from Parker’s circle in red crayon; inscribed ’Cor. Col.’ [Corpus Christi College, Cambridge] (f. 5r). This manuscript seems to have been used by Archbishop Parker to make a copy to supply the defect in Corpus Christi College MS. 449 (Ker, 1957: no. 71).John Lumley, 1st baron Lumley (b. c.1533, d. 1609), collector and conspirator: inscribed with his name (f. 5); listed in the 1609 catalogue of his collection (see The Lumley Library, 1956); passed to Henry, prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library.The Old Royal Library (the English Royal Library): included in the catalogue of 1666, Royal Appendix 71 (f. 8).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','Parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100101103295.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100101103297.0x000001/full/142,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107064',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(123,1,'Royal MS 15 C VII','Royal','990-1200',990,1200,'This manuscript contains a dossier of liturgical material pertaining to St Swithun, with Latin and Old English glosses. This includes the earliest copies of Lantfred of Fleury\'sTranslatio et Miraculi Sancti Swithuni, an acrostic hymn in honour of St Swithun, Wulfstan Cantor\'s letters to Bishop Ælfheah of Winchester and the brothers of the Old Minster, and Wulfstan Cantor\'sNarratio Metrica de Sancto Swithuno. The majority of the manuscript was probably written at the Old Minster, Winchester, in the 990s or the first years of the eleventh century, very soon after the composition of the texts written by Wulfstan Cantor, who was the precentor at the Old Minster. Marks made in the margin shortly after the manuscript\'s creation seem to indicate readings for services around the feast of St Swithun, and may indicate how this manuscript was used (see, for example, the Roman numerals in the margin of f. 4r; see also Lapidge,Cult(2003), pp. 104-05). In the late eleventh century, three more sho...','Origin: The Old Minster, Winchester, in the late 990s or first years of the eleventh century (see Lapidge,Cult(2003), p. 240): written by a single scribe, with further verses and prose about miracles of St Swithun added at the end of the 11th century or the early 12th century (ff. 124v-126v).Provenance:The Old Minster, Winchester: marks in the margin made shortly after the manuscript was written indicate seem to indicate passages to be used in the liturgy (see, for example, f. 4r; see also Lapidge,Cult(2003), p. 104); remained at Winchester until at least the 16th century (see medieval inscriptions on f. 127v; see also Lapidge,Cult(2003) pp. 70, 175).Thomas Dackombe (d. c. 1572), rector of St Mary Colebrook and minor canon of Winchester Cathedral, in 1566: inscribed \'Libru[m] d[omi]n[i] Thomas dackombis 1566\', (f. 2r); inscribed \'Dakomb\' (f. 1*r, 95r); inscribed list of names ending \'Dackomb\' (f. 1v).Humphrey Llwyd (b. 1527, d. 1568), physician, map maker, and member of Parliament: inscribed \'Humfredus Lloyd\' (f. 2*v).John Lumley, 1st baron Lumley (b. c. 1533, d. 1609), collector and conspirator, Lloyd\'s brother-in-law: inscribed with his name (f. 2r); listed in the 1609 catalogue of his collection, no. 601 (seeThe Lumley Library(1956), p. 91); passed to Henry, prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library; in the 1698 catalogue of the library of St James\'s Palace (see Bernard,Catalogi librorum(\'1697\'), no 8121).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English, OldLatin','1 parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100058101243.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058101245.0x000001/full/155,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107071',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(124,1,'Royal MS 15 C X','Royal','2nd half of 10th century',950,999,'This manuscript contains a brief biographical notice of Statius and Statius\'Thebais.Decoration: gold initials (oxidized to green) of varying sizes and rubrics throughout.  Syntactic marks or glosses using a system of dots and dashes have been used.','Origin: Southern England (Canterbury?), 2nd half of the 10th century: the first half of the manuscript was written by a scribe who also appears in Bibliothèque nationale de France, lat. MS 7585 (see Bishop,English Caroline Minuscule(1971), p. xxv). This manuscript\'s exemplar may have been Bibliothèque nationale de France, Nouv. acq. lat. MS 1627, which may also have been the exemplar for Worcester Cathedral Library, MS Q.8 part ii and Add. MS 7 (see Bishop,English Caroline Minuscule(1971), p. 18).Provenance:The cathedral priory of St. Andrew, Rochester: included in the catalogue of 1202 (no. 197) and inscribed \'lib[er] de claustro Roff[e]n[si] p[er] Gerardu[m] mon[achum]\' (f. i verso).Flyleaf contains farm accounts from Hoo and Halstow, Kent in a 13th-century hand (f. i) .13th-century glosses and annotations throughout.The Old Royal Library (the English Royal Library): Westminster inventory number \'no. 830\'; included in the inventory of books in the Upper Library at Westminster of 1542 (f. 35); a note in the hand of the king\'s librarian, Patrick Young [Junius] (b. 1584, d. 1652) (f. 140) and in the catalogue of the library of St James’s Palace (see Catalogi librorum manuscriptorum Angliae et Hiberniae (Oxford: Sheldonian, \'1697\'), nos. 8605 and 8622.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','Latin','1 parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100058101812.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058101814.0x000001/full/168,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107074',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(125,1,'Royal MS 17 A XVI','Royal','1420',1420,1420,'An almanac, including an astronomical calendar in pictorial form, for 1420, with miscellaneous additions.A similar almanac, dated 1412, is now Harley MS 2332.Contents: f. 1v: Added 15th-century meteorological notes from Christmas to Twelfth Night, in a year in which Christmas fell on Sunday, regarded as forecasting the weather of the next twelve months. Incomplete, ending on 2 January.f. 2r: Added 15th-century diagram in red of the orbits of the sun and moon with estimates of the distance of the planets according to Rabbi Moyses and notes on Arabic numerals.f. 2v: Added 15th-century diagram of the division of the world between Shem, Ham, and Japhethf. 3r: Added 15th-century short text on reasons for fasting on Friday, beginning, \'Oportet nog, fratres, magis\'.f. 3v: Added 15th-century four-line verse, beginning \'It is a wonder, be þe rode, whan too hedys loke in a hode\'.ff. 3v-4v: Added 15th-century verses rhyming ababccbccb on Ave Maria, beginning \'Ave, hayll Marie, full of grace, o...','Origin: Northern England (Yorkshire).Provenance:Inscribed with various names: \'dan Thomas Rowland, priour of [the] monastery\', possibly Luffield, 1487-1494 (f. 31r); And. Jarves (f. 17); Myles Lambregos (?), f. 18; Ales Thomson de Ely (f. 21); Joh. Sumter de Thesauro (f. 24v); Rob. Howell (?) (f. 24v); Rob. Barfot (f. 25v); Will Horble, alyter Cadderon (f. 26r); Raff and Johan Jessen (f. 31r); Joh. Bestoun (f. 31); a note of money lent \'to Edward Redes wyeff\' (f. 31v).John Lumley, 1st baron Lumley (b. c. 1533, d. 1609), collector and conspirator: inscribed with his name (f. 2r); listed in the 1609 catalogue of his collection, no. 1633; passed to Henry Frederick, prince of Wales.Henry Frederick (b. 1594, d. 1612), prince of Wales and eldest child of James I: his collection became part of the Royal Library: perhaps in the catalogue of 1661 (f. 35, no. 7).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','EnglishLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100165176538.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165704077.0x00003f/full/172,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107247',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(126,1,'Royal MS 17 B XXVIII','Royal','1536-1581',1536,1581,'This manuscript contains a record of the household expenses of Princess Mary, later Mary I (r. 1553-1558), Queen of England, for the period 1536-1544.The accounts feature marginal notes and corrections written in Mary\'s hand, and her signature inscribed at the end of each month for the first year. Among the entries are references to the christening of her half-brother Edward (ff. 1r, 27r), the burial of Jane Seymour (f. 28r), to Princess Elizabeth (ff. 6r, 53v, 59r) and Anne of Cleves (ff. 76v, 78r).The household expenses are followed by an inventory of Mary\'s jewels that were entrusted to the custody of Mary Fynche (b. 1508, d. 1557), one of her courtiers. Princess Mary also added notes throughout the text and her signature features in the lower margin of each page.For an edition of the household expenses and the inventory, see Madden,Privy Purse Expenses of the Princess Mary(1831).Contents:f. 1*r: An added title-page.ff. 1r-110v: A record of the expenses of Princess Mary, for the ...','Origin:England.Provenance:Mary I (r. 1553-1558), Queen of England and Ireland: her added marginal notes and corrections in the inventory of her household expenses (ff. 1r-110v); her signature inscribed in the lower margin of each page of the inventory of her jewels (ff. 112r-125v).The Old Royal Library (the English Royal Library): not included in any of the old catalogues.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','English','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100176155482.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100178529530.0x000157/full/183,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107317',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(127,1,'Royal MS 18 D III','Royal','1574-1592',1574,1592,'An atlas of England and Wales, made by Christopher Saxton (1542x4–1610/11), map maker, under the patronage of Thomas Seckford (1515/16–1587), lawyer and administrator. Owned by William Cecil, 1st Baron Burghley (1520/21-1598), royal minister, whose notes and annotations are found throughout. It is known as the Burghley Atlas after him.Containing printed and coloured maps from drawings by Saxton, dated between 1576 and 1577. Engraved by Remigius Hogenbergius, Augustinus Ryther, Comelius Hogius, Leonaert Terwoort, Nicholas Reynoldus, Franciscus Scatterus and possibly others. With the royal arms and those of Seckford. The atlas also contains lists of Justices of Peace for each county, c. 1580-1592.Please note: f. 21r is bound in the volume back-to-front. It is reproduced here in the correct original order; f. 75r is marked in the manuscript as f. 76r; there is no f. 87. The images of the maps span across each verso and the facing recto.f. 1r: Brief genealogical notes of Lampton, Tempes...','Origin:England. Made by Christopher Saxton (1542x1544–1610/11), map maker, under the patronage of Thomas Seckford (1515/16–1587), lawyer and administrator.Provenance:William Cecil, 1st Baron Burghley (1520/21-1598), royal minister: former owner and annotator.Presented to the British Museum by George II, King of Great Britain and Ireland (reigned 1727–1760), as part of the Old Royal Library, in 1757.','EnglishLatin','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100165176929.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165697447.0x0000dd/full/157,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107555',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(128,1,'Royal MS 18 E V','Royal','1473 to 1479',1473,1479,'Contents:TheHistoire tripartiteorChronique de Baudouin d\'Avennes, a compilation of ancient history also known asLe trésor des histoiresorLe trésor de sapience, consisting of:ff. 1r-19r: Table of Chapters;f. 20r: Prologue;ff. 21r-390r:Histoire tripartitein 368 chapters, up to the death of Hadrian.Versions of the same compilation are found in Harley 4415, Cotton Augustus V and parts in Additional 25884.Decoration:12 large miniatures in colours and gold, with full borders with spaces left for a coat of arms, and initials in colours with penwork decoration in gold, at the beginning of books (ff. 21r, 54v, 80r, 111r, 137v, 158v, 199r, 232r, 263r, 330v, 355v, 365v). 41 one-column miniatures partially in grisaille and gold, with partial borders and foliate initials in colours and gold or initials in colours with penwork decoration in gold, at the beginning of some chapters (ff. 28r, 31v, 36r, 38v, 40v, 46r, 62v, 68v, 73v, 86v, 91r, 94v, 99r, 103v, 118v, 121r, 123v, 125v, 130r, 133r, 141r, ...','Origin: Netherlands, S. (Bruges?).Provenance:Written in 1473: colophon \'Cy fine lhistoire tripartite / qui fut escripte et finee le / xxviie jour de mars lan de / lincarnation nostre seigne[u]r / mil iiii c lxxiii. / Libro finito sit laus et gloria Christo.\' (f. 390r).Edward IV (b. 1442, d. 1483), king of England and lord of Ireland, perhaps acquired by him.The Old Royal Library (the English Royal Library): included in the list of books at Richmond Palace in 1535, no. 1; included in the catalogue of 1666, f. 11v.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','French, Middle','Parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100057738755.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057738757.0x000001/full/145,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107569',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(129,1,'Royal MS 19 A IX','Royal','c 1464',1459,1469,'Contents: Gossuin (Gautier) de Metz (c. 1245),L\'Image du monde,a French version ofDe imagine mundiby Honorius of Autun.ff. 1r-3v: Table of chapters;ff. 4r-4v: Prologue, This manuscript contains a unique prologue linking it to Caxton\'s printed editions and stating \'ce p[rese]nt volume appelle lymage du monde Et fu translate de latin en franchois p[ar] le co[m]mandement et ordonnance du noble duc Jehan de berry et d\'auvergne l\'an 1245\'. Jean, duc de Berry (b. 1340, d. 1416);ff. 5r-5v: Translator\'s prologue;ff. 5v-47r: Part I, Creation and science from a historical and moral perspective;ff. 47r-102v: Part 2, Earth and its elements: earth, water, air, fire and ether;ff. 102v-150v: Part 3: Astronomy and the celestial motions.Decoration:5 miniatures in colours and gold (ff. 4r, 5v, 8r, 9r, 149r). Circular diagrams in colours (ff. 41r, 42r, 43r, 43v, 44r, 45v, 48r, 48v, 49r, 49v, 50r, 90r, 100v, 102r, 104r,106r,107v, 108v, 110r). Rubrics and page numbers in red. Small capitals at beginning...','Origin: Netherlands, S. (Bruges).Provenance:Johan le Clerc, Bruges: inscribed \'en la ville de bruges en.....1464 par le comandement de Johan le clerc, librarier et bourgois dicelle ville de bruges\' (f. 4v).John Theyer (bap. 1598, d. 1673): included in the catalogue of his library left to his grandson Charles Theyer (b. 1651): see E. Bernard,Catalogi librorum manuscriptorum Angliae et Hiberniae, 3 vols. (Oxford: Sheldonian, \'1697\', but 1698?), II, no. 6649.Robert Scott (b. c. 1632, d. 1709/10), London bookseller: included in the catalogue of John Theyer’s manuscripts in his possession, made in 1678 by William Beveridge and William Jane, Royal Appendix, 70, no . 75.Charles II (b. 1630, d.1685), king of England, Scotland, and Ireland: purchased from Scott together with other 311 manuscripts from Theyer\'s library.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','French, Middle','Parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100058663464.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058663466.0x000001/full/149,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107579',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(130,1,'Royal MS 19 A XVIII','Royal','1st half of the 15th century',1400,1449,'Content:Roman de la Roseby Guillaume de Lorris continued by Jean de Meun. This manuscript contains an abridged version of the romance.The text is only 14,000 lines long, with omissions noted. For example on f. 5, rubrics marked by paraphs summarise the narrative omitted, e.g., \'[P] Oyseuse, [P] les gens de la karolle [P] Comme courtoisie prie lamant de danssez\'. The first part by Guillaume de Lorris is copied on the first two quires (ff. 1-16) and is about 2,500 lines long, written by a different scribe from the remaining quires. The parchment appears to have been torn and repaired. The second part is 11,500 lines long and omissions are again marked by rubrics. The passage identifying de Lorris as author is omitted, but the reference to Jean de Meun remains: \'Puis vendra Iehan Clopinel.\' (f. 50r).f. 1v: Table of contents in French quoting the original foliation: \'Haygne et felonnie .I. Convoitise avarice et envie .ii.\'.f. 2r-94v:Roman de la Rose, beginning \'Maintes gens dient que en...','Origin: France, Paris.Provenance:The Old Royal Library (the English Royal Library): in the catalogue of 1666, Royal Appendix 71, f. 13 or 14.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','French, Old','A parchment codex, 94 folios.','https://bl.digirati.io/iiif/ark:/81055/vdc_100057738863.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057738865.0x000001/full/163,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107588',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(131,1,'Royal MS 19 B XII','Royal','1st half of the 15th century',1400,1449,'Contents:TheRoman de la Roseby Guillaume de Lorris continued by Jean de Meun. Jean de Meun\'s portion begins f. 28v: \' Et si lay je perdue espoir\'.ff. 2r-147v: \'Maintes genz dient quen songe/ Na se fables non et mensonge./ Mais on puet tel songe songier/ Qui me sont mie mensongier\'. Ending: \'Et quiconque blasme les songes/ Et die que ce sont menconges/ De cestui ne le di je mie/ Car je tesmoigne et certifie/ Que tout quanque jay recite/ Est fine et pure verite. Explicit\'. From another contemporary hand: \'La Romance de la rose\'.f. 147v: besides the explicit of theRoman de la Rose,two verses written by the same scribe: \'Nus hons ne doit tant amer, comme son deul laissier/ Aller puis quil ne le peut amender et toud jours vivre en joie\'.ff. 148r-179r:Le Testamentattributed to Jean de Meun: rubric: \'Ci commence le testament maistre Jehan de Meun qui traite de tres noble et notable matiere, lequel maistre Jehan de Meun ecrist le Roman de la Rose\'; beginning: \'Li peres et li filz et li sain...','Origin: France, Central (Paris?).Provenance:Nicholas Upton, heraldic writer, precentor of Salisbury from 1446 to 1457: his effaced ownership inscription: \'Liber magistri Nicholai Upton precentoris Sar.\' (f. 194v).Humphrey Stafford (b. 1425 d. 1458), earl of Stafford from 1444 to 1455, son of Humphrey Duke of Buckingham: his effaced ownership inscription, \'pnti Humffridi comes Stafford\' (f. 194v).Henry VIII (b. 1491, d. 1547), king of England and Ireland: the monogram \'HR\' [for Henricus Rex] (f. 2r).The Old Royal Library (the English Royal Library): Westminster inventory number \'no. 1413\' (f. 2r), included in the Upper Library at Westminster after 1547, and in the catalogue of 1666, Royal Appendix 71, f. 13 or 14.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','French, Old','A parchment codex, 194 folios.','https://bl.digirati.io/iiif/ark:/81055/vdc_100057738873.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057738875.0x000001/full/152,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107604',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(132,1,'Royal MS 19 B XVI','Royal','1428',1428,1428,'This manuscript contains an early 15th-century copy ofLe Miroir des Dames, an anonymous French translation of theSpeculum dominarum, a treatise on queenship written for Jeanne de Navarre (b. 1273, d. 1305), Queen of France and wife of Philip IV (r. 1285-1314), by her confessor, Durand de Champagne.Only a single copy of the LatinSpeculum dominarumsurvives (now Paris, Bibliotheque nationale de France, lat. 6784), while its French translation is extant in at least 12 known manuscripts. These include London, British Library, Add MS 29986; Cambridge, Corpus Christi College, MS 324; Paris, Bibliotheque nationale de France, ms fr. 610; and Vatican, Biblioteca Apostolica Vaticana Reg. Lat. 403 (for a full list of the surviving manuscripts, see Mews, \'TheSpeculum dominarum(Miroir des dames) (2011), p. 22).Contents:f. 2r-v: The translator\'s preface to the work, beginning, \'Selon ce que dit vn maistre qui est nomez Vegecius\'.ff. 2v-163r:Le Miroir des Dames, an anonymous French translation of D...','Origin:Northern France.Provenance:The manuscript was written in 1428: colophons inscribed, \'Cy fenist le mireour des dames. plaise a dieu que il leur pouffite aus ames. amen\' (f. 163r), and, \'Ce livre est accompli et achive / le vendredi ixe jour de juil/let lan mil iiiic. xxviii. / deo gracias\' (f. 164v).Henry VII (r. 1485-1509), King of England and Lord of Ireland: his added Royal arms, supported by a red dragon and white greyhound, with a hawthorn bush surmounted by a golden crown (f. 1v).The Old Royal Library (the English Royal Library): included in the catalogue of 1666, Royal Appendix MS 71, f. 11r.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','French','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100165171657.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165759428.0x000149/full/158,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107608',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(133,1,'Royal MS 19 C I','Royal','Early 14th century',1300,1340,'Contents:Matfre Ermengaud (or Matfres Ermengau, Eymengau) de Beziers:ff. 1r: Chanson, incipit, \'Dregz de natura comanda don amors pren naysshe men\';ff. 2r-250v: Breviari d\'Amor, preceded by a table of rubrics. This encyclopaedic work, explaining how the world is an emanation of love, consists of 34,550 lines in verse in the Occitan dialect composed between 1288 and 1292;ff. 251r-v: A letter from Matfre Ermengaud to his sister Suau;ff. 252r-253r: \'Salve regina en romans\';f. 253v-255v: A legend of the Tree of the Cross entitled \'Del peccat dadam\'.Decoration:3 full-page miniatures in colours and gold (ff. 11v, 30v, 125v). 21 two-column miniatures in colours and gold (ff. 7r, 33r, 34v, 37r, 37v, 42v, 50r, 51r, 53v, 54v, 58v, 67v, 74r, 96r, 168r, 173r, 177v, 202r, 204r, 204v, 245v). Numerous smaller miniatures in colours and gold. Puzzle initials in blue and red, with pen-flourishing in red and purple. Smaller initials in blue or red with pen-flourishing in red or purple. Paraphs in blue...','Origin: France, S. (Toulouse?).Provenance:Added title \'lo breuiari damors\', 14th century (f. 255v).Added drawing of a hooded head, 15th century? (f. 208r).Henry VIII (b. 1491, d. 1547), king of England and Ireland: the monogram \'HR\' [for Henricus Rex] (f. 1r).?Shelfmark of a very large number in black ink (Carley\'s \'Old Large Number\') \'36\' (f. 1r).The Old Royal Library (the English Royal Library): Westminster inventory number \'no. 132\' (f. 1r), included in the inventory of books in the Upper Library at Westminster of 1542; and in the catalogue of 1666, Royal Appendix 71, f. 14r. Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','French, OldOccitan, Old','A parchment codex, 256 folios','https://bl.digirati.io/iiif/ark:/81055/vdc_100057740622.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057740624.0x000001/full/143,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107611',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(134,1,'Royal MS 19 C VII','Royal','Middle of the 15th century',1430,1470,'This manuscript contains a copy ofLe Livre du Chevalier de la Tour Landry(The Book of the Knight of the Tower), written by Geoffroy IV de la Tour Landry (b. before 1330, d. between 1402 and 1406), a nobleman of Anjou, for the instruction of his daughters.The volume also contains a number of other texts in French, includingMélibée et Prudence, a translation by the Dominican friar Renaut de Lousans (fl. 1330s) of Albertanus of Brescia\'sLiber Consolationis et Consilii;Griseldis, a prose translation of Petrarch\'s Tale of Griselda, written by Philippe de Mézières (b.c. 1327, d. 1405); and a devotional poem attributed to the French author Jean de Meun (b.c. 1240, d.c. 1305).Contents:ff. 1r-121v: Geoffroy IV de la Tour-Landry,Le Livre du Chevalier de la Tour-Landry, written in French prose, with a prologue beginning, \'En lan mil troixcens soixante et onze, en vn jardin...\'; the main text beginning, \'Et cest moult belle chose et moult noble...\'.ff. 123r-148v: Renaut de Louhans,Mélibée et Pr...','Origin:Northern France.Provenance:Inscribed, 15th century-16th century: \'Ihesus merci quod Ward\' (f. i verso), with added pen-trials and drawings of armoured knights, horses, and ladies (ff. ii recto, ii verso, 149r, 166v, 167r).The Old Royal Library (the English Royal Library): included in the list of books at Richmond Palace of 1535, no. 84 (see Carley, ed.,Libraries of King Henry VIII(2000), pp. 22-23); included in the catalogue of 1666, Royal Appendix 71, f. 11r.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','French, Middle','1 volume','https://bl.digirati.io/iiif/ark:/81055/vdc_100165171787.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165761662.0x00014f/full/157,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107617',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(135,1,'Royal MS 20 A III','Royal','2nd half of the 14th century',1350,1399,'Contents:ff. 1-120: Gossuin de Metz,L\'image du monde;ff. 121-236: ProseBrutChronicle.','Origin: France or England.Provenance: Date of 1342 inscribed on f. 120v: \'Si fine livre de limage de monde Fait en lan de grace mil. Ccc.xlii le samadi devant la feste Saint Martyn dyver\'.John Lumley, 1st Baron Lumley (b. c. 1533, d. 1609), collector and conspirator: inscribed with his name (f. 1); listed in the 1609 catalogue of his collection, no. 1049 (seeThe Lumley Library, 1956); passed to Henry, prince of Wales.Henry Frederick, prince of Wales (b. 1594, d. 1612), eldest child of James I: his collection became part of the Royal Library.The Old Royal Library (the English Royal Library): included in the catalogue of 1666 (f. 11r).Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','French, Middle','Parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100058662812.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100058662814.0x000001/full/130,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107642',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(136,1,'Royal MS 20 A XVI','Royal','Early 16th century',1500,1540,'Except where the contrary is stated, the chansons are for three voices and are anonymous. The contra-tenor is sometimes called \'Concordans.\' The names of the composers are given only in a few cases, but several are by Josquin des Pres, and one at least (f. 10b) is by Alexander Agricola.Contents:1. \'Leure est venue.\' By Josquin des Près. See Add MS 11585, f. 23b, f. 1b.2. \'Despitant fortune.\' f. 2b.3. \'A la mignonne de fortune\'; in two parts. f. 3b.4. \'Se vous voulez m\'estre loyale\'; in two parts. f. 5b.5. \'En actendant (sic) la grace de ma dame.\' f. 7b.6. \'Il nest viuant.\' f. 8b.7. \'Vostre beaulte.\' f. 9b.8. \'Cest mal cherc[h]e.\' By Agricola. f. 10b.9. \'En effait, se ne repreues.\' f. 11b.10. \'Par vng Jour de matinee.\' f. 12b.11. \'Pour faire larlkymie damours\'; in two parts. f. 13b.12. \'Soit pres ou loing.\' f. 15b.13. \'Se je vous eslongne.\' f. 16b.14. \'Helaz, de vous je me doy bien complaindre.\' f. 17b.15. \'Ce nest pas jeu.\' f. 18b.16. \'Elle en est hors du cueur.\' f. 19b.17. \'Al[l]ez...',NULL,'French','1 volume (36 folios)','https://bl.digirati.io/iiif/ark:/81055/vdc_100054742730.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100054742732.0x000001/full/148,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107655',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(137,1,'Royal MS 20 D VII','Royal','1st quarter of the 15th century',1400,1424,'Content:TheRoman de la Roseby Guillaume de Lorris, continued by Jean de Meun at f. 25r; \'Et si lay je perdu espoir\'..ff. 1r-128r: beginning, \'Maintes gens dient quen songes/ Na se flabes non et menconges/ Mus on puet telz songes songes/ Qui ne sont mie mencongier\', ending: \'Ainsi oi la rose vermeille/ A tant fu jour et je mesveille. Explicit. Le roumant de la rose/ ou lart damours est toute enclose/ Deo gracias\'.Decoration:Partial bar border in colours and gold with vine leaf extensions and a foliate initial with foliate extensions into the margins, in colour and on gold ground (f. 1r). Small initials in blue with red pen flourishing or in red with black pen flourishing.A pen trial drawn by the scribe: f. 77r.Catchwords (e. g. ff. 12v, 36v, 108v).Running titles (e. g. ff. 39-49).','Origin: France, Central (Paris).Provenance:The Old Royal Library (the English Royal Library): Westminster inventory number \'no. 736\' (f. 1), included in the inventory of books in the Upper Library at Westminster of 1542 f. 20, and in the catalogue of 1666, Royal Appendix 71, f. 13 or 14.Presented to the British Museum by George II in 1757 as part of the Old Royal Library.','French, Old','A parchment codex, 128 folios.','https://bl.digirati.io/iiif/ark:/81055/vdc_100057738912.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100057738914.0x000001/full/146,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-002107696',NULL,'2026-01-28 04:27:44');
INSERT INTO manuscripts VALUES(138,1,'Cotton MS Appendix LVI','Cotton','1st quarter of the 12th century-1st half of the 15th century',1100,1449,'This composite manuscript contains seven parts (ff. 1-4; ff. 5-60; ff. 61-90; ff. 91-111; f. 112; f. 113; ff. 114-122) that were most likely produced at different locations in England and in different periods of time. These parts were joined together in the library of Sir Robert Bruce Cotton (b. 1571, d. 1631).The manuscript contains theological, computistical, liturgical, biblical and historical texts. Among its contents is theCosmographia(Cosmography), an 8th-century work that describes the cosmography of the heavens, the geography of the world, and the monstrous peoples and creatures that inhabit its different regions. The work is presented as a travelogue written down by its protagonist ‘Ister Aethicus’, a Scythian philosopher, that was then found and edited by the Church Father St Jerome (b. 347, d. 420). The manuscript also contains the Anglo-NormanComput(Computus): the oldest extant scientific text in the vernacular, that was composed by Philippe de Thaon (fl. c. 1113–1150), ...','Provenance:Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician: his bookplates gold-stamped on the upper and lower covers; the manuscript is listed in his catalogues which indicate that he had acquired it before 1621 (see Tite,The Early Records(2003), p. 230).Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton.Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Anglo-NormanLatin','A parchment codex','https://bl.digirati.io/iiif/ark:/81055/vdc_100063636863.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100063636865.0x000001/full/169,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001104031',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(139,1,'Cotton MS Augustus II 2','Cotton','679',679,679,'King Hlothhere of Kent grants land atWestanæin the Isle of Thanet, Kent, and at Sturry, Kent, to Abbot Beorhtwald and his monastery; dated May 679, Reculver (Sawyer, no. 8).The earliest surviving single-sheet Anglo-Saxon charter.','Origin: England.Provenance:Reculver Minster, Kent.Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156044.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165406072.0x000001/full/115,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102006',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(140,1,'Cotton MS Augustus II 3','Cotton','736',736,736,'King Æthelbald of the Mercians and of the South Angli grants ten hides (cassati) at Ismere by the river Stour and land at Brochyl in Morfe forest, Worcestershire, to Cyneberht,comes,for the construction of a minster: dated 736 (Sawyer, no. 56).Endorsed in a 10th-century hand, ‘Norð stur.’; and in a 12th-century hand, ‘Æþelbald rex.’','Origin: England.Provenance:Benedictine cathedral priory of St Mary the Virgin, Worcester, Worcestershire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156095.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165405921.0x000001/full/176,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102007',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(141,1,'Cotton MS Augustus II 4','Cotton','779',779,779,'King Offa of the Mercians grants toDuddonus(Dudda),minister, 4 hides (cassatae) near Salmonsbury in Bourton-on-the-Water, Gloucestershire; dated 779, Hartleford, Gloucestershire, confirmed at Gumley, Leicestershire (Sawyer, no. 114).Endorsed in a 9th- or 10th-century hand, ‘burhtunes boc’.','Origin: England.Provenance:Benedictine abbey of St Mary the Virgin and St Egwin, Evesham, Worcestershire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156145.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401617.0x000001/full/129,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102008',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(142,1,'Cotton MS Augustus II 5','Cotton','2nd half 14th century-Early 15th century',1350,1440,'King Wulfhere of the Mercians confirms and grants to St Peter’s Minster,Medeshamstedeland at Peterborough (Medeshamstede), Thorpe Hall, Dogsthorpe, Eastfield near Peterborough, Newark, Garton End, Eye, Werrington, Gunthorpe, Peakirk, Glinton, Deeping Gate, Peakirk Marsh, Eye Marsh, the hermitage of Singleshole, Castor, Ailsworth, Sutton near Peterborough, Upton near Ailsworth, Milton Park, Barnack, Southorpe, Walcot Hall in Southorpe, Pilsgate, Ufford, Bainton, Ashton in Bainton, Torpel (lost) in Ufford, Thornhaugh, Sibberton Lodge in Thornhaugh, Wansford, Wittering, Wothrope, Burghley near Stamford, Maxey, Lolham Hall in Maxey, Nunton in Maxey, Helpston, Northborough, Etton, Woodcroft Castle in Etton, Paston, Walton, Marholm, Warmington, Oundle, Ashton Wold, Churchfield, Stoke, Benefield, Glapthorn, Cotterstock, Stanwick, Irthlingborough Kettering, Cottingham, East Carleton, Pytchley, Northampton, Northamptonshire; Olney, Buckinghamshire; Hoo and Avery Farm, Kent; Howden, Yorks. ER...','Origin: Benedictine abbey of St Peter, St Paul, and St Andrew, Peterborough, Northamptonshire.Provenance:Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156201.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165394791.0x000001/full/159,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102009',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(143,1,'Cotton MS Augustus II 6','Cotton','972',972,972,'King Edgar grants to Pershore Abbey privileges and restoration of land at Pershore, and of 10 hides (mansi) at Bricklehampton, 10 at Comberton, 5 at Pensham in Pershore St Andrew, 16 at Eckington, 10 at Birlingham, 10 at Defford, 10 at Strensham, 10 at Besford, land atCromban(? Croombe Perry in Pirton), 10 hides at Severn Stoke, 10 hides at Pirton, 4 at Wadborough in Pershore Holy Cross, 3 at Chevingtonibid.,3 at Broughtonibid., 10 at Peopleton, 10 at Snodsbury, 7 at Naunton Beauchamp, 4 at Abberton, 5 atWihtlafestune(? North Piddle), 5 at Flyford, 5 at Grafton Flyford, 5 at Dormston, 5 at Martin Hussingtree, 3 at Broughton Hackett, 2 at Libbery in Grafton Flyford, 30 at Longdon, 7 at Powick, 3 atBeornothesleahe(Leigh), all in Worcestershire; 3 at Acton Beauchamp, Herefordshire; 40 at South Stoke (i.e. Hawkesbury), Hillesley, Tresham, Kilcott, Oldbury on the Hill, Didmarton, Badminton and Hawkesbury Upton, 10 at Dyrham, 5 at Longney, 6 at Lydney, 6 at Wyegate, all in Gloucestershire...','Origin: England.Provenance:Benedictine abbey of St Edburga (originally of St Mary the Virgin, St Peter, and St Paul), Pershore, Worcestershire.Benedictine cathedral priory of St Mary the Virgin, Worcester, Worcestershire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156243.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165394694.0x000001/full/200,158/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102010',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(144,1,'Cotton MS Augustus II 7','Cotton','3rd quarter of the 12th century',1150,1174,'Letter of Godfrey, archdeacon of Worcester, addressed to \'Pope A\', certifying the authenticity of a charter of King Edgar of England (r. 959–975), which grants privileges and the restoration of land to Pershore Abbey. Godfrey\'s confirmation of the document\'s authenticity is based on its three seals, belonging to King Edgar, St Dunstan, Archbishop of Canterbury (b. 909, d. 988), and Ælfhere, Earl of Mercia (d. 983).Godfrey was archdeacon of Worcester 1144–1156 x 7 and c. 1158 x 9–1167 x 8. There were three popes in succession who had the initial \'A\' during this time: Anastasius IV (reg. 1153–1154), Adrian IV (reg. 1154–9), and Alexander III (reg. 1159–81). The charter of King Edgar described in the letter has been identified as Cotton MS Augustus II 6 (Stokes, \'King Edgar\'s Charter for Pershore\' (2008), pp. 76-78).The dorse of the letter features an inscription in a 16th-century hand.','Origin:England (Worcester).Provenance:Benedictine cathedral priory of St Mary the Virgin, Worcester, Worcestershire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','1 leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156299.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165371451.0x000001/full/200,102/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102011',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(145,1,'Cotton MS Augustus II 8','Cotton','Mid 15th century',1430,1470,'King Cnut grants privileges and renders of fish from Welle (Upwell and Outwell), Norfolk, and of eels from Lakenheath, Suffolk, to Bury St Edmunds Abbey; 1021 × 1023, spurious (Sawyer, no. 980).Endorsed in a 15th- or 16th-century hand, ‘Carta Regis Canuti’.','Origin: Benedictine abbey of St Edmund, King and Martyr, Bury St Edmunds, Suffolk.Provenance:Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156355.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165370886.0x000001/full/200,147/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102012',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(146,1,'Cotton MS Augustus II 9','Cotton','836',836,836,'King Wiglaf of the Mercians grants privileges to the minster at Hanbury, Worcestershire, in return for the surrender to the king of 20 hides atIddeshale(? Idsall, Salop.), land atHæccaham(? Hanbury, Worcs.), 10 hides at Felda byWeoduman(? in Beanhall in Feckenham, Worcs.), and in return for the grant of 10 hides at Crowle, Worcestershire, to ealdorman Mucel, son of Esne, and a gift of 600 shillings in gold to ealdorman Sigered; dated 836, Croft, Leicestershire, in Latin with English (Sawyer, no. 190).Endorsed in contemporary hands, ‘☧ ðis is heanbirige friodom se ƿaes bigeten mid ðy londe aet iddeshale ⁊ aet heanbyrig ten hida ðaes londes ⁊ aet felda ten hida on beansetum’; ‘⁊ biscop gesalde sigrede aldormenn sex hund scillinga on golde’; ‘⁊ mucele aldormenn ten hida lond æt crog lea’; and in another hand, ‘Ƿiglaf cinig’.','Origin: England.Provenance:Benedictine cathedral priory of St Mary the Virgin, Worcester, Worcestershire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156410.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165317336.0x000001/full/200,93/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102013',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(147,1,'Cotton MS Augustus II 10','Cotton','Early 9th century',800,840,'King Coenwulf of the Mercians grants two sulungs (aratra) atAppincg londnear Rainham, two sulungs atSuithhunincg londat Graveney, and two and a half tenements (hagae) in Canterbury, Kent, to Archbishop Wulfred of Canterbury in return for 126 mancuses; dated 1 August 811, London (Sawyer, no. 168).Endorsed in a ?10th-century hand, ‘grafen ea’; in a 10th- or 11th-century hand, ‘sƿiðuningland.’ and ‘Grauanea’; in a 12th-century hand, ‘Concilium cenulfi regis in quo dedit suiðhunigland et grauenea wlfredo archiepiscopo.’ and ‘.latine.’','Origin: England (London?).Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Edward Dering, first baronet (b. 1598, d. 1644), antiquary and religious controversialist: likely his mark on the dorse.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165155970.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165410958.0x000001/full/149,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102014',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(148,1,'Cotton MS Augustus II 12','Cotton','4th quarter of the 15th century',1475,1499,'King Edgar grants privileges and confirms land to Thorney Abbey at Whittlesey, Cambridgeshire; Water Newton, Woodston, Yaxley and Farcet, Huntingdonshire; Barrow-upon-Humber, Lincolnshire; Teafolscet; and two hides (mansae) at Huntingdon; dated 973, spurious (Sawyer, no. 792).','Origin: England.Provenance:Benedictine Abbey of Saint Mary the Virgin and St Botolph, Thorney, Cambridgeshire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156003.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165406194.0x000001/full/200,129/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102016',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(149,1,'Cotton MS Augustus II 13','Cotton','1st half of the 15th century',1400,1449,'Confirmation by King Henry VI of England of an inspeximus by King Henry V of England of the charters of Ely Cathedral Priory; dated 7 February 1423/4, Westminster. Includes a confirmation of King Edgar of England (943/4–975) to Ely Abbey (Sawyer, no. 779).','Origin: England.Provenance:Benedictine abbey and cathedral priory of St Peter and St Æthelthryth, Ely, Cambridgeshire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment roll','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156011.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165406155.0x000001/full/200,132/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102017',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(150,1,'Cotton MS Augustus II 15','Cotton','990-992',990,992,'Record of a dispute between Wynflæd and Leofwine about land at Hagbourne and Bradfield, Berkshire, and Datchet, Buckinghamshire; 990 × 992 (Sawyer, no. 1454).A cyrograph, the cut-word ‘CPILREOTGVRMAEFSVTM’ written along the lower edge, with alternating letters written in a bolder shade, to be read as ‘CIROGRAFVM PLETVM EST’.Endorsed in a 12th-century hand, ‘.Inutile.’; and in a 13th-century hand, ‘Inutilia.’','Origin: England.Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, Old','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156019.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165406230.0x000001/full/200,110/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102019',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(151,1,'Cotton MS Augustus II 16','Cotton','? 853-? 858',852,859,'Plegred declares that he has purchased from Æthelmod,dux, part of atunnear Canterbury formerly pertaining toWilburgewellan,Kent: 859 forc.853 × 858 (Sawyer, no. 1196).Endorsed in a 12th-century hand, ‘Pleired dedit eðelmod duci terram at Ƿilburgeƿel.’ and ‘.latine.’','Origin: England.Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156023.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165406213.0x000001/full/200,95/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102020',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(152,1,'Cotton MS Augustus II 17','Cotton','2nd half of the 9th century',850,899,'Charter of Ceolwulf, granting to Eanmund land at Canterbury; dated 888, probably for 867 (Sawyer, no. 1204).Endorsed in the same hand as the main text, ‘+ Ciolulf sealde eanmunde his mege ðisne tuun betƿix eum ƿið .cxx. in ęc ęrbe ęðeredes cyninges friols ⁊ his handseten ⁊ sęlen’; in a 9th- or 10th-century hand, ‘+ Æðeleræ gebohte et cialulfe ða strętę siððan hæ ðis land hæfde ðæ hær be æften stent ·vii·fan. fęt an bræde ðe to ðissum lande belimpeð suð innan ðet land an ðara ƿistræte an lucænan geƿitnesse. ⁊ hyldefriðes ⁊ an cuðulfęs. ⁊ an hymman ⁊ an eadulfes. ⁊ an biarhthlafæs·· ⁊ ðer ne gebyreð an ðam landę an folcæs folcryht to lefænnæ rumæs butan tƿigen fyt to yfæs drypæ.’; and in a 12th-century hand, ‘.latine.’','Origin: England.Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156029.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165406116.0x000001/full/200,75/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102021',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(153,1,'Cotton MS Augustus II 18','Cotton','704-705',704,705,'Letter of Bishop Wealdhere of London, addressed to Archbishop Berhtwald of Canterbury, concerning his attendance at a council to be held at Brentford, Middlesex, on a dispute which had arisen between the king of the West Saxons and the rulers of the East Saxons; 704 × 705 (Sawyer, no. 1428b).Endorsed in a 12th-century hand, ‘Epistula inutilis.’','Origin: England.Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156033.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165406088.0x000001/full/200,97/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102022',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(154,1,'Cotton MS Augustus II 19','Cotton','863-870',863,870,'Agreement between Eadweald, son of Oshere, and Cynethryth, widow of Ealdorman Æthelmod, concerning land at (Little) Chart, Kent: 863 × 870, perhaps 867 × 870 (Sawyer, no. 1200).','Origin: England.Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, Old','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156039.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165406102.0x000001/full/200,71/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102023',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(155,1,'Cotton MS Augustus II 20','Cotton','2nd quarter of the 9th century-2nd half of the 12th century',825,1199,'Record of an agreement made at Kingston, Surrey, between Archbishop Ceolnoth of Canterbury, and Kings Ecgberht and Æthelwulf, concerning the recovery by Christ Church, Canterbury, of land at Mallingum (East Malling, Kent or South Malling, Sussex); dated 838 (Sawyer, no. 1438).With an additional agreement concerning the election of abbots and abbesses; a confirmation by King Æthelwulf at a synod of Wilton, dated 839; and a confirmation by a Southumbrian synod beld æt Astran (? Easter, Essex), dated 839.Endorsed in a 12th-century hand, ‘Egbertus et aðulfus \\filius eius/ reges celnoðo archiepiscopo ad opus ecclesie cristi prius a baldredo rege datam et postea ablatam rediderunt mellinges. simul cum conditione firme pacis inter illos et ipsum et successores eorum.’ and ‘.latine.’','Origin: England.Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156048.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165405998.0x000001/full/186,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102024',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(156,1,'Cotton MS Augustus II 21','Cotton','2nd quarter of the 9th century',825,849,'Record of an agreement made at Kingston, Surrey, between Archbishop Ceolnoth of Canterbury, and Kings Ecgberht and Æthelwulf, concerning the recovery by Christ Church, Canterbury, of land atMallingum(East Malling, Kent or South Malling, Sussex); dated 838 (Sawyer, no. 1438).With an additional agreement concerning the election of abbots and abbesses.Endorsed in a 10th-century hand, ‘meallinga edgift’; and in a 12th-century hand, ‘Ceolnothus archiepiscopus recuperauit mallinges. in concilio apud Kingestun.’ and ‘.latine.’','Origin: England.Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156053.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165406014.0x000001/full/200,194/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102025',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(157,1,'Cotton MS Augustus II 22','Cotton','1001',1001,1001,'King Æthelred grants of 25 hides (mansi) at Long Itchington and Arley, Warwickshire, to Clofi; dated 1001, with English bounds (Sawyer, no. 898).Endorsed in a contemporary hand, ‘Þis is þara ·xxv· hida boc þe æþelred cyngc gebocode. yceantun. clofige his þegne a on \\ece/ erfe.’; with a slightly later hand adding, ‘to geofenne ⁊ to geldenne ær dæge ⁊ æft dæge ðæm þe him leofest seo;’.','Origin: England.Provenance:Benedictine cathedral priory of St Mary the Virgin, Coventry, Warwickshire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156057.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165406036.0x000001/full/200,127/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102026',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(158,1,'Cotton MS Augustus II 23','Cotton','939',939,939,'King Æthelstan grants 12 hides (mansae) at Meopham, Kent, to Ealdwulf,minister:dated 939, with English bounds (Sawyer, no. 447).Endorsed in a contemporary hand, ‘+ Þis is meaphames land boc þe. æþelstan cing gebocode. ealdulfe his þegne on ece yrfe.’; and in a 12th-century hand, ‘Ethelstanus rex dedit .xii. mansas apud meapham. ealdulfo ministro suo.’ and ‘.latine.’','Origin: England.Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156064.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165406053.0x000001/full/200,122/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102027',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(159,1,'Cotton MS Augustus II 24','Cotton','1021-1023',1021,1023,'King Cnut grants five hides (cassaturae) at Newnham, Northamptonshire, to Æfic, monk: 1021 × 1023, with English bounds (Sawyer, no. 977).Endorsed in a contemporary hand, ‘Into niƿanham.’','Origin: England.Provenance:Benedictine abbey of St Mary the Virgin and St Egwin, Evesham, Worcestershire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156068.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165405984.0x000001/full/164,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102028',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(160,1,'Cotton MS Augustus II 25','Cotton','4th quarter of the 11th century',1075,1099,'Diploma of King William I of England (r. 1066–1087) to Abbot Baldwin (d.c.1097) and the monks of Bury St Edmund\'s, confirming the exemption of the church and the vill of St Edmund from the jurisdiction of Bishop Herfast of Thetford (d. 1084) and his successors; the case having been heard and settled by the King with the counsel of his archbishops, bishops, earls, and other knights. A bilingual charter written in Latin, with an Old English translation. Dated 31 May 1081. Spurious.Witnessed by King William I; Queen Matilda; Lanfranc, Archbishop of Canterbury; Thomas, Archbishop of York; Odo, Bishop of Bayeux and many others.Endorsed in a 12th-century hand, \'PRIVILEGIVMSANCTI EADMVNDI\' (a 14th-century hand has inserted \'Abbathie\'); in a 14th-century hand, \'d. e. Beri\'; in a 14th-century hand, \'Item quando monachi ibi fuerunt primo introducti\'.','Origin:England (Bury St Edmunds).Provenance:Benedictine abbey of St Edmund, King and Martyr, Bury St Edmunds, Suffolk.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','1 leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156073.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165405969.0x000001/full/166,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102029',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(161,1,'Cotton MS Augustus II 26 and 27','Cotton','2nd half of the 8th century',750,799,'Cotton MS Augustus II 27 (f. 1r): King Offa of Mercia grants 30 hides (manentes) between Harrow(-on-the-Hill) and theLidding(Wealdstone Brook), Middlesex, and east of theLidding,to Abbot Stithberht, in exchange for 30 hides atWichaminCiltinne;dated 767 (Sawyer, no. 106).Cotton MS Augustus II 26 (f. 1v): Endorsed with confirmation of Pilheard,comesof King Coenwulf of the Mercians; dated 799 × 801 (Sawyer, no. 1186a).Also endorsed in a 12th-century hand (on the face), ‘Offa Rex dedit stidberhto abbati terram in middelsexe’.','Origin: England (Mercia).Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156079.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401786.0x000001/full/126,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102030',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(162,1,'Cotton MS Augustus II 28','Cotton','2nd half 9th century-2nd half 10th century',850,999,'King Æthelwulf of the West Saxons, the men of Kent, and all the southern people grants a vill in Canterbury with 22 appurtenant acres (iugera) to Dudda (Ithda); dated 839 (Sawyer, no. 287).With a confirmation by King Alfred of the West Saxons, and note of the purchase of this estate by Lulla from Æthelwald; 871 × 888, in English; and further witnesses to Æthelwulf’s charter.Endorsed with a later note of the purchase of the estate by Archbishop Dunstan from Uhtlufu and her sons and his grant of it to St Martin’s, Canterbury; 959 × 988, in English.Also endorsed in a 12th-century hand, ‘Rex eðeluulfus dedit dudde terram in ciuitate cantuarie.’ and ‘.latine.’','Origin: England.Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156084.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165405955.0x000001/full/200,102/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102032',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(163,1,'Cotton MS Augustus II 30','Cotton','11th century',1000,1099,'King Offa of the Mercians grants ten hides (manentes) atWærsetfelda(cf. Wast Hills in Alvechurch), five hides (cassati) at Cofton Hackett and five hides (mansae) at Rednal in Kings Norton, Worcestershire, to the church of St Peter, Bredon, for the use of the bishop of Worcester; dated 780, in Latin (Sawyer, no. 117).Endorsed in contemporary hands, ‘Hu Offa cyning geaf to breadune ƿearsetfeld ⁊ coftun. ⁊ ƿreodanhale’; ‘to breodune offa bocade inu.’','Origin: England.Provenance:Benedictine cathedral priory of St Mary the Virgin, Worcester, Worcestershire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156100.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401739.0x000001/full/200,125/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102034',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(164,1,'Cotton MS Augustus II 31','Cotton','4th quarter of the 10th century-1st quarter of the 11th century',975,1024,'King Æthelstan grants privileges to the bishopric of Crediton in return for 60 pounds of silver; dated 933 (Sawyer, no. 421).Endorsed in a contemporary hand, ‘Libertas totius Cridiensis æclesiæ episcopatus.’; in a 13th-century hand, ‘Libertas totius cridianensis episcopatus concessa eaddulfo episcopo ab adelstano rege pro sexaginta libris pecunie. Anno domini dcccc. \\nongentesimo/ tri[cesimo tercio]’; in an early 14th-century hand, ‘Carta Adelstani Regis ecclesie Creditonensi Anno domini Nongentesimo tricesimo tercio. Bene conseruetur. quia fide digna in perpetuum.’; and in a hand of 1608, ‘Ista carta concessa fuit ante conquestum cxxxiii. Antiquitas eius dclxxv. ad hunc annum mdcviii.’','Origin: England.Provenance:Collegiate church of Holy Cross, Crediton, Devon.Cathedral church of St Peter, Exeter, Devon.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156106.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401757.0x000001/full/200,102/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102035',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(165,1,'Cotton MS Augustus II 32','Cotton','Late 12th century-1st half of the 13th century',1175,1249,'King Æthelbald of Mercia grants seven hides (manentes) in the district calledGeddinges(cf. Yeading), Middlesex, to Wihtred,comes, and toAnsith, his wife; dated 716 × 757 (Sawyer, no. 100). Written in the first half of the 13th century.Verso: Part of a leaf listing graduals at Christ Church; among donors (or owners) are William Brito, John of Northgate, Robertus sacrista, Ricardus cancellarius, and Ædwinus. Written in the late 12th century, in a script contemporary with the earliest surviving Christ Church catalogue (Cambridge, University Library, MS Ii.3.12).','Origin: Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Provenance:Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156110.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401725.0x000001/full/200,126/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102036',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(166,1,'Cotton MS Augustus II 33','Cotton','2nd half of the 11th century',1050,1099,'King Eadwig of England grants of 20 hides (mansi) at Cuddesdon, Oxfordshire, to Ælfhere, hiscomes:dated 956, with English bounds (Sawyer, no. 587).Endorsed by the scribe of the main text, ‘Þis is seo lanboc to Cuþenes dune to þan tƿentigan hidan þe Eadƿig cync gebocede Ælfhere his ealdormen on ece yrfe.’; and in a 12th-century hand, ‘Carta de Codesdona. Eaduii.’','Origin: England.Provenance:The Benedictine Abbey of St Mary the Virgin, Abingdon, Berkshire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156114.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401711.0x000001/full/160,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102037',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(167,1,'Cotton MS Augustus II 34','Cotton','Mid 11th century',1030,1070,'Bequest by Thurstan to Christ Church of land at Wimbish, Essex; 1042 × 1043 (Sawyer, no. 1530).Upper portion of a tripartite chirograph, with ‘CYROGRAPHVM’ written along the lower edge.Endorsed in a 12th-century hand or hands, ‘Þurstan dedit ƿimbisc ecclesiae cristi id est conuentae’, ‘.anglice’, ‘Anno mº xlix’, and ‘VIII’.','Origin: England.Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, Old','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156121.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401770.0x000001/full/200,111/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102038',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(168,1,'Cotton MS Augustus II 35','Cotton','1044-1048',1044,1048,'Account of the purchase of land by Godric of Bourne at Offham, Kent, from his sister, Eadgifu; 1044 × 1048 (Sawyer, no. 1473).Upper portion of a tripartite chirograph, with ‘CYROGRAPHVM’ written along lower edge.Endorsed in a 12th-century hand, ‘Quomodo Godricus emit terram de offeham.’ and ‘.anglice.’','Origin: England.Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, Old','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156125.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401697.0x000001/full/200,72/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102039',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(169,1,'Cotton MS Augustus II 37','Cotton','2nd quarter of the 9th century',825,849,'Record of an agreement made at Kingston, Surrey, between Archbishop Ceolnoth of Canterbury, and Kings Ecgberht and Æthelwulf, concerning the recovery by Christ Church, Canterbury, of land at Mallingum (East Malling, Kent or South Malling, Sussex); dated 838 (Sawyer, no. 1438).With an additional agreement concerning the election of abbots and abbesses; a confirmation by King Æthelwulf at a synod of Wilton, dated 839; and a confirmation by a Southumbrian synod beld æt Astran (? Easter, Essex), dated 839.Endorsed by the scribe of the text, ‘+ ðis sint ecgberhtes geðinge ⁊ æðeluulfes uuið arcebiscep ⁊ uuið hiora leoda uuiotan ymb eouuer gecor gif eoƿ hua brocie for eouuere gecore ðonne ieuuað ge ðis geuurit.’; in a 10th-century hand, ‘meallingas.’; in a 12th-century hand, ‘Concilium celnothi archiepiscopi apud kingestun ubi recuperauit mallinges sibi et ecclesie.’ and ‘.G.’ and ‘ .latine.’; and in a 13th-century hand, ‘Mallinge.’','Origin: England.Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156130.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401680.0x000001/full/200,46/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102041',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(170,1,'Cotton MS Augustus II 38','Cotton','993',993,993,'King Æthelred confirms the privileges of Abingdon Abbey, including the right of free election of a new abbot; dated Pentecost (4 June) 993 at Winchester, Hampshire, and 17 July 993 at Gillingham, Dorset (Sawyer, no. 876). This charter is associated with the \'penitential\' charters of Æthelred and is also an example of the \'Orthodoxorum\' formulation.Endorsed in a 13th-century hand, ‘Priuilegium Æþelredi regis factum de Abbenduna.’','Origin: England.Provenance:The Benedictine Abbey of St Mary the Virgin, Abingdon, Berkshire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','Latin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156135.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401653.0x000001/full/200,155/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102042',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(171,1,'Cotton MS Augustus II 39','Cotton','Mid 10th century',930,970,'King Edgar of England grants 22 hides (cassati) at Ringwood, Hampshire, to Abingdon Abbey; dated 961, with English bounds (Sawyer, no. 690).Endorsed in a late 12th-century hand, ‘Carta regis Eadgari de Rimecuda’; and in a 14th-century hand, ‘Carta regis Eadgari de Rimecuda’, with a another hand adding, ‘id est le Rye’.','Origin: England.Provenance:The Benedictine abbey of St Mary the Virgin, Abingdon, Berkshire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156141.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401668.0x000001/full/200,173/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102043',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(172,1,'Cotton MS Augustus II 40','Cotton','Mid 10th century',930,970,'King Edgar of England restores forfeited lands atÆscesburuh(Woolstone), Denchworth, Garford, Chieveley, Stanmore in Beedon, Chaddleworth, Boxford, Benham, Berkshire; Worting, Tichborne, Hampshire; Stedham, Tillington, Patching, Poynings and Newtimber, Sussex, to Wulfric,minister;dated 960, with endorsement in English (Sawyer, no. 687).Endorsed by the scribe of the charter, ‘+ Þis is ealra þara landa freols þe eadgar cyning ge ed freolsade ƿulfrice his þegene on ece yrfe’; and in a 15th-century hand, ‘Concessit istas terras \\infrascriptas/ cuidam seculari.’','Origin: England.Provenance:The Benedictine abbey of St Mary the Virgin, Abingdon, Berkshire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156151.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401641.0x000001/full/200,106/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102044',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(173,1,'Cotton MS Augustus II 41','Cotton','956',956,956,'King Eadwig of England grants 15 hides (mansae) at Milton (Berkshire) to Ælfwine, hisfamiliar:dated 956, with English bounds (Sawyer, no. 594).Endorsed in a 10th-century hand, ‘Þis is þara .xv. hida boc æt Middel tune þe Eadwig cing gebocode Ælfƿine on ece yrfe.’; and in hands of various later dates, ‘Karta de Mideltona’, ‘Midelton’, ‘Codicelle Edwii Regis’.','Origin: England.Provenance:The Benedictine abbey of St Mary the Virgin, Abingdon, Berkshire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156155.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401601.0x000001/full/200,112/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102045',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(174,1,'Cotton MS Augustus II 42','Cotton','845-853',845,853,'Will of Badanoth Beotting; 845 × 853 (Sawyer, no. 1510).Endorsed in a 12th-century hand, ‘.anglice.’ and ‘Testamentum badnoði qui dedit familie ecclesie cristi terram quam habuit de rege. aðeluulfo’; and in a 14th-century hand, ‘Anno D.CCCº.xxxº.viiº’ and ‘xii’.','Origin: England.Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, Old','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156162.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401607.0x000001/full/200,72/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102046',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(175,1,'Cotton MS Augustus II 43','Cotton','956',956,956,'King Eadwig of England grants five hides (cassati) at Tadmarton, Oxfordshire, to Brihtric hisminister:dated 956, with English bounds (Sawyer, no. 618).Endorsed in a contemporary hand, ‘Ðis \'is\' ðara .v. hida boc æt Tademær tune ðe Eadƿig cyning gebocaþ Brihtrice on ece yrfe.’; in a 12th-century hand, ‘Carta de Tademertona.’','Origin: England.Provenance:The Benedictine abbey of St Mary the Virgin, Abingdon, Berkshire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156167.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401574.0x000001/full/171,200/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102047',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(176,1,'Cotton MS Augustus II 44','Cotton','949',949,949,'King Eadred of England grants 18 hides (mansae) at Welford (Berkshire) to Wulfric in exchange for land at Pendavey in Egloshayle (Cornwall); dated 949, with English bounds (Sawyer, no. 552).Endorsed by the scribe of the charter, ‘+ Þis is þara .xviii. hida boc æt Ƿelig forda þe Eadred cing gebocode Ƿulfrice his þegne on ece yrfe . ƿiþ þæs landes geƿrixle þe on Ƿealum is æt Pendyfig.’; and in a succession of later hands, \'Carta de Weliford.\', \'Iste rex istam terram cuidam amico suo carissimo.\', \'Prima.\'','Origin: England.Provenance:The Benedictine abbey of St Mary the Virgin, Abingdon, Berkshire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156171.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401590.0x000001/full/200,140/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102048',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(177,1,'Cotton MS Augustus II 45','Cotton','956',956,956,'King Eadwig of England grants 10 (later altered to 16) hides (cassati) at Annington, Sussex, to Edmund, hisoptimas:dated 956, with English bounds (Sawyer, no. 624).Endorsed in a contemporary hand, ‘+ Þis is þara .x. [altered to.xvi.] hida boc æt Anninga dune þe Eadƿig cing gebocode Eadmunde ealdormen on ece yrfe.’; and in a 14th-century hand, ‘Concessit istam terram cuidam optimati suo.’','Origin: England.Provenance:The Benedictine abbey of St Mary the Virgin, Abingdon, Berkshire.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156177.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401554.0x000001/full/200,158/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102049',NULL,'2026-01-28 04:29:33');
INSERT INTO manuscripts VALUES(178,1,'Cotton MS Augustus II 46','Cotton','Mid 10th century',930,970,'Fragment of a charter of King Æthelwulf of the West Saxons, concerning a grant of 12 hides (cassati) and a separate hide; with English bounds, dated 21 April 854, Wilton (Sawyer, no. 1862).Endorsed in a 12th-century hand, ‘inutile’.','Origin: England.Provenance:Benedictine cathedral priory of Holy Trinity or Christ Church, Canterbury, Kent.Sir Robert Bruce Cotton (b. 1571, d. 1631), 1st baronet, antiquary and politician. Cotton’s collection was augmented by his son, Sir Thomas Cotton (b. 1594, d. 1662), 2nd baronet, and his grandson, Sir John Cotton. Sir John Cotton (b. 1621, d. 1702), 3rd baronet: bequeathed the entire Cotton collection of books and manuscripts to trustees ‘for Publick Use and Advantage’, 12 and 13 William III, c. 7. Formed one of the foundation collections of the British Museum in 1753.','English, OldLatin','Parchment leaf','https://bl.digirati.io/iiif/ark:/81055/vdc_100165156182.0x000001','https://bl.digirati.io/thumbs/ark:/81055/vdc_100165401542.0x000001/full/200,58/0/default.jpg','https://searcharchives.bl.uk/catalog/040-001102050',NULL,'2026-01-28 04:29:33');
