INSERT INTO manuscripts VALUES(1124,2,'MS. Bodl. 579','Bodley','9th century, second half',850,900,'This complex volume is divided by scholars into three parts. The original core, \'Leofric A\' is not a missal but a hybrid sacramentary, pontifical and ritual, probably made in England by continentally-trained scribes for use at Canterbury, in the late ninth or early tenth century, perhaps for Archbishop Plegmund. \'Leofric B\' consists of calendrical, computistical and liturgical material added at Canterbury down to the end of the tenth century, both on inserted leaves and quires and as additions on existing leaves of part A. \'Leofric C\' comprises masses and other material added at Exeter in the eleventh century after the manuscript had been acquired by Bishop Leofric, again both as separate codicological units and as additions on existing leaves of parts A and B.','England',NULL,'fol.','https://iiif.bodleian.ox.ac.uk/iiif/manifest/97b5f725-af6d-4934-ad75-575eb081838f.json','https://iiif.bodleian.ox.ac.uk/iiif/image/594d08d3-f73f-4e04-94bc-d9c7ffdb0e5a/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/97b5f725-af6d-4934-ad75-575eb081838f/',NULL,'2026-01-28 04:33:53');
INSERT INTO manuscripts VALUES(1125,2,'MS. Bodl. 343','Bodley','12th century, second half',1150,1200,'The manuscript contains a collection of Ælfric\'s homilies, tracts and saints\'\n                            lives, with other homiletic material by\n                            Wulfstan, Latin sermons and\n                        musical annotations.','England',NULL,'leaves.','https://iiif.bodleian.ox.ac.uk/iiif/manifest/96cc6a43-6e73-4829-90fe-b82669c92806.json','https://iiif.bodleian.ox.ac.uk/iiif/image/a3f30129-22b0-4d0a-8689-960250dff207/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/96cc6a43-6e73-4829-90fe-b82669c92806/',NULL,'2026-01-28 04:33:53');
