INSERT INTO manuscripts VALUES(1191,2,'MS. Eng. poet. a. 1','Eng. poet.','c. 1390–1400',1381,1400,'This manuscript, famously known as the Vernon manuscript, is an impressive book in every respect. Its imposing size equals the extent of its vernacular Middle English texts whilst its plentiful decoration and illumination serve to highlight its luxury status. An extensive collection of Middle English religious and didactic texts, the manuscript runs to over 350 items and has been termed a \'typical medieval one-volume library\' by Görlach (1974, p. 102). The manuscript is thought to date from c. 1390.','English','enm','folios, foliated i-viii, 1–414, the modern foliation (not present on every folio) following the medieval (see below) and including 71 leaves now missing (the former fols. 37, 57–64, 81–88, 102, 106–113, 127–166, 248, 389–391, 402); the original extent was therefore 8 + 413 folios.','https://iiif.bodleian.ox.ac.uk/iiif/manifest/52f0a31a-1478-40e4-b05b-fddb1ad076ff.json','https://iiif.bodleian.ox.ac.uk/iiif/image/1c428c2e-d12b-422a-9057-52ca242cf1c5/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/52f0a31a-1478-40e4-b05b-fddb1ad076ff/',NULL,'2026-01-28 04:33:53');
