INSERT INTO manuscripts VALUES(1212,2,'MS. Digby 177','Digby','June 1180 × June 1183',1180,1183,'A contemporary record of miracles at the shrine of St Frideswide, composed by Philip, prior of the community of regular canons that formed a continuation of her monastery in Oxford, now Christ Church. The work celebrates the priory’s translation of Frideswide’s relics on 12 February 1180 and the miraculous events in which pilgrims to the shrine took part. A scribe began to copy the manuscript between 1180 and 1183, and marginal annotations show that it formed the basis for an expanded miracle collection. The canons used this manuscript for liturgical readings.','Oxford, Augustinian priory of St Frideswide','la','leaves','https://iiif.bodleian.ox.ac.uk/iiif/manifest/df97240b-039d-46db-a6e1-7a4b38f3d8c0.json','https://iiif.bodleian.ox.ac.uk/iiif/image/e209ab14-78be-4440-a3f4-1778b619ceb6/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/df97240b-039d-46db-a6e1-7a4b38f3d8c0/',NULL,'2026-01-28 04:33:53');
