INSERT INTO manuscripts VALUES(1215,2,'MS. Digby 23','Digby','12th century, middle',1140,1160,'This composite manuscript is famous for its second part, which contains the earliest copy of the Chanson de Roland . Written in the Anglo-Norman dialect of French, this copy was probably produced in England in the second quarter of the twelfth century, but its medieval provenance remains tantalisingly opaque. The first part of the manuscript, containing a Latin translation of Plato\'s Timaeus , was owned by Oseney Abbey from the thirteenth century: that the abbey also owned the chanson de geste is possible but unproven.','French',NULL,NULL,'https://iiif.bodleian.ox.ac.uk/iiif/manifest/378bf1f5-a728-4b9e-aa4d-3fd20f59ef13.json','https://iiif.bodleian.ox.ac.uk/iiif/image/e53b940d-d8da-441e-af25-c23f57dc996f/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/378bf1f5-a728-4b9e-aa4d-3fd20f59ef13/',NULL,'2026-01-28 04:33:53');
