INSERT INTO manuscripts VALUES(1221,2,'MS. Digby 86','Digby','13th century, end (c. 1272–82)',1272,1282,'A late thirteenth-century \'common-place book\' containing French, Latin and eighteen English texts of various genres including fabliau, romances, devotional and didactic texts, prognostications, charms and prayers, among others written between 1271 and 1283. The manuscript was written by its owner and has amateurish scribal drawings and decoration.','English','xno',NULL,'https://iiif.bodleian.ox.ac.uk/iiif/manifest/2d6dfc9f-2ab9-46bf-9b32-e52f0e6eabb3.json','https://iiif.bodleian.ox.ac.uk/iiif/image/88abdb11-9b84-4e59-b759-eade1964b5ca/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/2d6dfc9f-2ab9-46bf-9b32-e52f0e6eabb3/',NULL,'2026-01-28 04:33:53');
