INSERT INTO manuscripts VALUES(1233,2,'Merton College MS. 249','Merton','S. XIII in.',1200,1225,'MS 249, given to the College by William Reed in 1374, consists of several books put together over time. Part IV seems to have been made for a monastery in northern England, but by the late thirteenth century was in the hands of a clerk serving the Warwickshire Luddington family. The whole was bought by Reed from Thomas Trillek, bishop of Rochester 1364–1372. Part I, perhaps French, with its homely drawings of bestiary beings, is the only example at Merton of an extensively illustrated text.','French','la','192 leaves ( ) Savagely retrimmed, damaging illustrations in the outer and lower margins of I, the edges spattered with red. Foliation of s. xv, 1–185, omitting 88 and repeating 172. At the head of f. 186 the foliator has written ‘185 folia sunt in isto libro.’ I and V written above top line.','https://iiif.bodleian.ox.ac.uk/iiif/manifest/ad6e13ec-e70a-4b54-8008-d124fd93a320.json','https://iiif.bodleian.ox.ac.uk/iiif/image/f5aa490e-1679-4fc6-a1da-7647cefb12b6/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/ad6e13ec-e70a-4b54-8008-d124fd93a320/',NULL,'2026-01-28 04:33:53');
INSERT INTO manuscripts VALUES(1234,2,'Merton College MS. 315','Merton','S. IX',800,900,'Easily the oldest book at the College, MS 315 was made in southern Germany and is an important witness to the ancient text it contains. Nothing is known of its history until it was acquired by Pietro Donato (d. 1447), humanist bishop of Padua, at the Council of Basel in the 1430s. After his death it was acquired by John Tiptoft, earl of Worcester (d. 1470), while studying at Padua. How it reached the College, presumably after Tiptoft’s death, is uncertain, but it was there by 1556.','Germany','la','160 leaves ( ) 1–156 of thick, stiff parchment, all edges retrimmed. Damage from damp at the head and foot of leaves early on.','https://iiif.bodleian.ox.ac.uk/iiif/manifest/6c2d7998-5b67-42ea-bfbd-8fd4c9bc4445.json','https://iiif.bodleian.ox.ac.uk/iiif/image/f0da50ad-6078-4118-87da-6dee95f33bcf/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/6c2d7998-5b67-42ea-bfbd-8fd4c9bc4445/',NULL,'2026-01-28 04:33:53');
