INSERT INTO manuscripts VALUES(1295,2,'MS. Douce 185','Douce','14th century, first quarter and (additions) end',1325,1400,'This homiliary was made for and partly by an as yet unidentified community of nuns in north-western Germany. It is unusual both for being restricted to the Christmas season and for its rich illumination. It falls into three sections. Fols. 1–102 (quires 1–13) contain material perhaps in liturgical order (although there are few rubrics) from the vigil of Christmas until Epiphany. Fols. 103–181 (quires 14–23) contain further Christmas sermons for unspecified occasions. Fols. 182–196 (quires 24–25) contain a mixture of Christmastide and Marian sermons.','German',NULL,'','https://iiif.bodleian.ox.ac.uk/iiif/manifest/43f84a7d-2160-4cfc-9e68-c3981788a4f6.json','https://iiif.bodleian.ox.ac.uk/iiif/image/b7a6e117-1321-4871-aabc-e599995ff4bc/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/43f84a7d-2160-4cfc-9e68-c3981788a4f6/',NULL,'2026-01-28 04:33:53');
