INSERT INTO manuscripts VALUES(1415,2,'MS. Laud Misc. 509','Laud Misc.','11th century, second half',1090,1100,'The \'Old English Heptateuch\' is the name given by modern scholarship to a compilation extant only in the present manuscript, most recently edited by Marsden (2008). It comprises Ælfric\'s preface to Genesis, followed by translations of Genesis, Exodus, Leviticus, Numbers, Deuteronomy, and Joshua and a homiletic version of Judges. The translations of Genesis 1-24:26, of the second half of Numbers, and of Joshua, and the homily on Judges, are by Latin glosses have been added on many leaves in a hand of s. xi/xii, as well\n                        as the English title This manuscript once formed a single volume with Vespasian D. xxi, fols\n                        18-40, which was separated by Cotton between 1603 and December 1606 (Tite\n                        1992, pp. 136-37).','England','ang','','https://iiif.bodleian.ox.ac.uk/iiif/manifest/c7c1517d-3014-4a3d-9038-f678cf4969b4.json','https://iiif.bodleian.ox.ac.uk/iiif/image/21a3ab32-02fe-4a81-92a2-915aac0cad91/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/c7c1517d-3014-4a3d-9038-f678cf4969b4/',NULL,'2026-01-28 04:33:53');
