INSERT INTO manuscripts VALUES(1449,2,'MS. Laud Misc. 636','Laud Misc.','c. 1121–31',1121,1131,'The so-called Anglo-Saxon chronicle was originally compiled in King Alfred\'s reign and perhaps with his encouragement, and was continued in several versions after his death (Irvine 2015). This manuscript, copied at Peterborough Abbey, is the only version to continue beyond 1079, and is an almost unique witness to historical writing in Old English in the early twelfth century. The later annals are particularly celebrated for the supposedly eye-witness description of William the Conqueror, and for their evidence of linguistic change from Old English to Middle English.','England',NULL,'. The main watermarks on the added paper resemble Heawood 1248 and 3499. (fols. 86-90)','https://iiif.bodleian.ox.ac.uk/iiif/manifest/87d8c5b2-28de-4fe5-944c-67f0849b8fdb.json','https://iiif.bodleian.ox.ac.uk/iiif/image/c51c57d8-4c85-4128-aa87-e6fa7003f7b1/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/87d8c5b2-28de-4fe5-944c-67f0849b8fdb/',NULL,'2026-01-28 04:33:53');
