INSERT INTO manuscripts VALUES(1684,2,'MS. Hatton 20','Hatton','Between 890 and 897',890,897,'The Pastoral Care is believed to be the earliest of the translations from Latin associated with King Alfred, who has been called \'the father of English prose\'. This is the only manuscript to survive largely complete from Alfred\'s time. It was the copy sent by the king to Bishop Wærferth of Worcester, and remained in Worcester until the seventeenth century.','England',NULL,'leaves (Watson)','https://iiif.bodleian.ox.ac.uk/iiif/manifest/2c391baa-ecff-4411-aad9-2567dbe44b85.json','https://iiif.bodleian.ox.ac.uk/iiif/image/0836a096-c7d3-49f6-babd-6c1a8f543d5d/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/2c391baa-ecff-4411-aad9-2567dbe44b85/',NULL,'2026-01-28 04:33:54');
