INSERT INTO manuscripts VALUES(1687,2,'MSS. Hatton 113-14','MSS','11th century, third quarter (Watson: between 1064 and 1083)',1050,1075,'A collection of homilies, mainly by Wulfstan and Ælfric, probably copied for and used by Wulfstan II, bishop of Worcester 1062–95 , and probably written to accompany MS. Junius 121. The principle contents are catechetical and moral homilies for any occasion, followed by homilies for Christmas to Pentecost and for saints\' days from 1 May to 1 November. The manuscript was bound as two separate volumes by the early thirteenth century; MS. Hatton 113 still retains that binding. The extensive glosses by the so-called \'Tremulous Hand of Worcester\' provide a fascinating glimpse of the study of Old English in the thirteenth century.','English',NULL,NULL,'https://iiif.bodleian.ox.ac.uk/iiif/manifest/a36fbb27-5ba6-4e72-8aa3-b01bfdd45ba8.json','https://iiif.bodleian.ox.ac.uk/iiif/image/0280f7fd-48c5-4645-a592-9c39b2c781e3/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/a36fbb27-5ba6-4e72-8aa3-b01bfdd45ba8/',NULL,'2026-01-28 04:33:54');
INSERT INTO manuscripts VALUES(1688,2,'MS. Hatton 48','Hatton','690s×700s',690,709,'The oldest surviving copy of the Rule of St Benedict, and the only manuscript of this text written in uncial script.','English','la','leaves','https://iiif.bodleian.ox.ac.uk/iiif/manifest/ce827512-d440-4833-bdba-f4f4f079d2cd.json','https://iiif.bodleian.ox.ac.uk/iiif/image/2c32b369-ce24-4b53-bcbc-aaff903db567/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/ce827512-d440-4833-bdba-f4f4f079d2cd/',NULL,'2026-01-28 04:33:54');
INSERT INTO manuscripts VALUES(1689,2,'MS. Hatton 116','Hatton','12th century, second quarter',1125,1150,'Homiliary begun in the second quarter of the twelfth century (1140s?). Begins with a unique homily on St Chad (pp. 1-18). Fols 18-152, 179-252, 279-90 are homilies for 24 June to 30 November, from Ælfric\'s First Series of Sermones catholici . Pages 253-78, 290-395 are catechetical and mainly Ælfrician, and most also occur in MS. Hatton 115. The Tremulous Hand adds glosses in Latin and English.','England',NULL,'leaves','https://iiif.bodleian.ox.ac.uk/iiif/manifest/48f3b519-fa3a-4ff8-a473-56b95ac0cee1.json','https://iiif.bodleian.ox.ac.uk/iiif/image/04c994b1-78fb-424b-ab5e-bbebb739e4f0/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/48f3b519-fa3a-4ff8-a473-56b95ac0cee1/',NULL,'2026-01-28 04:33:54');
