INSERT INTO manuscripts VALUES(1884,2,'MS. Junius 121','Junius','s. xi',1050,1100,'A book for episcopal use, including canonical, penitential, and homiletic texts, many associated with Archbishop Wulfstan (d. 1023) and his commonplace book tradition (see Bateson 1895; Sauer 2000). The manuscript was produced in Worcester a generation or so after Archbishop Wulfstan\'s death, during the episcopate of St Wulfstan (1062–95) , and compiled c. 1060–72, with Hatton 113 and Hatton 114 (Franzen 1998, p. 55–56). Glosses added by the so-called Tremulous Hand of Worcester in the thirteenth century.','England',NULL,'','https://iiif.bodleian.ox.ac.uk/iiif/manifest/44360db1-f67e-47c3-8136-6515a090d968.json','https://iiif.bodleian.ox.ac.uk/iiif/image/c336825e-2ef4-4df2-a3c2-b00a19268251/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/44360db1-f67e-47c3-8136-6515a090d968/',NULL,'2026-01-28 04:33:54');
INSERT INTO manuscripts VALUES(1885,2,'MS. Junius 1','Junius','1170s × 1180s',1170,1189,'The surviving portions of the first volume of The Orrmulum . It contains biblical narratives and homilies. An incomplete list of pericopes, between Orrm\'s Dedication and Preface, shows that at least 242 biblical narratives, each followed by a homily, were planned. The manuscript is Orrm\'s autograph, and contains numerous insertions, deletions and revisions in his hand.','English','enm',', numbered [i], 1–118, [119], [ii]. the front and endleaf are unnumbered modern paper flyleaves. Fols 1, 2 comprise a bifolium bearing thirteenth-century writing and are not necessarily an integral part of the codex. Fols 3–118, [119] constitute the manuscript proper.','https://iiif.bodleian.ox.ac.uk/iiif/manifest/90a06f70-880a-4b5b-bd30-798710afff11.json','https://iiif.bodleian.ox.ac.uk/iiif/image/2df386ab-abf6-48d3-9b30-0c6d22586b7d/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/90a06f70-880a-4b5b-bd30-798710afff11/',NULL,'2026-01-28 04:33:54');
INSERT INTO manuscripts VALUES(1886,2,'MS. Junius 25','Junius','11th century, late or 12th century, early',1090,1110,'This manuscript is famous for its early German glosses and glossaries, and also preserves important copies of other encyclopaedic, grammatical and theological texts. It is comprised of nine or ten separate \'libelli\', which are attributed on palaeographical grounds either to Murbach abbey, to its mother-house Reichenau, or to the area of south-west Germany and Lake Constance. Inscriptions on fols. 1v, 103v and 194r show that the volume was in something like its present form at Murbach in 1461 when it was in a poor state of repair and restored by the abbot.','Germany',NULL,'leaves','https://iiif.bodleian.ox.ac.uk/iiif/manifest/4df4cdd2-14d8-4256-ae07-a09917b3408e.json','https://iiif.bodleian.ox.ac.uk/iiif/image/fe7020ce-ab0c-48f6-976d-01099c9d0b35/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/4df4cdd2-14d8-4256-ae07-a09917b3408e/',NULL,'2026-01-28 04:33:54');
INSERT INTO manuscripts VALUES(1887,2,'Lincoln College MS. Lat. 27','Lincoln','s. xii',1150,1175,'This complex composite manuscript represents an assemblage of reading put together at Sempringham priory, the mother-house of the Gilbertine Order, initially during the lifetime of the founder, St Gilbert of Sempringham ( c . 1085–1189). It is a significant volume not least for its unique copy of the short version of Maurice of Kirkham’s Contra Salomitas , a work that sought to establish the correct relationship of the kin of Jesus against the contemporary notion that Salome (the mother of James and John) was a man. The treatise is addressed to Gilbert, and this portion of the volume may be the very leaves sent by Maurice to Gilbert himself. Other material here, such as the denunciation of the legendary Voyage of Brendan, answers to Maurice’s concern to counter other such ‘fables’. The final item is one more unique tract addressed to St Gilbert, this by a Master Bernicius, who seems to have been a talent of the cathedral school at Lincoln. The volume as constituted is redolent of the monastic schoolroom during St Gilbert’s own lifetime.','England',NULL,'i (a lifted pastedown) + i + 209 + i + i (a lifted pastedown; all flyleaves of medieval parchment).','https://iiif.bodleian.ox.ac.uk/iiif/manifest/ac663596-5660-4549-8e15-f893f44d36fd.json','https://iiif.bodleian.ox.ac.uk/iiif/image/8e061318-12d5-4c8e-94bb-735e163fb810/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/ac663596-5660-4549-8e15-f893f44d36fd/',NULL,'2026-01-28 04:33:54');
INSERT INTO manuscripts VALUES(1888,2,'Lincoln College MS. Lat. 92','Lincoln','s. xiv',1390,1400,'A rare manuscript in which the binding fragments are the most valuable part of the volume, and the volume thereby one of the most precious in the Library. These two leaves at the back belong to an early eighth-century gospel book from Northumbria that originated in the same scriptorium as the Lindisfarne Gospels. Now drastically cut down, the leaves derive from a volume that was once bigger and perhaps even grander than Lindisfarne. It is a priceless witness to the golden age of Anglo-Saxon book art.','Northern Italy',NULL,'i (vellum) + 163 + ii (foliated 165–165, conjugate bifolium of Insular parchment (s. viii in ) 2 formerly pastedown).','https://iiif.bodleian.ox.ac.uk/iiif/manifest/ce7070be-9462-4caa-807d-b6d1a2f52116.json','https://iiif.bodleian.ox.ac.uk/iiif/image/28d14888-be3c-492f-bd14-0ed31f451f6d/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/ce7070be-9462-4caa-807d-b6d1a2f52116/',NULL,'2026-01-28 04:33:54');
INSERT INTO manuscripts VALUES(1889,2,'Lincoln College MS. Lat. 119','Lincoln','15th century, first quarter',1400,1425,'Old and New Testaments in the Later Version of the Wycliffite Bible','England','enm','356 leaves, c.','https://iiif.bodleian.ox.ac.uk/iiif/manifest/d9ff799c-9061-4445-b392-ee9985bb492e.json','https://iiif.bodleian.ox.ac.uk/iiif/image/d66e5b8a-5faf-49ed-9dbf-06c16ce92102/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/d9ff799c-9061-4445-b392-ee9985bb492e/',NULL,'2026-01-28 04:33:54');
INSERT INTO manuscripts VALUES(1890,2,'Lincoln College MS. Lat. 95','Lincoln','1256 × 1281',1256,1281,'A significant treasure of the Library, the unique copy of a work of St Thomas Aquinas long thought to have been only legendary. Thomas is said to have delivered his second set of lectures on the first book of the Sentences at the new Dominican studium provinciale of Santa Sabina in Rome, where he was lector between 1265 and 1268. In effect it was a studium personale since the curriculum was entirely entrusted to Thomas. This manuscript is the only known evidence for his teaching there. His Lectura romana is represented in the form of reportationes , in other words, as lecture notes taken down by a student in Aquinas’s very classroom.','Italy','la','; flyleaves are medieval parchment contemporary with the text-block, conjoint with pastedowns.','https://iiif.bodleian.ox.ac.uk/iiif/manifest/e36b3f78-9f9c-4332-9499-cb853781e7cf.json','https://iiif.bodleian.ox.ac.uk/iiif/image/2f200592-10d4-4b84-b4e3-714941327ac8/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/e36b3f78-9f9c-4332-9499-cb853781e7cf/',NULL,'2026-01-28 04:33:54');
INSERT INTO manuscripts VALUES(1891,2,'MS. Add. E. 3 (R)','Additional E','1553',NULL,NULL,'Account of','English',NULL,NULL,'https://iiif.bodleian.ox.ac.uk/iiif/manifest/bde84df0-cab2-4fc1-95cc-cf1bfd1cb46e.json','https://iiif.bodleian.ox.ac.uk/iiif/image/1315cc4f-3d7d-42e4-b678-8f36345fdf47/full/256,/0/default.jpg','https://digital.bodleian.ox.ac.uk/objects/bde84df0-cab2-4fc1-95cc-cf1bfd1cb46e/',NULL,'2026-01-28 04:33:54');
INSERT INTO manuscripts VALUES(1892,3,'MS Add. 451','Additional','Fourth quarter of the 14th century.',1375,1399,'Missal, Use of Sarum (The Braybrooke Missal)','Robert Braybrooke (1382-1404): the manuscript may have been made for him: his intended ownership is suggested by the Braybrooke arms inscribed in colours and gold in the lower margin of f. 11r and in red ink in the lower margin of f. 18v . Hungerford family of Down Ampney, Gloucestershire: the Calendar features an obit of Elizabeth, wife of Anthony Hungerford, 16 March (f. 6r ), Christine, wife of Sir Thomas Hungerford, 31 July 1504 (f. 8r ), Thomas Hungerford, knight, son of Edmond Hungerford, 21 October 1494 (f. 9v ), Thomas Hungerford, 3 December (f. 10v ); the name \'Hungerford\' is inscribed in a 16th-century hand on f. 262r . Thomas Rodd (1796-1849), bookseller: listed as (?) no. 124 in his catalogue of manuscripts of 1835 (this no. inscribed in pencil on the inside upper cover); an description of the manuscript that is said to have been extracted from this catalogue has been added to f. 1r .','Latin, with added texts in Middle English','Codex: 2 + 242 + 4 leaves. The manuscript also features a loose fragment from a printed (?) 17th- or 18th-century English almanack that is located in the gutter between f. 90 and f. 91, perhaps used to cover a tear in the parchment. Leaf height: 310 mm, width: 210-215 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-00451','https://images.lib.cam.ac.uk/iiif/MS-ADD-00451-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-00451',NULL,'2026-01-28 19:50:09');
