INSERT INTO manuscripts VALUES(1954,3,'MS Add. 2994','Additional',NULL,NULL,NULL,'Legal manuscript','Owned and partially written by Edward Cushyn (fl. 1512) a lawyer, and perhaps a relative of the Norfolk lawyer John Cushyn (fl. 1500). According to Baker and Ringrose Edward Cushyn was admitted to Lincoln\'s Inn in 1512 and called to the Bar in 1518. Edward Cushyn\'s annotations can be found on ff. 72r , 197r , 208r , 209v . John Baker and Jayne Ringrose, Catalogue of English Legal Manuscripts in Cambridge University Library (1996) Perhaps owned by the Henry Gray (fl. 1545) who was admitted to Lincoln\'s Inn in 1545. A note on f. 191r , \'Henry Gray per me\'. Owned by Sir Francis Palgrave (1788-1861), historian and Deputy Keeper of Public Records. Palgrave\'s signature is present in ink in the lower portion of 1r : \'Francis Palgrave\'. Owned by the bookseller J. E. Cornish of Manchester.',NULL,'Codex: i + 200 | 1 + i leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-02994','https://images.lib.cam.ac.uk/iiif/MS-ADD-02994-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-02994',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1955,3,'MS Add. 3020','Additional','Early fourteenth century.',NULL,NULL,'Red Book of Thorney (vol. 1)','Thorney Abbey, Cambridgeshire: contents of the cartulary relate to the landholdings, property and rights of the abbey, with additions made by several hands during the fourteenth, fifteenth and early sixteenth centuries (see Additions for further details). Apparently in the possession of Sir Francis Fane (1579-1629), 1st earl of Westmorland, by 1621, when it was recorded among others in \'A note of Divers Manuscriptts I am promised to have gotten for me this 30. April 1621\' by Sir Robert Cotton (1571-1631): \'Liber Cartarum monasterii Thorney the red book. Sir Fr: Vane\' (see: London, British Library, MS Harley 6018, f. 150v ; Tite (2003), p. 37 ([3.17])). There is no evidence that Cotton received or had possession of the manuscript, and further inscriptions by the Fane family confirm that it remained in their possession (see below). Two inscriptions by a hand of the 17th century - "W. Virtue non vi. Mildmay" and "M. Ferende vincam. Westmorland" - probably the mottoes of Mildmay Fane (1601-1666), 2nd earl of Westmorland and his second wife Mary (1611-1669), countess of Westmorland (f. 11r ). Francis Fane (1825-1891), 12th earl of Westmorland: his sale (sale of \'a nobleman\'), Sotheby\'s, 13 July 1887, lot 134. Purchased by Bernard Quaritch: no. 15 in Handlist of illuminated and historical manuscripts on exhibition ... 4-14 June 1889 .','Latin and Middle French','Codex: iv + 2 + 3 + 1 + 5 + 1 + 193 + iv leaves. This count does not include a piece of parchment that was removed when the manuscript was rebound. It is shown here as \' removed piece of parchment \'. It is now kept separately from the manuscript, housed in melinex and bound into a conservation volume containing endleaves, sewing remnants, boards and other materials retained from the previous binding. (See Contents, Binding and Custodial History for further details). The endleaves and a later endleaf, f. 10a, have not been digitised. Leaf height: 350 mm, width: 245 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03020','https://images.lib.cam.ac.uk/iiif/MS-ADD-03020-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03020',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1956,3,'MS Add. 3021','Additional','Early fourteenth century.',NULL,NULL,'Red Book of Thorney (vol. 2)','Thorney Abbey, Cambridgeshire: contents of the cartulary relate to the landholdings, property and rights of the abbey, with additions made by several hands during the fourteenth, fifteenth and early sixteenth centuries (see Additions for further details). Apparently in the possession of Sir Francis Fane (1579-1629), 1st earl of Westmorland, by 1621, when it was recorded among others in \'A note of Divers Manuscriptts I am promised to have gotten for me this 30. April 1621\' by Sir Robert Cotton (1571-1631): \'Liber Cartarum monasterii Thorney the red book. Sir Fr: Vane\' (see: London, British Library, MS Harley 6018, f. 150v ; Tite (2003), p. 37 ([3.17])). There is no evidence that Cotton received or had possession of the manuscript, and further inscriptions by the Fane family confirm that it remained in their possession (see below). Two inscriptions by a hand of the 17th century - "W. Virtue non vi. Mildmay" and "M. Ferende vincam. Westmorland" - probably the mottoes of Mildmay Fane (1601-1666), 2nd earl of Westmorland and his second wife Mary (1611-1669), countess of Westmorland (f. 11r ). Francis Fane (1825-1891), 12th earl of Westmorland: his sale (sale of \'a nobleman\'), Sotheby\'s, 13 July 1887, lot 134. Purchased by Bernard Quaritch: no. 15 in Handlist of illuminated and historical manuscripts on exhibition ... 4-14 June 1889 .',NULL,'Codex: 4 + 268 + 4 leaves. The endleaves have not been digitised. Leaf height: 350 mm, width: 245 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03021','https://images.lib.cam.ac.uk/iiif/MS-ADD-03021-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03021',NULL,'2026-01-28 19:50:09');
