INSERT INTO manuscripts VALUES(1958,3,'MS Add. 3047','Additional','1550',1550,1550,'Ephraem Syrus','The manuscript was owned by a hieromonk Pachomios, as stated in a note in the lower margin of f. 1r (original orthography): "Καὶ τὸδε πρὸς τοῖς ἄλλοις Παχωμίου ἰερομονάχου".The manuscript was also owned by a Raphael proigoumenos, see note on f. 322v (original orthography): "Καὶ τὼδε σὺν τῆς ἅλλοις πέφικεν προιγουμένῳ Ραφαήλ". The manuscript was later owned by C. J. Cummings of Volo.','Greek','Codex 3 + 322 Leaf height: 210 mm, width: 155 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03047','https://images.lib.cam.ac.uk/iiif/MS-ADD-03047-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03047',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1959,3,'MS Add. 3048','Additional',NULL,NULL,NULL,'Greek prayers and hymns','Possibly owned by a monastery of the Taxiarches in Zagora (the name of a number of different places), mentioned in a note on f. 3v . Owned by C. J. Cummings of Volos.','Greek','Codex iii + 323 + iii','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03048','https://images.lib.cam.ac.uk/iiif/MS-ADD-03048-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03048',NULL,'2026-01-28 19:50:09');
