INSERT INTO manuscripts VALUES(1964,3,'MS Add. 3121','Additional','not before the 16th century',1500,1599,'Morning service of Easter Saturday','Belonged in the 18th century to Stylianos Moulianos, who added the great doxology on f. 1v and probably the account on f. 89r of an incident occurring at Easter 1743. Stylianos Moulianos is probably the copyist and owner of Paris, Bibliothèque nationale de France, Supplément grec 1307 .','Greek','Codex vi + 78 + vi, Leaf height: 131 mm, width: 95 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03121','https://images.lib.cam.ac.uk/iiif/MS-ADD-03121-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03121',NULL,'2026-01-28 19:50:09');
