INSERT INTO manuscripts VALUES(1966,3,'MS Add. 3166','Additional','10th or 11th century',1000,1099,'Greek-Latin lexicon','Reused in the binding of MS Add. 3165, copied in Germany in 1437. MS Add. 3165 owned by Duke Emmerich-Joseph von Dalberg (1773-1833). MS Add. 3165 owned by Howell Wills.',NULL,'Fragment (bifolio) 2 Leaf height: 285 mm, width: 195-205 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03166','https://images.lib.cam.ac.uk/iiif/MS-ADD-03166-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03166',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1967,3,'MS Add. 3206','Additional','Second half of the 11th century',1050,1099,'Wulfstan, Canons of Edgar and Institutes of Polity (fragments)','The leaves were pastedowns in the binding of a book of octavo size. Formerly part of Cambridge University Library, MS Add. 4166, a collection of fragments bought by Samuel Sandars in the Bateman sale at Sotheby\'s, 25 May 1893, lot 1528.',NULL,'Fragment, two adjacent leaves. 1-2 Leaf height: 160 mm, width: 118 mm. 3-4 Leaf height: 162 mm, width: 108 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03206','https://images.lib.cam.ac.uk/iiif/MS-ADD-03206-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03206',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1968,3,'MS Add. 3303(3)','Additional','Late 14th or early 15th century.',1400,1499,'A leaf from a folding almanac','England, perhaps London.','Latin','Fragment from a folding almanac, comprising: 1 leaf. Unfolded dimensions: Leaf height: 290 mm, width: 205-210 mm. Folded dimensions: height: 145 mm, width: 65-72 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03303-00003','https://images.lib.cam.ac.uk/iiif/MS-ADD-03303-00003-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03303-00003',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1969,3,'MS Add. 3324','Additional',NULL,NULL,NULL,'Isaac of Nineveh (Isaac the Syrian)',NULL,NULL,'Codex 366, Leaf height: 222 mm, width: 150 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03324','https://images.lib.cam.ac.uk/iiif/MS-ADD-03324-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03324',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1970,3,'MS Add. 3326','Additional','12th or first two-thirds of the 13th century',1200,1299,'Gospel book','Acquired by an Edinburgh bookbinder named Orrock, from a source reportedly unknown to him. The bookbinder Alexander Orrock, Senior was active in Edinburgh at the time of its acquisition; however, the accession register of Additional manuscripts refers to "Arch. Orrock", presumably abbreviating the name Archibald, perhaps a relative of Alexander.',NULL,'Codex 211 Leaf height: 217 mm, width: 165 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03326','https://images.lib.cam.ac.uk/iiif/MS-ADD-03326-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03326',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1971,3,'MS Add.3389','Add.3389','First third of the 12th century C.E.',1100,1199,'Mass for Ascension Day (fragment)','Written in Central Italy (southern Tuscany or Lazio). The leaf was previously used as the lower endpaper of a printed miscellany of incunable texts from the Veneto in the 1480s which is still in its original binding. The first item in the volume is Agostino Dati, Elegantiolae (Venice: Antonius de Strata, de Cremona, 1480-83). It is not known when the volume entered the University Library; it was lot 509 in an unidentified, probably 19th-century, English sale. The leaf was removed from the binding in the late 19th century and given its current shelfmark.','Latin','Single leaf with stub bound with 12 modern paper flyleaves (a-b + 1 + c-k) of which only a, b and c are photographed; all the others are blank. Leaf height: 213 mm, width: 162 mm. Written height: 169 mm, width: 90 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03389','https://images.lib.cam.ac.uk/iiif/MS-ADD-03389-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03389',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1972,3,'MS Add. 3479','Additional','Mid-9th century',800,899,'Compilation of patristic texts','Metz: the notation of the antiphons added in the 9th century has been identified as that of Metz by H.M. Bannister. The Benedictine Abbey St-Mihiel (Meuse): presumably to be identified with \'S. Augustini Sermones numero 36\' recorded there by B. de Montfaucon, Bibliotheca Bibliothecarum Nova (Paris, 1739), II, 1179. \'Benedictinorum S. Michaelis in Lotaringia Congregationis S. Vitoni\' (f. i recto ) and pressmark \'E fol. no. 6\' (f. [c] verso ) (17th/18th cent.). Payne and Foss, booksellers: no. 512 in their catalogue for February 1826. Sir Thomas Phillipps (1792-1872): Middle Hill stamp with coat of arms and no. 2173 on [c] recto (number repeated on [b] verso ).','Latin','Codex iii + 1 + 207 + ii Leaf height: 285 mm, width: 225 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03479','https://images.lib.cam.ac.uk/iiif/MS-ADD-03479-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03479',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1973,3,'MS Add. 3561','Additional','6 October 1610',1610,1610,'Greek grammar by Antonius Arcudius','Italy','Greek, Latin and Italian','Codex 1 + 60, Leaf height: 190 mm, width: 125 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03561','https://images.lib.cam.ac.uk/iiif/MS-ADD-03561-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03561',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1974,3,'MS Add. 3574','Additional','second half of the 11th or first half of the 12th century',1150,1199,'Menologion for September and October','Owned by the book collector Bertram Ashburnham, 4th Earl of Ashburnham (1797-1878).','Greek','Codex 228 Leaf height: 350 mm, width: 260 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03574','https://images.lib.cam.ac.uk/iiif/MS-ADD-03574-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03574',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1975,3,'MS Add. 3849','Additional',NULL,NULL,NULL,'Menaion for April',NULL,'Greek','Codex 43','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-03849','https://images.lib.cam.ac.uk/iiif/MS-ADD-03849-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-03849',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1976,3,'MS Add. 4085','Additional','Late 13th or early 14th century.',1300,1399,'Fragmentary Psalter','Marginal grotesque on f. 37v holding a shield bearing the coat of arms of the Montalt family, azure, a lion rampant argent , perhaps the manuscript\'s original owners. Sold by William Pickering (1796-1854), bookseller and publisher: see note on the front pastedown . Purchased from Pickering in 1840 by Thomas Bateman (1821-1861), of Youlgrave, Derbyshire, archaeologist, antiquary and collector: his bookplate on the front pastedown . Inherited by Bateman\'s son, Thomas William Bateman (1852-1895). Lot 1304 in the \'Bateman heirlooms\' sale at Sotheby\'s (25 May 1893). Purchased for £43 at the sale by Bernard Quaritch (1819-1899), acting on behalf of Samuel Sandars (1837-1894), book collector and benefactor (see Additions for further details).',NULL,'Codex: ii + 74 + ii leaves. Leaf height: 105 mm, width: 75 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-04085','https://images.lib.cam.ac.uk/iiif/MS-ADD-04085-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-04085',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1977,3,'MS Add. 4087','Additional','c. 1400.',1400,1400,'Collection of alchemical works','Edmund Ley (fl. 15th/16th century): his ownership inscription on f. iii recto : "Liber Edmundi Ley (?)habentes in Su[...]". George Pen (fl. 17th century): his ownership inscription in the upper margin of f. 1r : "Georgii Pen liber"; and at the foot of f. 278v : "G.P. Georgius Pen". Reginald Cholmondeley (1826–1896) of Condover Hall, Shropshire: his armorial bookplate pasted on the inside of the front cover , recorded and described in detail by Alfred J. Horwood, \'The manuscripts of Reginald Cholmondeley, esq., of Condover Hall, Shropshire\', Fifth Report of the Royal Commission on Historical Manuscripts (London: H.M. Stationary Office, 1876), pp. 333-335 (p. 334); probably sold with his library on 24 November 1887. Samuel Sandars (1837-1894), librarian and benefactor: bought from Quaritch in 21 August 1889, his armorial bookplate pasted on f. [a] verso and his name inscribed on f. [a] recto : "Samuel Sandars. Trinity Coll. Cant. AM / London 1889".','Latin','Codex: i + 3 + 278 leaves. Leaf height: 175 mm, width: 135-145 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-04087','https://images.lib.cam.ac.uk/iiif/MS-ADD-04087-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-04087',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1978,3,'MS Add. 4126','Additional','Mid-19th century',1800,1899,'Book of Hours (Use of Rome)','Edward Henry Lawrence, F.S.A.: his sale, Sotheby\'s, London, 9 May 1892, lot 307 ( [ii] recto ). Purchased by Quaritch on commission for Samuel Sandars (b. 1837, d. 1894) for £66 ( [ii] recto ).','Latin','Codex i + 138 + i Leaf height: 170 mm, width: 115 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-04126','https://images.lib.cam.ac.uk/iiif/MS-ADD-04126-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-04126',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1979,3,'MS Add. 4166.22','Additional','15th or 16th century',1500,1599,'Oktoechos','Part of an album of fragments (MS Add. 4166) owned by the antiquarian Thomas Bateman (1821-1861). Bought at Sotheby\'s in May 1893 by the bookseller Bernard Quaritch from the auction of the Bateman collection by Bateman\'s son Thomas, for £10 (lot 1528). Bought from Quaritch by the collector Samuel Sandars (1837-1894).',NULL,'Fragment (scrap) 1 Leaf height: 272 mm, width: 216 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-04166-00022','https://images.lib.cam.ac.uk/iiif/MS-ADD-04166-00022-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-04166-00022',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1980,3,'MS Add. 4166.23','Additional','in the second half of the 14th century.',1350,1399,'Synaxarion for the month of April, fragment','The fragment was part of the Bateman\'s collection (see the book-plate on the left pastedown of the binding of the album of fragments Add. 4166: " Bateman of Middleton Hall (by Youlgrave) in the County of Derby" ); probably the album was owned, in particular, by Thomas Bateman (1821-1861) (see R. Rushforth, The Barrow Knight, the Bristol Bibliographer, and a Lost Old English Prayer , in: Transactions of the Cambridge Bibliographical Society, 13.1, 2004, pp. 112-131: 112-114). It was sold within the "Bateman heirlooms" sale by Sotheby\'s on 25th May 1893 (Lot 1528). MS Add. 4166 was acquired by Quaritch (on the sale see Rushforth 2004 : 115), and afterwards came into the possession of the bibliographer Samuel Sandars (1837-1894), whose family originated in Derbyshire.',NULL,'Fragment (leaf) 1, Leaf height: 96 mm, width: 77 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-04166-00023','https://images.lib.cam.ac.uk/iiif/MS-ADD-04166-00023-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-04166-00023',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1981,3,'MS Add. 4166.24','Additional','15th or early 16th century',1500,1599,'Contents list','Probably owned by the monk Niphos. Owned by the priest Kallistos Baruch, who probably bought the manuscript from Niphos, as indicated by his note on the verso . Part of an album of fragments (MS Add. 4166) owned by the antiquarian Thomas Bateman (1821-1861). Bought at Sotheby\'s in May 1893 by the bookseller Bernard Quaritch from the auction of the Bateman collection by Bateman\'s son Thomas, for £10 (lot 1528). Bought from Quaritch by the collector Samuel Sandars (1837-1894).',NULL,'Fragment (scrap) 1 Fragment height: 188 mm, width: 111 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-04166-00024','https://images.lib.cam.ac.uk/iiif/MS-ADD-04166-00024-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-04166-00024',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1982,3,'MS Add. 4166.25','Additional','second half of the 16th century',1550,1599,'Table of contents of a Homiliary','The fragment was part of the Bateman collection (see the bookplate on the left pastedown of the binding of the album of fragments Add. 4166: "Bateman of Middleton Hall (by Youlgrave) in the County of Derby" ); the album was probably owned, in particular, by Thomas Bateman (1821-1861) (see R. Rushforth, The Barrow Knight, the Bristol Bibliographer, and a Lost Old English Prayer , in: Transactions of the Cambridge Bibliographical Society, 13.1, 2004, pp. 112-131: 112-114). It was sold among the "Bateman heirlooms" by Sotheby\'s on 25th May 1893 (Lot 1528). MS Add. 4166 was acquired by Quaritch (on the sale see Rushforth 2004 : 115), and afterwards came into the possession of the bibliographer Samuel Sandars (1837-1894), whose family originated in Derbyshire.',NULL,'Fragment (leaf)1, Leaf height: 226 mm, width: 165 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-04166-00025','https://images.lib.cam.ac.uk/iiif/MS-ADD-04166-00025-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-04166-00025',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1983,3,'MS Add. 4173','Additional','first half of the 16th century',1500,1549,'Three Gospels and Acts','The manuscript was owned by T. Swinburne; his name is written on f. 3r .','Greek','Codex i + 180 + i, Leaf height: 145 mm, width: 105 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-04173','https://images.lib.cam.ac.uk/iiif/MS-ADD-04173-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-04173',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1984,3,'MS Add. 4489','Additional',NULL,NULL,NULL,'Gospel lectionary palimpsest, with Menologion undertext','The lectionary manuscript containing these folios was acquired in a collection of manuscripts bought from a dealer in Ioannina in 1870 for Baroness Angela Burdett-Coutts (1814-1906). These folios, detached from that manuscript, were bought from Burdett-Coutts by Frederick H.A. Scrivener (1813-1891), probably before 1883, at which time they were not available to Caspar René Gregory when he examined the Burdett-Coutts collection.','Greek','Fragment (leaves) 16 ff. 1-9, 11-16 Leaf height: 410 mm, width: 255 mm. f. 10 Leaf height: 360 mm, width: 235 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-04489','https://images.lib.cam.ac.uk/iiif/MS-ADD-04489-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-04489',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1985,3,'MS Add. 4490','Additional','last quarter of the 10th or the 11th century',1075,1099,'Commentary on the Gospel of Matthew','Probably owned by Baroness Angela Burdett-Coutts (1814-1906). Owned by Frederick H. A. Scrivener (1813-1891).',NULL,'Fragment (leaves) iii + 3 + ii Leaf height: 322 mm, width: 237 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-04490','https://images.lib.cam.ac.uk/iiif/MS-ADD-04490-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-04490',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1986,3,'MS Add. 4491','Additional','second half of the 11th or first half of the 12th century',1150,1199,'Life of Barlaam and Joasaph','The main body of the manuscript to which this fragment originally belonged was owned in by the Durachani Monastery near Ioannina, and transferred in 1846 to the Zosimaia Schole in Ioannina. It is unclear whether or not these folios had become separated from it at this time. These folios were probably acquired in a collection of manuscripts bought from a dealer in Ioannina in 1870 for Baroness Angela Burdett-Coutts (1814-1906). Probably bought from Burdett-Coutts by Frederick H.A. Scrivener (1813-1891).',NULL,'Fragment (quire, leaves) 14 Fragment height: 275 mm, width: 204 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-04491','https://images.lib.cam.ac.uk/iiif/MS-ADD-04491-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-04491',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1987,3,'MS Add. 4541','Additional','first half of the 12th century',1100,1149,'Gospel of Matthew',NULL,NULL,'Fragment (scrap) 1 Fragment height: 204 mm, width: 149 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-04541','https://images.lib.cam.ac.uk/iiif/MS-ADD-04541-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-04541',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1988,3,'MS Add. 5368','Additional','12th century.',1100,1199,'Origen, Sermons on Genesis, Exodus and Leviticus, translated into Latin by Rufinus of Aquileia','Belonged to the Cistercian community of Waverley Abbey from the late 12th century, and may have been made there. Ownership inscription on 4v : "Waverlea, liber tuus est hic, crimine liber | Non erit ante deum qui tibi tollit eum" in a hand of the 13th century. MLGB3, no. 5598 Owned by the Cope family of Bramshill House, in Bramshill, England not far from Waverley Abbey. It is not known when the Cope family came into possession of the volume. Sold by Sir Anthony Cope (1842-1932) of Bramshill House in the Cope sale by Sotheby\'s on 4 March 1913. Purchased from the Cope sale (Sotheby\'s) on 4 March 1913 by Percy Mordaunt Barnard (1868-1941), a bookseller.',NULL,'Codex: 3 + 176 leaves. Leaf height: 330 mm, width: 205 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-05368','https://images.lib.cam.ac.uk/iiif/MS-ADD-05368-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-05368',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1989,3,'MS Add. 5948','Additional','Late 8th century',700,799,'Etymologiae','Sir Thomas Phillipps: classmark \'Phillipps MS 15105 2 \' on the verso. His sale, Sotheby\'s, 19 May 1913, lot. 743 (where it was one of three fragments offered for sale together). Fragment purchased by \'H.A. Selden\', bookseller of 18 Sicilian Avenue, London, W.C. (i.e. R.B. (Reginald Berti) Haselden, 306 Earl\'s Court Road, London, SW; later Curator of Manuscripts, The Huntington Library, San Marino, California. (Price of the fragment, with the two others, was £11 10s. See annotated sale catalogues, British Library).','Latin','Fragment1 Leaf height: 254-256 mm, width: 199-204 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-05948','https://images.lib.cam.ac.uk/iiif/MS-ADD-05948-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-05948',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1990,3,'MS Add. 6009','Additional',NULL,NULL,NULL,'Miscellany of canon law and other texts in Greek','Owned by the hieromonachos Nikephoros Pringelis of Athens, as indicated by his note on f. 1r . Owned by the book collector George Dunn (1864-1912), whose label appears on f. i verso .','Greek','Codexii + 193 Leaf height: 306 mm, width: 214 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-06009','https://images.lib.cam.ac.uk/iiif/MS-ADD-06009-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-06009',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1991,3,'MS Add. 6190','Additional','Third quarter of the 15th century.',1450,1474,'Treatises on the soul','1r : \'Iste liber pertinet dopmne [sic] Thome Wuly p[?ret\']\'. Not hitherto identified, but perhaps the Thomas Wulley recorded as chaplain at New College, 1452-53. Emden, BRUO, p. 2098 If the date in the colophon was a mistake, with \'1441\' written in error instead of \'1471\', then Thomas Clare may still have been the copyist and it may still be possible to link the manuscript to Abbey of Bury St Edmunds (see Summary for further discussion). On ff. 1r and 110v , \'Whiti et amicorum\' (17th century). \'White\' has not been identified, though it may be Thomas White (d. 1624)White, Thomas, approximately 1550-1624, founder of Sion College. On f. 126r , \'Humfredus Wanley ejus liber 1689/90\': Humphrey Wanley, scholar of Old English and librarian. Given by Humphrey Wanley to Coventry Grammar School in 1689/90, together with other books, including a catalogue of the manuscripts at Sion College. See f. 32v of the School Library Donors\' Book, now Cambridge, University Library, MS Add. 4467. No. 15 in Wanley\'s catalogue of the School\'s manuscripts in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697), II, p. 34. Lot 291 in the School sale (Hodgson), 11 November 1908, when sold for 5s to Leighton.',NULL,'Codex: ii + 130 + v leaves. This does not count the loose sheet of paper inserted before f. 1 (see Accompanying Material for further details). Leaf height: 385 mm, width: 275 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-06190','https://images.lib.cam.ac.uk/iiif/MS-ADD-06190-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-06190',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1992,3,'MS Add. 6220.10','Additional','20th of December 1741',1741,1741,'Note accompanying MS Add. 6220.11','The note was owned by Alexander Gordon W. Murray.',NULL,'Fragment (two leaf)1 Leaf height: 82 mm, width: 112 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-06220-00010','https://images.lib.cam.ac.uk/iiif/MS-ADD-06220-00010-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-06220-00010',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1993,3,'MS Add. 6220.11','Additional','the early 17th century',1600,1699,'Letters 4, line 29 - 7, line 15 (ed. Methodios 1970-1975)','The fragment was owned by Alexander Gordon W. Murray.',NULL,'Fragment (quire)3 Leaf height: 210 mm, width: 155 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-06220-00011','https://images.lib.cam.ac.uk/iiif/MS-ADD-06220-00011-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-06220-00011',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1994,3,'MS Add. 6314','Additional','second half of the 16th century',1550,1599,'Demosthenes','The codex was owned by the librarian F. Neville Holt ( Easterling (1962), p. 321).','Greek, Latin, French','Codex 97, Leaf height: 190 mm, width: 140 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-06314','https://images.lib.cam.ac.uk/iiif/MS-ADD-06314-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-06314',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1995,3,'MS Add. 6447','Additional',NULL,NULL,NULL,'Speculum humanae salvationis','Perhaps the Abbey of St Bavo, Ghent. Cardon, pp. 382-84 Perhaps in Utrecht in the 16th century: \'21 [ [St W?] ] traiecti in edibus Decani S. Marie\' (inscription on front pastedown ). Jean-Baptiste-Godefroid Delbecq (1771-1840), Ghent schoolteacher and collector of prints and books: his sale, de Porre and Verhulst, Ghent, 8-12 September 1840, lot 49. According to the note by J.L.C. Jacob (see below), Delbecq had purchased the manuscript at the time when the monasteries in Ghent were closed. J.L.C. Jacob (1805-1865), bookseller: purchased at the sale of Jean-Baptiste Delbecq (notes concerning the manuscript, f. ii ). Sir Thomas Brooke (1830-1908), wool merchant and book collector, Armitage Bridge House, Yorkshire: his bookplate (and ?shelfmark \'A.37\') ( [iv] recto , and recorded in the catalogue of his collection, published 1891 (vol. 2, p. 604). Sir John Arthur Brooke (d. 1920)',NULL,'Codex: iv + 47 + i leaves. Leaf height: 320 mm, width: 225 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-06447','https://images.lib.cam.ac.uk/iiif/MS-ADD-06447-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-06447',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1996,3,'MS Add. 6594','Additional','9th century',800,899,'Codex Macedoniensis','The manuscript was in the possession of a Monastery of the Virgin Mary located to the West of Drama when consulted by Papadopoulos-Kerameus in the 19th century. It is said to have been subsequently owned by a Macedonian doctor toward the end of the 19th century. Later on, in 1900, the English Quaker minister Joseph Bevan Braithwaite (1818-1905) acquired the manuscript, giving it the name of \'Codex Macedoniensis\'. In 1901, it came into the hands of his son, the scholar William Charles Braithwaite (1852-1922), who studied it and collated its text.','Greek','Codexii + 304 + ii Leaf height: 180 mm, width: 130 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-06594','https://images.lib.cam.ac.uk/iiif/MS-ADD-06594-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-06594',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1997,3,'MS Add. 6677','Additional',NULL,NULL,NULL,'Gospel book','Owned by Nikolaos Exarchopoulos, protopapas of Coron and notary (PLP 91856), probably in the 15th century. Owned by the Rev. William Makellar of Edinburgh, and after his death sold at auction in November 1898.','Greek','Codex iii + 15 + 262 + iii Leaf height: 223 mm, width: 170 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-06677','https://images.lib.cam.ac.uk/iiif/MS-ADD-06677-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-06677',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1998,3,'MS Add. 6678','Additional','second half of the 12th or first half of the 13th century',1250,1299,'Act and Epistles book','Possibly presented to Anthemos of Ephesos, Bishop of Samos in 1639, and then presented to the Monastery of the Prophet Elias on Samos by the sakellarios of Samos in 1672. This depends on Carr\'s hypothesis that this was the Acts and Epistles book then combined with the Psalter whose annotations record these events. Owned by the Rev. William Makellar of Edinburgh, and after his death sold at auction in 19 November 1898 (lot 3013).',NULL,'Codex ii + 147 + ii Leaf height: 188 mm, width: 135 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-06678','https://images.lib.cam.ac.uk/iiif/MS-ADD-06678-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-06678',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(1999,3,'MS Add. 6685','Additional','1396.',1396,1396,'Old Testament, in Italian','\'Si concede licentia al Magnifico Signor Giouanbaptista Saluiati Gentilhomo fiorentino di poter tenere et legere questa parte sacra Bibia uulgare da sacro offizio della Romana uniuersale Inquisizione. Datum in Roma nel pPalazoo de el santo offizio al li 28 de luglio M.D.lviiii\' (f. 25v ): license granted by \'Frater Thomas de scotis Viglevanensis ordinis predicatorum sacre theologie professor Comissarius generalis sancte Romane Inquisitionis\' to Giovanni Battista Salviati (fl. 1559) of Florence to keep and read this vernacular Bible. Printed by Berger and compared with the similar licence of 12 March 1559 in Siena, Biblioteca Comunale degli Intronati, MS F.III.4 The Salviati family: library bookstamp in sepia of the Salviati arms (comprising three bands embattled and counter-embattled, impaling another unidentifiable coat, and surmounted by a cardinal\'s hat), with the number \'19\' added in ink (f. ii verso ); and a black bokstamp with the Salviati arms surmounted by a coronet and surrounded by the motto \'Ex lib. bibl. dom. Salviatae\' (f. 1r ). Pope Pius VI (1717-1799) (reg. 1775-1779): arms tooled in gold on the binding. Recorded in the library of Alexander Hamilton Douglas (1767-1852), then Marquess of Douglas and Clydesdale, later 10th duke of Hamilton. The Hamilton Palace mark \'B M 161\' written in pencil on f. [b] recto . Clarke (1819), p. 258 By descent to William Alexander Anthony Archibald Hamilton (1811-1863), 11th duke of Hamilton and then William Douglas-Hamilton (1845-1895), 12th duke of Hamilton. Their sale, 1882, lot 86. (For the history and dispersal of the Hamilton collection, see H. Boese, Die lateinischen Handscriften der Sammlung Hamilton zu Berlin (Wiesbaden, 1966), pp. ix-xxv). Lot 86 in a sale planned for 1882, but collection purchased en bloc by the Prussian Government and assigned to the Kupferstich-Kabinett, Berlin. von Seidlitz (1883), p. 272 Biadene (1887), pp. 322-23 Returned to London in the third sale of Hamilton Palace manuscripts by the Prussian Government, Sotheby\'s, 23 May 1889, lot 9. Purchased at that sale by Quaritch, for Arthur William Young (1852-1936), for £162 15s. Recorded in the catalogue of bibles in his library (now Cambridge, University Library, MS Add. 6751: see f. 10r, slip no. 9).','Italian','Codex: ii + 2 + 357 + ii leaves. The two medieval endleaves at the front are formed from a bifolium, the first leaf of which (f. i) is now adhered to the verso of the modern endleaf that precedes it (f. [b]). At the rear, the last medieval leaf is part of the final quire; it has likewise been adhered to the recto of the modern leaf that follows it. In both instances, the modern endleaves and medieval end/leaves are counted in the statement of extent as if separate. Leaf height: 370 mm, width: 270 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-06685','https://images.lib.cam.ac.uk/iiif/MS-ADD-06685-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-06685',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2000,3,'MS Add. 6865','Additional',NULL,NULL,NULL,'Medical and theological texts','Owned by the Augustinian Priory of St Giles and St Andrew in Barnwell, Cambridge. The name \'Bernewell\' is written in ink on f. i verso in a medieval hand. The book seems to have been in the possession of a member of the Barnwell community in 1451: on f. 13r , there is an erased inscription printed by J.S. Ringrose in her Summary Catalogue of the Additional Manuscripts: "Hic liber pertinet domui canonicorum de Bernwell [...] domino Willelmo Teb[...] canonico eiusdem domus [...] die Octobris Anno Domini 1451." As Ringrose points out, this is probably William Tebbald, who was Prior of Barnwell from 26 Nov 1474 until his death on 6 August 1489. The name Anthony Shupton appears on ff. 14r , 134v , and iii recto . This appears to be the same Anthony Shupton who added his name in several places to London, British Library, Sloane MS 4 . Evidence in the Sloane manuscript suggests that Shupton was alive in 1510, but the dates of his birth and death are unknown. Owned by James Cobbes (?1602-1685) of Bury St Edmunds, who owned several manuscripts that had once belonged to the Abbey in Bury St Edmunds. Cobbes foliated the manuscript and added running titles to the centre of the upper margin of each leaf, as well as a table of contents on f. ii recto . For further information about Cobbes as a collector see Beadle (2004). R. Beadle, \'The manuscripts of James Cobbes of Bury St Edmunds (c. 1602-1685)\', in T. Matsuda, R.A. Linethal, J. Scahill (eds.), The medieval book and a modern collector: essays in honour of Toshiyuki Takamiya (Cambridge, 2004), pp. 427-442 In his will, James Cobbes (?1602-1685) left his "Bookes and papers concerning Literature" to his grandson, James Harvy. Owned by Rev. Dr Cox Macro (1683-1767) of Bury St Edmunds. Macro probably purchased the volume from James Harvy, as several Cobbes manuscripts became part of Macro\'s collection. Cambridge, University Library, Add. MS 6865 was manuscript was no. 29 in Cox Macro\'s library and a label with that designation is still present on the spine, as is his former title label, now mostly torn away. The manuscript was seen among the items in Macro\'s library by Thomas Tanner (1674-1735) and appears among Macro\'s possessions in Tanner\'s Bibliotheca Britannico-Hibernica published in 1748. For further information about Macro\'s collection and its later fate, see Beadle (2016). R. Beadle, \'The manuscripts of James Cobbes of Bury St Edmunds (c. 1602-1685)\', in T. Matsuda, R.A. Linethal, J. Scahill (eds.), The medieval book and a modern collector: essays in honour of Toshiyuki Takamiya (Cambridge, 2004), pp. 427-442 R. Beadle, \'Macro MS 5: A Historical Reconstruction\', Transactions of the Cambridge Bibliographical Society 16.1 (2016), pp. 35-77 After Dr Cox Macro\'s death, his library passed to his daughter, Mary Macro. Mary Macro married William Stainforth in 1767. After their deaths, the manuscripts passed to William Stainforth\'s niece Elizabeth Stainforth (b. 1760). She married John Patteson (1755-1833) who owned the manuscripts until 1820. John Patteson encountered financial difficulties in the second decade of the 19th century, and in 1820 he sold the Macro manuscripts to London bookseller James Christie (1773-1831). The Macro manuscripts were purchased as a group from James Christie the Younger (1773-1831) by Dawson Turner (1775-1858) on the understanding that fellow collector Hudson Gurney would later purchase a portion of the collection. Purchased from Dawson Turner by Hudson Gurney (1775-1864) of Bawdeswell Hall, Bawdeswell, Norfolk. The manuscript remained with the Gurney family until it was sold by Major Quintin Edward Gurney (1883-1968) in a sale of the Gurney family manuscripts at Sotheby\'s in 1936. For further information about Macro\'s collection see Beadle (2016).',NULL,'Codex: i + 12 | 123 + 1 leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-06865','https://images.lib.cam.ac.uk/iiif/MS-ADD-06865-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-06865',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2001,3,'MS Add. 7216','Additional','18th century',1700,1799,'Sticherarion (menaion)','Probably owned by Georgios K. Nikolaidis, as indicated by his note on f. 205v .',NULL,'Codex ii + 301 + ii Leaf height: 179 mm, width: 130 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-07216','https://images.lib.cam.ac.uk/iiif/MS-ADD-07216-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-07216',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2002,3,'MS Add. 7307','Additional','Presumably made in 1457, contemporaneously with the roll it was intended to carry.',1457,1457,'Inscription relating to the bag\'s contents','Henry Fillongley/Fylongley (fl. c. 1440-1450): courtier, sheriff and between 1453 and 1457 Keeper of the Great Wardrobe of Henry VI. At some point during the 1440s, Fillongley was in possession of the Dunmows manor house, which stood on a rectangular moated site at Hall Orchard, on the outskirts of Fulbourn, near Cambridge. The earthworks for the moat survive, but the house was demolished in the 18th century. See A.F. Wareham and A.P.M. Wright, A history of the County of Cambridge and the Isle of Ely , Victoria County History (2022), vol. 10: Cheveley, Flendish, Staine and Staploe Hundreds (North-Eastern Cambridgeshire) and Aileen Connor, \'Investigations on a Medieval Moated Site at Hall Orchard, Fulbourn: An Archaeological Training Dig\' (Fulbourn: Archaeological Field Unit, Cambridgeshire County Council, 2006), p. 6.','Latin','A bag made of undyed doeskin. It is bell-shaped in outline, with the mouth narrower than the base. Round the mouth of the bag is a double drawstring also made of doeskin. The two upper corner of the bag are finished with ornamental knots, the lower ones with tassles constructed of bunches of small strips of skin. Object height: 245 mm, width: 210-340 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-07307','https://images.lib.cam.ac.uk/iiif/MS-ADD-07307-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-07307',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2003,3,'MS Add. 7593','Additional',NULL,NULL,NULL,'Menologion for November','Owned by the hierodiakonos Gabriel Dokyanis. Owned by the collector Alexander Peckover (1830-1919) and his daughter Alexandrina Peckover (1860-1948). Bought in the sale of the Peckover collection in 1948 by R. C. Pearson, and sold in 1949 to Donald S. Robertson, Regius Professor of Greek at Cambridge.','Greek','Codex 228','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-07593','https://images.lib.cam.ac.uk/iiif/MS-ADD-07593-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-07593',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2004,3,'MS Add. 7872','Additional',NULL,NULL,NULL,'Palimpsest of Homer and John Chrysostom',NULL,'Greek','Fragment (leaf) 1 Leaf height: 346 mm, width: 226 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-07872','https://images.lib.cam.ac.uk/iiif/MS-ADD-07872-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-07872',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2005,3,'MS Add. 7912','Additional','Second half of the 15th century.',1450,1499,'The Jenney Commonplace Book','Sir Edmund Jenney (d. 1522): some of the notes are in his hand and may have obtained other items from his father, William Jenney (d. 1483), who was administered to Lincoln\'s Inn in 1430, and was Justice of the King\'s Bench 1481-1483. Jenny\'s role of compiler is supported by the second item (ff. 10r-75v), which was made for Thomas Banyard of Lincoln\'s Inn, who was administered in 1459, with William Jenney as his sponsor. Folio 287v also contains the name \'Tymperley\', which probably refers to John Tymperley (d. 1491) of Hintlesham, Suffolk, who was administered to Lincoln\'s Inn in 1463. The name \'Andrewys\' is written on the manuscript\'s old cover in a 15th-century script; this may be the \'Andrew\' who was adminstered to Lincoln\'s Inn in 1433, possibly John Andrews of Baylham, Suffolk, Justice of the Peace of Suffolk between 1445 and 1460. The issues of William Jenney, the eldest son of Edmund, and Francis Jenney (b. 1510) , son of William, on ff. 8r-9v suggest that the manuscript passed down to his son and grandson. Various items throughout the manuscript relate to members of the Jenney family. Robert Cuddon (d. 1580), of Mulbarton, Norfolk, administered to Gray\'s Inn in 1575: perhaps his draft indenture on f. 305r: \'Teste me Roberto Cuddon de Furnyvall [Inn]\'. John Norman: his name inscribed in a 16th-century script on f. 242v. Sir John Fenn (d. 1794), Norfolk antiquary: his armorial bookplate. John Frere (d. 1807), of Roydon Hall, Norfolk: his armorial bookplate; passed down to his discendant J. T. Frere. J. T. Frere: no. 961 in the same of his books at Sotheby\'s on 14-18 Feburary, 1896. James Tregaskis (1850-1926), London book dealer: purchased the manuscript at J.T. Frere\'s sale at Sotheby\'s on 14-18 Feburary, 1896.','Middle French, Latin, and Middle English','Codex: i + 305 + i leaves. The manuscript contains 304 leaves with an additional strip of paper (f. 8a). Leaf height: 175 mm, width: 135-145 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-07912','https://images.lib.cam.ac.uk/iiif/MS-ADD-07912-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-07912',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2006,3,'MS Add. 9213','Additional',NULL,NULL,NULL,'Rāzī, Liber Almansoris','Possibly owned by Clare College, Cambridge (then known as Clare Hall): an ownership inscription by a hand of the fourteenth century on f. iv verso reads: \'Liber colegii de [...]\'. The removal of the following word makes a conclusive identification impossible, however this may be one of the four books donated to Clare Hall by William de Acton/Aketon (d. by Feb. 1391) (the others were copies of John of Gaddesden, Rosa medicinae , Avicenna, Canon medicinae , tr. Gerard of Cremona, and Bartholomeus Anglicus, De proprietatibus rerum). R.W. Hunt, \'Medieval Inventories of Clare College Library\', TCBS 1.2 (1950), pp. 105-125 CBMLC 10, pp. 138-39, 655 MLGB3 Venn:ACAD (no reference ID - search \'Aketon\') Owned by the Tollemache family of Helmingham Hall, Helmingham, Suffolk, England: Helmingham MS 15, pressmark L.J.IV (paper label, turn-in of the front cover ). A loose leaf of paper kept with the manuscript bears a brief description written in ink in a ?20th century hand, with the pressmark reference L.J.IV.2 (with the \'2\' struck out). It is not known when the Tollemache family acquired MS Add. 9213; according to Edwards and Griffiths the Tollemache family seems to have began assembling a private library by the mid-16th century, and subsequent generations continued to acquire manuscripts and rare books. The 1993 Sotheby catalogue description suggests that the the manuscript was \'probably bound for Sir Lionel Tollemache (1649-1727), 1648-1726 (!) , third earl of Dysart\', which would place the family\'s acquisition of the volume before 1727. Probably the manuscript described as \'Liber Medicines Abubecri\' in the 1762 Catalogue of the Library at Helmingham Hall in Suffolk (Suffolk Record Office, Ipswich HD 1538/253/167, printed in Edwards and Griffiths, pp. 362-364). Edwards and Griffiths tentatively suggested that the \'Liber Medicines Abubecri\' might be their \'MS 64\', now Pennsylvania, University of Pennsylvania, Library, Lawrence J. Schoenberg Collection, MS 24 , a copy of the medical works of Isaac Israeli ben Solomon, but since the opening words of MS Add. 9213 are \'Abubecri arazi filij zacarie liber incipit\' ( 1r ) it seems much more likely that that the \'Liber Medicines Abubecri\' entry in the in the 1762 Catalogue refers to CUL MS Add. 9213. Peter Kidd, \'The Helmingham Hall Manuscripts\', Medieval Manuscripts Provenance: Notes and Observations (18 March 2015) A.S.G. Edwards and J. Griffiths, \'The Tollemache Collection of Medieval Manuscripts\', The Book Collector 49.3 (2000), pp. 349-364. MS Add. 9213 is their MS 63. Owned by Philip Robinson (1902-1991), antiquarian bookseller (with his brother Lionel Robinson (1897-1983)): see correspondence from N.R. Ker, kept with the manuscript.',NULL,'Codex: 1 + ii + 1 + 230 + ii | i leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-09213','https://images.lib.cam.ac.uk/iiif/MS-ADD-09213-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-09213',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2007,3,'MS Add. 9308','Additional',NULL,NULL,NULL,'Medical recipes and charms','\'Thys ys thomas hullis boke of stebbyng\' (f. i recto ; repeated in part on f. iv recto ): Stebbing is a village in Essex and numerous Thomas Hulls are attested in manorial and other records relating to it. One or other of these may have been the owner, however it may be that the \'Thomas Hull of Stebbing\' who inscribed MS Add. 9308 is also the signatory \'Thomas Hull the elder\' of an indenture of a lease from 1553 (now Essex Record Office, D/DVx/6 ). Not only is the style of handwriting in both closely similar, but also Thomas Hull is styled in the lease as \'Thomas Hull the elder, barbour\', a title commonly applied at this time to practitioners of medicine and minor surgery. \'5.5.0\': unidentified ?pressmark (probably not a price, if £5 5s, perhaps if 5s 5d), though it is possible the annotation may be unrelated to the manuscript.',NULL,'Codex: 6 + 90 leaves. Leaf height: 105 mm, width: 85 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-09308','https://images.lib.cam.ac.uk/iiif/MS-ADD-09308-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-09308',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2008,3,'MS Add. 9309','Additional','15th century.',1400,1499,'Medical recipes and charms','Unknown English owner, their name illegible in a 15th-century inscription on the inside upper cover : \'Iste liber constat [...]\'. Unknown English owner, their name erased in a 15th-century inscription on f. 35v : \'Iste liber constat [...] scriptoris\' Unknown English owner, their name erased in a 15th-century inscription on f. 35v : \'[...] est bonus puer quem deus amat\'. ?Thomas Wortis, his name inscribed in a 15th-century inscription on the inside lower cover : \'Thomas wort[is] Leche\'.','Middle English and Latin','Codex: 34 leaves. Only small portions of the second leaf (f. 2r-2v and f. [2a] ) remain. A single fragment of another missing leaf features after f. 19 (f. [19a] ). Leaf height: 175 mm, width: 135-145 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-09309','https://images.lib.cam.ac.uk/iiif/MS-ADD-09309-000-00000.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-09309',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2009,3,'MS Add. 10062','Additional','second half of the 12th century',1150,1199,'Gospel lectionary (Saturdays, Sundays and weekdays)','Owned by the nobleman Prince Antonio Comuto (1748-1833) on Zakynthos. Given by him in 1820 to General Colin Macaulay (1760-1836), and donated by Macaulay to the British and Foreign Bible Society on 6 November 1821. It was bought from the Society by Cambridge University Library in 2014.',NULL,'176 ff. Leaf height: 280 mm, width: 170-178 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-10062','https://images.lib.cam.ac.uk/iiif/MS-ADD-10062-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-10062',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2010,3,'MS Add. 10070','Additional','latter three-quarters of the 11th century',1000,1099,'Gospel lectionary (Saturdays and Sundays)','Owned by the British and Foreign Bible Society, having been acquired by Isaac Lowndes (c. 1790-1873), appointed as agent for the Society in the Mediterranean in 1845. Sold in 2014 to the Museum of the Bible.',NULL,'Codex 288 Leaf height: 277 mm, width: 223 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-10070','https://images.lib.cam.ac.uk/iiif/MS-ADD-10070-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-10070',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2011,3,'MS Add. 10185','Additional','Second half of the 13th century, probably no later than 1274/75.',1274,1274,'Rental roll from the Augustinian Priory of Holy Trinity, Ipswich','The Augustinian Priory of Holy Trinity, Ipswich: although there is no explicit medieval evidence of provenance, it is highly likely that the roll was made by and subsequently was held at the priory. The list of tenants begins with property in the parish of St Margaret\'s and \'Thingstead\', locations closest to the site of the priory. The roll likely remained among the muniments of the Christchurch manor, formed from the estate of the priory at its dissolution in 1536. The first membrane bears an inscription, perhaps of the 18th or 19th century: \'Rent Roll Christ Church Estate St Margaret Ipswich\'. W.P. Hunt, in his 1847 transcript of the roll\'s contents, claimed to have accidentally found this and another roll (now Ipswich, Suffolk Record Office, HD1/9/1/4/1) among the muniments at Christ Church the previous year. Unidentified owner: included in the sale of \'Western and Oriental Manuscripts and Miniatures\', Dreweatts and Bloomsbury, 6 July 2017, lot 69.',NULL,'Roll, seven and a half membranes. Roll height: 4230 mm, width: 175 mm. Membrane height: 235-750 mm, width: 175 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-ADD-10185','https://images.lib.cam.ac.uk/iiif/MS-ADD-10185-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-ADD-10185',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2012,3,'MS Dd.1.11','Dd',NULL,NULL,NULL,'The \'False Decretals\' of Pseudo-Isidore; Nicholas Trivet, Commentary on \'De consolatione philosophiae\' of Boethius',NULL,NULL,'iv + 2 + 232 + 601 + 2 + iv','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00001-00011','https://images.lib.cam.ac.uk/iiif/MS-DD-00001-00011-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00001-00011',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2013,3,'MS Dd.1.14','Dd','Second quarter of the 14th century',1325,1349,'Bible','Recorded as being in the treasury of St Paul\'s Cathedral, London St. Paul\'s Cathedral London, England, in 1458 (see Dugdale, History of St Paul\'s (1818)), p. 397). 405r largely erased inscription, ending \'Londonyensis\', perhaps also relating to St Paul\'s Cathedral The same hand has also noted the titles of two other books, \'Hugo de Venna postulata >- - \' (i.e. Hugh of Saint-Cher, Postillae in Bibliam ) and \'petrus comestor historiarum\' (i.e. Petrus Comestor, Historia scholastica ), as well as adding other mottoes: \'spes mea in deo est\' and \'God spede all gode men\'. The latter may refer to MS Gg.4.7, a copy of the \'Historia scholastica\', which also from St Paul\'s and also came to the University Library as a gift from George I (see Williman, (1999), p. 443). John Moore (1646-1714), bishop of Ely: no. 1 (f. [a] recto ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Latin','Codex i + 1 + 403 + i Leaf height: 430 mm, width: 260 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00001-00014','https://images.lib.cam.ac.uk/iiif/MS-DD-00001-00014-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00001-00014',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2014,3,'MS Dd.1.16','Dd','Fourth quarter of the 12th century',1175,1199,'Historical compilation','John Moore (1646-1714), bishop of Ely: no. 285 (f. i recto ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Latin','Codex iii + 2 + 285 + 2 + iii Leaf height: 215 mm, width: 145 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00001-00016','https://images.lib.cam.ac.uk/iiif/MS-DD-00001-00016-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00001-00016',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2015,3,'MS Dd.2.22','Dd',NULL,NULL,NULL,'Maximos the Confessor, treatises and letters','The provenance of this manuscript is unknown.','Greek and Latin','Codex iii + 189 + i Leaf height: 320 mm, width: 233 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00002-00022','https://images.lib.cam.ac.uk/iiif/MS-DD-00002-00022-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00002-00022',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2016,3,'MS Dd.2.51','Dd',NULL,NULL,NULL,'Hexabiblos','Owned by Theodosios Zygomalas (1544-c.1614) (RGK I 120, II 159, III 202), protonotarios and later dikaiophylax of the Patriarch of Constantinople.','Greek','Codex i + 7 + 233 + 3 Leaf height: 260 mm, width: 210 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00002-00051','https://images.lib.cam.ac.uk/iiif/MS-DD-00002-00051-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00002-00051',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2017,3,'MS Dd.3.50','Dd',NULL,NULL,NULL,'John Klimakos, the Ladder of Divine Ascent and To the Pastor','The provenance of the manuscript is unknown.','Greek','Codex iii + 1 + 173 + iii Leaf height: 270 mm, width: 180 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00003-00050','https://images.lib.cam.ac.uk/iiif/MS-DD-00003-00050-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00003-00050',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2018,3,'MS Dd.3.51','Dd',NULL,NULL,NULL,'Platearius and other medical texts','John Moore (1646-1714), bishop of Ely: no. 10 in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697) (p. 361).',NULL,'Codex: 5 | 107 | 14 leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00003-00051','https://images.lib.cam.ac.uk/iiif/MS-DD-00003-00051-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00003-00051',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2019,3,'MS Dd.3.52','Dd',NULL,NULL,NULL,'Guy de Chauliac, Chirurgia magna (in Middle English) and Summa conservationis et curationis (extract)','John Mawkester (fl. 16th century): his name inscribed on f. 250r : \'By me John Maw[?n]kester\'. John Williamson (fl. 16th century): his name inscribed on f. 265r : \'me Jhon Wylliamson\' (perhaps referring to the crossing out of a recipe); perhaps also added a note to f. 262r : \'This is the day which the Lorde hath made\'. Michael Hare (fl. 1560): his ownership inscription on f. 1v : "Jesu Christ saue ye soule of Mich. Hare the owner of this Booke 1560". John Dwyre (fl. 1700): his ownership inscription on f. 1v : "John Dwyne his Book 1700". Perhaps John Moore (1646-1714), bishop of Ely: attributed to Moore by Binski and Zutshi, but not recorded or identified in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697), or Thomas Tanner\'s supplementary handlist (MS Oo.7.50(2)).',NULL,'Codex: 8 | 18 ; 81 ; 8 ; 147 + i leaves. Leaf height: 290 mm, width: 215 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00003-00052','https://images.lib.cam.ac.uk/iiif/MS-DD-00003-00052-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00003-00052',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2020,3,'MS Dd.3.86.9','Dd','17th century',1600,1699,'Liber geeponicus',NULL,NULL,'Codex iii + 29 + iii, Leaf height: 307 mm, width: 200 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00003-00086-00009','https://images.lib.cam.ac.uk/iiif/MS-DD-00003-00086-00009-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00003-00086-00009',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2021,3,'MS Dd.3.86.10-11','Dd',NULL,NULL,NULL,'Maximus the Confessor and a fragment of the Geoponica','The two parts now bound together in MS Dd.3.86.10.11 were owned by John Moore (1646-1714), bishop of Ely: they appear together as number 87 in the list of Moore\'s manuscripts published in E. Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (Oxoniae 1697), II, p. 363 ("Fragmentum Γεωπονικῶν, Gr. Fragmentum computi Maximi Monachi."). Apparently these two parts were already kept together at that time (and perhaps the present part II, containing the fragment from the Geoponica preceded the present part I with the Computus by Maximus the Confessor); the next mention of them is found in the Cambridge University Library catalogue of manuscripts of 1856, where they are parts 10 and 11 of a larger volume coprising 11 parts, Dd.3.86. The number of the manuscript in Bernard\'s list is written on f. 2:[1]r . That the fragment from the Geoponica was in Moore\'s possession is also testified by its mention in Needham\'s edition of the text of 1704 as " Fragmentum Manuscriptum penes Episcopum Norvicensem" (see Summary).','Greek','Codex i + 18 + i, Leaf height: ca. 210 mm, width: 140 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00003-00086-00010-00011','https://images.lib.cam.ac.uk/iiif/MS-DD-00003-00086-00010-00011-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00003-00086-00010-00011',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2022,3,'MS Dd.4.16','Dd',NULL,NULL,NULL,'Greek philosophical miscellany','Owned by the Venitian scholar Niccolò Leonico Tomeo (1456?-1531?) who left some notes (ff. 241r , 260r , 263v ) and some leafed twigs as page markers (e.g. f. 112v and f. 327v ). It later entered into the collection of John Moore (1646-1714), bishop of Ely. The manuscript is neither listed in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697) nor in the handwritten supplementary list of Moore\'s manuscripts, now CUL MS Oo.7.50.2, compiled by Thomas Tanner after the publication of Bernard\'s catalogue, but a note on f. 1r states "Late Bp of Elys MSS. lent to Mr. Dechaire for Mr. Pearse of Edmund Hall". The manuscript is also listed in the old catalogue of Parris-Whisson CUL MS Oo.7.53, f. 20r. The manuscript was probably previously owned by Jean-Baptiste Hautin (1580?-1640), whose collection partially passed to Moore. On f. 1v remains a short title in French: "Receuil".','Greek and Latin','Codex 3 + 1 + 327 + 1 + 3 Leaf height: 210 mm, width: 145 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00004-00016','https://images.lib.cam.ac.uk/iiif/MS-DD-00004-00016-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00004-00016',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2023,3,'MS Dd.4.17','Dd',NULL,NULL,NULL,'Book of Hours (Use of Sarum)',NULL,NULL,'Codex: i + 1 + 135 + 1 + i leaves. Leaf height: 215 mm, width: 155 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00004-00017','https://images.lib.cam.ac.uk/iiif/MS-DD-00004-00017-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00004-00017',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2024,3,'MS Dd.4.24','Dd','First quarter of the 15th century.',1400,1424,'Canterbury Tales','Preliminary note: Much of the medieval and early modern provenance of MS Dd.4.24 remains uncertain. The manuscript contains numerous annotations and inscriptions, often of names - all, some or none of which may be connected with its ownership. Many of the connections between these names and specific individuals were first put forward by John Manly and Edith Rickert (1940), but the evidence is often tenuous and the connections speculative, and they remain the subject of some debate. See Seymour (1997), Mosser (2011) and Da Rold (2013) for further discussion. Rather than reproduce what was proposed by Manly and Rickert, this description will instead list the locations and approximate dates of the names written into MS Dd.4.24, providing convenient links to these instances and the basis for future research. 8r : \'Hungerford\' (15th century). \'Hungerford\' has not been identified. (A \'Margery Hungerford\' signed her name in Cambridge, University Library, MS Ff.1.6, f. 14v , however the style of handwriting is different to that used here). 38r : \'Rychard Mervyn\' (16th century). Rychard/Richard Mervyn has not been identified. 146r : \'Thys ys Wyllyam Langstuns Boke\' (16th century). William Langston/Langdon (16th century) has not been identified. 180r : \'Said william rokes\' (16th/17th century). Another inscription on f. 120v might repeat the surname \'rokes\'. William Rokes/Rookes (16th/17th century) has not been identified, though the same name may also be found in Cambridge, University Library, MS Add. 6864. 150r : \'Wyllyam pully ys my name and he\' (16th/17th century). William Pully has not been identified. (A William Pulley was at Trinity College, Cambridge, 1584-91, vicar at various parishes in Kent 1596-1608 onwards. Will proven 1645. See: Venn:PLY584W. \'S W\' (16th/17th century). Initials blind-tooled on the covers of an earlier, 16th/17th-century binding, preserved on the front and rear pastedowns of the 19th-century binding (which itself has been replaced and is retained with the manuscript). \'S. W.\' has not been identified. Seymour suggests that the initials could indicate the manuscript\'s ownership by Samuel Ward (d. 1605) of Ipswich, though on what basis is not made clear, and this connection remains speculative.','Middle English, with some rubrics and marginal annotations in Latin. Not in LALME, but localised to London area (Thaisen and Da Rold (2009)). Previously localised to western Norfolk, Ely and Cambridgeshire (Manly and Rickert (1940))','Codex: iv + 180 + iv leaves. 36 leaves of parchment or paper have been inserted in place of missing leaves as part of the volume\'s conservation. See Custodial History for further information. These inserted leaves have not been digitised, with two exceptions, where the remains of a leaf have been incorporated and mis-numbered (f. 37 , as \'36b\'; and f. 188 , as \'188a\'). Leaf height: 285 mm, width: 190 mm. The dimensions here relate to the leaves of paper. Those of parchment are of irregular size and typically smaller than the paper leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00004-00024','https://images.lib.cam.ac.uk/iiif/MS-DD-00004-00024-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00004-00024',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2025,3,'MS Dd.4.39','Dd',NULL,NULL,NULL,'Psalter','The provenance of this manuscript is unclear.','Greek','Codex iv + 298 + iv','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00004-00039','https://images.lib.cam.ac.uk/iiif/MS-DD-00004-00039-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00004-00039',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2026,3,'MS Dd.4.40','Dd','1669',1669,1669,'Index of the Greek manuscripts in the Vatican Library','It was probably part of the Hautin library; it did not belong to Jean-Baptiste Hautin (who died in 1640), but was acquired by one of his descendants. After 1697, it entered into the collection of John Moore (1646-1714), bishop of Ely. However, the manuscript is neither listed in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697) nor in the handwritten supplementary list of Moore\'s manuscripts, now CUL MS Oo.7.50.2, compiled by Thomas Tanner (1674-1735) after the publication of Bernard\'s catalogue.',NULL,'Codex 2 + 111 + 4, Leaf height: 233 mm, width: 178 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00004-00040','https://images.lib.cam.ac.uk/iiif/MS-DD-00004-00040-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00004-00040',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2027,3,'MS Dd.4.42','Dd','second half of the 13th or 14th century',1350,1399,'Menaion for December','Owned by the priest Yūḥannā (John), son of the priest Ibrāhīm, as indicated by his note on f. 134v .',NULL,'Codex i + 167 + i Leaf height: 230 mm, width: 180 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00004-00042','https://images.lib.cam.ac.uk/iiif/MS-DD-00004-00042-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00004-00042',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2028,3,'MS Dd.4.44','Dd','First quarter of the 15th century.',1400,1424,'Medical recipes and charms for horses','Thomas Hobwood: his unfinished ownership inscription in a 16th-century script on f. 1r : \'Thomas Hobwood hys\'. Thomas Peapes: his name inscribed in a 16th-century script in the left margin of 6v : \'by me Thomas Peapes\'. John Lane: his name inscribed in a 17th- or 18th-century hand in the upper margin of 1v with the possible date \'1765\' inscribed in the upper margin of f. 2r . John Moore (1646-1714), bishop of Ely: MS Dd.4.45 (with which MSS Dd.4.43, Dd.4.45, and Dd.4.46 were formerly bound together) is no. 606 in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Middle English, Latin, and Middle French','Codex: ii + 36 + ii leaves. Leaf height: 235 mm, width: 160-165 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00004-00044','https://images.lib.cam.ac.uk/iiif/MS-DD-00004-00044-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00004-00044',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2029,3,'MS Dd.4.45','Dd',NULL,NULL,NULL,'Alchemical works','John Moore (1646-1714), bishop of Ely: no. 606 (inscribed on f. 1:1r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: ii + 10 | 13 | 9 | 12 + ii leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00004-00045','https://images.lib.cam.ac.uk/iiif/MS-DD-00004-00045-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00004-00045',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2030,3,'MS Dd.4.63','Dd','late 15th century.',1400,1499,'Lexicographic treatises','Owned by Jean-Baptiste Hautin (1580?-1640), who added his ex libris on f. iv verso , and " Harpocrationis vocabularium " on f. v recto . It later entered the possession of John Moore (1646-1714), bishop of Ely: number 998 in the handwritten supplementary list of Moore\'s manuscripts, now CUL, MS Oo.7.50.2, compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codexi-iii + iv-xii + 55 + xiii-xv Leaf height: 230-235 mm, width: 150 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00004-00063','https://images.lib.cam.ac.uk/iiif/MS-DD-00004-00063-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00004-00063',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2031,3,'MS Dd.5.5','Dd','Second quarter of the 14th century (probably c. 1330-1340).',1330,1340,'Breviary of Marie de Saint Pol','Marie de Saint Pol (c. 1304-1377), countess of Pembroke and wife of Aymer de Valence (c. 1270-1324), earl of Pembroke: shown kneeling in veneration before St Cecilia, wearing a heraldic mantle bearing the arms of Châtillon-Saint Pol impaled with Valence, on f. 388r . Other kneeling female figures, presumably also intended to represent Marie, are found on ff. 236r and 274r , and her arms were also frequently incorporated into the marginal decoration throughout the manuscript (see, for example, ff. 21r , 28v , 106r , 211r , 217v , 236r , etc). Perhaps William Morin, Franciscan confessor of Marie de Saint Pol; or Emma de Beauchamp, abbess of the Franciscan abbey at Bruisyard, Suffolk; or the house of Franciscan nuns at Denny Abbey, Cambridgeshire (see Introduction for further discussion and references). Erasure of \'Papa\' from the text, indicating the manuscript\'s presence in England during the Reformation (see ff. 422r , 430r , 434r , 438v , and elsewhere).',NULL,'Codex: i + 424 + i leaves. Leaf height: 200 mm, width: 135 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00005-00005','https://images.lib.cam.ac.uk/iiif/MS-DD-00005-00005-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00005-00005',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2032,3,'MS Dd.5.29','Dd','second half of the 17th century',1650,1699,'Transcriptions, notes and collations made by Abednego Seller',NULL,'Greek and Latin','Codex 95 , Leaf height: 185 mm, width: 143 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00005-00029','https://images.lib.cam.ac.uk/iiif/MS-DD-00005-00029-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00005-00029',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2033,3,'MS Dd.5.53','Dd','15th century.',1400,1499,'Medical and astrological treatises','Unknown owner, their erased ownership inscription in a 15th-century script on f. [iii] verso : "Liber Gilbert [...]". Unknown owner, their faded user inscription in a late 15th- or early 16th-century script on f. [iii] verso : "Per me Bartho[lomeus] A[...]". Unknown owner, their inscription of a price that may refer to the sum paid for the manuscript at the top of f. 1r : "Precium [?a] xiijs iiijd". Sewing guards recycled from a 15th-century document, containing references to the parish church of \'Westleueton\' (probably Westleton) (ff. 65v×66r) and to a monastery dedicated to St Mary at \'Wyveton\' (perhaps Binham Priory, near Wiveton) (ff. 69v×70r) – which together are suggestive of a Suffolk/Norfolk provenance at some point in the manuscript\'s early history. John Moore (1646-1714), bishop of Ely: no. 31 (inscribed on f. 1r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Latin and Middle English','Codex: ii + 2 + 88 ; 55 + iii leaves. Leaf height: 210 mm, width: 135-140 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00005-00053','https://images.lib.cam.ac.uk/iiif/MS-DD-00005-00053-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00005-00053',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2034,3,'MS Dd.5.76','Dd',NULL,NULL,NULL,'Medical treatises and recipes','John Moore (1646-1714), bishop of Ely: no. 772 (inscribed on f. 1r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: ii + 29 | 46 | 14 + vi leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00005-00076','https://images.lib.cam.ac.uk/iiif/MS-DD-00005-00076-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00005-00076',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2035,3,'MS Dd.6.9','Dd','Between c. 1590 and c. 1600',1590,1600,'Collection of medical, cosmetic, culinary and household recipes','John Troutbeck (bap. 1612, d. 1683), physician and chemist: perhaps owned the manuscript and signed his name on f. 55v : \'John Troutbeck\' (2x) and \'John Trout\'. If so, the \'E.T.\' who has marked recipes with their initials throughout the manuscript may be John\'s father: Edmund Troutbeck, who was known as a surgeon and doctor.','English and Latin','Codex, comprising 80 leaves in 8 paper quires, including two torn leaves (ff. 1, 5) and excluding five paper stubs (ff. 2, 3, 4, 25, 78): 80 leaves. Leaf height: 200 mm, width: 150 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00006-00009','https://images.lib.cam.ac.uk/iiif/MS-DD-00006-00009-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00006-00009',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2036,3,'MS Dd.6.18','Dd','second half of the 17th century, before 1693',1693,1693,'Byzantine and patristic religious texts','England','Greek','Codex 61 Leaf height: 201 mm, width: 152 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00006-00018','https://images.lib.cam.ac.uk/iiif/MS-DD-00006-00018-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00006-00018',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2037,3,'MS Dd.6.19','Dd','second half of the 17th century, before 1693',1693,1693,'Byzantine and patristic miscellany','England','Greek','Codex 2 + 91 Leaf height: 182 mm, width: 145 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00006-00019','https://images.lib.cam.ac.uk/iiif/MS-DD-00006-00019-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00006-00019',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2038,3,'MS Dd.6.29','Dd','Late 14th century and the first half of the 15th century.',1400,1449,'Medical miscellany','\'Sir William Howheton\': name inscribed on f. 14v (not noted by Binski and Zutshi), perhaps a member of the Hoghton family of Lancashire. There were two Sir William Hoghtons. Judging by the style of handwriting, the first is probably too early, having predeceased his father Sir Richard Hoghton (c. 1342-c. 1422). The second, Sir William Hoghton (d. 1501), seems a more likely match. In the calendar, neither \'pape\' (Gregory, f. 3v, glossed by a late 15th- / 16th-century hand \'ver\', for \'vere\'? (\'truly\'); Stephen, Sixtus, f. 8v; Marcus, f. 10v; Silvester, f. 12v) nor entries for the feast (f. 12v) and translation of St Thomas Becket (f. 7v) have been erased. This suggests that the manuscript remained in recusant hands during the 16th century, which would tally with continued ownership by the Hoghton family.','Latin and Middle English (dialect of ff. 110r-118v) supposedly Herefordshire (LALME)','Codex: iii + 118 + iii leaves. Leaf height: 190 mm, width: 125-35 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00006-00029','https://images.lib.cam.ac.uk/iiif/MS-DD-00006-00029-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00006-00029',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2039,3,'MS Dd.6.56','Dd',NULL,NULL,NULL,'Plutarch',NULL,'Greek and Latin','Codex iii + 83 + iii Leaf height: 146 mm, width: 95 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00006-00056','https://images.lib.cam.ac.uk/iiif/MS-DD-00006-00056-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00006-00056',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2040,3,'MS Dd.6.84','Dd','in the first half of the 17th century',1600,1649,'Lycophron\'s Alexandra',NULL,'in Greek and Latin','Codex 2 + 74, Leaf height: 140 mm, width: 90 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00006-00084','https://images.lib.cam.ac.uk/iiif/MS-DD-00006-00084-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00006-00084',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2041,3,'MS Dd.8.3','Dd','the first three quarters of the 15th century',1400,1499,'Greek-Latin lexicon','Owned by one J.-B. Hautin, probably the grandson of Jean-Baptiste Hautin (ca. 1580-1640) (Easterling, \'Two Greek MSS.\', p. 111, n. 1). Owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 987 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).',NULL,'Codex i + 159 Leaf height: 396 mm, width: 140 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00008-00003','https://images.lib.cam.ac.uk/iiif/MS-DD-00008-00003-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00008-00003',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2042,3,'MS Dd.8.12','Dd',NULL,NULL,NULL,'Bible','One of the manuscripts of Richard Holdsworth (1590-1649), Master of Emmanuel College.',NULL,'Codex: ii, 6 | 431 | 20 | 7, i leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00008-00012','https://images.lib.cam.ac.uk/iiif/MS-DD-00008-00012-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00008-00012',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2043,3,'MS Dd.8.19','Dd',NULL,NULL,NULL,'John Gower, Confessio amantis','The family name \'Levanthorp\' inscribed (but erased) in a 15th-century hand on f. 91v , perhaps John Leventhorpe, receiver-general of the Duchy of Lancaster. Pearsall and Mooney, A Descriptive Catalogue (2020), p. 29, suggest that he may have had a link with the lords De La Warr. Thomas West and Margery [? West], unidentified owner(s) or reader(s): their names inscribed in the same hand from the 15th century or early 16th-century on f. 134r : "Tomas West / Margry"; perhaps identifiable with Thomas West, 8th Baron De La Warr (c. 1457-1525), and his sister Margery West, and referred to in the two inscriptions on the same page: "My lady la Warr" (seemingly in the same hand as their names), and "My lord La warr" (probably written in a different and earlier hand). "Thallmache", unidentified owner or reader: their family name written in a late 15th- or early 16th-century hand on f. 134r . Pearsall and Mooney, A Descriptive Catalogue (2021), p. 29, suggest that this may refer to the Tollemache family of Helmingham in Suffolk. Brywys, unidentified owner or reader: their name inscribed in a late 15th- or early 16th-century hand on f. 134r . John Wlwaid: his name inscribed in a 16th-century hand in the lower margin of f. 128v : "To Jhon Wlwaid be thys deleuered". James of Carrigart, unidentified owner or reader: his name occuring five times in a 16th-century hand on f. 134r : "James de Carricart" and "James de Carriquart", perhaps an Anglicisation of Carraig Airt, Kilmacrennan, Donegal, Ireland, or Carreg y Garth, Carernarfon, Gwynedd, Wales. Christofer Whitton, unidentified owner or reader: his name inscribed in a 16th-century hand on f. 134r . Magister [Master] Asshe, unidentified: owned the manuscript probably in the first half of the 16th century. Donated the manuscript to Thomas Curson, according to an inscription on f. ii recto (see below). Thomas Curson (d. 1555), of Waterperry, Oxfordshire, Clerk Comptroller of the Queen\'s Household (see Kew, The National Archives, PROB-11-37-352 ): his name inscribed with a Latin motto on f. i verso , his ownership inscription on f. ii recto : "Master Thomas Curson ys the Honour of this booke ex dono Magistri Asshe", followed by a note about his donation of the manuscript with his signature (see below). Ambrose Belson, son of William Belson and Anne Curson, the sister of Thomas Curson, to whose second wife Agnes Saunders (d. before 1588) Ambrose was a servant and from whom he received the manuscript according to an inscription on f. ii recto : "Ambrose Belson is the honor of this boke of the gyfete of Mr Cursson - Thomas Cursson - Ambrose Belson". His signature ("Belson") inscribed in the lower margin of f. 115r . John Barton, owned the manuscript in the second half of the 16th century: his ownership inscription with a note that he received the manuscript from Ambrose Belson on f. ii recto : "Liber J [?F] Barton ex dono Ambrosij Belson". Perhaps the same "John Barton" who inscribed his name in squiggly lines on f. 134r . Eliza or Elizabeth Hampden, possibly the daughter of Edmund Hampden (d. 1577) and Isabel Curson (fl. 1577-1588), and great-niece of the aforementioned Thomas Curson and Anne Curson: her name written upside down in a late 16th-century or 17th-century hand in the upper margin of f. 57r . Richard Barton, may have inherited the manuscript from John Barton (possibly a relative): his signature inscribed in the upper margin of f. 74r . John Moore (1646-1714), bishop of Ely: no. 467 (inscribed on f. 1r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: ii + 2 + 127 + 1 + ii leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00008-00019','https://images.lib.cam.ac.uk/iiif/MS-DD-00008-00019-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00008-00019',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2044,3,'MS Dd.8.23','Dd','13th century',1200,1299,'Gospel lectionary (Saturdays, Sundays and weekdays)','Owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 20 in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).',NULL,'Codex ii + 212 + ii Leaf height: 395 mm, width: 303 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00008-00023','https://images.lib.cam.ac.uk/iiif/MS-DD-00008-00023-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00008-00023',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2045,3,'MS Dd.8.49','Dd',NULL,NULL,NULL,'Gospel lectionary','Owned by the deacon Ibrahīm, as indicated by his Greek and Arabic notes on ff. 21v-22r and 59v . The presence of two sequences of quire signatures in Armenian numerals indicates repeated rebindings by Armenian-speakers. This combination of features, combined with those of the text reused in the endleaves, suggests that the manuscript spent a considerable part of its history somewhere in the Levant, or in Cyprus.Owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 34 in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codex ii + 198 + v + ii Leaf height: 276 mm, width: 215 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00008-00049','https://images.lib.cam.ac.uk/iiif/MS-DD-00008-00049-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00008-00049',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2046,3,'MS Dd.9.69','Dd',NULL,NULL,NULL,'Gospel book','Owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 34 in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codex iii + 326 + ii Leaf height: 203 mm, width: 145 mm. The inserted folios bearing the miniatures are of smaller, variable dimensions: f. 13 Leaf height: 195-200 mm, width: 132-137 mm. f. 88 Leaf height: 200 mm, width: 134-142 mm. f. 139 Leaf height: 197 mm, width: 143 mm. f. 13 Leaf height: 191-200 mm, width: 126-135 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00009-00069','https://images.lib.cam.ac.uk/iiif/MS-DD-00009-00069-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00009-00069',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2047,3,'MS Dd.10.42','Dd','late 15th century',1400,1499,'Theocritus of Syracuse','Owned by Jean-Baptiste Hautin (1580?-1640). It later entered in possession of John Moore (1646-1714), bishop of Ely: number 853 in the handwritten supplementary list of Moore\'s manuscripts, now CUL, MS Oo.7.50.2, compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codex iii + 55 + ii Leaf height: 290 mm, width: 250 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00010-00042','https://images.lib.cam.ac.uk/iiif/MS-DD-00010-00042-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00010-00042',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2048,3,'MS Dd.10.44','Dd',NULL,NULL,NULL,'Medical treatises and recipes','William Parker (fl. 16th century): owned or accessed the book; his name inscribed on f. 149r : \'By me William Parker\'. Francis Slater (fl. 16th century: owned or accessed the book; his name inscribed on f. 149r : \'By me ffrauncis Slater\'. John Young (fl. 16th century): owned or accessed the book; his name inscribed on f. 149v : \'By me John Yowng\'. John Tyghte (fl. 16th century): owned or accessed the book; his name inscribed on f. 149v : \'John Tyghte\'. William Thorowgood (fl. 16th century): his ownership inscription on f. 149v : \'But I belonge to William Thorowgood only / for to all these he lent me [added:] and nowe was supervisour to Thomas Judwyn his Executour\'. Inscribed an entry on the birth of his daughter in 1561 on f. 102v .',NULL,'Codex: iii + 103 | 46 + iii leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00010-00044','https://images.lib.cam.ac.uk/iiif/MS-DD-00010-00044-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00010-00044',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2049,3,'MS Dd.10.54','Dd',NULL,NULL,NULL,'Ladder of Divine Ascent','The presence of a note in Italian on f. 1r suggests that the manuscript spent some time in Italy during the early modern period.','Greek','Codex i + 1 + 158 + 5 + i','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00010-00054','https://images.lib.cam.ac.uk/iiif/MS-DD-00010-00054-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00010-00054',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2050,3,'MS Dd.10.55','Dd','1425',1425,1425,'Erotemata',NULL,NULL,'Codexi + 107 + i Leaf height: 220 mm, width: 144 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00010-00055','https://images.lib.cam.ac.uk/iiif/MS-DD-00010-00055-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00010-00055',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2051,3,'MS Dd.11.45','Dd',NULL,NULL,NULL,'Medical treatises','Sir Thomas Knyvett (1539-1618): Knyvett\'s shelfmark is inscribed in the lower margin of f. 153v : \'Sed ― 53\'. See McKitterick (1978), p. 163 (MS 53). Thomas Knyvett (1596-1658): grandson of Sir Thomas Knyvett 1539-1618, inherited this manuscript together with Knyvett\'s collection. See McKitterick (1978), pp. 33-34.. John Knyvett (1623-1673): great-grandson of Sir Thomas Knyvett 1539-1618 and son of Thomas Knyvett (1596-1658), inherited this manuscript together with Knyvett\'s collection. See McKitterick (1978), p. 36 . Thomas Knyvett (d. 1693): great-great-grandson of Sir Thomas Knyvett 1539-1618 and son of John Knyvett (1623-1673), inherited this manuscript together with Knyvett\'s collection. Thomas died without heir and the Knyvett library was fragmented after his death: 57 of Knyvett\'s manuscripts had been acquired by John Moore [see below] by 1698. See McKitterick (1978), p. 37. John Moore (1646-1714), bishop of Ely: no. 195 (inscribed on f. 1r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: i + 117 | 16 | 9 | i leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00011-00045','https://images.lib.cam.ac.uk/iiif/MS-DD-00011-00045-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00011-00045',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2052,3,'MS Dd.11.54','Dd',NULL,NULL,NULL,'Lucian, Libanius, Severus Alexandrinus, Aelius Aristides and Pseudo-Nonnos','This manuscript was part of the library of Cardinal Niccolò Ridolfi (1501-1550): on f. 6v Ridolfi\'s designation is preserved (" nº 40 ").After being part of the estate of the Queen of France, Catherine de Medici (see Muratore (2009)), the book seems to have been removed from the French Royal collection before 1622 (when Nicolas Rigault compiled his catalogue), probably by the numismatist and Rigault\'s collaborator Jean-Baptiste Hautin (1580?-1640).After Hautin\'s death, the manuscript passed to John Moore (1646-1714), bishop of Ely. The manuscript is listed neither in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697) nor in the handwritten supplementary list of Moore\'s manuscripts, now CUL MS Oo.7.50.2, compiled by Thomas Tanner after the publication of Bernard\'s catalogue.','Greek','Codex iii + ii + 133 + i + iii Leaf height: 152-180 mm, width: 110-130 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00011-00054','https://images.lib.cam.ac.uk/iiif/MS-DD-00011-00054-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00011-00054',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2053,3,'MS Dd.11.70','Dd',NULL,NULL,NULL,'Theological treatises, scholia to dramas and the Iliad, and treatises on metric','Owned by John Moore (1646-1714), bishop of Ely: number 1001 in the handwritten supplementary list of Moore\'s manuscripts, now CUL MS Oo.7.50.2, compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codexii + 292 + ii Leaf height: 210-223 mm, width: 130-165 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00011-00070','https://images.lib.cam.ac.uk/iiif/MS-DD-00011-00070-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00011-00070',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2054,3,'MS Dd.11.90','Dd','last quarter of the 12th century or the first half of the 13th',1175,1199,'Act and Epistles book','Possibly owned by Demetrios Batas Owned by Kosmas Phrochmos (or Phromchos) Owned by John Luke (1634-1702), Professor of Arabic at Cambridge.',NULL,'Codex iv + 159 + iv Leaf height: 160 mm, width: 138 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00011-00090','https://images.lib.cam.ac.uk/iiif/MS-DD-00011-00090-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00011-00090',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2055,3,'MS Dd.12.23','Dd','First half of the 15th century.',1400,1449,'Compilation of legal and language texts','48v : Colophon contains the name \'Mershfeld\', perhaps a student attending the course at Oxford. 50v : \'Jhon Balding\', perhaps a former owner of the manuscript.',NULL,'Codex: i + 91 + i leaves. Leaf height: 175 mm, width: 135 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00012-00023','https://images.lib.cam.ac.uk/iiif/MS-DD-00012-00023-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00012-00023',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2056,3,'MS Dd.12.51','Dd',NULL,NULL,NULL,'Scientific and medical texts','Inscription by a 16th-century hand: \'Jhon Hanleys\'',NULL,'Codex: iii + v + 66 | 14 | 6 + iv + iii leaves. Leaf height: 135-155 mm, width: 95-105 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00012-00051','https://images.lib.cam.ac.uk/iiif/MS-DD-00012-00051-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00012-00051',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2057,3,'MS Dd.13.3','Dd','Second quarter of the 14th century.',1325,1349,'Apparatus in quinque libros Decretalium','\'Iste liber est Carthusiensem prope Magunciam\' (f. 256v ): Carthusian monastery of St Michael (originally St Peter), Mainz. Inscription written by a later 14th / early 15th-century hand. One of the manuscripts of Richard Holdsworth (1590-1649), Master of Emmanuel College.','Latin','Codex: i + 256 + ii leaves. The manuscript contains three stubs after the front pastedown and three stubs before the rear pastedown. The first and last are of parchment, the first blank and the last bearing writing on both sides. The rest are of paper and are blank. See Foliation. Leaf height: 375 mm, width: 245 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00013-00003','https://images.lib.cam.ac.uk/iiif/MS-DD-00013-00003-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00013-00003',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2058,3,'MS Dd.13.27','Dd','First half of the 16th century C.E. (c. 1524-1533)',1524,1533,'Tudor part book','The manuscript was owned by John Moore (1646-1714), Bishop of Ely. Bishop Moore\'s collection was donated to the University Library by King George I (1660-1727) in 1715. Listed in the 1856 catalogue as being bound with CUL MS Dd.13.28, a seventeenth-century legal manuscript which was also from the library of John Moore but the two manuscripts do not appear to have any prior connection.',NULL,'ii + 16 + iv + 17 + ii Leaf height: 321 mm, width: 224 mm. Written height: 245 mm, width: 187 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00013-00027','https://images.lib.cam.ac.uk/iiif/MS-DD-00013-00027-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00013-00027',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2059,3,'MS Dd.14.30.1','Dd','30 May 1652',1652,1652,'Biblical commentary',NULL,'Latin, Greek and Hebrew','Codex iii + 1 + 87 + ii Leaf height: 143 mm, width: 90 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00014-00030-00001','https://images.lib.cam.ac.uk/iiif/MS-DD-00014-00030-00001-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00014-00030-00001',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2060,3,'MS Dd.15.15','Dd',NULL,NULL,NULL,'Compilation of moral guidance texts','Folio 218v : erased ?ownership inscription. Front pastedown and rear pastedown : ownership inscription: \'Ecce magistro quippe Richardo Wallour iste | Presbitero codex pertinet exiguus\' (15th cent.). This may be the same Richard Wallour/Waller recorded as chaplain in the chantry of Robert Thorpe of Ashwellthorpe and whose will, dated 1506, is preserved at Norfolk Record Office (NCC will register Ryze 305), though this cannot presently be confirmed. John Moore (1646-1714), bishop of Ely: no. 6 in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697) ( i recto ).','Latin','Codex 4 + 2 + 218 Leaf height: 120 mm, width: 85 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00015-00015','https://images.lib.cam.ac.uk/iiif/MS-DD-00015-00015-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00015-00015',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2061,3,'MS Dd.15.27','Dd','1584',1584,1584,'Treatise on the Astrolabe','Owned by Fédéric Morel (ca. 1552-1630). Owned by one J.-B. Hautin, probably the grandson of Jean-Baptiste Hautin (ca. 1580-1640). (Easterling, \'Two Greek MSS.\', p. 111, n. 1) Probably owned by John Moore (b. 1646, d. 1714), bishop of Ely. Although it carries the Royal Library bookplate usually (but not invariably) indicating that a book belonged to the Moore collection, this manuscript is not recorded as part of that collection in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697), nor in the handwritten supplementary list of Moore’s manuscripts, now MS Oo.7.50(2), compiled by Tanner, Thomas, 1674-1735. However, since many other books previously owned by Hautin reached Cambridge University Library via the Moore collection, it is likely that this manuscript too was part of that collection.','Greek','Codex 44 Leaf height: 150 mm, width: 105 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-DD-00015-00027','https://images.lib.cam.ac.uk/iiif/MS-DD-00015-00027-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-DD-00015-00027',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2062,3,'MS Ee.1.3','Ee','Second half of the 15th century.',1450,1499,'Common Pleas entries','1r-22r : Simon Elryngham of Hackney (d. 1481/85), attorney of the Common Pleas and filazer of that court for Norfolk, 1442-1475: compiled and owned the manuscript as indicated by a rubrics on f. 4r : "Kalendare istius libri factum per Simonem Elrygnton" and f. 8v : "Simon Elryngton de Hakeney deo gracias"; and ownership inscriptions on f. clxxiv verso : "Liber Simonis Elryngton filiciarii Norff. in Communi Banco ihc. mercy"; f. cclxiv verso : "Liber S. Elryngton de Hakeney"; f. cclxvi verso : "Explicit quod Simon Elrygnton possessor totius libri etc. ihc". Simon Elryngton perhaps passed the manuscript down to his son John Elryngton (d. 1504), filazer for Hampshire and Wiltshire from 1460 to 1475, and then for London and Middlesex, deputy Custos Brevium as suggested by the item on f. 21v . 1r-22r : Tamezen Grenham: her name inscribed in a 16th-century script on f. 22r : "Tamezen Grenham and Alles her dowter". John Moore (1646-1714), bishop of Ely: no. 298 in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Latin, Middle English, and Middle French','Codex: 2 + 341 + 2 leaves. The endleaves at the beginning have been foliated ff. 1-2 and those at the end ff. 21-22. The core leaves include f. 12, a parchment stub with writing, a fragmentary leaf (f. v a), and leaves omitted in the 15th-century foliation sequence (ff. cvii a-f, cxxiii a-d, cxlvii a, clxvi a, clxvi a, clxviii a, and ccx a). However, unfoliated blank stubs after ff. cxiii, cxix, ccxlvii, cclxxvii, cclxxviii, and ccxciii are not included in this count. Leaf height: 255 mm, width: 170 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-EE-00001-00003','https://images.lib.cam.ac.uk/iiif/MS-EE-00001-00003-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-EE-00001-00003',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2063,3,'MS Ee.1.13','Ee',NULL,NULL,NULL,'Medical manuscript','Richard Slacke (fl. 1572): owned or accessed the manuscript in 1572: his initials inscribed on f. 139r ("Per me R.S. 1572") followed by a note: "I Rychard slacke beinge sike in bodye but whole" and another note by him on f. 38r and f. 94v : "1572 Mi mestar is sicat heys hart wisen hey wyll amend I canot tell verely bat god amen hem sone if yow cold amen hem wyll geff yow xli of good and lastelle [...] this monet of Dugland at the fest of natyvety of John Baptes nex ensueng"; perhaps Richard Slacke (1555-1593) of Derbyshire, son of William Slacke and Alice Scholey. Henry Hancoke (fl. c. 1573): his ownership inscriptions in the margins of: f. 19r : "Henry hancoke off the conty of darby woeth theys bock god ssend hem wyelle ssped of [...] all". f. 61v : "Henry hancok of stuble in the Conty of Darby wohs thes bock". f. 65v : "Henry hancok of stuble in the xxvi day of August in the xv yere of the Ren of owre sover". f. 92r : "Henry hancok of stuble est p[?ossessor]". f. 103v : "Henry hancok of stuble woeth thys book". Hancoke\'s name is written in the margins of: ff. 16v , 39v , 66r , 92r (with the name "Arthor Barekar of totle" in Hancoke\'s hand), 95v , 104v , 107r , 108v , 114v . Hancoke\'s name also appears in an erased inscription in the margin of f. 73v , and in a memorandum in the margin of f. 81v : "In name of god amen the xv day of August in the year of owr lord M d lxxiij I henry hancok of stuble seyll in bad of good and per[...]". John Moore (1646-1714), bishop of Ely: no. 196 (written on f. 1r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: iv + 2 | 96 | + 54 + iv leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-EE-00001-00013','https://images.lib.cam.ac.uk/iiif/MS-EE-00001-00013-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-EE-00001-00013',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2064,3,'MS Ee.1.15','Ee',NULL,NULL,NULL,'Collection of medical tracts and recipes','Robert Steel (fl. 17th century): his name inscribed on f. 4r . Perhaps the Robert Steele of Harpham, Yorkshire (b. c. 1623, d. 1688): admitted to Christ\'s College, Cambridge in 1640, and later headmaster of Beverley School 1645-47 and Hull School 1647-50, Vicar of Scarborough c. 1650-60, Rector of Catwick and later Brandesburton 1661-68 (see Venn, Alumni Cantabrigienses ). John Moore (1646-1714), bishop of Ely: no. 163 (f. 1r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: iii + 99 | 50 + iii leaves. Leaf height: 215 mm, width: 140-145 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-EE-00001-00015','https://images.lib.cam.ac.uk/iiif/MS-EE-00001-00015-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-EE-00001-00015',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2065,3,'MS Ee.2.29','Ee',NULL,NULL,NULL,'Theological and historical works','An unknown owner with the surname "Upton": inscribed in a late 15th- or early 16th-century hand a prayer-request for Christ to protect their family and the manuscript on f. 2v : "Dulcis semper ihesus vpton tueatur et librum". Sir Thomas Knyvett (1539-1618): Knyvett\'s shelfmark is inscribed in the lower margin of f. 257v : "Sed. 27" (and is repeated by a modern hand on f. 1r : "Knyvett Collection Sed. 27"). See McKitterick (1978), p. 160 (MS 27). Thomas Knyvett (1596-1658): grandson of Sir Thomas Knyvett 1539-1618, inherited this manuscript together with Knyvett\'s collection. See McKitterick (1978), pp. 33-34.. John Knyvett (1623-1673): great-grandson of Sir Thomas Knyvett 1539-1618 and son of Thomas Knyvett (1596-1658), inherited this manuscript together with Knyvett\'s collection. See McKitterick (1978), p. 36 . Thomas Knyvett (d. 1693): great-great-grandson of Sir Thomas Knyvett 1539-1618 and son of John Knyvett (1623-1673), inherited this manuscript together with Knyvett\'s collection. Thomas died without heir and the Knyvett library was fragmented after his death: 57 of Knyvett\'s manuscripts had been acquired by John Moore [see below] by 1698. See McKitterick (1978), p. 37. John Moore (1646-1714), bishop of Ely: no. 177 in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: 2 + 132 | 91 | 31 | + 1 leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-EE-00002-00029','https://images.lib.cam.ac.uk/iiif/MS-EE-00002-00029-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-EE-00002-00029',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2066,3,'MS Ee.3.59','Ee','Mid-13th century (perhaps c. 1255).',1255,1255,'Vie de seint Aedward le Rei','Since the manuscript is a copy of London/Westminster origin, it was perhaps made for Queen Eleanor\'s daughter-in-law, Eleanor of Castile on her arrival in England in 1255. It may have been one of the books about Sts Thomas and Edward repaired and rebound for Eleanor in 1288 (wardrobe account in The National Archives, E101/352/11 mem. 2: see B.F. and C.R. Byerly, Records of the Wardrobe and Household, 1286-1289 (1986), p. 379, no. 3217). Laurence Nowell (b. c. 1530, d. 1570), antiquary: name and date, 1563, inscribed on f. 3r . Nowell may have acquired the manuscript from William Bowyer (d. 1569/70), antiquary and Keeper of Records in the Tower, who made numerous manuscripts available to Nowell (see: Black (1982), p. 117 and n. 7). William Lambarde (b. 1536, d. 1601), antiquary and lawyer, and friend of Nowell\'s: name inscribed in archaised form on f. 3r ) (see: Black (1982), p. 116). \'Au Monsir Cope son Treschur Anye, Envoi a Guill. Lambard cest Poesie\': manuscript apparently given by Lambard to Sir Walter Cope (d. 1614), administrator, according to inscription on f. 3r (see Watson (1987), MS B2). Perhaps part of the collection of William Cecil, Lord Burghley (b. 1520/21, d. 1598), royal minister: it was apparently sold with other books from his library by T. Bentley and B. Walford, 21 Nov. 1687). John Moore (1646-1714), bishop of Ely: no. 36 (f. 2r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Anglo-Norman French','Codex: ii + 2 + 33 + 1 + iii leaves. Leaf height: 280 mm, width: 195 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-EE-00003-00059','https://images.lib.cam.ac.uk/iiif/MS-EE-00003-00059-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-EE-00003-00059',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2067,3,'MS Ee.4.24','Ee','Third quarter of the 13th century.',1250,1274,'Psalter','\'I. kerdings\' or \'I. herdings\' and \'Wyllyam Foolk\' or \'Foolle\': names inscribed in the late 15th or early 16th century, perhaps former owners (f. 4v ). According to Alison Stones (p. 16), these names have been \'tentatively attributed\' to John Herd (?1512-1588), historian and medical practitioner (Venn HRT529J), and William Fulke (1538-1589), Vice-Chancellor of the University of Cambridge 1581-52 (Venn FLK555W). Sir Thomas Knyvett (1539-1618) of Ashwellthorpe, book collector: characteristic shelfmark \'Sed: 41\' (f. 38v ) and inscription of name (subsequently scribbled over) (ff. 1r , 2r ). No. 41 in the catalogue of Knyvett\'s manuscripts made shortly after his death (now Cambridge, University Library, MS Ff.2.30), where it is described as \'Psalterium Davidicum\' (see McKitterick (1978), p. 162). Thomas Knyvett (1596-1658), grandson of Sir Thomas Knyvett (1539-1618): inherited this manuscript together with Knyvett\'s collection. See McKitterick (1978), pp. 33-34. John Knyvett (1623-1673), great-grandson of Sir Thomas Knyvett (1539-1618) and son of Thomas Knyvett (1596-1658): inherited this manuscript together with Knyvett\'s collection. See McKitterick (1978), p. 36. Thomas Knyvett (d. 1693), great-great-grandson of Sir Thomas Knyvett (1539-1618) and son of John Knyvett (1623-1673), inherited this manuscript together with Knyvett\'s collection. Thomas died without heir and the Knyvett library was fragmented after his death: 57 of Knyvett\'s manuscripts had been acquired by John Moore [see below] by 1698. See McKitterick (1978), p. 37. John Moore (1646-1714), bishop of Ely: no. 71 in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697) (see also f. 1r ).',NULL,'Codex: vii + 38 + vii leaves. Only the first of each set of blank endleaves has been photographed. Leaf height: 290 mm, width: 205 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-EE-00004-00024','https://images.lib.cam.ac.uk/iiif/MS-EE-00004-00024-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-EE-00004-00024',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2068,3,'MS Ee.4.29*','Ee','first half of the 12th century',1100,1149,'Collectio LXXXVII capitulorum','The manuscript to which this fragment belongs was owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 12 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).',NULL,'Codex i + 6 + i Leaf height: 260-272 mm, width: 200 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-EE-00004-00029-AST','https://images.lib.cam.ac.uk/iiif/MS-EE-00004-00029-AST-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-EE-00004-00029-AST',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2069,3,'MS Ee.4.29','Ee',NULL,NULL,NULL,'Canon law','Owned by John Moore (1646-1714), bishop of Ely: number 12 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codex iii + 353 + iii Leaf height: 270-277 mm, width: 200-207 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-EE-00004-00029','https://images.lib.cam.ac.uk/iiif/MS-EE-00004-00029-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-EE-00004-00029',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2070,3,'MS Ee.5.18','Ee',NULL,NULL,NULL,'Walter Atwell\'s Book of Readings','Walter Atwell (fl. c. 1520), member of the Staple Inn: compiled and owned the manuscript as indicated by the occurence of his name in ownership inscriptions and colophons throughout the manuscript: "Ihu mercy Lady help quod Walterus Atwell cujus anime propitietur" (f. 28r ); "Jhesu mercy lady help Quod Walterus Atwell cujus anime propitietur Deus" (f. 29r ); "Atwell Walterus" [in red ink] (f. 38r ); "Finis laudetur deus quod Walterus Atwell" (f. 41r ); "Llewta retaw" [his name written in reverse] (f. 52* recto ); "Atwell Waltero constat liber iste benigno" (f. 52* verso ); "Deo gracias quod Walterus Atwell artis Bacularius cuius anime propicietur deus amen Jhesus - Anno viij o h viij xxiij die julij finitur istud reporte in scriptis per me W.A. predictum etcaetera" (f. 49v ); " Jhesus nazarenus rex judeorum crucifixus fili dei vnu miserere nobis quod Walter Atwell" (f. 49v ); "Finis deo gracias quod Walterus Atwell" (f. 58v ); "Finis deo gracias Walterus Atwell" (f. 60v ); "Finis laudetur deus quod Walterus Atwell cuius anime propicietur Deus amen Jhesus Jhesus Jhesus esto mihi Jhesus Amen" (f. 95r ); "Finis hujus capituli quod Walterus Atwell" (f. 96r ). John Moore (1646-1714), bishop of Ely: probably no. 330 (this number also inscribed on f. i recto ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697), where the volume is described as "Matters relating to our Laws in the times of Edward II ... Edward VI" (identified in MS Oo.7.54).',NULL,'Codex: xviii + 55 | 45 | 5 | 1 + x leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-EE-00005-00018','https://images.lib.cam.ac.uk/iiif/MS-EE-00005-00018-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-EE-00005-00018',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2071,3,'MS Ee.5.22','Ee','Second half of the 15th century, probably c. 1485.',1485,1485,'Readings on Statutes','Baker and Ringrose describe some of the annotations on f. 50v as being in a hand \'resembling that of Francis Tate\'. Francis Tate (1560-1616) was an English antiquary and politician as well as a Member of Parliament for Northampton and Shrewsbury. John Moore (1646-1714), bishop of Ely: no. 327 in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Medieval Legal French, Latin, Middle English','Codex: i + 1 + 379 + i leaves. Leaf height: 295 mm, width: 200 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-EE-00005-00022','https://images.lib.cam.ac.uk/iiif/MS-EE-00005-00022-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-EE-00005-00022',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2072,3,'MS Ee.6.35','Ee','late 15th or early 16th century',1500,1599,'Chiliades and other works of Ioannes Tzetzes',NULL,'Greek','Codexiii + 301 + ii Leaf height: 194 mm, width: 145 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-EE-00006-00035','https://images.lib.cam.ac.uk/iiif/MS-EE-00006-00035-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-EE-00006-00035',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2073,3,'MS Ee.6.41','Ee','15th century.',1400,1499,'Johannes de Sancto Paulo, Breviarium; Matthaeus Platearius, De simplicibus medicinae','One of the manuscripts of Richard Holdsworth (1590-1649), Master of Emmanuel College.','Latin','Codex: ii + 3 + 235 + ii leaves. Leaf height: 170 mm, width: 115 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-EE-00006-00041','https://images.lib.cam.ac.uk/iiif/MS-EE-00006-00041-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-EE-00006-00041',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2074,3,'MS Ff.1.6','Ff',NULL,NULL,NULL,'Findern Manuscript',NULL,NULL,NULL,'https://cudl.lib.cam.ac.uk/iiif/MS-FF-00001-00006','https://images.lib.cam.ac.uk/iiif/MS-FF-00001-00006-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00001-00006',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2075,3,'MS Ff.1.7','Ff','in the 17th century, after 1624',1624,1624,'Collection of letters in Greek','The manuscript was owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 663 in the list of Moore\'s manuscripts published in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codex vii + 40+ vii, Leaf height: 195 mm, width: 145 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00001-00007','https://images.lib.cam.ac.uk/iiif/MS-FF-00001-00007-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00001-00007',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2076,3,'MS Ff.1.17.1','Ff','1180-1230 C.E.',1180,1230,'The Later Cambridge Songs','At the foot of folio 7v is a donation inscription in a fourteenth-century hand refering to the main volume of which this is orginally a flyleaf (Ff.1.17.2): "Summa de vitiis et vertutibus abbreviata ex dono fratris Rogeri de Schepiswed". Shepshed is a village west of Loughborough in Leicestershire. The manuscript was acquired from the library of Richard Holdsworth (1590-1649), Master of Emmanuel College, Cambridge, in 1664.',NULL,'iv + 8 + v Leaf height: 192-198 mm, width: 145-152 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00001-00017-00001','https://images.lib.cam.ac.uk/iiif/MS-FF-00001-00017-00001-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00001-00017-00001',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2077,3,'MS Ff.1.23','Ff','First half of the 11th century, perhaps as early as the fourth quarter of the 10th century.',1000,1049,'Bilingual Psalter in Old English and Latin','Matthew Parker (1504-1575), archbishop of Canterbury: partial pagination in characteristic red/orange crayon. Annotation in same crayon on front pastedown \'to y e Lord Keper\', indicating Parker\'s intention to give the manuscript to Sir Nicholas Bacon (1509-1579), Lord Keeper of the Great Seal. The manuscript is recorded as a bequest to Bacon in Parker\'s will of 1575 ( TNA PROB/11/57/423 ) - where it is described as \'Librum Psalterii Dauidis cum glosa Saxonice pulchre scriptum et Ligatum\' - but it was evidently in Bacon\'s possession before that date and by 1574 at the latest (see below for further details).',NULL,'Codex: iii + 278 + iii leaves. Leaf height: 270 mm, width: 160 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00001-00023','https://images.lib.cam.ac.uk/iiif/MS-FF-00001-00023-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00001-00023',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2078,3,'MS Ff.1.24','Ff',NULL,NULL,NULL,'Testaments of the Twelve Patriarchs','Transferred to Athens c.1175 as part of the library of Michael Choniates (1138-approximately 1222), archbishop of Athens. Seen in Athens c. 1200 by the English scholar John of Basingstoke, according to the medieval chronicler, Matthew Paris (1200-1259), and brought to England c.1240 under the orders of Robert Grosseteste (1175?-1253), Bishop of Lincoln. Contains numerous notes by the hand of Robert Grosseteste. After Grosseteste\'s death in 1253, the manuscript passed into the library of Greyfriars, Oxford where it was consulted by Roger Bacon (1214?-1294).',NULL,'i + i + 263 Leaf height: 255-259 mm, width: 204 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00001-00024','https://images.lib.cam.ac.uk/iiif/MS-FF-00001-00024-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00001-00024',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2079,3,'MS Ff.1.25(1)','Ff',NULL,NULL,NULL,'William of Malmesbury, Gesta pontificum Anglorum',NULL,NULL,'Codex: ix + iii + 59 + ix leaves. The nine modern paper endleaves at the front and rear have not been photographed. Leaf height: 270 mm, width: 190 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00001-00025-00001','https://images.lib.cam.ac.uk/iiif/MS-FF-00001-00025-00001-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00001-00025-00001',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2080,3,'MS Ff.1.25(2)','Ff','Mid-16th century (not after 1574).',1574,1574,'Gesta pontificum Anglorum (Book Five)','Matthew Parker (1504-1575), archbishop of Canterbury: text copied specifically as a supplement to the rest of the Gesta pontificum Anglorum (now MS Ff.1.25(1)) in Parker\'s possession. As with other volumes within MS Ff.1.25, this contains part of the sequence of partial pagination in characteristic red/orange crayon.','Latin','Codex: ix + 38 + ix leaves. The nine modern paper endleaves at the front and rear have not been photographed. Leaf height: 270 mm, width: 190 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00001-00025-00002','https://images.lib.cam.ac.uk/iiif/MS-FF-00001-00025-00002-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00001-00025-00002',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2081,3,'MS Ff.1.25(3)','Ff','Mid-16th century (not after 1574).',1574,1574,'Historia novella','Matthew Parker (1504-1575), archbishop of Canterbury: text copied specifically as a supplement to other historical works by William of Malmesbury (now MS Ff.1.25(1)-(2)) in Parker\'s possession. As with other volumes within MS Ff.1.25, this contains part of the sequence of partial pagination in characteristic red/orange crayon.','Latin','Codex: ix + 22 + ix leaves. The nine modern paper endleaves at the front and rear have not been photographed. Leaf height: 270 mm, width: 190 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00001-00025-00003','https://images.lib.cam.ac.uk/iiif/MS-FF-00001-00025-00003-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00001-00025-00003',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2082,3,'MS Ff.1.25(4)','Ff','Mid-13th century.',1200,1299,'Compilation of crusade texts','Erased inscription, perhaps the name of a former owner, on f. 1r . Matthew Parker (1504-1575), archbishop of Canterbury: partial pagination in characteristic red/orange crayon.','Latin','Codex: ix + 71 + ix leaves. The nine modern paper endleaves at the front and rear have not been photographed. Leaf height: 270 mm, width: 190 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00001-00025-00004','https://images.lib.cam.ac.uk/iiif/MS-FF-00001-00025-00004-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00001-00025-00004',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2083,3,'MS Ff.1.25(5)','Ff',NULL,NULL,NULL,'Geoffrey of Monmouth, Historia regum Britanniae',NULL,NULL,'Codex: ix + i + 35 + 4 + ii + ix leaves. The nine modern paper endleaves at the front and rear have not been photographed. Leaf height: 270 mm, width: 190 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00001-00025-00005','https://images.lib.cam.ac.uk/iiif/MS-FF-00001-00025-00005-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00001-00025-00005',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2084,3,'MS Ff.1.26','Ff','first half of the 16th century.',1500,1549,'Euthymius Zigabenus','It belonged to Matthew Parker, (1504-1575, Archbishop of Canterbury from 1559).','Greek','Codex 2 + 321 + 2, Leaf height: 273 mm, width: 180 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00001-00026','https://images.lib.cam.ac.uk/iiif/MS-FF-00001-00026-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00001-00026',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2085,3,'MS Ff.1.27','Ff',NULL,NULL,NULL,'MS Ff.1.27',NULL,NULL,'20 + 16 + 24 + 5 + 36 + 25 + 112 + 72 + xii Leaf height: 305 mm, width: 229 mm. Written height: 240 mm, width: 160 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00001-00027','https://images.lib.cam.ac.uk/iiif/MS-FF-00001-00027-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00001-00027',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2086,3,'MS Ff.1.28','Ff',NULL,NULL,NULL,'Richard of Cirencester, Speculum historiale de gestis regum Anglie','John Stow (?1525-1605), historian: memorandum on f. i recto recording Stow\'s exchange of this manuscript and another on parchment for a printed book with Matthew Parker, who presumably wrote the note: \'Memorandum that John Stowe coming to Lambith the [...] daye of Maie Anno 1572 was contented that this his booke with one all of parchment which I had of [him] should be left with me as my owne requiring to h[ave] Matthue Paris istorie printed which I delivered him [...] in exchange. And so he departed.\' (The note is now much faded and the present transcription, checked against what remains, is taken from an unpublished description of the manuscript by H.L. Pink: see Data Source(s)). Matthew Parker (1504-1575), archbishop of Canterbury: partial pagination and other additions in characteristic red/orange crayon.',NULL,'Codex: ii + 3 + 258 + 4 + ii leaves. Leaf height: 295 mm, width: 190 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00001-00028','https://images.lib.cam.ac.uk/iiif/MS-FF-00001-00028-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00001-00028',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2087,3,'MS Ff.1.30','Ff',NULL,NULL,NULL,'Pauline Epistles with catena',NULL,NULL,'Codex ii + 1 + 173 + 2 + ii Leaf height: 292 mm, width: 215 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00001-00030','https://images.lib.cam.ac.uk/iiif/MS-FF-00001-00030-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00001-00030',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2088,3,'MS Ff.3.2','Ff','1628-1634',1628,1634,'Commentarius magnus (in Psalmos)','Owned by Augustine Lindsell (d. 1634) Subsequently owned by Meric Cassaubon (1599-1671).',NULL,'Codexii + 1 + 141 + 1 + ii Leaf height: 336 mm, width: 242 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00003-00002','https://images.lib.cam.ac.uk/iiif/MS-FF-00003-00002-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00003-00002',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2089,3,'MS Ff.3.4','Ff',NULL,NULL,NULL,'Byzantine canonical texts','The codex was in the hands of the English merchant Edward Abbott, consul at Cairo in the 1650s (concerning him see Oates (1986), pp. 292-294 with bibliography), who donated it to Nicholas Hobart (ca. 1605-1657), Fellow of King\'s College in Cambridge from 1625 to 1650. This is stated in a message from Abbott to Hobart written on f. [ii] verso , dated 16th July 1650 in Cairo: " nº 2. Sir, this manuscript composed by Theodoro Ballamone of the Rites and Ceremonyes of the Greek church, hath some curiosityes in it, yet is not so perfect as I should have wished, however I desyre your acceptance of it, being the best that could heer be found, by your most affectionate servant Edw. Abbott. Grand Cayro, the 16th July 1650.". The wrong name (and spelling) of the author derives from an annotation in Greek on f. [ii] recto citing Theodor Balsamon. The wrong name was underlined and corrected by another hand as " Matthaeus Blasteres".','Greek','Codex i + 1 + 177+ i, Leaf height: 310 mm, width: 210 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00003-00004','https://images.lib.cam.ac.uk/iiif/MS-FF-00003-00004-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00003-00004',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2090,3,'MS Ff.3.6','Ff',NULL,NULL,NULL,'Commentary on the Psalms','Owned by Meric Cassaubon (1599-1671).',NULL,'Codex i + 7 + 54 + 11 + i Leaf height: 318-325 mm, width: 200-210 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00003-00006','https://images.lib.cam.ac.uk/iiif/MS-FF-00003-00006-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00003-00006',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2091,3,'MS Ff.3.9','Ff','Late 11th / 12th century.',1100,1199,'Homiliae in Ezechielem','1r : Pressmark \'TR\' (in monogram form), characteristic of manuscripts belonging to Christ Church Cathedral Priory, Canterbury in the 12th century. (See: James, The Ancient Libraries of Canterbury and Dover The Catalogues of the Libraries of Christ Church Priory and St. Augustine\'s Abbey at Canterbury and of St. Martin\'s Priory at Dover (Cambridge: at the University Press, 1903), pp. xxxi-xxxv). Marginal markings characteristic of manuscripts belonging to Christ Church: \'ice cream cone\', diagonal arrangement of dots, sometimes with descending lines of dots alongside the text. Recorded in the list of books at Christ Church, compiled during the time of Prior Henry of Eastry (Prior 1284-1331). No. 144 in M.R. James\'s edition (see: James, Ancient Libraries , pp. 32, 507). Recorded in the list compiled by William Ingram, custos of the shrine of St Thomas, of books repaired at Christ Church in 1508. No. 130 in M.R. James\'s edition (see: James, Ancient Libraries , pp. 157, 507). One of the manuscripts of Richard Holdsworth (1590-1649), Master of Emmanuel College.','Latin','Codex: i + 2 + 102 + 1 + i leaves. Leaf height: 325 mm, width: 225 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00003-00009','https://images.lib.cam.ac.uk/iiif/MS-FF-00003-00009-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00003-00009',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2092,3,'MS Ff.3.30','Ff','16th July 1550',1550,1550,'Greek medical works','The manuscript was bought in 1596, in Messina, by a certain hieromonk Neophytos of Sinai for the price of 15 tarì, as it is written in an annotation on the left pastedown : ͵αφϙϛ΄ ἀγόρασα τὸ παρὸν ταρία ιε΄ Νεόφυτος ἱερομόναχος Σιναίτης ἐν Μεσσήνῃ τῆς Σικελίας. The hieromonk Neophytos probably acquired the manuscript for Saint Catherine\'s Monastery on Mount Sinai. The codex indeed was there in 1618/1619: this date is mentioned in an official note by Ioasaph written on f. 257v , below the last text: Ἡ παροῦσα βίβλος τῇ ἱερᾷ μονῇ τοῦ Σιναίου ἁγίου ὄρους κεκλήρωται· συνοχῇ ἀρᾶς, καὶ δεσμοῦ, τὸν σφετερησόμενον ἀπείργουσα, διὰ τοῦ παρόντος τῆς ἐμεῖς (!) ταπεινότητος, διωρισθικοῦ γράμματος. ͵ζρκζ΄ ἐκ τοῦ (?) Σινᾶ ὄρους Ἰωάσαφ. (The last five words in monocondyle). The same note signed by Ioasaph in monocondyle is present in a manuscript which has remained until now in Saint Catherine\'s Monastery, MS Sinai, Saint Catherine\'s Monastery, gr. 74, f. 246r (a transcription of the note is found in Δ. Στρατηγοπουλος, Τὸ χειρόγραφο Θεοτοκάριο τοῦ Ἱδρύματος Παπανικολάου (Κομοτηνή) καὶ ὁ κωδικογράφος Ἱερεμίας Μαγγαφούρης ο Σιναϊτης, in Byzantina Symmeikta 27 (2017), pp. 315-346: 337). The codex was in the hands of the English merchant Edward Abbott, consul at Cairo in the 1650s (concerning him see Oates 1986, pp. 292-294 with bibliography), who donated it to Nicholas Hobart (ca. 1605-1657), Fellow of King\'s College in Cambridge from 1625 to 1650. This is stated in a message from Abbott to Hobart written on f. i verso , dated 16th July 1650 in Cairo: " nº 1. Sir, this manuscript I obteyned by favor of a friend out of the publique library of the Bishopp of Mount Sinai resident heere in Grand Cayro, wharein though the Synopsis on Gallens\' book of Terapephtike and his problems on the humours bee common, yet I suppose that the Physicall Treatises of Simeon Protomestraki of Antioch, of the most learned Psellius, and the problems of Alexander Aphrodisius, are more rare and usefull. You will finde it iust 100 yeares from this 16th of July 1650 since the finishing of this book by George of Constantinople. Wich accept from your most affectionate servant Edw. Abbott. Grand Cayro, this 16th July 1650."','Greek','Codex 1 + 258, Leaf height: 355 mm, width: 245 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00003-00030','https://images.lib.cam.ac.uk/iiif/MS-FF-00003-00030-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00003-00030',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2093,3,'MS Ff.4.2','Ff',NULL,NULL,NULL,'Late Antique commentaries on the Book of Genesis','Owned by one J.-B. Hautin, probably the grandson of Jean-Baptiste Hautin (ca. 1580-1640) (Easterling, \'Two Greek MSS.\', p. 111, n. 1). Owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 975 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codex 3 + 298 + 2','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00004-00002','https://images.lib.cam.ac.uk/iiif/MS-FF-00004-00002-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00004-00002',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2094,3,'MS Ff.4.3','Ff','1563-1564',1563,1564,'Byzantine canon law','Probably owned by Gaspar de Guzmán, Count-Duke of Olivares (1587-1645). Owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 976 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codexii + 3 + 241 + 4 + ii Leaf height: 301 mm, width: 210 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00004-00003','https://images.lib.cam.ac.uk/iiif/MS-FF-00004-00003-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00004-00003',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2095,3,'MS Ff.4.42','Ff','after c. 850 with glosses added between the latter half of the ninth century and the early eleventh century',NULL,NULL,'Cambridge Juvencus','Written in Wales; McKee tentatively suggests that the presence of the cryptogram on fol. 36r suggests that the manuscript may have been written in a monastery close to the court at Gwynedd where the code, devised by an Irishman, Dubthach, was known in the early ninth century or in the region of the lower Usk and lower Wye valleys where the bishop Cymelliauc was active (McKee 2000:28). By the early eleventh century, the manuscript was in England, possibly at Worcester, where fols 2-5 were glossed in an Anglo-Caroline hand (McKee 2000:38). There is no evidence of later medieval ownership; the earliest modern owner who can be discerned is Richard Amadas, rector of Hallingbury Magna, Essex 1585-1629 who annotated the manuscript in several places. Directly or indirectly, Ff.4.42 passed into the possession of Richard Holdsworth (1590-1649) who acquired several other Amadas books. Holdsworth\'s collection passed to the University Library in 1664.',NULL,'55 folios Leaf height: 260 mm, width: 195 mm. Written height: 215-240 mm, width: 150-160 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00004-00042','https://images.lib.cam.ac.uk/iiif/MS-FF-00004-00042-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00004-00042',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2096,3,'MS Ff.4.47','Ff','in the first half of the 16th c.',NULL,NULL,'Byzantine Miscellany','The manuscript was probably owned by the physician and book collector Richard Mead (1673-1754) ( Stubbings 1976, pp. 316-317; Easterling 2000, pp. 114-115). The codex was later owned by the book collector Anthony Askew (1722-1774) (see also McKendrick 2020: 119).','Greek','Codex iii + 118 + iii The leaves of the manuscript have been heavily trimmed. Some leaves containing marginal notes, being bigger than the rest of the manuscript, have been folded ( ff. 5r-7v ). Some leaves, by contrast, have been trimmed more on the external margin and are therefore narrower. ff. [i]-65, [iv]-[vi] Leaf height: 213 mm, width: 150 mm. ff. 66-118 Leaf height: 213 mm, width: 143 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00004-00047','https://images.lib.cam.ac.uk/iiif/MS-FF-00004-00047-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00004-00047',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2097,3,'MS Ff.5.5','Ff','15th century.',1400,1499,'Legal texts','Corbett (fl. 16th century): "Registrum Corbet" inscribed on ff. i recto , 1r , 1v , and 2r . The Middle English poems on 204v have the added title: "Consulare Cura Corbettes". According to Baker and Ringrose (1996), he may have been Reynold Corbert (d. 1566), J.Q.B. Francis Tate (d. 1616), bencher of the Middle Temple: ? his number \'41\' inscribed on f. 205v (see Baker and Ringrose (1996)). John Moore (1646-1714), bishop of Ely: no. 501 (f. 1r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697), Volume 2 Part 1, p. 373 (no. 9649).','Latin and Middle English','Codex: i + 206 + i leaves. Leaf height: 225 mm, width: 165 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00005-00005','https://images.lib.cam.ac.uk/iiif/MS-FF-00005-00005-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00005-00005',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2098,3,'MS Ff.5.8','Ff','between the end of the 12th and the beginning of the 13th century',1200,1299,'Rhetoric','The manuscript was owned by the Neapolitan humanist Antonio Seripando (1476-1531), as stated in the note on f. 108v : "Antonij Seripandi ex Jani Parrhasii testamento". Seripando inherited the library of the humanist Aulus Janus Parrhasius (1470-1522). At Seripando’s death, his books passed on to his brother, Cardinal Girolamo Seripando (1493-1563), who in turn bequeathed his library to the Augustinian convent of San Giovanni a Carbonara in Naples. Before being declared a \'Royal Library\' by King Ferdinand IV of Naples in 1792, the convent library was predated on several occasions and in some instances manuscripts and books were sold by the monks themselves.',NULL,'Codex i + 2 + 107 + 1 + i, Leaf height: 230 mm, width: 125 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00005-00008','https://images.lib.cam.ac.uk/iiif/MS-FF-00005-00008-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00005-00008',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2099,3,'MS Ff.5.45','Ff',NULL,NULL,NULL,'Devotional texts','\'Elizabethe\' (f. 32r ), \'John Whyte\', \'(?)Wm saynes\' \'(?)Warnese\' (\'\'Starnes\' (?)\' in Hanna (2010)) (f. 72v ): names inscribed by hands of the 16th- and 17th-century. John Moore (1646-1714), bishop of Ely: no. 760 (f. [v] recto ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: i + iv + 2 | 70 + iv + i leaves. Leaf height: 215 mm, width: 145 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00005-00045','https://images.lib.cam.ac.uk/iiif/MS-FF-00005-00045-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00005-00045',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2100,3,'MS Ff.6.8','Ff','1st quarter of the 15th century.',1400,1499,'Book of Hours','John Moore (1646-1714), bishop of Ely: no. 38 (f. 2r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Latin and Middle English','Codex: 3 + 140 leaves. Leaf height: 185 mm, width: 125 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00006-00008','https://images.lib.cam.ac.uk/iiif/MS-FF-00006-00008-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00006-00008',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2101,3,'MS Ff.6.32','Ff','around the 1530s',NULL,NULL,'Euclid\'s Elements','The manuscript was owned by a certain J.B. Hautin, probably to be identified with Jean Baptiste II Hautin, son of the French scholar and numismatist Jean-Baptiste Hautin (ca. 1580-1640): on f. 1v there is a title by the hand, which occurs in almost all Hautin\'s manuscripts: " Euclidis geometria " (see Jackson 2006, p. 33 no. 5). It passed afterwards to John Moore (1646-1714), bishop of Ely: number 1043 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of C. Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697) (see also McKitterick 1986, p. 142, and Jackson 2006, p. 33 no. 5).','Greek','Codex 82, Leaf height: 162 mm, width: 100 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00006-00032','https://images.lib.cam.ac.uk/iiif/MS-FF-00006-00032-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00006-00032',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2102,3,'MS Ff.6.51','Ff',NULL,NULL,NULL,'Collection of theological works','One of the manuscripts of Richard Holdsworth (1590-1649), Master of Emmanuel College.',NULL,'Codex: ii + 3 + 60 | 294 + ii leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00006-00051','https://images.lib.cam.ac.uk/iiif/MS-FF-00006-00051-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00006-00051',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2103,3,'MS Ff.6.53','Ff','2nd half of the 13th century.',1200,1299,'Florilegium','One of the manuscripts of Richard Holdsworth (1590-1649), Master of Emmanuel College.','Latin','Codex: iii + 289 + iii leaves. Paper stubs before f. ii recto and after f. v verso indicate that two later endleaves have been removed: f. [i] and f. [vi]. Leaf height: 120 mm, width: 80 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00006-00053','https://images.lib.cam.ac.uk/iiif/MS-FF-00006-00053-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00006-00053',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2104,3,'MS Ff.6.56','Ff','between 1639 and 1675',1639,1675,'Callimachus','Stanley\'s annotations were reportedly used by the classical scholar Richard Bentley (1662-1742) ( A Short Account of Dr. Bentley\'s Humanity and Justice to those Authors who have written before him, with an honest Vindication of Thomas Stanley, Esq., and his Notes on Callimachos (London 1699)).','Greek and Latin','Codex 6 + 77 Leaf height: 166 mm, width: 111 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00006-00056','https://images.lib.cam.ac.uk/iiif/MS-FF-00006-00056-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00006-00056',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2105,3,'MS Ff.6.57','Ff','between 1639 and 1675',1639,1675,'Callimachus','Stanley\'s annotations were reportedly used by the classical scholar Richard Bentley (1662-1742) ( A Short Account of Dr. Bentley\'s Humanity and Justice to those Authors who have written before him, with an honest Vindication of Thomas Stanley, Esq., and his Notes on Callimachos (London 1699)).',NULL,'Codex 20 + 109 Leaf height: 149 mm, width: 96 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-FF-00006-00057','https://images.lib.cam.ac.uk/iiif/MS-FF-00006-00057-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-FF-00006-00057',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2106,3,'MS Gg.1.1','Gg','First half of 14th century, after 1307 C.E.',1307,1307,'Trilingual compendium of texts','A note on fol. i(v) in a seventeenth-century hand reads: \'Bought of Mr Washington\'. Washington is well-known as a London bookseller of the seventeeenth century (cf. Watson 1966, p. 29). The manuscript was owned by John Moore (1646-1714), Bishop of Ely. Bishop Moore\'s collection was donated to the University Library by King George I (1660-1727) in 1715.',NULL,'ii + 633 + ii Leaf height: 215 mm, width: 148 mm. Written height: 157-165 mm, width: 110 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00001-00001','https://images.lib.cam.ac.uk/iiif/MS-GG-00001-00001-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00001-00001',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2107,3,'MS Gg.1.2','Gg',NULL,NULL,NULL,'Greek rhetorical, musical, grammatical miscellany','This manuscript, like many others in the CUL collection, was owned by a certain J.-B. Hautin, probably to be identified with Jean Baptiste II Hautin, son of the French scholar and numismatist Jean-Baptiste Hautin (approximately 1580-1640) (on this matter see Jackson 2006, pp. 38-40 with bibliography; on this manuscript see p. 33 in particular). On f. [i] verso has been pasted a paper sheet with an index written by a hand recurring in the manuscripts owned by J.-B. Hautin; moreover the same hand wrote a title on f. [i] verso . The manuscript was later owned by John Moore (1646-1714), bishop of Ely: number 1047 in the concordance of Bernard / Tanner numbers with the new Library classmarks, with \'Alia Addenda\', compiled by F.S. Parris and Stephen Whisson in 1753, now MS Oo.7.56.',NULL,'Codex 1 + 326 + 1 Leaf height: 213 mm, width: 140 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00001-00002','https://images.lib.cam.ac.uk/iiif/MS-GG-00001-00002-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00001-00002',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2108,3,'MS Gg.1.8','Gg',NULL,NULL,NULL,'Compilation of alchemical works, including the \'Crowning of Nature\'',NULL,NULL,'Codex: 52 | 25 | 68 | 6 | 1 leaves. Leaf height: 200 mm, width: 145 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00001-00008','https://images.lib.cam.ac.uk/iiif/MS-GG-00001-00008-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00001-00008',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2109,3,'MS Gg.1.10','Gg',NULL,NULL,NULL,'Macrobius and Mattheus Platearius','John Moore (1646-1714), bishop of Ely: no. 822 (f. 1r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: i + 1 + 52 | 84 | 2 + i leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00001-00010','https://images.lib.cam.ac.uk/iiif/MS-GG-00001-00010-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00001-00010',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2110,3,'MS Gg.2.33','Gg',NULL,NULL,NULL,'Greek texts on mathematics, astronomy and geography','This manuscript, like many others in the CUL collection, was owned by a certain J.B. Hautin, probably to be identified with Jean Baptiste II Hautin, son of the French scholar and numismatist Jean-Baptiste Hautin (approximately 1580-1640) (on this matter see Jackson 2006, pp. 38-40 with bibliography). On f. [i] verso there is a summary of the manuscript\'s contents written by a hand which appears in the majority of Hautin\'s manuscripts, with title " Recueil d\'autheurs grecs de mathematique". The manuscript was later owned by John Moore (1646-1714), bishop of Ely: number 974 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).',NULL,'Codex 1 + 265 + 1 Leaf height: 285 mm, width: 210 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00002-00033','https://images.lib.cam.ac.uk/iiif/MS-GG-00002-00033-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00002-00033',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2111,3,'MS Gg.2.34','Gg','first half of the sixteenth century',NULL,NULL,'Greek texts on music','An unpublished description made by the librarians of Cambridge University Library before the manuscript was rebound in 1964 (CUL ULIB 7/3/72/33), describing the binding, attributes possession of the manuscript to the French scholar Jean-Baptiste Hautin (approximately 1580-1640), stating that there was a title written in his hand. Like many other Greek manuscripts now at Cambridge University Library, this codex was owned by him or his son Jean-Baptiste Hautin II (or possibly with his nephew Jean Baptiste III; on the problem of the identification of Hautin see Jackson 2006, pp. 38-40) and passed later to John Moore (b. 1646, d. 1714), bishop of Ely: number 980 in the handwritten supplementary list of Moore\'s manuscripts, now MS CUL Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697). On the left pastedown is glued the engraved bookplate made by John Pine for the Royal Library (1737).','Greek','Codex ii + 16 + xiv, Leaf height: 280 mm, width: 192 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00002-00034','https://images.lib.cam.ac.uk/iiif/MS-GG-00002-00034-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00002-00034',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2112,3,'MS Gg.3.6','Gg','Fourth quarter of the 14th century.',1375,1399,'Dante Alighieri, Divina commedia','Coats of arms of the Orsini di Patigliano, Becuti and Tricino families incorporated in border decoration (f. 3r ), presumably indicative of early provenance or association. Giachino da Saladuo: name inscribed on f. 252r , late 14th century. Note signed by I. Zuchari on f. 1v , early 15th century. Jean-Baptiste Hautin (approximately 1580-1640). John Moore (1646-1714), bishop of Ely: no. 1012 ( front cover ) in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Italian and Latin','Codex: ii + 2 + 248 + 2 + ii leaves. Two additional notes - one attached to f. [iv] verso, the other loose and stored with the manuscript - have been digitised but are not counted in this statement of extent. Leaf height: 260 mm, width: 180 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00003-00006','https://images.lib.cam.ac.uk/iiif/MS-GG-00003-00006-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00003-00006',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2113,3,'MS Gg.3.15','Gg','1650s',NULL,NULL,'Thomas Stanley, Adversaria','Owned by John Moore (b. 1646, d. 1714), bishop of Ely: no. 668 in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek and Latin','Codex 420, Leaf height: 290 mm, width: 195 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00003-00015','https://images.lib.cam.ac.uk/iiif/MS-GG-00003-00015-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00003-00015',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2114,3,'MS Gg.4.6','Gg','Second quarter of the 14th century, probably c. 1330-1340.',1330,1340,'Le Roman de la Rose','\'Ric. Smythei liber\' (f. 2r ) and \'R. Smithe\' (f. 7v ): ownership inscriptions of Richard Smith (fl. 16th century) Smith, Richard, fl. 16th century, as yet unidentified. \'Robert Smith his booke\' (f. 113v : ownership inscription of Robert Smith (fl. 16th/17th centuries), as yet unidentified but perhaps related (?son) to Richard Smith (see above). \'John dygby\' (f. 7v ): possible ownership inscription of John Dygby (fl. 16th/17th centuries), as yet unidentified. \'Richard Beltham is his book witnes John harris and\' (f. 94v : possible ownership inscription of Richard Beltham (fl. 17th century), as yet unidentified. \'29\' written inside a circle (adjacent to another number, similarly inscribed but subsequently crossed out): perhaps a pressmark, as yet unidentified. John Moore (1646-1714), bishop of Ely: no. 834 ( front pastedown ) in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Old French','Codex: iv + 2 + 137 + 2 + iv leaves. Folios 1 and 142 were formerly pastedowns; now lifted. Leaf height: 320 mm, width: 230 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00004-00006','https://images.lib.cam.ac.uk/iiif/MS-GG-00004-00006-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00004-00006',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2115,3,'MS Gg.4.18','Gg','First quarter of the 15th century (after 1410).',1410,1410,'De consolatione philosophiae','\'Anne Preston\': name inscribed in plummet on f. 54r , with shorter forms or trials also to be found on ff. 24r , 33v , 79v and 96r . Perhaps Anne Paget, née Preston (d. 1587), wife of William Paget (1506-1563), 1st Baron Paget. One of the manuscripts of Richard Holdsworth (1590-1649), Master of Emmanuel College.','Middle English, with some paratext written in Latin','Codex: ii + 112 + ii leaves. Dimensions height: 265 mm, width: 170 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00004-00018','https://images.lib.cam.ac.uk/iiif/MS-GG-00004-00018-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00004-00018',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2116,3,'MS Gg.4.27(1)','Gg',NULL,NULL,NULL,'Anthology of Geoffrey Chaucer\'s literary works, with other texts',NULL,NULL,NULL,'https://cudl.lib.cam.ac.uk/iiif/MS-GG-00004-00027-00001','https://images.lib.cam.ac.uk/iiif/MS-GG-00004-00027-00001-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00004-00027-00001',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2117,3,'MS Gg.4.27(2)','Gg','First quarter of the 14th century',1300,1324,'The Geste of King Horn, with fragments of other Middle English verse texts','10r : annotation mark in the margin (a curved line above two dots), also found in other manuscripts known to have belonged to the antiquary Joseph Holland (d. 1605) (see, for example: London, British Library, Cotton MS Vespasian E.v, ff. 18v, 19r, 19v). Holland was apparently responsible for having this quire bound together with what is now MS Gg.4.27(1) , which contains Holland\'s ownership inscription on ff. 5r (now erased, but located directly beneath the border flourishing in the lower margin) and 516v (also erased, but located directly beneath the Cambridge University Library stamp in the lower margin). MS Gg.4.27(1) also contains Holland\'s annotation mark, on ff. 166v and 213v. There is a note by \'J.M.K.\' - i.e. John Mitchell Kemble (1807-1857) - in a volume containing other leaves that were added to MS Gg.4.27(1) by Holland: see MS Gg.4.27(1), f. (2r . This confirms that the leaves now bound separately as MS Gg.4.27(2) were at that time, and probably originally, positioned after f. 516v of MS Gg.4.27(1) (f. 482v by the foliation in ink, the numbering added by Holland and the only foliation sequence in the volume at the time that Kemble saw it). Almost certainly one of the manuscripts of Richard Holdsworth (1590-1649), Master of Emmanuel College.','Middle English','i + 14 + i leaves. Leaf height: 220-250 mm, width: 130-160 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00004-00027-00002','https://images.lib.cam.ac.uk/iiif/MS-GG-00004-00027-00002-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00004-00027-00002',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2118,3,'MS Gg.4.31','Gg','Sixteenth century C.E.',NULL,NULL,'Vision of Piers Plowman','Possibly owned and annotated at the time of its creation by someone who signs themselves W.H. In 1656, the manuscript was given by Robert Morgan (1608-1673), later bishop of Bangor and alumnus of Jesus College, to Cambridge University Library.',NULL,'ii + 106 + ii Leaf height: 250 mm, width: 174 mm. Written height: 238 mm, width: 140 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00004-00031','https://images.lib.cam.ac.uk/iiif/MS-GG-00004-00031-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00004-00031',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2119,3,'MS Gg.5.35','Gg','Mid-11th century (after 1039).',1039,1039,'Compilation of classical, late antique and medieval poetic works (including the \'Cambridge Songs\')','iii verso : \'D. xi Gra ii\': pressmark of the Benedictine abbey of St Augustine, Canterbury.A catalogue of the library of the Benedictine abbey of St Augustine, Canterbury, compiled between 1375 and 1420, survives in a transcription made between 1474 and 1497. Though this catalogue refers to the location of books using the same pressmark system as that found inscribed in this manuscript on f. iii verso (see above), this manuscript is not found among those books recorded in the catalogue. Barker-Benfield argued that further leaves may have been lost from the end of that manuscript and, furthermore, through the use of cross-references, it is possible to reconstruct what their likely contents were - among them, the present manuscript. Dublin, Trinity College, MS 360 Barker-Benfield (2008), pp. 3, 1615, 1701, 1709-1714; BA1.M1847 The manuscript remained at the Benedictine abbey of St Augustine, Canterbury through the 15th century: folio numbers were added to the leaves of the manuscript and to the table of contents by the hand of Clement Canterbury (fl. 1463-95). Barker-Benfield (2018), p. 1839 Gibson et al. (1983), p. 144 and n. 14 (citing identification by Bruce Barker-Benfield. Titles of texts from this manuscript are among those recorded in a fair copy of notes by John Leland on the occasion of a visit to the Benedictine abbey of St Augustine, Canterbury (these notes were later published in 1715 as Leland\'s De rebus Britannicis collectanea ). Leland\'s recording of monastic traditions as related by the monks themselves, and other evidence, confirms that this visit must have occurred prior to the abbey\'s Dissolution on 30 July 1538. Oxford, Bodleian Library, MS Top. gen. c. 3, p. 5 Barker-Benfield (2008), pp. 1673-74, 1684-86; BA7.21a-g.','Latin','Codex: ii + 1 + i + 1 + 443 + iii leaves. Leaf height: 215 mm, width: 145 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00005-00035','https://images.lib.cam.ac.uk/iiif/MS-GG-00005-00035-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00005-00035',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2120,3,'MS Gg.6.3','Gg','c. 1310-c. 1350.',1310,1350,'Astronomy and astrology','Adam Easton (c. 1330-1397), Benedictine monk and scholar: possibly acquired by him when he studied at Gloucester College, Oxford. Donated to Norwich Cathedral Priory by Adam Easton (c. 1330-1397): pressmark \'X Clxx\' on f. 1r . The letter \'X\' was allocated to Easton\'s donations (see: Ker, \'Medieval Manuscripts from Norwich Cathedral Priory\' (1949), p. 21; Ker, Medieval Libraries of Great Britain (1964), p. 136). John Style (fl. 16th century): his name inscribed on f. [i] recto : \'Jhon Style\' [3x] and: \'Jhon\' (erased). William David (fl. 16th century): his name inscribed on f. [i] recto : \'willelmus David\' and: \'Wyllyam\' (in a different hand), possibly followed by a classmark: \'33\'. Thomas Knyvett (c. 1539-1618), of Ashwellthorpe: no. 56 in his library as indicated by the classmark on f. 391v : \'Sed - 56\' (see McKitterick (1978), p. 163 [no. 56]). John Moore (1646-1714), bishop of Ely: no. 238 (this number inscribed on f. [i] recto ) in the handwritten supplementary list of Moore\'s manuscripts, now CUL Oo.7.50.2, compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Latin','Codex: 7 + 388 + 8 leaves. Some leaves are smaller or of irregular size as a consequence of being formed of off-cuts of parchment, but have nevertheless been counted in Extent (and are foliated). Leaf height: 190 mm, width: 120 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00006-00003','https://images.lib.cam.ac.uk/iiif/MS-GG-00006-00003-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00006-00003',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2121,3,'MS Gg.6.10','Gg','the second quarter of the 16th century and 1563',1563,1563,'Michael Psellos','Owned by J.-B. Hautin, probably to be identified with Jean-Baptiste II Hautin, son of the French scholar and numismatist Jean-Baptiste Hautin (c. 1580-1640). On f. 34v , on the leaf\'s upper border, there is an annotation by the hand that occurs in almost all Hautin\'s manuscripts: " Psellus in Platonis psycogoniam" (see also Jackson 2006, p. 33). The codex was later owned by John Moore (1646-1714), bishop of Ely: number 1016 in the handwritten supplementary list of Moore\'s manuscripts, now MS CUL Oo.7.50(2), compiled by Thomas Tanner after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codex i + 42 + i, Leaf height: 185 mm, width: 115 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00006-00010','https://images.lib.cam.ac.uk/iiif/MS-GG-00006-00010-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00006-00010',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2122,3,'MS Gg.6.43','Gg','first half of 17th century',1600,1649,'Achilles Tatius, The Adventures of Leucippe and Clitophon','Owned by John Moore (1646-1714), bishop of Ely: number 219 of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697) .','Greek','Codex i + 104 + i Leaf height: 200 mm, width: 155 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-GG-00006-00043','https://images.lib.cam.ac.uk/iiif/MS-GG-00006-00043-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-GG-00006-00043',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2123,3,'MS Hh.1.10','Hh','Third quarter of 11th century C.E.',1050,1074,'Ælfric, Grammar and Glossary','Ker ascribes a Christ Church, Canterbury provenance based on the suggestion that it was bound with London, British Library, MS Cotton Domitian A.viii, an assertion that has been refuted by Dumville. Drage suggests that although the manuscript is not identifiable in the inventories of 1327 or 1506, it remained at Exeter until the sixteenth century (p. 338). It was owned by Matthew Parker (1504-1575), Archbishop of Canterbury.',NULL,'[i] + vi + 93 + ii Leaf height: 204 mm, width: 140 mm. Written height: 155 mm, width: 98 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-HH-00001-00010','https://images.lib.cam.ac.uk/iiif/MS-HH-00001-00010-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-HH-00001-00010',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2124,3,'MS Hh.6.11','Hh','13th century.',1200,1299,'Compilation of theological texts','f. 2r : Ramsey Abbey: Given to the treasury ( armariolo ) of Ramsey Abbey by brother Ralph de Olneya, inscribed rubric for the list of contents, Isti libri continentur in hoc uolumine quod quidem uolumen frater R. de Olneya dedit Armariolo Ramesye . f. i recto : possibly Samuel Clarke: ownership inscription, perhaps date of acquisition: Sam Clarke. Maij 17, 1658 . John Moore (1646-1714), bishop of Ely: no. 881 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50.2, compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Latin, with few notes in Middle English and Anglo-Norman French','Codex: i + 71 + i leaves. Leaf height: 200 mm, width: 150 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-HH-00006-00011','https://images.lib.cam.ac.uk/iiif/MS-HH-00006-00011-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-HH-00006-00011',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2125,3,'MS Hh.6.12','Hh','at the very end of the 15th or very beginning of the 16th century',1500,1599,'Gospel book','Probably owned by one Robert Poyntz, perhaps Robert Poyntz (c. 1535-), author of Testimonies for the real presence of Christes body and blood in the blessed Sacrament... (Louvain 1566). Owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 665 in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).',NULL,'Codex i + 1 + 186 + 1 + i Leaf height: 200 mm, width: 148 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-HH-00006-00012','https://images.lib.cam.ac.uk/iiif/MS-HH-00006-00012-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-HH-00006-00012',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2126,3,'MS Hh.6.13','Hh',NULL,NULL,NULL,'Theological works','John Moore (1646-1714), bishop of Ely: no. 136 (f. 1r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: i + 2 | 83 | 1 + i leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-HH-00006-00013','https://images.lib.cam.ac.uk/iiif/MS-HH-00006-00013-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-HH-00006-00013',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2127,3,'MS Ii.1.16','Ii',NULL,NULL,NULL,'Compilation of medical texts',NULL,NULL,'Codex: ii + 2 + 39 | 18 | 134 | 25 + 2 + ii leaves. Leaf height: 195 mm, width: 140 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00001-00016','https://images.lib.cam.ac.uk/iiif/MS-II-00001-00016-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00001-00016',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2128,3,'MS Ii.1.33','Ii','Second half of 12th century.',1150,1199,'Homilies and saints\' lives, in Old English','Matthew Parker (1504-1575), archbishop of Canterbury: partial pagination in characteristic red/orange crayon. It is unknown from where Parker acquired the manuscript. Bremmer and Dekker (2013) suggest the possibility that her may have found it in Ely during his time as canon there 1541-1554, or during his visitation in 1563 (see Schipper (1983)).','Old English, with some passages in Latin','Codex: v + + 1 + 226 + iii leaves. There are two blank endleaf guards, foliated \'i bis\' and \'vi bis\'. They have not been counted as leaves in this statement of extent. Leaf height: 220 mm, width: 160 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00001-00033','https://images.lib.cam.ac.uk/iiif/MS-II-00001-00033-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00001-00033',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2129,3,'MS Ii.2.4','Ii','Third quarter of the 11th century C.E.',1050,1074,'Alfred the Great\'s Old English translation of Gregory the Great\'s Pastoral Care','Almost certainly written at Exeter. It was acquired by Matthew Parker (1504-1575), Archbishop of Canterbury probably before 1568 and presumably directly from the chapter library at Exeter. Parker owned several Exeter manuscripts, for example, CUL MS Ii.2.11 which contains an inscription recording its donation to Parker by Gregory Dodds, Dean of Exeter, by 1566. MS Ii.2.4 is no. 6 in the listing of manuscripts given to Cambridge University Library by Parker in 1574.','Old English','1 (pastedown), 2bis, 3-146, 149, 149bis, 150, 150bis, 151, 151bis, 152 (pastedown). Two leaves are missing at the beginning before fol. 3 and two at the end after fol. 146 . Leaf height: 330 mm, width: 225 mm. Written height: 278 mm, width: 160 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00002-00004','https://images.lib.cam.ac.uk/iiif/MS-II-00002-00004-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00002-00004',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2130,3,'MS Ii.2.5','Ii',NULL,NULL,NULL,'Medical texts','A hitherto unidentified manuscript formerly used or in the possession of Roger Marchall (fl. 1436-1477), doctor of medicine: rubrics written in his characteristic handwriting on ff. 1r , 17r , 44r (over an erased line of text) and 63r . For further details of Marchall and other manuscripts containing his handwriting, see L. Voigts, \'A doctor and his books: the manuscripts of Roger Marchall (d. 1477)\', in R. Beadle and A.J. Piper (eds.), New science out of old books: studies in manuscripts and early printed books in honour of A.I. Doyle (Aldershot, 1995) pp. 249-314',NULL,'Codex: ii + 24 | 19 | 19 | 36 + ii leaves. Leaf height: 340 mm, width: 240 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00002-00005','https://images.lib.cam.ac.uk/iiif/MS-II-00002-00005-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00002-00005',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2131,3,'MS Ii.2.12','Ii','First half of the 15th century.',1400,1449,'Middle English commentary on the Gospel of Matthew','\'Matth. Saunders\': ownership inscription on f. 4r . Probably the Matthew Saunders (d. 1622) recorded as being admitted as fellow-commoner of Gonville and Caius College on 5 May 1593; member of Middle Temple, 1594; knighted, 1617; died 1622 (see Venn:SNDS593M). In addition to the present manuscript, Saunders also owned Cambridge, University Library, MS Ff.6.20 and MS Ff.6.45-49, both 13th-century copies of the Bible, and both of which later passed into the hands of Richard Holdsworth. See Oates (1986), p. 344. One of the manuscripts of Richard Holdsworth, Master of Emmanuel College (1590-1649).','Middle English [LALME:\'MS in one hand...Analysis from fff. 92v-97v, 112r-116r. LP 164. Grid 472 360. Nottinghamshire\']','Codex: ii + 148 + ii leaves. Leaf height: 320 mm, width: 225 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00002-00012','https://images.lib.cam.ac.uk/iiif/MS-II-00002-00012-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00002-00012',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2132,3,'MS Ii.3.17','Ii',NULL,NULL,NULL,'Alchemical and Astrological Texts','?Ownership inscription of a Wylhemus Chauseyin a 15th or 16th century hand: \'Ego Wylhelmus Chausey publicus\' (f. 161r ). ?Ownership inscription of a William Martyn in 15th- or 16th-century hand: \'Ego Wylhelmus Martyn publicus\' (f. 162r ).',NULL,'Codex: iv + 47; 112 | 2 + iv leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00003-00017','https://images.lib.cam.ac.uk/iiif/MS-II-00003-00017-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00003-00017',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2133,3,'MS Ii.3.21','Ii',NULL,NULL,NULL,'Boethius, De consolatione philosophiae; Geoffrey Chaucer, Boece',NULL,NULL,'Codex: ii + 8 | 172 | 118 + ii leaves. Leaf height: 320 mm, width: 220 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00003-00021','https://images.lib.cam.ac.uk/iiif/MS-II-00003-00021-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00003-00021',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2134,3,'MS Ii.3.25','Ii','in the 14th century',1300,1399,'John Chrysostom','Toward the middle of the 16th century, the manuscript was conserved in Rochester Cathedral. In 1564, it was given to Matthew Parker (1504-1575, Archbishop of Canterbury from 1559) by the dean of Rochester Cathedral, as is specified in the Latin inscription on the pastedown : "Hic grecus codex quondam fuit Theodori Archiepiscopi Cantuariensis et servatus in Ecclesia Cathedrali Roffensi: eius ecclesie Decanus dedit eum Mattheo Cantuariensi anno 1564." The manuscript was counted by Matthew Parker among the books believed to have belonged to Theodore of Tarsus (d. 690), archbishop of Canterbury.','Greek with few notes in Latin','Codex2 + 145 + 1 Leaf height: 235 mm, width: 155 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00003-00025','https://images.lib.cam.ac.uk/iiif/MS-II-00003-00025-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00003-00025',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2135,3,'MS Ii.4.6','Ii',NULL,NULL,NULL,'Homilies in Old English',NULL,NULL,'Codex: ii + 6 + 1, i, 148, ii, 147, ii, 1, i, 1, ii + i + xvi + i + ii leaves. The manuscript opens with eight endleaves, two added to the volume when it was most recently bound and six added when it was bound in the 16th century (see Binding for further details). From that point onwards, the medieval portion of the manuscript begins, however leaves were added in various places during the 16th century in order to supply space for a table of contents, a printed accompaniment to part of the text, or text missing through the loss of leaves. These different leaves have been enumerated above and distinguished from the medieval leaves by commas. The plus sign separates this medieval section from the various endleaves or added leaves that precede or follow it. (See Part 2\'s Additions for further details of the contents of some of these). Two unfoliated paper stubs are present after f. 21, in place of two excised leaves, and were added in order to secure the binding of the two leaves (ff. 16-17) that were originally conjoint with them. Being stubs rather than partial leaves, they are not included in this statement of extent. However, since one of them does contain a 19th/20th-century annotation in pencil, they have been assigned numbers for the purpose of this digital record (see Foliation).','https://cudl.lib.cam.ac.uk/iiif/MS-II-00004-00006','https://images.lib.cam.ac.uk/iiif/MS-II-00004-00006-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00004-00006',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2136,3,'MS Ii.4.16','Ii','10 November 1479',1479,1479,'Introduction to Grammar','Bought in Rome in 1476 or 1479 by John Shirwood (d. 1494), Bishop of Durham and papal protonotary. Owned by Richard Harton and then by his son Walter Harton. Owned by Gabriel Applebie in 1614. Owned by Meric Casaubon (1599-1671).',NULL,'Codexi + 2 + 151 + 1 + i Leaf height: 237 mm, width: 175 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00004-00016','https://images.lib.cam.ac.uk/iiif/MS-II-00004-00016-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00004-00016',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2137,3,'MS Ii.4.26','Ii','Early 13th century.',1200,1299,'Bestiary','73r : \'Iacobus Thomas Herison Thys ys y e Abbaye of Rev-\', cropped inscription, suggesting the manuscript was perhaps at the Cistercian abbey of Revesby, Lincolnshire, by the 16th century. However, this ownership was rejected by N.R. Ker, Medieval Libraries of Great Britain , 2nd edn. (1964), p. 158.',NULL,'Codex: 4 leaves of parchment have been inserted in place of missing leaves, when the volume was rebound (for further information on which, see Foliation and Binding). These inserted leaves have been digitised but have not been counted here as part of the manuscript\'s extent. For the sake of clarity, it has been decided not to enumerate them separately either. iv + 74 + iii leaves. Leaf height: 280 mm, width: 190 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00004-00026','https://images.lib.cam.ac.uk/iiif/MS-II-00004-00026-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00004-00026',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2138,3,'MS Ii.5.11','Ii','Mid-15th century.',1400,1499,'Aldobrandino da Siena, Régime du corps','Owned by King Henry VII of England (1457-1509) and Elizabeth of York (1465-1503): their impaled coat of arms painted onto one side of an added bifolium (f. 6v ), presumably after their marriage in 1486. On the tomb in which Henry and Elizabeth are buried in Westminster Abbey, Henry\'s arms are presented above, with these impaled arms below. In such a context, presenting a \'joint\' coat of arms in addition to Henry\'s would presumably have been redundant, thus raising the possibility that the impaled arms are indicative not of joint ownership but rather of Elizabeth\'s personal possession of this manuscript. The name \'Will(?elmus) Walter(?us)\' on f. 86r next to a Latin couplet (see Contents for further information) and the word \'llinpenff\'(?), all in what appears to be the same 16th-century hand. A William Walter (d. 1523) was known to Henry VII, whom he briefly served as an envoy at the papal curia in the late 1490s. This Walter had studied at Bologna earlier in that decade and was subsequently recorded as doctor of canon and civil law there; he spent the last two decades of his life as archdeacon of Brecon. The word \'llinpenff\' bears the hallmarks of an as yet unidentified Welsh placename that began \'Llyn...\' (meaning \'lake\'), which is also suggestive of a possible connection between this manuscript and this Walter. Another William Walter (fl. c. 1525-1533), poet and translator, was alive around this time. He may have been the owner of London, British Library, MS Sloane 1686, f. 1r , a copy of the Canterbury Tales, which bears an ownership inscription matching his name, written in a later, different style of handwriting to the inscription found in MS Ii.5.11. Little is known about this second Walter\'s life, and Ralph Griffiths has put forward suggestive evidence that the two Walters are one and the same. R. Griffiths, \' From Bologna to Brecon: The Cosmopolitan World of a Pre-Reformation Archdeacon \', Medieval Prosopography 33 (2018), pp. 153-166 A.S.G. Edwards, \'Walter, William (fl. c. 1525-1533), Oxford Dictionary of National Biography (2004) [ https://doi.org/10.1093/ref:odnb/28641 ] The manuscript may have left the Royal library by c. 1535-1542. MS Ii.5.11 is not listed among the 123 French manuscripts and printed books recorded by an anonymous French visitor to Richmond Palace in 1535. The list is printed in H. Omont, \'Les manuscrits français des rois d\'Angleterre au château de Richmond\', in Etudes romanes dédiés à Gaston Paris (Paris: É. Bouillon, 1891), pp. 1-13 and in CBMLC 7, pp. 3-29 as list \'H1\' with minor variations from Omont\'s list. Nor is MS Ii.5.11 in the list of the books in the Upper Library at Westminster made in 1542 shortly after the death of Henry VIII, which includes four copies of the Régime du corps identified in CBMLC 7 as Lisbon, Biblioteca de Ajuda MS 52-XIII-2, London, British Library, MS Royal 20.B.ix, London, British Library, MS Royal 16.F.8, and London, British Library, MS Royal 20.B.x; the 1542 Westminster list is printed in CBMLC 7 as list \'H2\', see esp., H2 nos 1291, 1294, 1299(1-2). CBMLC 7, H1 and H2 John Moore (1646-1714), bishop of Ely: no. 577 (f. 2r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Middle French with some annotations in Latin and Middle English','Codex: i + 4 + 2 + 80 + i leaves. Leaf height: 275 mm, width: 210 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00005-00011','https://images.lib.cam.ac.uk/iiif/MS-II-00005-00011-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00005-00011',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2139,3,'MS Ii.5.44','Ii',NULL,NULL,NULL,'Aristotle','The manuscript probably belonged to the library of Baldassar Migliavacca, who seems to be responsible for the restoration of quire 11*.The manuscript certainly later entered into the collection of John Moore (1646-1714), bishop of Ely: number 981 (classmark noted on front pastedown ) in the handwritten supplementary list of Moore\'s manuscripts, now CUL Oo.7.50.2, compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).',NULL,'Codex iii + 147 + i Leaf height: 270-290 mm, width: 220 mm. A strip of 20 x 200 mm has been cut off from f. 1 and replaced with modern parchment.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00005-00044','https://images.lib.cam.ac.uk/iiif/MS-II-00005-00044-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00005-00044',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2140,3,'MS Ii.6.2','Ii','Late 14th century.',1300,1399,'Book of Hours','Addition of St Etheldreda, patron saint of Ely, to the Calendar (f. 8v ) and of a prayer to her (f. 102v ) point to early ownership in East Anglia. Addition of obituaries to the calendar indicate that the manuscript was in Suffolk by the first half of the fifteenth century: f. 5r : \'Obitus domine Margerie Carbonell uxoris domini I[ohannis] C[arbonell] m[ilitis], Anno domini Millesimo CCCC mo vicesimo vi to , littera dominicalis e\' / \'The death of Margerie Carbonell, wife of Sir John Carbonell [of Badingham in Hoxne Hundred], in the year of Our Lord 1426, dominical letter e\': i.e. 2 March 1426 (not 4 March, the line on which the inscription begins). f. 8r : \'Obitus Margarete Heuenyngham, Anno domini Millesimo CCCCxxxii, littera dominicalis G\' / \'The death of Margaret Heveningham, in the year of Our Lord 1432, dominical letter G\': i.e. 2 September 1432 (not 1 September, the line on which the inscription begins). The individuals named may have been former owners, though no explicit evidence of their possession of the manuscript exists, and it is equally possible that the book was in the hands of unnamed relatives. Addition of impaled coat of arms of the Tilney and Thorpe families (f. 2v ) indicates that the manuscript was later in Norfolk, later in the 15th and/or in the early 16th centuries. Additions and notes relating to members of the Roberts family indicate the manuscript was in Middlesex, certainly during the second half of the 16th century and perhaps for longer: f. 33r : \'The tyme of Byrth of Thomas Robertz Children\', with dates of birth ranging from 1508 to 1531. f. 109v : further dates of birth for Roberts family children, with dates ranging from 1550 to 1574. The individuals named may have possessed or accessed the manuscript, individually or jointly, and at varying times, however the only evidence that points more firmly towards ownership are the recurrent additions and inscriptions by Thomas Roberts (1470-1542) and Edmund Roberts (1521-1585) of Willesden. The latter wrote his name in many places, usually across openings that contain miniatures, and often with the date 1553, which may be when he acquired the book (ff. 4r , 33v-34r , 37v-38r , 44v-45r , 54r , etc). f. 103v : a further inscription relating to a child\'s date of birth, probably made by a parent or other family member and perhaps after the manuscript had left the possession of the Roberts family: \'Memorandum that Anne Barnesdale was borne 16 day of September 1588 on a Monday\'. John Moore (1646-1714), bishop of Ely: no. 151 (f. 2r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Latin, with additions in Latin and Middle English','Codex: ii + 3 + 94 + 3 + ii leaves. Leaf height: 195 mm, width: 130 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00006-00002','https://images.lib.cam.ac.uk/iiif/MS-II-00006-00002-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00006-00002',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2141,3,'MS Ii.6.5','Ii',NULL,NULL,NULL,'Constantinus Africanus, al-Khwarizmi, Hermannus Contractus, and other texts','Ownership inscription and list of the contents on 2v showing that the volume (i.e., all composite parts) belonged to the Abbey of Bury St Edmunds by the late-14th century as the ownership inscription and the list of the contents are in the hand of Bury monk Henry of Kirkestead (d. c. 1378). John Moore (1646-1714), bishop of Ely: no. 911 (f. 3r ) in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697). Also recorded as no. 57 (on p. 390) in the Appendix to Moore\'s library in Bernard.',NULL,'Codex: ii + 2 | 102 | 8 | 16 + ii leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00006-00005','https://images.lib.cam.ac.uk/iiif/MS-II-00006-00005-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00006-00005',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2142,3,'MS Ii.6.17','Ii',NULL,NULL,NULL,'Miscellany','John Moore (1646-1714), bishop of Ely: no. 217 (inscribed in ink on f. 1r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: i + 55 | 20 | 42 + iii leaves. Leaf height: 150 mm, width: 110 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00006-00017','https://images.lib.cam.ac.uk/iiif/MS-II-00006-00017-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00006-00017',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2143,3,'MS Ii.6.31','Ii','15th century.',1400,1499,'The Book of Privy Counselling','Owned and annotated by Stephen Batman, who used the manuscript for his transcription, now Harvard University, Houghton Library, MS Eng 1015 (see Edwards (1999), p. 269). Name inscribed at the top of f. 64v (now faint). (For further discussion of Batman\'s book ownership and reading practices, see: M.B. Parkes, \'Stephan Batman\'s manuscripts\', in Medieval heritage: essays in honour of Tadahiro Ikegami (Tokyo: Yushodo Press, 1997), pp. 125-56, and Simon Horobin, \'Stephan Batman\'s manuscripts of Piers Plowman \', Review of English Studies , 62 (2011), pp. 368-372). According to an inscription on f. [i] verso , the manuscript was given by Stephen Batman to a William Danby, perhaps William Danby (fl. 1542-1593), lawyer and coroner. \'William Danby [...] given unto hym by Stephen Batman\'. Peter Hooker (fl. 1613): name inscribed on f. 64v , with the date 1613.','Middle English and Latin','Codex: i + 1 + 64 + 1 + i leaves. Leaf height: 160 mm, width: 125 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00006-00031','https://images.lib.cam.ac.uk/iiif/MS-II-00006-00031-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00006-00031',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2144,3,'MS Ii.6.32','Ii','850-1000 C.E.',1000,1000,'Book of Deer','The Columban house at Deer, Aberdeenshire; probably at Cistercian monastery of Deer, Aberdeenshire, 13th-14th century C.E.; Thomas Gale, 1695; acquired in 1697 from Gale by John Moore (d. 1714); presented to University Library by George I, 1715',NULL,'86 fols Leaf height: 157 mm, width: 108 mm. Written height: 108 mm, width: 71 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00006-00032','https://images.lib.cam.ac.uk/iiif/MS-II-00006-00032-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00006-00032',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2145,3,'MS Ii.6.33','Ii',NULL,NULL,NULL,'The Boke of Rota and The Knowing of Woman\'s Kind in Childing','John Moore (1646-1714), bishop of Ely: no. 253 in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697). This number cannot be found in the manuscript, but the description in Bernard matches the contents and it may be that the number was lost when the first leaf was excised and the manuscript rebound and/or bound with MS Ii.6.34.',NULL,'Codex: i + 32 | 36 | 3 + i leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00006-00033','https://images.lib.cam.ac.uk/iiif/MS-II-00006-00033-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00006-00033',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2146,3,'MS Ii.6.39','Ii',NULL,NULL,NULL,'Collection of medical, astrological, and theological works','Thomas Ball (fl. late 16th or early 17th century): his name inscribed on the lower margins of ff. 53v-54r (written upside down): \'Th. Ball\'; and also on ff. 231v-232r: 231v-232r : \'Ball me (?) sanum\'; perhaps Thomas Ball (1590-1659), of Emmanuel College Cambridge, and vicar of All Saints Northampton. John Moore (1646-1714), bishop of Ely: no. 126 (f. 1r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: Volume I: iii + 4 | 62 | 8 | 57 + iii leaves. Volume II: iii + 56 | 28 | 23 | 82 + iii leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00006-00039','https://images.lib.cam.ac.uk/iiif/MS-II-00006-00039-I-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00006-00039',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2147,3,'MS Ii.6.41','Ii','17th century',1600,1699,'Epictetus, Aesop and Ignatios the Deacon','The manuscript was owned by John Moore (b. 1646, d. 1714), bishop of Ely: numbers 9845, 9846, 9847 of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697). The fact that the manuscript is identified in Bernard with three numbers, referring respectively to each of the three texts it contains, suggests that maybe at the time it was preserved unbound, each text forming an independent part.','Greek','Codex i + 2 + 96 + 3 + i, Leaf height: 133 mm, width: 75 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00006-00041','https://images.lib.cam.ac.uk/iiif/MS-II-00006-00041-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00006-00041',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2148,3,'MS Ii.6.43','Ii',NULL,NULL,NULL,'Devotions','Sir Thomas Knyvett (1539-1618): Knyvett\'s shelfmark is inscribed on f. 159v (with off-set on f. 160v ): "Sed. 64". Not identified in McKitterick (1978), p. 164 (MS 64). Thomas Knyvett (1596-1658): grandson of Sir Thomas Knyvett 1539-1618, inherited this manuscript together with Knyvett\'s collection. See McKitterick (1978), pp. 33-34.. John Knyvett (1623-1673): great-grandson of Sir Thomas Knyvett 1539-1618 and son of Thomas Knyvett (1596-1658), inherited this manuscript together with Knyvett\'s collection. See McKitterick (1978), p. 36 . Thomas Knyvett (d. 1693): great-great-grandson of Sir Thomas Knyvett 1539-1618 and son of John Knyvett (1623-1673), inherited this manuscript together with Knyvett\'s collection. Thomas died without heir and the Knyvett library was fragmented after his death: 57 of Knyvett\'s manuscripts had been acquired by John Moore [see below] by 1698. See McKitterick (1978), p. 37. John Moore (1646-1714), bishop of Ely: no. 199 (also inscribed in the manuscript on f. 1r and f. 2v ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: ii + 3 + 144 | 15 + ii leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-II-00006-00043','https://images.lib.cam.ac.uk/iiif/MS-II-00006-00043-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-II-00006-00043',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2149,3,'MS Kk.1.6','Kk',NULL,NULL,NULL,'Collection of devotional works','The name of Arthur Hopton is inscribed in the upper margin of f. 242v (\'Arturus Hopton\'): he was a member of the Hopton family of Westwood in Blythburgh in North-East Suffolk, as a 16th-century or early 17th-century note suggests: \'P[our] my humfre owen de suffolke amen / Selled and delyvered in the presens of master thomas hoopton\' (f. 100v , upper margin). The same hand has written a note with the date \'Anno Domini 1571\' (f. 97r , outer margin); a note on a payment to master Harvey of Darsham in Suffolk: \'Item payd to master harve of darsam / Item the county of Suffolke knave Amen\' (f. 131v , upper margin); and \'Suffolk and Norffolk / amen dico vobis\' (f. 245r , outer margin). Darsham is situated a few miles to the south-east of Blythburgh. If these notes were written by Arthur Hopton (which is unclear because he writes his name in a different stylised script), then he almost certainly was Arthur Hopton (c. 1540-1607), High Sheriff of Suffolk. The name of Arthur Melle: \'Arthur melle ded wryt thys\' (f. 2r , lower margin). Perhaps Arthur Melle, son of Henry Melle and his wife Frances, born in 1548 at Bramfield, five miles south-west from Blythburgh. One of the manuscripts of Richard Holdsworth (1590-1649), Master of Emmanuel College.',NULL,'Codex: i + 1 + 244 + 2 + i leaves. Leaf height: 275 mm, width: 195 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00001-00006','https://images.lib.cam.ac.uk/iiif/MS-KK-00001-00006-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00001-00006',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2150,3,'MS Kk.1.24','Kk','8th century.',700,799,'Gospel book','Perhaps owned by Ely Cathedral by the 10th century, remaining there until the Dissolution in 1539, as suggested by Neil Ker in 1964. London, British Library, Cotton MS Tiberius B.v, f. 76 and London, British Library, Sloane MS 1044, f. 2, are both leaves that were formerly part of this manuscript, and the former (according to Ker) contained documents relating to Ely cathedral priory. However, this was later rejected in 1987 by Andrew Watson, who observed that these texts related not to Ely but to nearby Ramsey Abbey (though he did not, in turn, place the manuscript in Ramsey\'s possession in the relevant section of the catalogue). Ker (1964), p. 78 Ker and Watson (1987), p. 35 and n. 2',NULL,'Codex: Five leaves of parchment have been inserted in place of missing leaves as part of the volume\'s conservation (for further information on which, see Custodial History). These inserted leaves have not been digitised, though in one instance (f. 190*) the stubs to which this is attached contains a fragment of decoration. These replacement leaves have not been counted here as part of the manuscript\'s extent. For the sake of clarity, it has been decided not to enumerate them separately either. iv + 113 + iv leaves. Leaf height: 305 mm, width: 225 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00001-00024','https://images.lib.cam.ac.uk/iiif/MS-KK-00001-00024-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00001-00024',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2151,3,'MS Kk.3.18','Kk',NULL,NULL,NULL,'Bede, Historia ecclesiastica gentis Anglorum (in Old English)',NULL,NULL,'Codex: iii + 97 + iv leaves. Leaf height: 315-320 mm, width: 220-230 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00003-00018','https://images.lib.cam.ac.uk/iiif/MS-KK-00003-00018-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00003-00018',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2152,3,'MS Kk.4.12','Kk','Early 14th century.',1300,1399,'Theological texts','\'K. xxxvii\': pressmark of Norwich Cathedral Priory, from \'Heruei de Swafham\' (f. 2r ). According to N.R. Ker, this was among hte books acquired after 1272 and before c. 1325. \'Herveus de Swaffham does not appear to have been a member of the community,\' Ker noted, and presumably was the manuscript\'s donor. For his obit (9 January), see London, British Library, Harley MS 3950 (early 14th cent.); also mentioned in the sacrist\'s roll for 1301-2 (roll 222). Ker (1949), p. 15 Notes on the contents by the unidentified 16th-century hand that was mentioned by Ker as occurring in manuscripts acquired by Cambridge University Library after 1582 and before 1600, both those from Norwich and others, but never in manuscripts recorded at the University Library in the 1556 and 1573 catalogues (or by Thomas James between nos 6 and 107). Ker (1949), p. 5 and pl. IB','Latin','Codex: + 1 + 54 ; 36 ; 56 ; 52 + ii leaves Leaf height: 345 mm, width: 235 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00004-00012','https://images.lib.cam.ac.uk/iiif/MS-KK-00004-00012-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00004-00012',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2153,3,'MS Kk.4.25','Kk','c. 1230.',1230,1230,'Didactic miscellany, containing a bestiary and other texts','Annotations by various 16th- or early 17th-century hands, including the names "Antony Byers" ( 56v ), "Peter" ( 109v-110r ), (?)"Marke Barne" ( 131v ). One of the manuscripts of Richard Holdsworth, Master of Emmanuel College (1590-1649).','Latin','Codexi + 125 + i Leaf height: 285 mm, width: 195 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00004-00025','https://images.lib.cam.ac.uk/iiif/MS-KK-00004-00025-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00004-00025',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2154,3,'MS Kk.5.6','Kk',NULL,NULL,NULL,'Aristides Quintilianus','The manuscript was owned by a certain J.B. Hautin, probably to be identified with Jean Baptiste II Hautin, son of the French scholar and numismatist Jean-Baptiste Hautin (ca. 1580-1640): on f. [iii] verso there is a small table of contents, written by the hand that occurs in almost all Hautin\'s manuscripts (see also Jackson (2006), p. 30). It passed afterwards to John Moore (1646-1714), bishop of Ely: number 977 (c.9) in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of C. Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).',NULL,'Codex 3 + 69 + 4 Leaf height: 275-328 mm, width: 210-230 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00006','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00006-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00006',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2155,3,'MS Kk.5.7','Kk','around the middle of the 16th century',1500,1599,'Erotian, Collection of Hippocratic words','As stated in a note on f. 1r , the manuscript was part of the library of the Parisian physician Jacques Mentel (1597-1671): " Ex Bibliotheca Jacobi Mentelii V.P.C". Near the note, probably by another hand, in red, there is a date, " 1670 mense maii". Mentel died in Paris in 1671, so the date of 1670 could indicate the time when the manuscript was acquired from his collection (see D.F. Jackson, The Greek Manuscripts of John Moore and Etienne Baluze, in Codices Manuscripti 56/57 (2006), pp. 29-41: 30). In the Greek collection of Cambridge University Library there is another Greek manuscript owned by Mentel with his possession note, MS Cambridge, University Library, Mm.1.17. Since this manuscript was owned by J.B. Hautin (probably to be identified with Jean Baptiste II Hautin, son of the French scholar and numismatist Jean-Baptiste Hautin (ca. 1580-1640)), it may be that MS Kk.5.7 was also owned by him. The manuscript was owned by John Moore (b. 1646, d. 1714), bishop of ElyIt is number 977 (c.11) in the handwritten supplementary list of Moore\'s manuscripts, now MS CUL Oo.7.50(2), compiled by Thomas Tanner after the publication of C. Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ , Oxford 1697.','Greek','Codex 22, Leaf height: 327 mm, width: 230 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00007','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00007-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00007',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2156,3,'MS Kk.5.8','Kk','around 1592',1592,1592,'Scholia on Oppian\'s Halieutica','The manuscript was owned by a certain J.B. Hautin, probably to be identified with Jean Baptiste II Hautin, son of the French scholar and numismatist Jean-Baptiste Hautin (ca. 1580-1640): on f. 2v there is a small table of contents, written by the hand, which occurs in almost all Hautin\'s manuscripts (see also Jackson 2006, p. 30). It passed afterwards to John Moore (1646-1714), bishop of Ely: number 978 (c.10) in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of C. Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codex 1 + 40 + 2, Leaf height: 330 mm, width: 215 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00008','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00008-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00008',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2157,3,'MS Kk.5.9','Kk','in the second half of the 16th century',1550,1599,'Greek philosophical miscellany','The manuscript was owned by a certain J.B. Hautin, probably to be identified with Jean Baptiste II Hautin, son of the French scholar and numismatist Jean-Baptiste Hautin (ca. 1580-1640): on f. 5v there is a small table of contents, written by the hand, which occurs in almost all Hautin\'s manuscripts (see also Jackson 2006, p. 30). It passed afterwards to John Moore (1646-1714), bishop of Ely: number 983 (d.3) in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of C. Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codex 93, Leaf height: 328 mm, width: 230 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00009','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00009-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00009',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2158,3,'MS Kk.5.11','Kk','1564',1564,1564,'Synopsis Basilicorum maior','Afterward, the manuscript was owned by a certain J.B. Hautin, probably to be identified with Jean Baptiste II Hautin, son of the French scholar and numismatist Jean-Baptiste Hautin (approximately b. 1580 d. 1640) (or possibly with his nephew Jean Baptiste III; on the problem of the identification of Hautin see Jackson 2006, pp. 38-40). The name of Hautin appears twice in the manuscript: on the left pastedown , " J. B. Hautin ", where it is accompanied by the title of the principal work, "Synopsis basilicon", and on the right pastedown , "J. B. Hautin"). Hautin wrote in his hand a title for the manuscript on f. [ii] verso , "Synopsis basilicon" (see Easterling 1961, p. 258). The manuscript was later acquired by John Moore (1646-1714), bishop of Ely: number 978 (c. 12) in the handwritten supplementary list of Moore\'s manuscripts, now MS CUL Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697). On the left cover there is the annotation "978 | (c. 12)", referring to the number of the manuscript in Tanner\'s list and to what looks like a shelfmark of unclear origin, also reported by Tanner (see Easterling 1961, p. 257 note 4).','Greek','Codex 2 + 289 + 1, Leaf height: 346 mm, width: 235 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00011','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00011-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00011',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2159,3,'MS Kk.5.12','Kk','the 16th century',1500,1599,'Greek-Latin lexicon','Owned by the Parisian scholar Claude Sarrau (c. 1600-1651) in 1647. Possibly owned by Jacques Mentel (1597/9-1670/1) (Jackson, p. 31). Owned by one J.-B. Hautin, probably the grandson of Jean-Baptiste Hautin (ca. 1580-1640) (Easterling, \'Two Greek MSS.\', p. 111, n. 1). Owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 979 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek and Latin','Codex i + 168 + i Leaf height: 292 mm, width: 215 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00012','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00012-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00012',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2160,3,'MS Kk.5.13','Kk','Second quarter of the 9th century (Rodgers), or 1st or 2nd third of the 9th century (Bischoff).',825,849,'De agricultura','\'Liber sancti Dyonensi [...] in ei furauerit aut abstr[...]rit uel istas literas deleuerit anathema sit\': ownership inscription and anathema relating to the Benedictine monastery of Saint-Denis, written by a hand of the 10th century (f. 1v ). Ownership inscriptions relating to the Benedictine monastery of Saint-Denis, written by hands of the 12th century: \'explicit liber beati dyonensi...\' (f. 121v ) \'Hugo dei gratia beati Dyonensii abbas\', probably Hugh V Foucault, abbot of Saint-Denis 1186-1197, or his successor Hugh VI of Milan (fl. 1197-1204), abbot 1197-1204 (f. 37v ). Further names were inscribed by hands of similar period, presumably those of monks of Saint-Denis: \'adam derichebore\' (?Adam de Richebourg), presumably a monk of Saint-Denis (f. 37v ) \'adam de biarruaisius\' (?Adam de Biarritz) (f. 41v ) Shelfmark (\'PA + . xxiiii . vii c . lxx .\') and ex libris inscription (\'Iste liber est beati dyonensi\') (both on f. 2r ) confirm that the manuscript remained at the Benedictine monastery of Saint-Denis until at least the fourteenth century. John Moore, (1646-1714), bishop of Ely: no. 988 (ff. [ii] verso and 1r ) in the handwritten supplementary list of Moore\'s manuscripts, now Oo.7.50.2, compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697). A note concerning the contents of the volume by Tanner, in the upper margin of f. 1r .','Latin','ii + 121 + i leaves. Leaf height: 275 mm, width: 195 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00013','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00013-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00013',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2161,3,'MS Kk.5.16','Kk','Mid-8th century (after 737).',700,799,'Bede, Historia ecclesiastica gentis Anglorum (\'The Moore Bede\')','The presence of numerous glosses throughout, and some textual additions at the end of the manuscript, all written by continental scribes, indicates that the manuscript was taken abroad at an early stage, and perhaps by the beginning of the 9th century. It has been suggested by Bernhard Bischoff that it may have been at Charlemagne\'s court, since the hand responsible for the additions at the end is similar to another that worked on manuscripts linked to it around the year 800 (e.g. London, British Library, MS Harley 2788). \'S. Juliani\' (f. 128v ): 17th-century ?ownership inscription of the Cathedral of Saint-Julien, Le Mans. Perhaps in the hands of J.B. Hautin, probably to be identified with Jean Baptiste II Hautin, son of the French scholar and numismatist Jean-Baptiste Hautin (approximately b. 1580 d. 1640) (or possibly with his nephew Jean Baptiste III; on the problem of the identification of Hautin see Donald Jackson, \'The Greek manuscripts of John Moore and Etienne Baluze\', Codices Manuscripti , 56/57 (2006), 29-42, pp. 38-40). The inscriptions on f. i verso were identified by Henry Bradshaw as by the hand of J.B. Hautin and the majuscule \'B\' in \'Beda\' bears a resemblance to that found in inscriptions of his name in other manuscripts owned by John Moore (see below). John Moore (1646-1714), bishop of Ely: no. 994 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Latin','Codex: iii + 128 + i leaves. Leaf height: 285 mm, width: 220 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00016','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00016-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00016',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2162,3,'MS Kk.5.19','Kk','second quarter of the 15th century and year 1476',1476,1476,'Thucydides, History of the Peloponnesian War','In the late 15th or early 16th century, the manuscript was certainly brought to Italy by Byzantine émigrés. At some point, it came into the possession of the Italian humanist and Chancellor of the Republic of Genoa (1514) Benedetto Tagliacarne, also known as Benedictus Theocrenus, whose mark of ownership ("Benedicti Theocreni") is found in the upper margin of f. 1r . It is likely to have been seized along with the rest of his goods by the soldiers of the Holy Roman Empire during the sack of Genoa in 1522. Between 1697 and 1714 the manuscript came into the possession of John Moore (1646-1714), bishop of Ely: number 982 in the handwritten supplementary list of Moore\'s manuscripts, now CUL, MS Oo.7.50.2, compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codex9 + 309 + 9 Leaf height: 275 mm, width: 205 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00019','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00019-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00019',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2163,3,'MS Kk.5.25','Kk',NULL,NULL,NULL,'Lexicon of Pseudo-Zonaras','Owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 984 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codex iii + 267 + iii Leaf height: 300 mm, width: 190 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00025','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00025-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00025',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2164,3,'MS Kk.5.26','Kk',NULL,NULL,NULL,'Greek texts on music, mathematics and astronomy','Perhaps no. 12 in the list of manuscripts owned by Jérôme Fondule, which were sent to the Fontainebleau Library in 1529 (Omont 1889, p. 371). However, no. 12 is described as containing "Ἀριστείδου καὶ τῶν ἄλλων περὶ μουσικῆς" (Aristeides and others on music), whereas this manuscript contains the work on music by Aristoxenus, not by Aristeides, so the possession of the manuscript by Fondule cannot be regarded as certain. Owned by Francis I, King of France (1494-1547), whose crest is present at f. 1r , with a dedication to him. The book was part of the Library of Fontainebleau and left the royal collection before 1622 (Jackson 2006, p.31). The manuscript was later owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 986 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).',NULL,'Codex 2 + i + 181 + 2 Leaf height: 287 mm, width: 210 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00026','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00026-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00026',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2165,3,'MS Kk.5.27','Kk','certainly after 1535',1535,1535,'Commentary on the First Alcibiades of Plato','The manuscript was owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 972 in the list of Moore\'s manuscripts published in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).',NULL,'Codex i + 147+ 1 + i Leaf height: 290 mm, width: 210 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00027','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00027-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00027',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2166,3,'MS Kk.5.28','Kk',NULL,NULL,NULL,'Nicomachus of Gerasa','The manuscript was owned by a certain Johannes Capella, whose name can be read at f. 1r although it was deleted. The name of Johannes Capella appears also in the MSS Leiden, Bibliotheek der Rijksuniversiteit, Scal. 71, Paris, Bibliothèque nationale de France, gr. 2516 and Paris, Bibliothèque nationale de France, gr. 2262. Jackson (2006) identifies him as a Frenchman living during or soon after the lifetime of Angelos Bergikios. Given that in the manuscript there are notes by a hand found also in manuscripts which were part of John Moore\'s collection, and which were previously owned by a J.B. Hautin, Kk.5.28 could possibly have this provenance as well; it could have been owned by a person probably to be identified with Jean Baptiste II Hautin, son of the French scholar and numismatist Jean-Baptiste Hautin (ca. 1580-1640). It was later owned by John Moore (1646-1714), bishop of Ely: number 985 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codex i + 120 + i, Leaf height: 270 mm, width: 193 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00028','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00028-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00028',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2167,3,'MS Kk.5.31','Kk',NULL,NULL,NULL,'Greek military treatises','This manuscript was owned by by a certain J.B. Hautin, probably to be identified with Jean Baptiste II Hautin, son of the French scholar and numismatist Jean-Baptiste Hautin (approximately b. 1580 d. 1640) (or possibly with his nephew Jean Baptiste III; on the problem of the identification of Hautin see Jackson 2006, pp. 38-40). : on f. i there is Hautin\'s ownership note, " J. B. Hautin ". It was later owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 995 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697). The number of the manuscript in Tanner\'s list is written on f. i , along with what looks like a shelfmark of unclear origin, also reported by Tanner: "995 (e. 4)".','Greek','Codex iii + 80 + 3 Leaf height: 242 mm, width: 175 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00031','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00031-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00031',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2168,3,'MS Kk.5.35','Kk','late 15th century',1400,1499,'Gospel book','Owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 665 of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697) or, more probably, number 999 of the handwritten supplementary list of Moore\'s manuscripts, now CUL Oo.7.50.2, compiled by Thomas Tanner after the publication of Bernard\'s catalogue. Both classmarks are noted on f. i verso .','Greek','Codex ii + 402 + ii Leaf height: 237 mm, width: 154 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00035','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00035-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00035',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2169,3,'MS Kk.5.37','Kk',NULL,NULL,NULL,'Byzantine chronicle of Constantine Manasses','Owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 996 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek and Latin','Codex i + 151 + i','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00005-00037','https://images.lib.cam.ac.uk/iiif/MS-KK-00005-00037-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00005-00037',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2170,3,'MS Kk.6.4','Kk','between about 960 and 1050',1050,1050,'Act and Epistles book','Owned by the humanist scholar François Vatable (Franciscus Vatablus) (d. 1547). Owned by one J.-B. Hautin, probably the grandson of Jean-Baptiste Hautin (c. 1580-1640) (Easterling, \'Two Greek MSS.\', p. 111, n. 1). Owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 1014 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).',NULL,'Codex i + 1 + 251 + 1 Leaf height: 185 mm, width: 125 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00006-00004','https://images.lib.cam.ac.uk/iiif/MS-KK-00006-00004-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00006-00004',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2171,3,'Kk.6.6','Kk','Late 14th century.',1300,1399,'Abridgement of Statutes','Richard Pygot (fl. 15th century): his name inscribed in a 15th-century hand on f. 58v : \'per me Ricardum Pygot\'. John Moore (1646-1714), bishop of Ely: no. 783 (f. 1r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Latin and Middle French','Codex: ii + 58 + ii leaves. Leaf height: 155 mm, width: 110 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00006-00006','https://images.lib.cam.ac.uk/iiif/MS-KK-00006-00006-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00006-00006',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2172,3,'MS Kk.6.23','Kk','between the end of 15th century and the early 16th century',1400,1599,'Greek literary epistles','The manuscript was owned by Jean-Baptiste Hautin (b. 1580?, d. 1640), who added his ex libris on the front pastedown, and a description (" philostrati epistulæ "), on the same pastedown and on f. 1**v . It later entered into the library of John Moore (b. 1646, d. 1714), bishop of Ely: number 1015 (R. 3) (classmark noted on f. 1*r ) of handwritten continuation to Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697) by Thomas Tanner (1697-1714) (now Cambridge, University Library, MS Oo.7.50.2 .','Greek with few annotations in Latin by the copyist','Codex 73, Leaf height: 210 mm, width: 145 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00006-00023','https://images.lib.cam.ac.uk/iiif/MS-KK-00006-00023-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00006-00023',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2173,3,'MS Kk.6.27','Kk','second half of the 17th century',1650,1699,'Ajax of Sophocles','Owned by John Moore (1646-1714), bishop of Ely: number 672 (classmark noted on the front cover ) of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697) .','Greek','Codex 1 + 43 + 5 Leaf height: 190 mm, width: 150 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00006-00027','https://images.lib.cam.ac.uk/iiif/MS-KK-00006-00027-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00006-00027',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2174,3,'MS Kk.6.29','Kk','first decade of the 16th century',1500,1599,'Description of the Known World','Probably owned by Cuthbert Tunstall (b. 1474, d. 1559), Bishop of London.','Greek','Codex i + 2 + 164 + 3 + i Leaf height: 197 mm, width: 133 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00006-00029','https://images.lib.cam.ac.uk/iiif/MS-KK-00006-00029-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00006-00029',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2175,3,'MS Kk.6.30','Kk',NULL,NULL,NULL,'Alchemical treatises','John Moore (1646-1714), bishop of Ely: no. 898 in the handwritten supplementary list of Moore\'s manuscripts, now CUL Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: 2 + 61 | 10 | 16 | 23 | 19 | 13 + 2 leaves. Leaf height: 215-225 mm, width: 145-155 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00006-00030','https://images.lib.cam.ac.uk/iiif/MS-KK-00006-00030-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00006-00030',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2176,3,'MS Kk.6.33','Kk',NULL,NULL,NULL,'Medical texts and recipes','John Moore (1646-1714), bishop of Ely: no. 152 in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: v + 2 | 15 | 92 + iv leaves. Blank paper leaves have been added at various places in the manuscript, specifically after the first two medieval leaves, and at points where medieval leaves are no longer present. For this statement of extent, these internal, modern leaves have not been counted. In one instance, a paper leaf has been added in order to provide a mount for a fragmentary leaf that would otherwise be detached from the manuscript (f. 1:7a). Since there is still a remnant of a medieval leaf that bears writing, this has been counted in this statement. This fragment was previously unfoliated but has now been assigned the number \'7a\'.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00006-00033','https://images.lib.cam.ac.uk/iiif/MS-KK-00006-00033-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00006-00033',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2177,3,'MS Kk.6.34','Kk','1530 and 1555',1530,1555,'On the Sublime','Owned by John Moore (1646-1714), bishop of Ely: number 213 (classmark noted on f. ii recto ) of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697) .','Greek','Codex ii + viii + 52 + ii, Leaf height: 156 mm, width: 114 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-KK-00006-00034','https://images.lib.cam.ac.uk/iiif/MS-KK-00006-00034-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-KK-00006-00034',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2178,3,'MS Ll.1.10','Ll',NULL,NULL,NULL,'Prayerbook (\'The Book of Cerne\')','John Moore (1646-1714), bishop of Ely: no. 113 (f. 1:i recto ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).',NULL,'Codex: i + 2 | 2 | 2 | 2 | 10 | 8 | 98 | 24 | 4 + i leaves. Leaf height: 230 mm, width: 180 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-LL-00001-00010','https://images.lib.cam.ac.uk/iiif/MS-LL-00001-00010-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-LL-00001-00010',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2179,3,'MS Ll.1.18','Ll','15th century (probably compiled over a period of time during the later 3rd and 4th quarters of the century).',1400,1499,'Miscellany of household information','John Moore (1646-1714), bishop of Ely: no. 114 (f. 3r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Middle English and Latin. Middle English with dialectical features locatable to Midlands and Nottinghamshire [LALME]','Codex: i + 130 + i leaves. Leaf height: 210-220 mm, width: 140-150 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-LL-00001-00018','https://images.lib.cam.ac.uk/iiif/MS-LL-00001-00018-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-LL-00001-00018',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2180,3,'MS Ll.2.2','Ll',NULL,NULL,NULL,'Sermons','John Wateregge (fl. 15th century) of Winslade, near Basingstoke (\'Iohannes Wateregge of wynslade\' (f. 1v ). Wateregge was perhaps also responsible for the inscription on f. 259r : \'Iohannes est nomen eius hodier[ni?] iohannes est nome [sic] eius\'. He was perhaps the donor of the manuscript to Basingstoke parish church (see below). Richard Gosmer (d. 1547): his ownership or use of the manuscript is indicated by a secundo folio reference at the top of on f. 1v : "Ricardus Gosmer, 2a fo. libenter". Gosmer also had access to at least two other manuscripts, in which his hand is also found: Oxford, University College, MS 61 (name inscribed on f. 1v) and Oxford, University College, MS 109 (name inscribed on f. 1r) , and perhaps also Oxford, University College, MS 55 (the annotation on f. 183v probably being by his hand) and Oxford, University College, MS 60. Gosmer\'s predecessor at Basingstoke, Thomas Reynes/Raynes owned MSS 60 and 109, though further comparison of the hands in MS Ll.2.2 with these other manuscripts is needed in order to determine whether this too had been Reynes\'s or had come to Gosmer by some other route (which the earlier inscription by John Wateregge might suggest). R.W. Hunt thought that \'[w]e have evidently the remains of a little collection handed down from priest to priest\'. (My thanks to Peter Kidd for sharing his draft descriptions and images of the University College manuscripts.) Hunt (1950-51), p. 24. Emden, BRUO , p. 794 Peter Kidd, Descriptive catalogue of the medieval manuscripts of University College, Oxford (forthcoming) Thomas Broune (d. 1587), vicar of Basingstoke 1554-87: his ownership inscription on f. 5r : \'Liber sermonum in membranis vel pellibus Thomas Brouneus possessoris huius\'. Broune\'s ownership inscriptions are also found in the four manuscripts at University College mentioned above (as well as others in that collection - see Hunt (1950-51)). He apparently left most of his books to his nephews, Richard (a Fellow of University College, Oxford, 1571-1622) and John (d. 1603). Hunt (1950-51), pp. 24-25. Peter Kidd, Descriptive catalogue of the medieval manuscripts of University College, Oxford (forthcoming) John Moore (1646-1714), bishop of Ely: no. 463 (f. 1r ) in Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697), Volume 2 Part 1, p. 373 (no. 9649).',NULL,'Codex: i + 2 + 12 | 14 | 44 | 12 | 44 ; 8 ; 97 + 2 + i leaves. Leaf height: 335 mm, width: 235-240 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-LL-00002-00002','https://images.lib.cam.ac.uk/iiif/MS-LL-00002-00002-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-LL-00002-00002',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2181,3,'MS Ll.2.13','Ll','late 15th century',1400,1499,'Greek Gospel book','Owned by John Moore (b. 1646, d. 1714), bishop of Ely: number 666 (classmark noted on f. 2r ) of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codex186, Leaf height: 285 mm, width: 178 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-LL-00002-00013','https://images.lib.cam.ac.uk/iiif/MS-LL-00002-00013-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-LL-00002-00013',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2182,3,'MS Ll.4.12','Ll','late 14th or early 15th century',1400,1499,'Miscellany of Greek texts','Owned by John Moore (1646-1714), bishop of Ely: number 973 (classmark noted on right cover, inner ) in the handwritten supplementary list of Moore\'s manuscripts, now CUL MS Oo.7.50.2, compiled by Thomas Tanner after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).','Greek','Codex ii + 102 + 1 + iii, Leaf height: 297 mm, width: 218 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-LL-00004-00012','https://images.lib.cam.ac.uk/iiif/MS-LL-00004-00012-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-LL-00004-00012',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2183,3,'MS Ll.5.4','Ll','Copied in the second half of the 17th century, after 1662, when Seller matriculated at Lincoln College, Oxford, where one of the source manuscripts for this compilation was held, and before his death in 1705. The text appearing first in the manuscript was copied in 1686, as indicated by a note on p. 1 .',1662,1686,'Compilation of notes and transcriptions of Greek texts','England, probably in Windsor, Cambridge and Oxford, where the source manuscripts for this compilation were held.','Greek, with some Latin','Codex ii + 2 + 146 + 1 + ii Leaf height: 310 mm, width: 200 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-LL-00005-00004','https://images.lib.cam.ac.uk/iiif/MS-LL-00005-00004-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-LL-00005-00004',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2184,3,'MS Ll.5.18','Ll','Fifteenth century. This is ratified by the dateable texts contained in MS Ll.5.18, which accommodate production from quite early in the first half of the century. The Life of Saint Margaret , commissioned by Edmund Mortimer, was composed by John Lydgate between 1415-26 and the version of the Life of Saint Dorothy contained in MS Ll.5.18 has been identified by Manfred Görlach to be one of a group of the tale that dates from the early fifteenth century.',1415,1415,'The Abbey of the Holy Ghost, etc.','Unknown','English','vi + 41 + v; all flyleaves part of modern rebinding. Written height and width varies per page. Leaf height: 207 mm, width: 142 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-LL-00005-00018','https://images.lib.cam.ac.uk/iiif/MS-LL-00005-00018-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-LL-00005-00018',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2185,3,'MS Mm.1.11','Mm','later 14th or earlier 15th century',1400,1499,'Euripides','Owned by Jean-Baptiste Hautin (b. 1580?, d. 1640), who added his ex libris on the front pastedown, and " Euripides " and on the inner margin " manuscrit oriental tres ancien ". The manuscript had probably belonged to the French Royal collection, but it left the collection before 1622, when Nicolas Rigault compiled his catalogue.','Greek','Codex ii + ii + 108 + ii, Leaf height: 210 mm, width: 140 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-MM-00001-00011','https://images.lib.cam.ac.uk/iiif/MS-MM-00001-00011-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-MM-00001-00011',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2186,3,'MS Mm.1.17','Mm',NULL,NULL,NULL,'Greek medical texts','As stated in a note on f. 1r , the manuscript was part of the library of the Parisian physician Jacques Mentel (1597-1671). Although the note is written on the first leaf of part I, it can be assumed that, by the time the note was added, the manuscript had already its present make-up. In Cambridge University Library, there is another Greek manucript owned by Mentel, MS Kk.5.7 : in this codex, near Mentel\'s name, the date of 1670 is mentioned, indicating that in that year it was still in the physician\'s possession. This may also apply to MS Mm.1.17. The manuscript was afterwards owned by a certain J.B. Hautin, probably a relative of the French scholar and numismatist Jean-Baptiste Hautin (ca. 1580-1640): on the left pastedown there is Hautin\'s name on the right, " J. B. Hautin ", and, on the left, by the same hand, the title " Oribasii tractatus". The same hand wrote another title on f. [i] verso , " Oribasii tractatus varii". Hautin acquired the manuscript probably after 1670. The manuscript passed to John Moore (1646-1714), bishop of Ely: number 1000 (the number is written on the left pastedown ) in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of C. Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (1697).',NULL,'Codex 1 + 132 Leaf height: ca. 220/225 mm, width: 160-164 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-MM-00001-00017','https://images.lib.cam.ac.uk/iiif/MS-MM-00001-00017-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-MM-00001-00017',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2187,3,'MS Mm.2.3(1)','Mm','Mid- to third quarter of the 15th century.',1450,1474,'Divina commedia','Jean-Baptiste Hautin (approximately 1580-1640). A date \'10 [...] 1648]\' (f. 1v ), now partially lost due to damage (record of ?purchase). \'Brodeau\' (f. 1v ), i.e. Julian Brodeau (d. 1653), whose library was dispersed in 1698 or 1699. McKitterick (1986), p. 133 John Moore (1646-1714), bishop of Ely: no. 1011 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Italian, with rubrics in Latin','Codex: i + 1 + 29 ; 30 ; 30 + i leaves. Leaf height: 350 mm, width: 245 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-MM-00002-00003-00001','https://images.lib.cam.ac.uk/iiif/MS-MM-00002-00003-00001-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-MM-00002-00003-00001',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2188,3,'MS Mm.2.3(2)','Mm','Second quarter to mid-14th century (not before 1324).',1324,1324,'Dante Alighieri, Divina commedia and Credo','Made for the Bini family of Florence, whose coat of arms is incorporated into the decorative borders at the beginning of each section (ff. 1r , 91r , 171r ). Jean-Baptiste Hautin (approximately 1580-1640). \'Brodeau\' (see f. 1v of MS Mm.2.3(1), with which this manuscript was formerly bound), i.e. Julian Brodeau (d. 1653), whose library was dispersed in 1698 or 1699. McKitterick (1986), p. 133 John Moore (1646-1714), bishop of Ely: no. 1011 in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697).','Italian and Latin','Codex: i + 89 ; 80 ; 100 + i leaves. Leaf height: 345-350 mm, width: 245-250 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-MM-00002-00003-00002','https://images.lib.cam.ac.uk/iiif/MS-MM-00002-00003-00002-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-MM-00002-00003-00002',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2189,3,'MS Mm.5.22','Mm','Mid- to late 9th century.',800,899,'De compendiosa doctrina','Perhaps from the Benedictine Abbey of Saint-Sulpice, Bourges: \'de sancto sulpicio\' written on f. 1r by a 16th-century hand. The manuscript was acquired by John Moore (see below) in 1701, along with another manuscript certainly from Bourges, now Cambridge, University Library, MS Gg.2.32. McKitterick (1986), p. 139 John Moore (1646-1714), bishop of Ely: no. 1005 ( front pastedown ) in the handwritten supplementary list of Moore\'s manuscripts, now MS Oo.7.50(2), compiled by Thomas Tanner (1674-1735) after the publication of Bernard, Catalogi librorum manuscriptorum Angliæ et Hiberniæ (c. 1697). The manuscript was borrowed in 1702 by Richard Bentley (1662-1742), for his collation of the text. Bentley\'s copy of an edition of Nonius Marcellus ( Nonii Marcelli nova editio. Additus est libellus Fulgentii de prisco sermone et notae in Nonium et Fulgentium , ed. by Josias Mercer (Paris, 1614) survives as British Library, 684.c.14, and contains a full collation of this manuscript (see Additions and note on f. [iii] recto ).','Latin','Codex: iii + 54 + i leaves. Leaf height: 225-230 mm, width: 205-210 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-MM-00005-00022','https://images.lib.cam.ac.uk/iiif/MS-MM-00005-00022-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-MM-00005-00022',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2190,3,'MS Mm.5.31','Mm','1249-1250 C.E.',1249,1250,'Expositio in Apocalypsim','Apparently in England from an early date (‘Liber Edmundi Ridell possessoris’, 14th-15th century, 205v ); ownership inscription (16th century, 205v ) of Cuthbert Tunstal, Bishop of Durham, but not one of books that he gave to Library (on which see Clarke, pp. 98–102, 741); Jo. Conyers (17th century (?), 205v ), perhaps of Middle Temple; John Garnett (17th century, 137v ); John Moore (d. 1714); presented to University Library by George I, 1715.','Latin','205 fols (at least 41 fols lost) Leaf height: 248 mm, width: 183 mm. Written height: 185 mm, width: 112-116 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-MM-00005-00031','https://images.lib.cam.ac.uk/iiif/MS-MM-00005-00031-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-MM-00005-00031',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2191,3,'MS Mm.6.9','Mm','13th century',1200,1299,'Gospels, Acts and Epistles book','Owned by the hieromonachos Makarios, probably in the 17th or 18th century.',NULL,'Codex ii + 6 + 288 + ii Leaf height: 185 mm, width: 135 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-MM-00006-00009','https://images.lib.cam.ac.uk/iiif/MS-MM-00006-00009-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-MM-00006-00009',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2192,3,'MS Mm.6.17','Mm',NULL,NULL,NULL,'Collection of theological works','Richard Colingburne (fl. c. 1450-1550): his ownership inscription on f. 1v :" Ricardus Colynburne me possidit".',NULL,'Codex: i + 1 + 7 | 4 ; 65 ; 40 ; 20 + 2 + i leaves.','https://cudl.lib.cam.ac.uk/iiif/MS-MM-00006-00017','https://images.lib.cam.ac.uk/iiif/MS-MM-00006-00017-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-MM-00006-00017',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2193,3,'MS Nn.1.21','Nn','first half of the 11th century',1000,1049,'John Chrysostom, homilies','Owned by Ioannes Porphiros Chalasophoures, and donated by him and his wife Anastasia Sophelia to the Monastery of the Panagia Pantochara (founded 1241) on Stamfani, in the Strofades, Greece. This is indicated by his notes on f. i verso . Owned by the book collector Anthony Askew (1722-1774).','Greek','Codex iii + 1 + 181 + iii Leaf height: 327 mm, width: 232 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-NN-00001-00021','https://images.lib.cam.ac.uk/iiif/MS-NN-00001-00021-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-NN-00001-00021',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2194,3,'MS Nn.1.22','Nn','11th century',1000,1099,'John Chrysostom, homilies','Owned by Ioannes Porphiros Chalasophoures, and donated by him and his wife Anastasia Sophelia to the Monastery of the Panagia Pantochara, Strophades (founded 1241), in the Ionian Islands, Greece, as indicated by his notes in MS Nn.1.21 , f. i verso. Owned by Anthony Askew (1722-1774).','Greek','Codex iii + 166 + iii Leaf height: 327 mm, width: 232 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-NN-00001-00022','https://images.lib.cam.ac.uk/iiif/MS-NN-00001-00022-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-NN-00001-00022',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2195,3,'MS Nn.1.23','Nn','in the 11th or 12th century',1100,1199,'Gregory of Nazianzus, Basil of Caesarea and John Chrysostom','Some monocondyles are present on f. 272v , but they are barely legible. On the same folio there is a name of Μιχαηλ ἀναγνώστης, otherwise unknown. The manuscript belonged to the collection of John Petty, 1st Earl of Shelburne (1706-1761) or of his son William Petty, 2nd Earl of Shelburne (1737-1805), Marquess of Lansdowne from 1784, who later donated the manuscript to the University Library. Shelburne\'s bookplate remains on the left cover, inner .','Greek','iii + 272 + i Leaf height: 315 mm, width: 220 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-NN-00001-00023','https://images.lib.cam.ac.uk/iiif/MS-NN-00001-00023-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-NN-00001-00023',NULL,'2026-01-28 19:50:09');
INSERT INTO manuscripts VALUES(2196,4,'MS 2086','Lambeth Palace','c.1620-c.1644',1620,1644,'William Rawley\'s miscellany; a collection of more than 900 anecdotes, apophthegms, memoranda, proverbs, and recipes; 1620s-1640s.','Miscellany of William Rawley, chaplain and secretary to Francis Bacon, and also editor of many of his literary works. After Rawley\'s death on 18 June 1667, the miscellany may have passed to his executor, John Rawley, and thence to Thomas Tenison, Archbishop of Canterbury, along with \'these papers of Lord Bacon, which composed the Baconiana \' (see Thomas Birch, preface to Letters, Speeches, Charges, Advices &c. of Francis Bacon (1763), A7v). The Bacon papers are now Lambeth Palace Library, MSS 647–62. If the miscellany did form part of the bequest, it was not included in Andrew Ducarel\'s arrangement of the papers in the mid-eighteenth century. In the nineteenth century Henry Todd included the manuscript among the \'Codices manuscripti miscellanei\', describing it as \'Codex chartaceus, in folio\', and describing its contents as \'Miscellaneous Collections, Temp. Jac. 1. & Car. 1.\' (Todd, Catalogue , p. 252). The manuscript was formerly known as Lambeth Palace MS 1034, but after its rediscovery in 1967 it was allocated its current number. Not included in David Wilkins\'s manuscript \'Catalogus manuscriptorum bibliothecæ Lambethanæ\' (1720) (Lambeth Palace Library, MS LR F 40), implying that the miscellany came to Lambeth Palace after that date. This would accord with it coming as part of, or as an adjunct to, the Bacon papers. Library stamps of Lambeth Palace (\'BIBLIOTHECA LAMBETHANA\') on first and penultimate leaves (ff. 1r and 45v ).','Mostly in English, but some entries in Latin and Greek, and some in Rawley\'s cipher.','46 leaves height: 310 mm, width: 250 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-LAMBETH-02086','https://images.lib.cam.ac.uk/iiif/MS-LAMBETH-02086-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-LAMBETH-02086',NULL,'2026-01-28 20:03:21');
INSERT INTO manuscripts VALUES(2197,4,'MS 2240','Lambeth Palace','1674-1708',1674,1708,'Alathea Bethell\'s book of private devotions in verse and prose; English; 1674-1708.','Nothing else is known about the provenance of this manuscript until it was given to Lambeth Palace Library in 1967 by Mrs E. H. Thorne (as recorded by Bill, 1976, p. 181).','All texts are in English','52 leaves height: 135 mm, width: 75 mm.','https://cudl.lib.cam.ac.uk/iiif/MS-LAMBETH-02240','https://images.lib.cam.ac.uk/iiif/MS-LAMBETH-02240-000-00001.jp2/full/200,/0/default.jpg','https://cudl.lib.cam.ac.uk/view/MS-LAMBETH-02240',NULL,'2026-01-28 20:03:21');
