INSERT INTO manuscripts VALUES(2597,7,'Rouse MS 40','Rouse','1443',1443,1443,'Rouse MS 40. BOOK OF HOURS, use of Rome, Latin. Fragment.','Italy (Genoa?). Acquired, still whole except for the two missing leaves, by Nicolas Pavlov, Dobbs Ferry, NY, from Reiss & Auvermann at Glashuetten im Taunus, West Germany (Catalog, lot #15, with plates) in October 1988. Dismembered by Pavlov and portions sold to other dealers. A part, probably the Office of the Dead, was sold to the bookdealer Bruce Guenter of South Egermont, MA. Rouse MS 40 was acquired in its present state from Pavlov in March 1990 by Richard and Mary Rouse. Given to UCLA in 2005.','Latin',NULL,'https://iiif.library.ucla.edu/ark%3A%2F21198%2Fzz000sj3c5/manifest','https://iiif.library.ucla.edu/iiif/2/ark%3A%2F21198%2Fzz000sj3dp/full/!200,200/0/default.jpg','https://digital.library.ucla.edu/catalog/ark:/21198/zz000sj3c5',104,'2026-01-28 23:48:41');
