INSERT INTO manuscripts VALUES(2713,8,'Peniarth MS 11','Peniarth','[c. 1380]',1380,1380,'Ystoryaeu Seint Greal',NULL,NULL,'291 ff. (ff. i-vii, 1-282, erratic, doubling 50, 198, 203 and 264, 177 wanting) : parchment ; 225 x 155 mm. (written space 155 x 115 mm.). Folios i and 282 are original parchment fly-leaves, ff. ii-v paper fly-leaves of [19 cent., second ½] and ff. vi-vii a letter from Thomas Stephens, 1860. The earliest foliation may be represented by a ‘66’ at the foot of f. 66 verso; ff. 1-6 were numbered by a hand of [16 cent., first ½]; the foliation was completed by a hand of [16-17 cent.] (and was present when Siôn Dafydd Rhys copied extracts into Peniarth MS 118).Bound in blind-tooled calf, [16 cent., second ½], over wooden boards, resewn on three bands, using the original holes, lightly cropped; brass fittings for two clasps survive together with the lower clasp itself, on a strap of whittawed leather. Rebacked in [19 cent., second ½].','https://damsssl.llgc.org.uk/iiif/2.0/6231899/manifest.json','https://damsssl.llgc.org.uk/iiif/2.0/image/6231900/full/200,/0/default.jpg','https://viewer.library.wales/6231899',NULL,'2026-01-29 01:02:49');
