INSERT INTO manuscripts VALUES(2925,8,'Peniarth MS 96','Peniarth','[c. 1584]-1616',1584,1616,'The poetical works of Lewys Dwnn',NULL,NULL,'349 ff. (ff. i-ii + pp. 1-698) : paper ; 203 x 152 mm. Foliation 1-343 (= pp. 1-690) by Siôn Rhydderch, with a few errors (see note by W.R.M. Wynne on loose slip at f. ii); his ff. 267-8 are now wanting. Pages 691-8 are extraneous loose leaves: pp. 691-2 contain French verse, [18-19 cent.]; on pp. 693-4, a fragmentary leaf, ‘Fui liber Edwardi Davies de Rhiwlas’, probably a stray from Peniarth MS 144 or 145.Rebound in white vellum about 1900. A cardboard wrapper of about that date is preserved apart.','https://damsssl.llgc.org.uk/iiif/2.0/6238066/manifest.json','https://damsssl.llgc.org.uk/iiif/2.0/image/6238067/full/200,/0/default.jpg','https://viewer.library.wales/6238066',NULL,'2026-01-29 01:02:49');
