INSERT INTO manuscripts VALUES(2929,8,'A diary and a letter book, 1770-1788','Peniarth','1770-1788',1770,1788,'A diary and a letter book, 1770-1788',NULL,NULL,'Peniarth MS 416i Extent: 201 ff. (foliated 191 ff. + 10 ff.) ; Dimensions: 154 x 98 to 164 x 105 mm. Peniarth MS 416ii Extent: 266 ff. ; Dimensions: 152 x 92 to 163 x 100 mm. Peniarth MS 416iii Extent: 185 ff. ; Dimensions: 150 x 99 to 162 x 103 mm. Peniarth MS 416iv Extent: 190 ff. (foliated 2 ff. + 188 ff.) ; Dimensions: 160 x 100 to 162 x 102 mm. Peniarth MS 416v Extent: 189 ff. (foliated 2 ff. + 187 ff.) ; Dimensions: 163 x 102 mm. Peniarth MS 416vi Extent: 197 ff. (foliated 2 ff. + 195 ff.) ; Dimensions: 161 x 101 to 165 x 103 mm. Peniarth MS 416vii Extent: 202 ff. (foliated 2 ff. + 200 ff.) ; Dimensions: 160 x 98 to 163 x 105 mm. Peniarth MS 416viii Extent: 228 ff. (foliated 2 ff. + 226 ff.) ; Dimensions: 161 to 164 x 103 mm. Peniarth MS 416ix Extent: 226 ff. (foliated 2 ff. + 224 ff.) ; Dimensions: 162 x 99 to 167 x 102 mm. Peniarth MS 416x Extent: 71 ff. (foliated 3 ff. + 68 ff.) ; Dimensions: 180 to 189 x 116 mm. Peniarth MS 416xi Extent: 93 pp. ; Dimensions: 238 x 157 to 308 x 202 mm. Peniarth MS 416 (Part I) :Bound in half leather. Peniarth MS 416 (Part II) :Bound in vellum.','https://damsssl.llgc.org.uk/iiif/2.0/5493199/manifest.json','https://damsssl.llgc.org.uk/iiif/2.0/image/5493200/full/200,/0/default.jpg','https://viewer.library.wales/5493199',NULL,'2026-01-29 01:02:49');
INSERT INTO manuscripts VALUES(2930,9,'mssEL 7 H 9','Ellesmere','[between 1300-1399] ; [between 1300 and 1350] ; [between 1300-1399]',1300,1399,'Roman law, fragments : [manuscript].','Composite manuscript made up of fragments of 3 or 4 legal books of Italian and English origin, brought together at an unknown date. The first and largest of these was in England before the end of the fourteenth century, when foliation, running headlines and marginalia were added. On f. 1, pressmark S. 1./2. in the hand of John Egerton (1622-86), 2nd Earl of Bridgewater. Acquired by Henry E. Huntington with the Bridgewater Library in 1917 (see pp. 5-7).','Latin [lat]','ff. 67 : parchment.','https://hdl.huntington.org/iiif/2/p15150coll7:52049/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52046/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52049',3,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2931,9,'mssEL 9 H 17','Ellesmere','[between 1300 and 1350]',1300,1350,'Book of Hours and Psalter : [manuscript].','The woman in the historiated initial on f. 175v may be intended to represent the first owner of the book. Of the 15 coats of arms in the borders, 2 may be associated with a Vernon family of Harlaston, Staffordshire and Haddon, Derbyshire; on f. 61, argent, a fret sable, a quarter gules; and, also on f. 61, the same but on the quarter a martlet argent. For a description of all the coats of arms, see The New Palaeographical Society ser. 2 pt. 3 (1915) text and plate 69, with reproductions of ff. 15 and 61. On f. 36, the first leaf of the calendar, s. XIVmed: "Domina Issabella de vernun dedit istud psalterium conventui de hanpul qui alienaverit excomunicatus est" referring to the Priory of the Virgin Mary of Cistercian nuns in Hampole, Yorkshire; see Ker, MLGB, 95 . On f. 1, "N:1" in the hand of John Egerton (1579-1649), 1st Earl of Bridgewater, corrected to "N:1./6" by the second Earl (1622-86). The current Bridgewater pressmark and ex libris on the front pastedown.','Latin [lat] ; French [fre]','ff. ii + 200 + ii : parchment ; 180 x 270 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49196/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49172/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49196',24,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2932,9,'mssEL 26 A 17','Ellesmere','[between 1385 and 1399]',1385,1399,'Confessio amantis : [manuscript].','On f. 172, erased possession note, s. XV. On f. 170, possession notes, s. XVIin, of William Downes: "Iste liber pertinet And bear it wel in mynde/ Per me Gulielmum downes so gentelle and so kynde/ A vinculis doloris Iesue do hym brynge/ Ad vitam etername [sic] to lyfe everlastynge. Amen" ( Hanna, "Addenda," n. 25 ), and "William Downes mee tenet"; on f. 21, rough strapwork initials, "W[illiam] D[ownes]"; on f. 76, s. XVIex, possession note of Phillip Downes. Notes of an antipapist, s. XVImed, across the upper margins of ff. 30, 60, 66, 77, 91 and 102: "Vacantur nomina paparum, Thomas Bekett & no seynt." Sixteenth century notes on f. 171 on the ownership of church lands: "The personage of Gwendrun & Stythians in ye county of Cornewall percell of ye possessions of ye late monastary of Rewley" and "The personage of Croppreadin in ye county of oxforde in the tenure of one mr chancye by leace for xxiti yeares grauntid unto hym by kinge Edward ye sixt in ye fyfte yeare of his raigne & paiethe by yeare lvili." The manuscript owes its appellation of "Stafford Gower" to the description of it by H. J. Todd, Illustration of the Lives and Writings of Gower and Chaucer (London 1810) 108-09, while in the possession of George Granville Leveson-Gower, 2nd Marquis of Stafford (aftw. 1st Duke of Sutherland), who had inherited the Bridgewater Library from his uncle, Francis Egerton, 3rd and last Duke of Bridgewater. The designation was used by Macaulay in his edition of the text (1900-01). Bridgewater bookplate on front pastedown and embossed Bridgewater library stamp on f. ii and f. 1. (CSmH)','Latin [lat]','ff. ii + 172 + ii : parchment ; 248 x 353 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49011/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49000/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49011',368,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2933,9,'mssEL 34 B 7','Ellesmere','[between 1500 and 1515]',1500,1515,'Processional : [manuscript].','Written in England at the beginning of the sixteenth century presumably for Dame Margery Byrkenhed of the Benedictine nunnery of St. Mary at Chester; her ownership note on f. 85v appears to be in the same hand as the text. The saints whose altars are named for the washing ceremony of Maundy Thursday are not those of Salisbury and thus could be those of Chester; assigned to Chester by Ker, MLGB, 50. Early Bridgewater pressmarks on f. 1, "X/3/" in the hand of John Egerton (1622-86), 2nd Earl of Bridgewater, now cancelled, and "S,8./4." in the hand of the third Earl (1646-1701). The current Bridgewater pressmark and that Library\'s bookplate on the front pastedown. Acquired by Henry E. Huntington with the Bridgewater Library in 1917.','Latin [lat] ; English [eng]','ff. 86 (1-6 and 86 = foliated flyleaves) : parchment , music; 140 x 200 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49210/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49197/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49210',13,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2934,9,'mssEL 35 B 54','Ellesmere','[between 1300 and 1325]',1300,1325,'Register of writs : [manuscript].','Pressmarks of the Bridgewater Library, "6107" and "35 B 54," on labels glued to the outer margin of f. 1.','Latin [lat]','ff. 96 : parchment ; 147-153 x 215-220 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:51134/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:51132/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/51134',2,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2935,9,'mssEL 35 B 61','Ellesmere','[between 1485 and 1499]',1485,1499,'Modus coronationis ; Modus tenendi parliamentum ; and two other works : [manuscript].','On f. ii, the pressmark "A:5." in the hand of John Egerton (1579-1649), 1st Earl of Bridgewater, corrected to "A:5./7." by the second Earl (1622-86). The current Bridgewater pressmark and the bookplate of that Library on the front pastedown.','Latin [lat] ; English [eng]','ff. i + i + i + 32 + i + i : parchment ; 182 x 252 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:51714/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:51709/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/51714',5,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2936,9,'mssEL 9 H 3','Ellesmere','[between 1340 and 1360]',1340,1360,'Summa summarum : [manuscript].','Dry point notes on f. 274v include the name of Thomas Waterhouse, rector at Ashridge when it was dissolved in 1539. See Ker, MLGB, 5 (tentatively ascribing this manuscript to Ashridge); H. C. Schulz, "The Monastic Library and Scriptorium at Ashridge," HLQ 1 (1938) 305-11, and provenance of EL 7 H 8. On f. 1, the inscription "ex dono Richardi Combe Armigeri" (nephew of Thomas Waterhouse) in the hand of John Egerton (1622-86), 2nd Earl of Bridgewater, as well as the Bridgewater pressmark, L:CC:B:2/16.','Latin [lat]','ff. ii + 404 + ii : parchment ; 253 x 365 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52098/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52095/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52098',3,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2937,9,'mssEL 34 A 8','Ellesmere','[between 1340 and 1360]',1340,1360,'Statutes primarily from the reigns of Henry III and Edward I : [manuscript].','The material on f. 2v suggests early ownership in Staffordshire. On f. 149, three armorial shields: the first, of England: gules, 3 lions passant gardant or; the second, of Spencer: quarterly argent and gules, 2 and 3 fret or, overall a bend sable; the third, of Garland of Lincolnshire (?): gules, 2 bars or, in chief 3 bezants. On f. 1v, ca. 1500, "Robert Bulkeley." On f. 3, pressmarks in the hand of John Egerton (1622-86), 2nd Earl of Bridgewater: "T/4," "L:CC:G.8," and "L:CC:H:15./1."','Latin [lat] ; French [fre]','ff. ii + 169 + ii : parchment ; 86 x 130 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:50954/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:50948/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/50954',6,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2938,9,'mssEL 34 B 9','Ellesmere','[1607]',1607,1607,'Entertainment at Ashby: manuscript, 1607','From the Bridgewater library.','English [eng]','15 leaves : paper ; 21 cm','https://hdl.huntington.org/iiif/2/p15150coll7:75920/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:75871/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/75920',49,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2939,9,'mssEL 9 H 4','Ellesmere','[between 1250 and 1299]',1250,1299,'Bible : [manuscript].','Names on the blank leaves at the end include, on f. 383v: Abbas elstane terram dono tibi plane quam dum vivebat virgo mildreda tenebat (s. XV); Dompnus Robertus wynstanley sacerdos est meus possessor (s. XV/XVI); on f. 384v: henricus byntun, Thomas Unbrege, Iohannis stokys of fordenyche gentylman of decoler, Iohannes Frouike of londun marchate of debanker (all s. XV). On f. 1v, Pe. [S?]anwood Armiger de Sancto stephani in parocchia de Hackingtone in Comitatu Cantir. secundo die Decembris Anno salutis nostrae 1590, Elizabeth Reginae tricessimo tertio, Stilo Angliae. On f. 1, the shelfmark "N:2./1." in the hand of John Egerton (1622-86), 2nd Earl of Bridgewater.','Latin [lat]','ff. ii + 384 + ii : parchment ; 210 x 300 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:50772/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:50767/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/50772',5,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2940,9,'mssEL 6893','Ellesmere','[approximately 1622-1632]',1622,1632,'Poems and problems : manuscript, approximately 1622-1632.','Once owned by Frances Egerton (1583-1636), Countess of Bridgewater, and her husband John Egerton (1579-1649), first Earl of Bridgewater. Armorial bookplate of the Bridgewater Library on verso of leaf 1. Inscription "J. Bridgewater" on verso of leaf 2.','English [eng]','194 leaves : paper ; 171 x 123 (145 x 100) mm','https://hdl.huntington.org/iiif/2/p15150coll7:72091/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:71690/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/72091',401,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2941,9,'mssEL 9 H 9','Ellesmere','[between 1350 and 1399]',1350,1399,'Works by Aegidius Romanus [i.e. Giles of Rome, Archbishop of Bourges] and Nicholas Trevet : [manuscript].','Apparently belonged to the house of the Boni Homines ("Bonshommes") at Ashridge. See Ker, MLGB , 4-5 , H. C. Schulz, "The Monastic Library and Scriptorium at Ashridge," HLQ 1 (1938) 305-11 , E. Searle, "The Calendar, Martyrology and Customal of the Boni Homines of Ashridge," Mediaeval Studies 23 (1961) 260-93 (which refers principally to EL 9 H 15, but gives a brief history of Ashridge), and provenance of EL 7 H 8. The last rector of Ashridge, Thomas Waterhouse, surrendered the house to the Crown at the Dissolution in 1539; the land and buildings of Ashridge were subsequently leased by Waterhouse\'s nephew, Richard Combes. Barely visible under ultra-violet light on f. 1 is the inscription: "liber Fra. Combe ex cenobio Ash __?___ ex dono Avunculi ibidem Abbatis Domini Thomas Waterhouse," presumably written by Francis Combes (1583-1641), grandson of Richard Combes (d. 1595). The same inscription continues: "1. Egidii de regimine principum; 2. et fratris Nicholai Triveti commentarium in Boetium de consolatione et cetera." Also on f. 1 the note "ex dono Richardi Combe Armigeri," written by John Egerton (1622-86), 2nd Earl of Bridgewater; in Egerton\'s hand are the note on f. 198 "desunt caetera," the numbers 1 and 2 in the upper margins of ff. 1 and 105 designating the 2 main texts, and the Bridgewater pressmark, "L:CC:B:2/13."','Latin [lat]','ff. ii + 198 + i + ii : parchment ; 245 x 345 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52137/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52133/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52137',4,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2942,9,'mssEL 35 B 53','Ellesmere','[between 1250 and 1299]',1250,1299,'Gradual : [manuscript].','Written in France in the second half of the thirteenth century; was shortly thereafter in England. Among the fifteenth century marginalia in English hands: f. 100, "Ego pravo [?] Ricardus lely convisi ille est manus pravus istius societatis et Iohannes cestren. et cetera tomas ia"; f. 110v, "Dominus Willelmus de brunbury persona eclesie de ald__?___"; f. 111, "__?___ de dusbere Omnibus est notum quod multum __?___"; f. 119v, "Et quere enim gelido zeperus fer __?___ sire et bone Ami __?___ Iohannes de Arderne honorables et reverentes de tous amitez sachez sire que ioe ai travalie en tour vous bosognies tentivement pour coe que ioe ne voliei que ne vous fustis descu quant" (ending abruptly; an apparently different hand on f. 133v also makes reference to "gelides zefferus"; the various repetitions of the verse, "Fuit homo missus...Iohannes" appear to be in a different hand); f. 146, "hugo de Lincoln." On f. 1, the pressmark "I:3./2." in the hand of John Egerton (1622-86), 2nd Earl of Bridgewater. The current Bridgewater pressmark and the bookplate from that Library on the front pastedown. Acquired by Henry E. Huntington with the Bridgewater Library in 1917.','Latin [lat]','ff. ii + 158 + ii : parchment, music ; 175 x 235 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49269/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49266/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49269',3,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2943,9,'mssEL 9 H 13','Ellesmere','[Between 1400 and 1610]',1400,1610,'Dogali and Antiphonal fragments : [manuscript].','The Bridgewater library of the Earls of Ellesmere was purchased privately by Henry Huntington in 1917 from Sotheby\'s through the negotiation of G. D. Smith. Please see link to full description for a more complete history of the collection.','Latin [lat]','41 items : parchment.','https://hdl.huntington.org/iiif/2/p15150coll7:52534/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52509/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52534',25,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2944,9,'mssEL 9 H 11','Ellesmere','[between 1125 and 1150]',1125,1150,'Prisciani grammatici viri disertissimi apocrisarii cesariensis urbis Rome constantinopolitane liber primus de arte grammatica incipit : [manuscript].','On f. 1, the price"3 s. 4 d." On f. ii, the cancelled pressmark"N.5" in the hand of John Egerton (1579-1649), 1st Earl of Bridgewater; also on f. ii,"W:4./5." in the hand of the second Earl (1622-86), and on f. 1, his signature as J[ohn Egerton, Viscount] Brackley, presumably inscribed before his father\'s death in 1649. (CSmH)','Latin [lat]','ff. ii + 197 + ii : parchment ; 173 x 262 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49275/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49270/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49275',5,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2945,9,'mssEL 34 B 17','Ellesmere','1624',1624,1624,'Game at chesse : manuscript, 1624.','Bookplate of the Bridgewater Library on first flyleaf.','English [eng] ; Latin [lat]','54 leaves : paper ; 19 cm','https://hdl.huntington.org/iiif/2/p15150coll7:78080/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:77963/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/78080',117,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2946,9,'mssEL 34 B 6','Ellesmere','[15th century]',1400,1499,'Satires by Persius and Juvenal : [manuscript]','Belonged to John Gunthorpe, dean of Wells, who was in Italy in the early 1460s (d. 1498); later owned by "Heron," when it was possibly bound with a Horace. The ownership of Gunthorpe and "Heron" is attested to by a note on f. 100v: "iuvenalis olim gunthorpi vuelli quondam decani, nunc autem heroni." Three Bridgewater pressmarks in the upper margin of f. 1:"__?___3" and "X3," both in the hand of John Egerton (1579-1649), 1st Earl of Bridgewater, both now cancelled, and "S:8./1." in the hand of the third Earl (1646-1701). (CSmH)','Latin [lat]','ff. ii + 100 + ii : paper and parchment ; 155 x 211 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49289/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49284/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49289',5,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2947,9,'mssEL 34 A 1','Ellesmere','[between 1450 and 1499]',1450,1499,'Book of Hours, use of Paris : [manuscript].','Written in France in the second half of the fifteenth century for owners whose names may have been Claude and Catherine, as indicated by the frequent use of the initials C. and C. in the decoration, and by the possible owner representation in the miniature of St. Claude, f. 155; the name of Catherine is suggested, less firmly, by the rather uncommon prominence given to Catherine of Siena, f. 158. The manuscript was acquired by Henry E. Huntington as part of the Bridgewater Library which he purchased in 1917.','Latin [lat]','ff. i + 166 + i : parchment ; 90 x 126 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52363/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52348/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52363',15,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2948,9,'mssEL 35 B 63 (EL 1123)','Ellesmere','[between 1450 and 1499]',1450,1499,'Master of game : [manuscript].','Bridgewater Library pressmark label, "35/B/63," inside front cover; on f. i, the number "1123" from another Bridgewater system and the bookplate from that Library. Acquired by Henry E. Huntington as part of the Bridgewater Library in 1917.','English, Middle (1100-1500) [enm]','ff. vi + ii + 44 + ii + vi : parchment ; 206 x 257 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49295/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49290/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49295',130,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2949,9,'mssEL 34 B 60 (EL 1160)','Ellesmere','[between 1450 and 1499]',1450,1499,'Tenures : [manuscript].','Miscellaneous pen trials mention the following names: of the sixteenth century: f. 6, "Robart Furth"; f. 11, "Ihesus amen In the yere of ouer lord god amen I Rychard brokysby"; f. 12, "Thys Indentur made the xxiiti day of marche in the xxii yere of the Reygn of our Souereygn lord kyng henry the viiithe betwyxt Antony Furthe of the one partie And ser Thomas ball parson of the parische churche of furthoo in the Countie of North.. . ." (on f. 6, "Robart Furthe") and "To whom thys present wrytyng shall com to hyer or onderstand that thyer ys a chapyll of sente Iohn babtyst In stony stretfford In the Conte of northmton. . ."; f. 25v, "Gerge Flower"; f. 65v, "Sciant presentes et futuri quod ego Thomas Chapman de Broughtoun in Comitatu Northmton. . ."; f. 81, "Robert brokesby" (on f. 11, "Rychard brokysby"); f. 101v, "Thomas longeuyle knyght dominus Iohannes longeuyle miles Thomas longevyle miles Thomas saunders [twice] William Johnson Myles camyn Peter Dekynson Willam [sic] blunt Thomas Chapman [twice] (on f. 65v, "Thomas Chapman"); f. 118v, "Omnibus christi fidelibus ad quos hoc presentem scriptum pervenerit Thomas Hamond de Chyvalton in comitatu Westm."; f. 130v, "Rychard Wyllyatt" and "derb. one ferme in duffeld Frith parcell of thonour of Tutbury called the kinges ferme nowe in the tenure of Thomas Bradshawe nuper Robert Bradshaw v markes, ibidem firma vocatur Bradlee lande per annum [?] iiii li., ibidem hopking mylles intra [?] fernes Bonsall myll"; f. 132v, "Thomas hamond de villa Northmpton in comitatu North." (on f. 118v, "Thomas Hamond"); of the end of the sixteenth century: f. 1, "bullocke est nebulo"; f. 9v, "Bullock"; f. 132, "Io. Bullock"; f. 131v, "Ioannes Bullocke de Interiori Templo London me furatus est sicut ipse palam confessus est. . ."; f. 117v, "Mystres Anne Bulleyn"; ca. 1600: f. 2, "vyncent lowe John Gillot Arthur Gillot olyuer draycot William Robenson & Jerman Southe"; f. 94, "Iohannem yonge in comitatu derby gent."; f. 131v, "of egerten x s. of Bampford x s. and of hym xv s. and a pistolet which pistolet I delivered hym ageyn and also xii s. besydes iiii s. for opton his matter and x s. from Mr ["Babington" cancelled] Cokey his matter"; f. 132v, "liber Iohannis Stephynson" and "Anthony Fitzherbert knyght. . ."; of the seventeenth century: f. 1, "M. to take Mr Grendon ii exegentes ageynst William Fletcher and [these last 2 words overscored] gentlman and Robert Dukley received [cancellation] iii s. ii d. M. to spek to Mr Lary [?] to send the book to my cosen Sney__?___ byrday." Of these persons, John Bullocke appears frequently in the Calendar of Inner Temple Records (London 1896) from 1568 to 1602; Anthony Furthe was admitted to the Inner Temple in 1526. Early Bridgewater pressmark on f. 1, "I:3/8," of which "I:3" is in the hand of the first Earl, and the "8" in the hand of the second Earl. On a label on the pastedown the current Bridgewater pressmark "34 B 60"; also numbered "1160" in another Bridgewater system. (CSmH)','French [fre] ; English [eng]','ff. i + i + 132 + i : paper ; 155 x 229 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49307/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49296/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49307',11,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2950,9,'mssEL 26 C 9','Ellesmere','ca. 1400-1410',1400,1410,'Canterbury Tales','From the Bridgewater House Library.','English, Middle (1100-1500) [enm]','ii (modern parchment), iv (contemporary parchment), 232, iv (modern parchment), ii (contemporary) fol.','https://hdl.huntington.org/iiif/2/p15150coll7:2838/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:2359/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/2838',480,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2951,9,'mssEL 9 H 10','Ellesmere','[between 1450 and 1499]',1450,1499,'Statutes dating from the reign of Edward III to the reign of Edward IV : [manuscript]','On f. iv, two cancelled pressmarks, "A.6" and "B.9" in the hand of John Egerton (1579-1649), 1st Earl of Bridgewater, and a later pressmark in the hand of the second Earl (1622-86), "L.CC.S:1./3."; on f. iii, in an early modern hand, "L. Cl.S.1.3." Bridgewater bookplate and current pressmark, "9 H 10," on the front pastedown.','French [fre] ; Latin [lat]','ff. ii + II + 389 + ii : parchment ; 200 x 295 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49111/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49104/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49111',7,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2952,9,'mssEL 34 B 23','Ellesmere','[between 1300 and 1315]',1300,1315,'Statutes and other legal writings : [manuscript].','Note on f. 195v, s. XV/ XVI, "liber iste Restat Ricardo Bunney" with what appears to be a monogram of initials "M" (or "W"?) and "L"(?). On f. iii: "Liber Tho. Egerton ex dono Thomae hyggons" inscribed by Sir Thomas Egerton (1540-1617); the two signatures "J Bridgewater" by the first and second Earls (1579-1649 and 1622-86, respectively); "E:2." by the first Earl, corrected to "E:2./10." by the second Earl. On f. 1, in modern pencil, "513" corrected to "1122."','Latin [lat] ; French [fre]','ff. ii + i + 195 + i : parchment ; 129 x 189 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49315/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49308/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49315',7,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2953,9,'mssEL 26 A 13','Ellesmere','approximately 1450',1450,1450,'Regiment of princes: manuscript, [approximately 1450].','Purchased from the Bridgewater library from John Francis Granville Scroop Egerton, 3rd Earl of Ellesmere, through the agency of George D. Smith and Sotheby\'s of London, 1917. On f. v, pressmark "Z:/2./2." in the hand of John Egerton (1622-86), 2nd Earl of Bridgewater, with the last number corrected to "10" at a later date, possibly by John Egerton (1646-1701), 3rd Earl of Bridgewater. Printed on a square yellow slip of paper glued to f. ii verso, "MSS. No. 4." Acquired by Henry E. Huntington in 1917 with the Bridgewater Library.','English, Middle (1100-1500) [enm] ; French, Middle (ca.1400-1600) [frm]','ff. ii + iv + 127 + i + i : parchment, bound; 205 x 283 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:18796/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:18519/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/18796',277,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2954,9,'mssEL 26 A 3','Ellesmere','[1410-1415]',1410,1415,'Works by Gautier de Metz, Jean de Meun, Geoffroi de Paris and Jacobus de Cessolis : [manucript].','Belonged to the Bridgewater Library; on f. 1, the pressmark "E:8." in the hand of John Egerton (1579-1649), 1st Earl of Bridgewater, corrected to "E:8./2." by the second Earl (1622-86). (CSmH)','French [fre] ; Latin [lat]','ff. i + 278 + i : paper ; 137 x 205 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:51823/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:51807/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/51823',16,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2955,9,'mssEL 7 H 8','Ellesmere','[between 1350 and 1375]',1350,1375,'Johannes Hispanus Flos decretorum ; Martin of Troppau Margarita Decreti ; and other titles : [manuscript].','A note in English on f. 294v, counting the blank leaves at the end of the volume, is dated 22 September 1591 and signed R. Combe and E. Combe. "R. Combe" may be the Richard Combes (nephew of Thomas Waterhouse, rector of Ashridge at the time of the Dissolution), to whom Queen Elizabeth (then princess) granted the land and buildings of Ashridge in 1557; the property was purchased by Sir Thomas Egerton in 1604. On f. 1, the inscription "ex dono Richardi Combe Armigeri" in the hand of John Egerton (1622-86), 2nd Earl of Bridgewater, as well as the Bridgewater pressmark "L:CC:B:2/15" on the same folio.','Latin [lat]','ff. i + i + 296 + i : parchment ; 260 x 400 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:51835/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:51828/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/51835',7,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2956,9,'mssEL 34 C 9 (EL 1121)','Ellesmere','[between 1440 and 1460]',1440,1460,'Historical miscellany : [manuscript].','A note, s. XV, on f. 37v "Dominus Nicholaus" may refer to an owner or to the Trevet text completed on f. 37 recto. The 2 parts were probably brought together by the time John Egerton (1622-86), 2nd Earl of Bridgewater wrote the early Bridgewater pressmark on f. 2, "M:1/3." Additional Bridgewater pressmarks "34 C 9" and "1121" (corrected from 512) were given at a later date and are still in use. Acquired by Henry E. Huntington with the Bridgewater Library in 1917.','Latin [lat] ; French [fre]','ff. 54 : paper ; 223 x 294 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49146/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49133/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49146',13,'2026-01-30 00:48:41');
INSERT INTO manuscripts VALUES(2957,9,'mssHM 719 vol. 01','Huntington Manuscripts','1778, May 22 - June 13',1778,1778,'Orderly book of the 8th Massachusetts Regiment, 1778, May 22 - June 13, Valley Forge.',NULL,NULL,'42 leaves, 30 cm, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:43010/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:42921/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/43010',89,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2958,9,'mssHM 946','Huntington Manuscripts','[between 1300 and 1350]',1300,1350,'Statutes : [manuscript].','On the front pastedown of the previous binding, s. XVIII, "r r s N T." N. 77 in the collection of Nathaniel Dunbar (d. 1837) of Middle Temple; his signature on the front pastedown and on f. i verso. Belonged to George Dunn (1864-1912); his list of the contents of HM 946, dated January 1895, on the front pastedown and the last flyleaf; Dunn sale, Sotheby\'s, 2 February 1914, lot 1347 to Leighton.','Latin [lat] ; French [fre]','ff. 83 : parchment ; 202 x 298 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:50690/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:50688/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/50690',2,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2959,9,'mssHM 936','Huntington Manuscripts','[between 1450 and 1475]',1450,1475,'De casibus vivorum illustrium in French : [manuscript].','Monogram"S.S." linked by a cord in the border, f. 1. Said to have belonged to a Duke of Orleans (see below, Cat. 1909) but there is no evidence in the manuscript to support this. Belonged to Ambroise Firmin Didot (1790-1876); at that time the manuscript had 234 leaves and began: //merusement regarder ces deux viellars qui e peine povoient parler qui avoient este faiz sans ouvrage de nature . . . (I, 2); his Catalogue illustré (Paris 1884) 6:45-46 n. 39, sold to Tumin. Acquired by Rushton M. Dorman of Chicago; his sale, Leavitt, New York, 5 April 1886 n. 23*. Belonged to Robert Hoe: Cat. (1909), p. 9; his sale, Anderson, New York, 1912, pt. II, n. 2429 to Sessler. Precise source and date of acquisition by Henry E. Huntington unknown.','French, Middle (ca. 1300-1600) [frm]','ff. 230 : parchment ; 265 x 360 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52033/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52027/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52033',6,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2960,9,'mssHM 10','Huntington Manuscripts','[between 1540 and 1560]',1540,1560,'Portolan atlas, Italian : [cartographic material] : [manuscript].','Arms of an early owner (ca. 1600) stamped on binding and drawn on f. 2: quarterly 1 and 4, gules a cross of Toulouse, 2 and 3, gules a lion rampant crowned, on an escutcheon of pretence azure, a greyhound salient argent with inscription "Ex Dono Regis Cosme Valbelleo Balmelio" below. Owned by Cruninghen ca. 1650; this name across center of f. 2.','Latin [lat]','ff. 20 (19 ff. folded & pasted back to back) : parchment ; 232 x 326 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46086/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46065/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46086',21,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2961,9,'mssHM 497','Huntington Manuscripts','1755-1759',1755,1759,'Abijah Willard journal, 1755-1759.',NULL,NULL,'1 volume, 299 pages.','https://hdl.huntington.org/iiif/2/p15150coll7:54534/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:54225/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/54534',309,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2962,9,'mssHM 144','Huntington Manuscripts','late 15th/early 16th century',1500,1599,'[Prose and poetry, late 15th/early 16th century].','An early possibly the first owner (the copyist himself?) had access to a manuscript which had belonged to the Augustinian monastery in Bisham Montague, Berkshire, and which was used for reinforcement in the binding. Other 16th century owners wrote their names in the book: f. ii, among many pentrials, "John thyll [second word erased]. John tylly owth for ii bowsylles of wy[cropped] the pres xxiiii d."; "Iste confessor domyni. Iste lyber pertenethe nicolaus serll"; on the inside of the front and back covers, "John Skynner" and "John Skynner of farnham." Manly and Rickert suggest that the note on f. 81 may be in the hand of William Thynne. The notes on ff. 1 and 9v appear to be written by John Stow who brought out a revised version of Thynne\'s edition of Chaucer in 1561. Belonged to a member of the Savile family. Sold by Ellis in that year to Henry Huth; sale of Alfred H. Huth to Quaritch. Acquired by Henry E. Huntington before 1925.','English, Middle (1100-1500) [enm]','152 leaves : paper ; 290 x 200 (185-197 x 130-146) mm','https://hdl.huntington.org/iiif/2/p15150coll7:41289/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:40970/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/41289',319,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2963,9,'mssHM 217','Huntington Manuscripts','[19th century]',1800,1899,'Matheus de Chiara, Portolan atlas, 19th or early 20th-century forgery : [manuscript].','Purchased by Henry Huntington in 1925 from Weymer Mills, London, who stated in a lettre preserved in Library files that the manuscripts [HM 217 and HM 218] "have been in the possession of an English family for 500 years." No owners\'s marks.','Latin [lat]','ff. 8 : parchment ; 163 x 237 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52811/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52807/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52811',4,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2964,9,'mssHM 923','Huntington Manuscripts','[between 1200 and 1350]',1200,1350,'Statutes : [manuscript].','Numerous references in the text to Scarborough point to early ownership in that town. On f. iii, pentrials, s. XV, including "dymnok" and "kalwater." On f. 215v, s. XV, "Iohannes Vear miles de Comitatu Essex," "Iohannes Veer," and "Omnibus christi fidelibus ad quos hoc presens scriptum pervenerit Iohannes Vear Armiger salutem in domino sempiternam"; notes in Vear\'s hand also on ff. 81, 94, 108. On f. 207v, s. XVII/XVIII, "Will Shallcrosse Booke," "John Shallcrosses Book," and "Jhon Shallcross Book Jhon" in a different hand. On the front pastedown, armorial bookplate of Holland House with motto "Vitam impendere vero," and Huth bookplate with traces of Huth\'s original, larger bookplate on the endpaper behind it. Acquired by Henry Huth (1815-78) from Quaritch in 1875; The Huth Library (London 1880) 4:1397.','Latin [lat] ; French [fre]','ff. ii + i + + 217 + ii : parchment.','https://hdl.huntington.org/iiif/2/p15150coll7:50704/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:50696/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/50704',8,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2965,9,'mssHM 37','Huntington Manuscripts','[1661]',1661,1661,'Portolan atlas, Italian : [cartographic material] : [manuscript].','Inside cover and label on front bear number "209 " (which apparently was misread by De Ricci as 1119) from the sale of the library of the Abate Luigi Celotti, Sotheby\'s, 14 March 1825, n. 209 to Thomas Thorpe (numbers 66 and 67 inside front cover may be from this sale) who sold it ca. 1825 to Phillipps. Sir Thomas Phillipps\' Middle Hill stamp inside back cover and his number 2550 altered from 2634.','Latin [lat]','ff. 2 : parchment ; 350 x 510 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46285/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46281/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46285',4,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2966,9,'mssHM 903','Huntington Manuscripts','[between 1340 and 1360]',1340,1360,'Manuel des péchés : [manuscript].','On f. 139v between the end of the text and the prayer a contemporary erased inscription in the hand of the text reads:"A Johan __?___ li Romance." On f. 1, the early or mid-fifteenth century ownership note of the Benedictine abbey of St. Mary in York:"liber Monasterii beate Marie Eboracensis emptus per fratrem Clementem Warthwyk, qui Alienaverit Anathema" (Ker, MLGB, 217); also on f. 1, a seventeenth century pressmark,"M." By 1870 the manuscript belonged to William Constable-Maxwell, 10th Lord Herries (1804-76), in whose collection it was seen and noted by J. Stevenson in the 1st Report of the HMC, Appendix (1871), p. 45. It subsequently belonged to Lord Herries\' daughter, the Duchess of Norfolk who disposed of a portion of the manuscript collection, ca. 1912 (see De Ricci,"Bibliotheca Britannica Manuscripta: a survey of manuscript material existing in the British Isles; preliminary bibliography," handwritten index cards at the University of London, photocopy at the Huntington Library). Sold by W. H. Robinson, Cat. 12 (Newcastle 1925), n. 384. Acquired by Henry E. Huntington in June 1925.','French [fre]','ff. 205 : parchment ; 167 x 240 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52431/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52428/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52431',3,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2967,9,'mssHM 32','Huntington Manuscripts','[between 1585 and 1599]',1585,1599,'Portolan atlas, Spanish : [cartographic material] : [manuscript].','Pencilled notes on paper backing of f. 1 "from Payne 1824" and "Payne MAP of the WORLD"; De Ricci cites Abate Celotti sale, Sotheby\'s, 14 March 1825, "possibly n. 206 to Thorpe for Sir T. Phillipps"; however, HM 32 is described in the Middle Hill catalogue p. 11 as n. 208 of the Bibliotheca Celotti; Phillipps\' Middle Hill stamp and "Phillipps MS 956" on f. 1.','Spanish [spa]','ff. 15 : parchment ; 231 x 325 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46101/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46087/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46101',14,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2968,9,'mssHM 687','Huntington Manuscripts','1759',1759,1759,'Lieutenant Joseph Bull\'s orderly book, 1759.',NULL,NULL,'1 volume, 134 pages.','https://hdl.huntington.org/iiif/2/p15150coll7:54743/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:54601/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/54743',142,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2969,9,'mssHM 719 vol. 12','Huntington Manuscripts','1781, Nov. 26 - 1782, Jan. 10',1781,1782,'Orderly book of the 8th Massachusetts Regiment, 1781, Nov. 26 - 1782, Jan. 10, West Point.',NULL,NULL,'87 p., 2 charts, 30 cm, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:44179/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:44083/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/44179',96,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2970,9,'mssHM 150','Huntington Manuscripts','[between 1400 and 1450]',1400,1450,'Vox clamantis and other Latin poems : [manuscript].','Earl of Ailesbury sale, London, 21 November 1687, p. 85 n. 91 to James Sotheby, who signed his name on f. 4; also on f. 4"I 4 2200[?]." Armorial bookplate of C. W. H. Sotheby on the front pastedown, with the note"Bought at Lord Burgleys sale 1702 for L. 1-2." Col. H. G. Sotheby sale, Sotheby\'s, 24 July 1924, lot 96 with plate of f. 13v to A. S. W. Rosenbach for Henry E. Huntington.','Latin [lat]','ff. 194 : parchment ; 158 x 230 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49749/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49742/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49749',7,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2971,9,'mssHM 121','Huntington Manuscripts','[1557]',1557,1557,'Mirroure of myserie / newly compiled and sett forthe by Miles Huggarde : [manuscript]','The text is intended as a New Year\'s gift to Queen Mary (f. 2v, "As a token that the new yeare doth begyn/ I presente to your grace..."); HM 121 could possibly be the presentation copy; no other copy, printed or manuscript, is known to exist. De Ricci, referring to the initials R. T. on the frontispiece, has suggested that HM 121 might be a transcript of an edition printed by Richard Tottell; however, there seems to be no evidence to support this. The manuscript is dated 1557, possibly Old Style; in that case, it may not be the book listed among the "New Year\'s Gifts presented to Queen Mary in 1556" [which is certainly Old Style, as the subtitle refers to 3 and 4 Philip and Mary] in Illustrations of the Manners and Expences of Antient Times in England . . . (printed by and for John Nichols, London 1797) p. 13: "By Myles Huggard, a book written. With the Quene her Maiestie"; her return gift, op. cit., p. 24: "To Myles Huggard, oone guilte salte, Raynes per oz., 5 oz. di." In the dedication, Hogarde admits to a yearly tradition, "To presente youre grace, then thus baselie/ With suche a rude booke every yeare. . ." On f. 26, an inscription, s. XVI: "Thi mother naturall and loueynge to her little power [?] Elyzabethe Rychers wissethe to the my dowghter Ceselia all helthe and perfitt felisite." Belonged to Major Thomas Pearson (1740?-81); his sale, 14 April 1788, lot 2162 to Lord Charlemont. The Charlemont sale was to have taken place 10 July 1865 (this manuscript as lot 1073), but a large portion of the collection burned in the fire at Sotheby\'s on 28 June; some of the surviving books were sold on 11 August 1865, including this one, as lot 221 to Toovey. Belonged to the Rev. Thomas Corser (1793-1876); his sale, Sotheby\'s, 6 August 1869, pt. III, lot 542 to Ellis. Sold in 1869 by Hazlitt to Henry Huth (1815-78); see The Huth Library 2:745; Alfred H. Huth (1850-1910) sale, Sotheby\'s, 2 June 1913, pt. III, lot 3894 to Quaritch.','English [eng]','ff. iii + 26 + iii : parchment ; 135 x 170 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:53019/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:53017/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/53019',2,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2972,9,'mssHM 617','Huntington Manuscripts','April 21, 1778-September 9, 1778',1778,1778,'Orderly book of the 2nd Battalion of the 71st Regiment of Foot, 1778, Apr. 21 - Sept. 9.',NULL,'English [eng]','111 leaves, 20 cm., bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:17692/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:17462/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/17692',230,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2973,9,'mssHM 134','Huntington Manuscripts','[between 1400 and 1450]',1400,1450,'Wycliffite New Testament : [manuscript].','Possible early owners were the Thomas Mould and the Thomas Smith who signed their names in the margins of the book. Armorial bookplate of Sir Ashton Lever on the front pastedown; probably to be identified with n. 286 in his sale, Sotheby\'s, 29 May 1786. Bought October 1920 by Quaritch; Quaritch Handlist, February 1923 n. 6 (?). Acquired by Henry E. Huntington from Sessler.','English, Middle (1100-1500) [enm]','ff. 160 : parchment ; 145 x 201 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:50716/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:50705/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/50716',11,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2974,9,'mssHM 132','Huntington Manuscripts','[between 1340 and 1360]',1340,1360,'Polychronicon : [manuscript].','Belonged to the Benedictine house of St. Werburg\'s in Chester; Ker, MLGB, p. 50; bottom of f. 294, which may have contained an ex libris, is cut away. On f. 294v an erased valuation, s. XIV/XV, "10 l, xix s, iiii d." On f. 183, s. XV or later, "Ricardus abbas monasterii Sancte Werburge," referring to Richard Seynesbury, abbot 1349-63. On f. i, heavily cancelled, "Liber E__?___ Richford [?]." On the rear pastedown, from the middle or end of the 16th century, "Iste liber pertinet beare it well in mynde/ Ad me Georgium Savagium Boothe curteyes and kynde/ A penis inferni Iehesu him bringe/ Ad gaudia celestia to everlastinge ioye. Amen" (Hanna, "Addenda," n. 25), and again, "By me George Savage." George Savage was appointed chancellor of the cathedral of Chester in 1541, a year after St. Werburg\'s was dissolved. Owned by Sir Thomas Phillipps, his MS 20712 (slip with number on spine; stamp and number on f. i). Phillipps sale, 5 June 1899, lot 698. Acquired in July 1900 by George Dunn (1865-1912) of Woolley Hall with his bookplate and pencilled note on front pastedown; his sale, Sotheby\'s, 11 February 1913, lot 512 with plate of the map on f. 4v, to Edwards. A typewritten description of this manuscript attributed to William Morris retained in Library files, but there is no indication that the manuscript ever belonged to him. Acquired February 1918 from Herschel V. Jones (1861-1928) of Minneapolis by Henry E. Huntington.','Latin [lat]','ff. 309 : parchment ; 174 x 264 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:50907/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:50895/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/50907',12,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2975,9,'mssHM 129','Huntington Manuscripts','[between 1400 and 1415]',1400,1415,'Northern homily cycle : [manuscript].','Written in Ireland, given the spelling forms of the scribe; see M. Benskin and A. McIntosh,"A Mediaeval English Manuscript of Irish Provenance," Medium Aevum 41 (1972) 128-31, and A. McIntosh,"Some Words in the Northern Homily Collection," Neuphilologische Mitteilungen 73 (1972) 196-208. On f. 231v, a series of cancelled notes in a fifteenth century hand, of which the last appears to read:"This es Jhon red boke." Sold by the book dealer James Toovey to Sir Thomas Phillipps about 1868; Phillipps number 20420 on ff. i and 1. Acquired by Henry E. Huntington through Rosenbach in 1923.','Middle English','ff. 231 : parchment ; 145 x 217 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49373/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49358/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49373',15,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2976,9,'mssHM 623','Huntington Manuscripts','June 20, 1775 - May 1, 1777',1775,1777,'Orderly book of Francis Marion, 1775, June 20 - 1779, May 6, Dorchester, Haddrells Point, Sullivan\'s Island, Charleston, S.C.',NULL,'English [eng]','305 leaves, 20 cm.','https://hdl.huntington.org/iiif/2/p15150coll7:21614/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:21294/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/21614',320,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2977,9,'mssHM 57','Huntington Manuscripts','[between 1285 and 1299]',1285,1299,'Summa de poenitentia et matrimonio : [manuscript]','Belonged to the Rev. Henry Drury (1778-1841); his note, cut from the flyleaf of the previous binding, tipped in before f. 1; his sale, Evans, 19 February 1827, n. 2386 to Haswell. Acquired by Henry E. Huntington from the Ross C. Winans collection, through G. D. Smith in January 1918.','Latin [lat]','ff. 232 : parchment ; 145 x 213 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52060/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52055/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52060',5,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2978,9,'mssHM 719 vol. 09','Huntington Manuscripts','1781, May 18 - July 1',1781,1781,'Orderly book of the 8th Massachusetts Regiment, 1781, May 18 - July 1, West Point, Peekskill.',NULL,NULL,'87 p., 30 cm, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:43810/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:43717/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/43810',93,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2979,9,'mssHM 619','Huntington Manuscripts','September 26, 1781 - November 2, 1781',1781,1781,'Orderly book of Anthony Wayne, 1781, Sept. 28 - Nov. 2, Yorktown, Va.',NULL,'English [eng]','95 leaves, bound manuscript, oblong octavo','https://hdl.huntington.org/iiif/2/p15150coll7:17890/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:17693/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/17890',196,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2980,9,'mssHM 622','Huntington Manuscripts','1781-1782',1781,1782,'Orderly book of Marion\'s Brigade of South Carolina militia, 1781, Feb. 16 - 1782, Dec. 15',NULL,'English [eng]','160 leaves, 16 cm., oblong octavo','https://hdl.huntington.org/iiif/2/p15150coll7:18079/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:17891/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/18079',188,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2981,9,'mssHM 592','Huntington Manuscripts','1778, January 20-April 6.',1778,1778,'Minute Book of Dutchess County, 1778, January 20-April 6.',NULL,NULL,'1 volume, 33 pages.','https://hdl.huntington.org/iiif/2/p15150coll7:53599/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:53535/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/53599',64,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2982,9,'mssHM 627','Huntington Manuscripts','[between 1140 and 1160]',1140,1160,'Miscellany of patristic literature : [manuscript].','Written in the Netherlands, or possibly in England, towards the middle of the twelfth century; ff. 121v-155 may be somewhat later. Belonged to the Cistercian abbey of Aulne in the diocese of Liège. For the 1632 Aulne catalogue, see A. Sanderus, Bibliotheca Belgica Manuscripta (Lille 1641-43/44; repr. London 1967 and in Archives et Bibliothèques de Belgique, n. special 7, Brussels 1972) 2:234-62, this manuscript on pp. 250-51. E. van Balberghe and G. Zelis,"Medieval Libraries of Belgium: A List of Surviving Manuscripts," Scriptorium 28 (1974) 103-09, HM 627 on p. 109. Acquired by Sir Thomas Phillipps in 1831; his MS 4621. Phillipps sale, Sotheby\'s, 10 June 1896, lot 846 to Quaritch. Quaritch Cat. 164 (1896) n. 109, Cat. 193 (1899) n. 27. Sotheby\'s, 17 December 1919, lot 705 to G. D. Smith. Precise source and date of acquisition by Henry E. Huntington unknown.','Latin [lat]','ff. 155 : parchment ; 110 x 180 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49760/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49750/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49760',10,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2983,9,'mssHM 25','Huntington Manuscripts','[approximately 1540]',1540,1540,'Portolan atlas : [cartographic material] : [manuscript], approximately 1540','Arms of first owner (?) on f. 1, partly erased or painted out: or an indistinct object sable (?) on a chief gules a cross argent. Owner\'s markings "676" and "H VIII n.3" pencilled on front pastedown along with "436 Guilford" indicating the sale of Frederick North, 5th Earl of Guilford (1766-1827), London, 8 December 1830, n. 436 to Thomas Thorpe. "Th 1833" and "Heber" in Phillipps\' hand on pastedown refer to sale by Thorpe in 1833 (n. 676 in his catalogue) to Richard Heber (1733-1833); his sale, Evans, 1836, pt. XI, n. 1233 to Sir Thomas Phillipps, whose mark "Phillipps MS 8275" is also on pastedown. Obtained privately through A. S. W. Rosenbach by Henry E. Huntington in 1924.','Latin [lat]','1 volume with 13 leaves : parchment ; 223 x 160 mm. (8 1/2 x 11 1/2 in.)','https://hdl.huntington.org/iiif/2/p15150coll7:46117/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46103/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46117',15,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2984,9,'mssHM 616','Huntington Manuscripts','November 5, 1776-July 19, 1777',1776,1777,'Orderly book for Lieut. Colonel\'s Sir John Johnson\'s Company, 1776, Nov. 5 - 1777, July 19.',NULL,'English [eng]','73 leaves, 19 cm., bound volume, in a slip-case.','https://hdl.huntington.org/iiif/2/p15150coll7:10024/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:9874/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/10024',150,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2985,9,'mssHM 268','Huntington Manuscripts','1440-1460',1440,1460,'Fall of princes: manuscript, [between 1440 and 1460].','Possibly in the collection formed by James Sotheby in the seventeenth century. Armorial bookplate of C. W. H. Sotheby on the front pastedown; sale of Col. H. G. Sotheby, Sotheby\'s, 24 July 1924, lot 24 with plate of f. 109v to A. S. W. Rosenbach. Precise source and date of acquisition by Henry E. Huntington unknown.','English, Middle (1100-1500) [enm]','ff. 1-158v, parchment, bound; 293 x 412 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:19622/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:19293/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/19622',329,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2986,9,'mssHM 605, v. 1','Huntington Manuscripts','March 31 to September 1, 1776',1776,1776,'Orderly books of the 4th Pennsylvania Battalion, 1776, Mar. 31 - Sept. 1, New York, Albany (N.Y.), Ile aux Noix (Québec)',NULL,NULL,NULL,'https://hdl.huntington.org/iiif/2/p15150coll7:30375/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:30146/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/30375',229,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2987,9,'mssHM 719 vol. 11','Huntington Manuscripts','1781, Aug. 10 - Nov. 25',1781,1781,'Orderly book of the 8th Massachusetts Regiment, 1781, Aug. 10 - Nov. 25, West Point.',NULL,NULL,'87 p., 2 charts, 30 cm, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:42854/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:42759/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/42854',95,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2988,9,'mssHM 719 vol. 06','Huntington Manuscripts','1780; Oct. 29 - Dec. 31',1780,1780,'Orderly book of the 8th Massachusetts Regiment, 1780, Oct. 29 - Dec. 31, Totawa, West Point.',NULL,NULL,'136 p., 30 cm, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:43244/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:43104/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/43244',140,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2989,9,'mssHM 42','Huntington Manuscripts','[between 1575 and 1599]',1575,1599,'Portolan atlas, Spanish : [cartographic material] : [manuscript].','Sold (1868) by Boone (?) to Henry Huth. Ex libris of Henry Huth (1815-78) and note "Portolano (3) p. 1171 " on front pastedown; The Huth Library (1880) pt. 4, 1171 .','Latin [lat]','2 sheets : parchment ; 682 x 395 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46317/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46315/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46317',2,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2990,9,'mssHM 148','Huntington Manuscripts','[between 1400 and 1460]',1400,1460,'Psalter ; English Psalter Commentary ; Holy Boke Gracia Dei ; and other works : [manuscript]','On f. 178v, s. XVI, "Ihon andrason boke"; on f. 1, s. XVIex, "galled Peter prec. __?___"; a scrap of paper once loose in the volume and now in the custody of the Curator with the note, "Thomas Sclater verus possessor huius libri 1682"; on the front pastedown, s. XIX, "No. 15." Listed among the books of the Ingilby family of Ripley Castle, Yorks. in the HMC, 6th Report (1877) p. 361. Sale of Sir William Henry Ingilby (1874-1950), Sotheby\'s, 21 October 1920, lot 137 to Maggs. Maggs Cat. 404 (1921) n. 20 and Cat. 446 (1924) n. 1785 with a plate of f. 23. Acquired by Henry E. Huntington in 1924.','English [eng]; Latin [lat]','ff. 221 + i (early modern paper) : parchment ; 200 x 268 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:51114/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:51104/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/51114',10,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2991,9,'mssHM 160','Huntington Manuscripts','[1567]',1567,1567,'Heroica eulogia.','Written in England in 1567, with calligraphic passages copied by John de Beauchesne, as the presentation copy from William Bowyer to Robert Dudley, Earl of Leicester. Sale of Thomas Jett, London, 11 May 1731, n. 19. Was in the Tixall Library of Sir F. A. T. Clifford Constable of Aston Hall; his sale, Sotheby\'s, 6 November 1899, lot 90 to B. F. Stevens. Belonged to Robert Hoe: Cat. (1909) pp. 10-11; his sale, Anderson, New York, 1911, pt. I, n. 2124 to G. D. Smith. Smith Catalogue 1 (1911) n. 66 to Henry E. Huntington in 1912','Latin [lat]','150 leaves : parchment ; 326 x 236 mm','https://hdl.huntington.org/iiif/2/p15150coll7:44975/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:44656/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/44975',319,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2992,9,'mssHM 126','Huntington Manuscripts','[between 1385 and 1399]',1385,1399,'Chronicle : [manuscript].','Possession notes: f. 136, birth notices of members of the Wombwell family, 1550-1621; back flyleaf i, s. XVI, "Your Loueing Harlow of Rochester" and "Edward Harlowe"; the same person added on back flyleaf iii, "By your Loueing and assured Edward harlowe Anno domini 1576"; also on back flyleaf i, s. XVI, "Thomas Anderson" and "Thomas Bannester"; back flyleaf ii, s. XVI, "Allaxander Gatton Genttellman dede borro this bok of Mr. John Cellsonne alldermane of the Sette of Rochester 1573." Pasted to the front flyleaf i verso, a note on the text of HM 126, signed "H.P." and dated from Stockwell, 1 December 1816. Belonged to the Earls of Essex; Essex bookplate dated 1701, as reported by De Ricci, no longer present; sale of Algernon Capell (1884-1966), 8th Earl of Essex by Hodgson, 30 November 1922, lot 1; Frank Marcham Cat. 44 (1924) n. 56 with plates of ff. 1 and 12v. (CSmH)','English, Middle (1100-1500) [enm]','ff. 136 : parchment ; 182 x 271 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49770/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49766/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49770',4,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2993,9,'mssHM 902','Huntington Manuscripts','[between 1300 and 1350]',1300,1350,'Roman de la Rose : [maunscript].','Belonged to William Constable-Maxwell, 10th Lord Herries (1804-76), whose bookplate is on the front pastedown; in 1870 it was seen and noted by J. Stevenson in the 1st Report of the HMC, Appendix, p. 45. Subsequently it belonged to the 11th Lord Herries\' daughter, the Duchess of Norfolk, who disposed of a portion of the manuscript collection, ca. 1912 (see De Ricci,"Bibliotheca Britannica Manuscripta: a survey of manuscript material existing in the British Isles; preliminary biliography," photocopy at Huntington Library from handwritten card index at University of London). Sold by W. H. Robinson, Cat. 12 (Newcastle 1925) n. 813. Acquired by Henry E. Huntington in June 1925.','French [fre]','ff. 135 : parchment ; 208 x 283 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49774/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49771/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49774',3,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2994,9,'mssHM 719 vol. 16','Huntington Manuscripts','1783, Feb. 24 - Apr. 6',1783,1783,'Orderly book of the 8th Massachusetts Regiment, 1783, Feb. 24 - Apr. 6, New Windsor.',NULL,NULL,'62 leaves, 30 cm, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:44399/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:44275/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/44399',124,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2995,9,'mssHM 164','Huntington Manuscripts','1723-1776',1723,1776,'Miscellaneous writings of Joseph Norris, 1723-1776.',NULL,'English [eng]','44 leaves ; 40 cm : bound ledger.','https://hdl.huntington.org/iiif/2/p15150coll7:78191/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:78100/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/78191',91,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2996,9,'mssHM 83','Huntington Manuscripts','1486-1488',1486,1488,'Cosmography; astrological medicine, 1486-1488.','Acquired by Henry E. Huntington in February 1926 from Maggs, Cat. 465 "Bibliotheca Americana et Philippina" Pt. IV (1925) n. 2588','Latin [lat]','25 leaves : paper ; 315 x 215 (265 x 170) mm.','https://hdl.huntington.org/iiif/2/p15150coll7:24625/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:24562/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/24625',63,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2997,9,'mssHM 45','Huntington Manuscripts','[approximately 1502]',1502,1502,'Portolan chart : [cartographic material] : [manuscript], approximately 1502','Possibly made in Italy after a Portuguese prototype early in the sixteenth century. A. Magnaghi in Il planisfero del 1523 della Biblioteca del Re in Torino (Florence 1929) 27 and G. Caraci in Tabulae geographicae vetustiores in Italia adservatae (Florence 1932) 3:62 attribute this chart to Amerigo Vespucci. It belonged to arctic traveller Richard King (1811?-76) and was bought in London by Alphonse Pinart (1832-1911); not in his 1884 sale. Obtained from him in Paris in 1885 by Dr. Jules Théodore Ernest Hamy (1842-1908). His sale by Anderson, New York, 19 November 1912, n. 3, with reproductions on pls. 4 and 5. Bought by James William Ellsworth. His library purchased by A. S. W. Rosenbach who sold this chart to Henry E. Huntington in 1923.','Latin [lat]','1 leaf : parchment ; 585 x 942 mm','https://hdl.huntington.org/iiif/2/p15150coll7:48627/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:48626/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/48627',1,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2998,9,'mssHM 677','Huntington Manuscripts','1778, April',1778,1778,'Orderly book of Samuel Holden Parsons, 1778, Feb. 16 - Apr. 29, Highlands, N.Y., West Point, N.Y.',NULL,NULL,'44 leaves, oblong quarto.','https://hdl.huntington.org/iiif/2/p15150coll7:24245/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:24152/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/24245',93,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(2999,9,'mssHM 678','Huntington Manuscripts','1780, Sept. - Nov.',1780,1780,'Orderly book of John Stark, 1780, Sept. 17 - Nov. 19,',NULL,NULL,'94 leaves, oblong quarto.','https://hdl.huntington.org/iiif/2/p15150coll7:24437/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:24246/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/24437',191,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3000,9,'mssHM 130','Huntington Manuscripts','[between 1390 and 1410]',1390,1410,'Pricke of Conscience : [manuscript].','On f. 120v,"Iste liber partinet [sic] Willelmo Smart. Smart groser," with merchant\'s mark; William Smart became a freeman of the Company of Grocers of London in 1495 and warden of the Company in 1509. The manuscript was, at least temporarily during the 1530s, in hands of the printer, Robert Wyer. Acquired in 1772 by William Herbert (1718-95), as shown by his signature and date on f. 1 (the original first leaf was already missing); on the inside front cover, possibly in Herbert\'s hand,"T.t.n." and"D. 723." On a label on the spine, the number"741/3." Belonged to Sir Gregory O. Page-Turner of Battlesden; his sale, 19 October 1824, part of lot 2717 to Sir Thomas Phillipps. Phillipps MS 3126, with the Middle Hill stamp and shelfmark"B.44.953" (in modern pencil) on the inside front cover. Also in modern pencil,"3244" on inside front cover and"240" on f. 120v. Acquired by Henry E. Huntington through A. S. W. Rosenbach in 1923.','English, Middle (1100-1500) [enm]','ff. 120 : parchment ; 160 x 235 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52085/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52078/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52085',7,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3001,9,'mssHM 26','Huntington Manuscripts','[approximately 1544]',1544,1544,'Portolan atlas : [cartographic material] : [manuscript], approximately 1540','Arms of first owner (?) on f. 2: or a swan\'s (or eagle\'s) head sable issuant from a cloud azure, holding in its beak a horse-shoe proper; sold by Ellis Booksellers, London, 1864, to Henry Huth (1815-78). His bookplate on front pastedown and pencilled note "Portolano (4) p. 1171" and "1550" referring to The Huth Library (1880) pt. 4, 1171. On back pastedown pencilled note "H 5916" referring to the sale of Alfred Henry Huth (1850-1910), Sotheby\'s, 1917, pt. VI, lot 5916, with reproduction of chart ff. 5v-6, to G. D. Smith from whom it was acquired by Henry E. Huntington.','Latin [lat]','1 volume, 14 leaves : parchment ; 242 x 171 mm. (10 x 14 in.)','https://hdl.huntington.org/iiif/2/p15150coll7:46135/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46118/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46135',17,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3002,9,'mssHM 594','Huntington Manuscripts','1776-1791',1776,1791,'Orderly books of Ebenezer Thayer, Jr. 1776-1791.',NULL,'English [eng]','133 leaves, 20 cm, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:8695/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:8425/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/8695',270,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3003,9,'mssHM 60','Huntington Manuscripts','[between 1490 and 1510]',1490,1510,'Les XXI epistres des dames illustes traduicttes d\'Ovide / par le Reverend Pere en Dieu Monseigneur l\'Evesque de Angoulesme : [manuscript].','Belonged to Jean Le Clerc (1657-1736); his sale, Amsterdam, 6 September 1735 with the catalogue entry reprinted by F. L. Hoffmann,"Handschriften welche in Katalogen öffentlich verkaufter Bibliotheken verzeichnet sind," Serapeum 19 (1858) 194-98, especially p. 197. Guglielmo Libri (1803-1869) sale, Sotheby\'s, 25 July 1862, lot 429 to Edwin Henry Lawrence; his sale, Sotheby\'s, 9 May 1892, lot 484 to Quaritch. Robert Hoe collection: Bierstadt (1895) pp. 16-18 with plates of ff. 112 and 123; Cat. (1909) pp. 153-55; his sale, Anderson, New York, 1911, pt. I, n. 2168 with a plate of f. 112 to G. D. Smith; sold in 1918 to Henry E. Huntington.','French [fre]','ff. 131 : parchment ; 167 x 243 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49400/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49374/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49400',26,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3004,9,'mssHM 40','Huntington Manuscripts','[1602, July 6]',1602,1602,'Portolan atlas, Italian : [cartographic material] : [manuscript].','Otto Vollbehr collection (possibly number 8326 or 38579 which are pencilled on flap of scroll).','Latin [lat]','f. 1 : parchment ; 1140 x 730 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:48056/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:48055/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/48056',1,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3005,9,'mssHM 4','Huntington Manuscripts','1647',1647,1647,'Comoedyes and pastoralls : with their songs, as also one booke of epigrammes by W.P. Esquier ... exscriptum anno salutis 1647. : manuscript, 1647.','By the later 18th century, work acquired by the antiquarian Sir William Burrell. Purchased in 1796 by the Duke of Roxburghe. It was then acquired by Joseph Haslewood (his notes, dated 1825, on the acquisition in info file), then the Duke of Devonshire and finally Henry E. Huntington. Armorial bookplate of the Duke of Devonshire with motto "Honi soit qui mal y pense" on front pastedown.','English [eng]','216, that is, 219 leaves : paper ; 30 cm','https://hdl.huntington.org/iiif/2/p15150coll7:69561/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:69106/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/69561',455,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3006,9,'mssHM 504','Huntington Manuscripts','[between 1490 and 1510]',1490,1510,'Explanationes notabiles super lectiones beati Iob : [manuscript]','Written at the end of the fifteenth century or at the beginning of the sixteenth, possibly in England by a scribe trained on the Continent. Notes in an eighteenth century English hand: on f. 1, the numbers"24-1"; on f. 60v,"Deest folium." Quaritch Cat. 321 (1912) n. 278 and Cat. 344 (1916) n. 30. Acquired by Henry E. Huntington in April 1925 from Quaritch.','Latin [lat]','ff. 75 : parchment ; 155 x 211 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49404/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49401/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49404',3,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3007,9,'mssHM 44','Huntington Manuscripts','[between 1550 and 1599]',1550,1599,'Portolan atlas, Portuguese : [cartographic material] : [manuscript].','The early endpapers affixed to modern parchment front and back bear oval ownership stamp with laurel wreath surrounding initials AY (?); owned by Henry Stevens (1791-1867); sale of his library, 1868, to Henry Huth (1815-78); his ex libris on front pastedown and pencilled notation "Portolano (6) p. 1171 " indicating The Huth Library (1880) pt. 4, 1171.','Latin [lat]','ff. 9 : parchment ; 330 x 440 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46336/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46331/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46336',18,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3008,9,'mssHM 55','Huntington Manuscripts','[1440]',1440,1440,'Life of St. Norbert : [manuscript].','Written in England, possibly in the Augustinian house at Lynn, Norfolk in 1440, as the presentation copy made by John Capgrave for John Wygenhale, alias Saresson, abbot of the Premonstratensian house of the Assumption of the Blessed Virgin Mary in West Dereham, Norfolk from 1429 to 1455; see P. J. Lucas,"On the Date of John Capgrave\'s Life of St. Norbert," The Library ser. 6, vol. 3 (1981) 328-30. Possession notes throughout the manuscript are: s. XVIIin: f. 28v,"frances Barnad" who also did the reckonings mentioned above; s. XVII: f. 13,"Richard Clarke est verus possessor huius libri"; s. XVII2: f. 49,"Ferdinand Newington his Booke 1670"; s. XVIII: on the front pastedown and on ff. 1 and 49,"Newington, ladbrooke" to which he added on the pastedown"Ye men of Orde" and on f. 49 (where his name was erased)"His Book 1729"; on ff. 3, 27 and 45, the signature of the Rev. Ar. Hubbard, lecturer in the parish of Watford, Hertfordshire, 1846-56; on f. 45 his name is followed by"Epping Essex." On the back flyleaf, the initials"R.P." of the late sixteenth or early seventeenth century. Savile sale, Sotheby\'s, 6 February 1861, lot 80 (this number on a round label on the front cover) to"Powis," a pseudonym for Sir Thomas Phillipps; his MS 24309. Acquired by Henry E. Huntington through A. S. W. Rosenbach in 1923.','English, Middle (1100-1500) [enm] ; Latin [lat]','ff. 59 : parchment.','https://hdl.huntington.org/iiif/2/p15150coll7:50944/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:50939/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/50944',5,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3009,9,'mssHM 614','Huntington Manuscripts','1778-1780',1778,1780,'Orderly book of John Lacey\'s Brigade of Pennsylvania Militia, 1778, Jan. 22 -- 1780, Sept. 1.',NULL,'English [eng]','58 leaves, 15 cm., oblong octavo, bound volume','https://hdl.huntington.org/iiif/2/p15150coll7:9663/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:9544/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/9663',119,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3010,9,'mssHM 659','Huntington Manuscripts','1778, Dec. 6 - 1779, Aug. 7',1778,1779,'Orderly book of Benjamin Lincoln, 1778, Dec. 6 - 1779, Aug. 7.',NULL,NULL,'114 leaves, 31 cm., bound volume','https://hdl.huntington.org/iiif/2/p15150coll7:23679/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:23506/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/23679',173,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3011,9,'mssHM 56','Huntington Manuscripts','[between 1140 and 1160] ; [between 1000 and 1099]',1140,1099,'Epistles of Paul ; Missal bifolium fragment : [manuscript].','On f. iv verso, erased inscription, s. XV: iste liber est conventus lucce __?___; below that, s. XVI: Emi ego frater M__?___ aliis libris venderent. On ff. 1 and 70, the stamp"Di casa Minutoli-Tegrimi." Reproductions of the stamp as it occurs in J.A. 3216 on pl. XXII and p. 53 of Alexander and de la Mare, Italian Manuscripts...of Major J. R. Abbey ; a list of other Minutoli-Tegrimi manuscripts in England on p. 55, n. 2. The collection of Conte Eugenio Minutoli-Tegrimi of Lucca was sold in 1871; this manuscript in the catalogue, p. 31, n. 164. On the front pastedown, ff. 1 and 155v, the stamped armorial ex libris of the Swiss-born artist Friedrich De Schennis (1852-1918); it may have been De Schennis who added copious notes in German on f. i recto and verso regarding historical aspects of Paul\'s life and his theology; sold to the Leipzig bookdealer, Karl Wilhelm Hiersemann; alien sequestrated property sale by Anderson, New York, 17 February 1919, n. 35 to G. D. Smith.','Latin [lat]','ff. 155 : parchment.','https://hdl.huntington.org/iiif/2/p15150coll7:50755/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:50751/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/50755',4,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3012,9,'mssHM 503','Huntington Manuscripts','[between 1400 and 1415]',1400,1415,'The clergy may not hold property : [manuscript].','Written in England in the early fifteenth century, in the same format and possibly of the same origin as Egerton 2820 and Dd.14.30(2); London, Lambeth Palace 551, printed by Matthew, is also of similar size and format. On f. 129, s. XVIin, "The vycar of Byllyngshurst [Sussex] whiche is of goode & vertuos of his lyvyng owyth this lytyll boke." Armorial bookplate of Sir John Cope (d. 1721) on the front pastedown; also on the pastedown and on f. iii, "vv.viii.4" in red pencil. "XX" in ink on f. i and "20" in pencil on f. iii refer to the entry for this book in the list of the Cope library manuscripts compiled by A. J. Horwood in the HMC, 3rd Report (1872) p. 243. Sale of Sir Anthony Cope (1842-1932), Sotheby\'s, 4 March 1913, lot 24. Quaritch Catalogue 328 (1914) n. 585 and Catalogue 344 (1916) n. 39, both with plates of f. 119v. Acquired by Henry E. Huntington in April 1925 from Quaritch. (CSmH)','English, Middle (1100-1500) [enm]','ff. 129 : parchment ; 95 x 129 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49411/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49405/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49411',6,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3013,9,'mssHM 143','Huntington Manuscripts','[between 1385 and 1415]',1385,1415,'Piers Plowman : [manuscript].','Written at the end of the fourteenth century in England, and localizable by its dialect to southwestern Worcestershire (Malvern Wells or Upton area). A fifteenth-century owner recopied the first 4 lines of the poem on f. 108; another wrote on f. 107v: "Ihesu ihesu ihesu for thyn holy name to be me ihesus." "Dan John redbery," s. XV/XVI, signed his name on f. 108; another early owner, s. XVI or XVII, John Russell signs his name with a monogram flourish on f. i verso and f. 107v. Belonged to the Sotheby family by the late seventeenth century; signature of James Sotheby (d. 1720) on f. ii and on f. 1; on f. ii the numbers "Y666" (or D666?) and "80." Armorial bookplate of C. W. H. Sotheby on the front pastedown; Col. H. G. Sotheby sale, Sotheby\'s, 24 July 1924, lot 129 with plate of f. 1 to A. S. W. Rosenbach. Acquired by Henry E. Huntington in 1924. (CSmH)','English, Middle (1100-1500) [enm]','ff. 108 : parchment ; 189 x 253 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:53252/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:53020/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/53252',232,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3014,9,'mssHM 31','Huntington Manuscripts','[1655]',1655,1655,'Portolan atlas, French : [cartographic material] : [manuscript].','Sale of the library of Abate Luigi Celotti (ca. 1768-ca. 1846), Sotheby\'s, 14 March 1825, lot 207. A sale catalogue slip affixed to front pastedown describes a "map of the World on three leaves. " Since this volume also contains the two charts made by Salvator Oliva (HM 02515) which form the first and second leaves and since neither is a "World map, " the sale catalogue entry either was carelessly made or the slip actually refers to a different portolan chart and was erroneously placed in this volume. This volume may instead have been lot 210 or lot 283 in the Celotti sale: both numbers are pencilled on the pastedown. Number 391 on back pastedown refers to Cochrane\'s sale of the library of Frederick North, 5th Earl of Guilford (1766-1827), to Sir Thomas Phillipps, 8 December 1830 as dated by A. N. L. Munby, The Formation of the Phillipps Library up to the Year 1840, Phillipps Studies (Cambridge 1951-60) 3:56. Front pastedown bears his number "Phillipps MS 6360. "','Latin [lat]','ff. 2 : parchment ; 288 x 405 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46341/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46340/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46341',1,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3015,9,'mssHM 27','Huntington Manuscripts','1553',1553,1553,'Portolan atlas : [cartographic material] : [manuscript], 1553','Inscribed on f. 8, "Baptista agnese fecit venetiis anno domini 1553, die viii Iulii." On f. 2, erased arms (?), French, s. XVIex: argent a chevron (?). On front flyleaf, a note in Latin and French giving author and date of manuscript; on front pastedown, "No. 19901"; "845 MC" pencilled on front pastedown indicates the Gerard Meerman sale, The Hague, 1824, pt. IV, n. 845 to Sir Thomas Phillipps. Phillipps\' Middle Hill stamp on front flyleaf with numbers "1912 & 24051" and note on pastedown stating "This was part of lot 845 in the Meerman Sale and should have been placed with other volume under Phillipps MS 1912, T[homas] F[itzroy] F[enwick]." Obtained privately through A. S. W. Rosenbach by Henry E. Huntington in 1924.','Latin [lat]','1 volume, 14 leaves : parchment ; 369 x 271 mm (14 x 18 in)','https://hdl.huntington.org/iiif/2/p15150coll7:46152/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46136/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46152',16,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3016,9,'mssHM 591','Huntington Manuscripts','1758',1758,1758,'Obadiah Harris journal, 1758 May 22-October 23.',NULL,NULL,'1 volume, 23 pages.','https://hdl.huntington.org/iiif/2/p15150coll7:54600/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:54535/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/54600',65,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3017,9,'mssHM 183','Huntington Manuscripts','[between 1450 and 1790]',1450,1790,'Album of English manuscripts : poems, epigrams and letters written between 1450 and 1790 : [manuscript]','Written in England, the three parts respectively in the second half of the fifteenth century, in the first half of the sixteenth, and towards the end of the sixteenth century through the late eighteenth century. The album was assembled by Joseph Haslewood (1769-1833), who in publishing art. 7 in 1808 stated that it was"obtained from the Hawkins library at Nash Court" (Kent); there is no information on his sources for pts. II and III. Haslewood sale, Evans, 16 December 1833, lot 1328 to T. Rodd. Thorpe Catalogues of 1834, lot 509 (note in Library files; this catalogue not available to us) and of 1836, lot 425 to Sir Thomas Phillipps; his n. 8923, although the usual inscription has been erased from the title page of the album. Phillipps sale, Sotheby\'s, 22 March 1895, lot 378 to Quaritch. Belonged to Robert Hoe; his sale, Anderson, New York, 1912, pt. IV, lot 2357 (see sale catalogue for further information on the other items in this album) to G. D. Smith. With bookplates of Haslewood and Hoe. Precise source and date of acquisition by Henry E. Huntington unknown.','English [eng]','1 album (34 leaves containing approximately 65 items) : paper.','https://hdl.huntington.org/iiif/2/p15150coll7:53256/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:53253/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/53256',3,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3018,9,'mssHM 136','Huntington Manuscripts','[England, middle of the 15th century]',1400,1499,'[Brut chronicle, middle of the 15th century].','HM 136 served as the printer\'s exemplar for the first printing of William Caxton\'s Chronicles of England (1480). The manuscript shows the printers marks throughout the volume. Contemporary side notes. Notes on f. 1, "pr. 1l 13s 4d." Twice the name of John Leche, late 15th century or early 16th century, appears, possibly by the same person who copied sections 1 and 4, on front flyleaf iii, "Liber Johannis Leche"; on back flyleaf i, "Liber Johannis Leche de Wico Malbano in Com. Cestr." A series of scribbles in the same sixteenth century hand in the upper margins of every few leaves throughout the book often contains the name of Dorothy Helbarton. Other sixteenth century notes: back flyleaf vii verso, "Franciscus Dorington huius liber possessor legittimus"; back flyleaf viii verso, birth notices of Arthur Cole (27 November 1519) and Ursula Cole (10 March 1521). Seventeenth century owners: front flyleaves iii and iv, "Joseph Sond"; front flyleaf vi, "Will Persall"; f. 1, "George Culcheth his Booke 1666" and "1681 J. Bagnalls." Thorpe catalogue (1836) lot 252; Sir Thomas Phillipps\' name and the date 1858 on front flyleaf iii; his MS 8858. Acquired privately by Henry E. Huntington through A. S. W. Rosenbach in 1923.','English, Middle (1100-1500) [enm]','158 leaves : parchment ; 286 x 190 (208 x 130) mm','https://hdl.huntington.org/iiif/2/p15150coll7:40969/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:40610/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/40969',359,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3019,9,'mssHM 113','Huntington Manuscripts','[between 1390 and 1499]',1390,1499,'Brut Chronicle, in English : [manuscript].','Possession notes in the volume are: s. XVI: f. 1, partially cropped, "John Wynche [?]"; f. 15v, "John norton"; s. XVII, f. 1, "N. Blundeston"; s. XVIex, f. 1, cancelled, "Sam. Oliver pr. 1 s." Thorpe cat., 1836, n. 250 to Sir Thomas Phillipps; his MS 8857. (CSmH)','English, Middle (1100-1500) [enm] ; Latin [lat]','ff. 166 : parchment.','https://hdl.huntington.org/iiif/2/p15150coll7:49418/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49412/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49418',6,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3020,9,'mssHM 643','Huntington Manuscripts','1779-1785',1779,1785,'Thos. Foster his Book, 1779-1785.',NULL,'English [eng]','63 leaves, 14 x 21 cm. oblong quarto, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:23307/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:23160/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/23307',147,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3021,9,'mssHM 124','Huntington Manuscripts','[between 1440 and 1460]',1440,1460,'Speculum Christiani : [manuscript].','Written in England in the middle of the fifteenth century by a scribe who produced 2 other known copies of this text. Ownership notes in the volume: ff. 33 and 68, s. XVI, "Willelmus"; ff. ii and 1, s. XVII-XVIII, "Sa. Rooper"; f. i, s. XVIII, "JGL." Erasure of possession note on f. iii verso. Sotheby\'s, 11 June 1923, lot 89A to Barnard. Acquired by Henry E. Huntington, ca. 1924, evidently from Maggs, as a typed description impressed with their seal accompanies the manuscript.','Latin [lat] ; English [eng]','f. iii + 78 + iii : parchment ; 117 x 170 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:51725/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:51720/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/51725',5,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3022,9,'mssHM 884','Huntington Manuscripts','[between 1585 and 1599]',1585,1599,'Discorso della virtù femminile : [manuscript].','Written in the hand of the author, Torquato Tasso. This manuscript was noticed in the 1856 Sotheby sale by A. Solerti, Appendice alle opere in prosa di Torquato Tasso (Florence 1892) 61-67, who implied that it might be the one mentioned in a letter from Ludovico Muratori to Apostolo Zeno, 28 March 1735 (that manuscript, however, now identified as Modena, Biblioteca Universitaria Estense, Raccolta Molza-Viti, Filza III, fasc. 9). A note attached to HM 884, f. vi identifies an early owner as the Abbate don Vincenzo Faustini of Ferrara, and states that from his hands the manuscript passed to a Signor Passini from whom a Captain Kühlen bought it in 1850. Another letter attached to f. v, dated 23 August 1855, signed L. Gruner and addressed to Leigh Sotheby, translates an authorization by Captain Kühlen for Gruner to sell the manuscript in London for 50 Pounds Sterling. Sotheby\'s, 23 February 1856, lot 41 (proprietor unnamed) to Guglielmo Libri (1803-69); his sale, Sotheby\'s, 28 March 1859, lot 981 with plate of f. 1 to Scalia (bought in); sale by Puttick, 4 February 1863, n. 924 to Abis. On f. ii, the ex libris of William K. Bixby (1857-1931) of St. Louis, Missouri, n. 1290. Acquired from him by Henry E. Huntington through G. D. Smith in August 1918.','Italian [ita]','ff. 6 : paper ; 210 x 290 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52303/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52302/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52303',1,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3023,9,'mssHM 626','Huntington Manuscripts','1777, June 11 - 1778, Nov. 15',1777,1778,'Journal of John André, 1777, June 11 - 1778, Nov. 15.',NULL,'English [eng]','117 pages, 15 x18 cm., bound volume, in a modern box.','https://hdl.huntington.org/iiif/2/p15150coll7:22547/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:22189/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/22547',358,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3024,9,'mssHM 112','Huntington Manuscripts','[between 1400 and 1450]',1400,1450,'Scale of perfection : [manuscript].','The 3 manuscripts, Add. 10052, HM 112 and Add. 10053 were still a single volume when seen and noted by Bernard, vol. 2, n. 6593 in the collection of Charles Theyer (b. 1651), who had inherited from his grandfather, the antiquary John Theyer (1597-1673) a collection of manuscripts originating in the library of Llanthony priory bequeathed to John Theyer by his uncle Richard Hart, last prior of that house (catalogue, s. XIV, in London, Brit. Lib., Harley 460). After Charles Theyer\'s unsuccessful efforts to offer the books to Oxford University, they passed to the London bookseller Robert Scott. A catalogue compiled in 1678 (London, Brit. Lib., Royal Appendix 70) does not list Add. 10052-HM 112-Add. 10053; this collection was purchased by Charles II and passed with the Royal Library to the British Museum. The manuscript which is now Add. 10052, HM 112 and Add. 10053 may have been split up and bound separately by 1807, date of Richard Heber\'s purchase of Add. 10053 (since he purchased Add. 10052 only in 1819). HM 112 may have received its present binding while in the possession of George Offor (1787-1864), since the date of 1824 is on the paper flyleaves that contain an account of the text signed by Offor. It survived the fire at Sotheby\'s, 28 June 1865, although it is not one of the manuscripts listed for the first day\'s sale: 27 June 1865, lot 2666; the only signs of damage to HM 112 are dark stains on the edges of the front and back flyleaves, corresponding to the shape of the turn-ins. Belonged to Sir Thomas Brooke (1830-1908); see A Catalogue of the Manuscripts and Printed Books Collected by Thomas Brooke F.S.A. (London 1891) 1:253. A number of other manuscripts which belonged to him were bequeathed by his brother, Canon C. E. Brooke to Keble College in 1911; see M. B. Parkes, The Medieval Manuscripts of Keble College Oxford (London 1979) mss 27-65 and roll 1. Sir John Brooke sale, Sotheby\'s, 30 May 1921, lot 776; Maggs Cat. 416 (1921) n. 171; a pencilled note on f. i verso "Page 31 Cat. vol I MSS." Acquired by Henry E. Huntington in 1924.$5CSmH',NULL,'ff. ii + vi (watermarked 1824) + 78 + ii :parchment ; 130 x 191 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49427/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49419/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49427',8,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3025,9,'mssHM 901','Huntington Manuscripts','[between 1440 and 1460]',1440,1460,'Prima pars de ymittacione christi et contemptu omnium vanitatum mundi et cetera : [manuscript].','Written in northern Germany in the middle of the fifteenth century. On f. 14, s. XVI:"Omnia ad maiorem dei gloriam." According to De Ricci, was n. 26153 in a German catalogue; this number on a label on the spine. Acquired from A. S. W. Rosenbach by Henry E. Huntington in December 1922.','Latin [lat]','ff. 58 : paper ; 222 x 307 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52687/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52684/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52687',3,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3026,9,'mssHM 89','Huntington Manuscripts','1758-1766',1758,1766,'Joseph Nichols diary, 1758-1766.',NULL,NULL,'130 pages, 14 cm., bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:54224/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:54063/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/54224',161,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3027,9,'mssHM 649','Huntington Manuscripts','August 18, 1776-May 18, 1777',1776,1777,'Letterbook of Philip John Schuyler, 1777, June 4-August 13.',NULL,NULL,'1 volume, 181 pages.','https://hdl.huntington.org/iiif/2/p15150coll7:23505/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:23317/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/23505',188,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3028,9,'mssHM 621','Huntington Manuscripts','1781-1782',1781,1782,'Journals and records of the campaigns of Rochambeau\'s army, 1781-1782',NULL,'French [fre]','68 leaves, 18 cm., bound volume','https://hdl.huntington.org/iiif/2/p15150coll7:29841/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:29692/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/29841',149,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3029,9,'mssHM 111','Huntington Manuscripts','between 1400-1425',1400,1425,'[Poems]: manuscript, [between 1400-1425].','Binding shows the book to have been in the library of Prince Henry (1594-1612); see S. Jayne an F.R. Johnson, The Lumley Library: the Catalogue of 1609 (London 1956), this manuscript recorded on p. 303. Already alienated by 1661 when the printed books and manuscripts of the Royal Library were catalogued by Thomas Ross (Henry E. Huntington Libary, MS HM 180). Belonged to Anthony Askew (1722-72); his sale, Sotheby\'s, 7 March 1785, lot 327 to George Mason (1735-1806). While in Mason\'s possession, Thomas Tyrwhitt made some notes of the disorder of the first leaves in a letter dated 4 April 1785, now affixed to the first pastedown. Mason added to these notes, and eventually published 6 of the poems (arts. 3, 9, 13, 16-18) in his Poems by Thomas Hoccleve (London 1796); his sale, Sotheby\'s, 25 April 1799, pt. IV, lot 279. Acquired by Richard Heber (1773-1833) with his purchase note in a small, careful script in the upper right corner of the front pastedown; his sale, Evans, 10 February 1836, pt. XI, lot 583 (round label with that number on the spine) to Payne. Belonged to Sir Thomas Phillipps; his MS 8151 and shelf mark (B.36.550) on fol. i. Notes by Furnivall dated 22 September 1882 added to Tyrwhitt\'s comments.','English, Middle (1100-1500) [enm] ; French, Middle (ca.1400-1600) [frm]','49 leaves : parchment ; 210 x 155 (155-170 x 90) mm','https://hdl.huntington.org/iiif/2/p15150coll7:9873/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:9766/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/9873',107,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3030,9,'mssHM 744','Huntington Manuscripts','between 1425 and 1450',1425,1450,'Didactic pieces : manuscript, [between 1425 and 1450].','In the collection of the Earl of Ashburnham (1797-1878), Appendix n. 133, with the characteristic yellow circular label on the spine. The Appendix manuscripts sold privately in May 1897 to Henry Yates Thompson (1838-1928); his sale of the items he did not wish to retain, Sotheby\'s, 1 May 1899, n. 81 to Leighton. Belonged to George Dunn (1865-1912); his sale, Sotheby\'s, 11 February 1913, pt. I, n. 518 to Maggs. Owned by Sir Israel Gollancz (1864-1930). Acquired by Henry E. Huntington in June 1925 from A. S. W. Rosenbach.','English, Middle (1100-1500) [enm]','68 leaves : parchment ; 160 x 233 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:18518/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:18365/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/18518',153,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3031,9,'mssHM 46','Huntington Manuscripts','[between 1540 and 1560]',1540,1560,'Portolan chart ; Nautical almanac, French : [cartographic material] : [manuscript].','On the extension of the world map originally bound into the front of the volume are the arms of Artus de CossÃ©, MarÃ©chal de France (1512-82), the first owner (?); his name is pencilled below the coat of arms, and arms are described on flyleaf of the volume by a later owner. Given by a Dr. Moore (of Paris) ca. 1850 to Joseph Brooks Yates (1780-1855). Bequeathed by him to Henry Yates Thompson (1838-1928), whose bookplate is on front flyleaf marked "95, Inherited J. B. Y. 1856" ( Cat. II, 1902, 2d series, n. 95).','Latin [lat]','ff. 20.','https://hdl.huntington.org/iiif/2/p15150coll7:46166/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46162/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46166',13,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3032,9,'mssHM 684','Huntington Manuscripts','Jan. 23 - Mar. 26, 1776',1776,1776,'Orderly book Col. David Waterbury\'s regiment, 1776, Jan. 23 - Mar. 26, Stamford, Conn., New York, N.Y.',NULL,NULL,'77 leaves, 21 cm, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:25624/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:25468/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/25624',156,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3033,9,'mssHM 719 vol. 10','Huntington Manuscripts','1781, July 2 - Sept. 19',1781,1781,'Orderly book of the 8th Massachusetts Regiment, 1781, July 2 - Sept. 19, Peekskill, Dobbs Ferry, Peekskill, West Point.',NULL,NULL,'131 p., 3 charts, 30 cm, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:43480/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:43339/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/43480',141,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3034,9,'mssHM 604','Huntington Manuscripts','1782',1782,1782,'Orderly book of the New Jersey Brigade, 1782, Nov. 9 - Dec. 31, Newburgh, N.Y.','From the collection of S. W. Cowles who had obtained it from James S. Hulme of Mount Holly, N.J.','English [eng]','60 leaves, 21 cm., oblong octavo','https://hdl.huntington.org/iiif/2/p15150coll7:9111/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:8989/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/9111',122,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3035,9,'mssHM 51','Huntington Manuscripts','[between 1200 and 1250]',1200,1250,'Bible : [manuscript].','Written in England (?) during the first half of the thirteenth century. Rubrics for the readings at mass ("ad usum morinensem,""secundum usum morinensis diocesis"), as well as the saints occurring on ff. i-xii verso show that at least by the time of this addition, s. XIV, the book was being used in the diocese of Thérouanne in northern France. Belonged to the Minneapolis bookseller and collector, Edmund D. Brooks; sale by Anderson, New York, 13 November 1913, n. 375 to Herschel V. Jones (1861-1928), also of Minneapolis; his sale, Anderson, New York, 29 January 1919, pt. II, n. 1070A to G. D. Smith.','Latin [lat]','ff. iii + i + xii + 378 + i + iii : parchment ; 173 x 242 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:50778/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:50773/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/50778',5,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3036,9,'mssHM 142','Huntington Manuscripts','between 1450 and 1467',1450,1467,'[Religious prose andverse]: manuscript, [between 1450 and 1467].','Belonged to Clarence S. Bement of Philadelphia; not identified in his sales (28 February, 29 March 1923); apparently acquired by Henry E. Huntington before 1916.','English, Middle [1100-1500] [enm] ; Latin [lat]','ff. 1-62v, bound; 170 x 255 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:19292/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:19151/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/19292',141,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3037,9,'mssHM 719 vol. 08','Huntington Manuscripts','1781, Mar. 12 - May 17',1781,1781,'Orderly book of the 8th Massachusetts Regiment, 1781, Mar. 12 - May 17, West Point.',NULL,NULL,'85 p., 30 cm, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:43103/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:43011/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/43103',92,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3038,9,'mssHM 139','Huntington Manuscripts','[between 1440 and 1460]',1440,1460,'Pricke of conscuence : [manuscript].','Among the early owners are certainly John Wyldon, and possibly John Pendand (?). Sold by Thorpe, 1836, lot 1023 to Sir Thomas Phillipps; his MS 9412. Acquired privately by Henry E. Huntington through A. S. W. Rosenbach in 1923.','English, Middle (1100-1500) [enm]','ff. 44 : paper ; 205 x 288 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49434/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49428/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49434',6,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3039,9,'mssHM 65','Huntington Manuscripts','1279',1279,1279,'Almagest : [manuscript].','Erased inscriptions at the top of ff. ii, 1. Belonged to Pier Leoni (d. 1492), physician to Lorenzo de\' Medici; n. 111 in the inventory of his books compiled in 1582 and published by L. Dorez,"Recherches sur la bibliothèque de Pier Leoni, médecin de Laurent de Médicis," Revue des Bibliothèques 7 (1897) 81-106. Identified by J. Ruysschaert,"Nouvelles recherches au sujet de la bibliothèque de Pier Leoni médecin de Laurent le Magnifique," Bulletin de la classe des lettres et des sciences morales et politiques de l\' Académie royale de Belgique, ser. 5, 46 (1960) 37-65. Probably belonged to the Jesuit College in Rome, some of whose books passed to the Vatican Library in 1912. At the same time approximately 27 of their manuscripts were sold to the bookdealer W. Voynich, including HM 65. Handwritten bookdealer\'s notice in French, n. 58, on inside of front cover. Belonged to the Chicago theologian and book collector Rev. Frank W. Gunsaulus (1856-1921); letter addressed to him by Prof. E. J. Goodspeed dated 25 February 1916 in Huntington files.','Latin [lat]','ff. 271 : parchment ; 226 x 319 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52698/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52688/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52698',10,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3040,9,'mssHM 114','Huntington Manuscripts','[England, middle of the 15th century]',1400,1499,'[Piers Plowman; Mandeville; Troilus; etc., middle of the 15th century]','16th century annotations, include "Richard" whose name appears in the initials of the back flyleaves, and "Thomas Browne," who signed his name on f. 299v and on the back flyleaf ii verso. Owned by Sir Henry Spelman, his name is written at the beginning of each section. Later belonged to Dr. John Taylor who bequeathed his books to Anthony Askew; his sale, Sotheby\'s, 7 March 1785, lot 319 to Richard Gough; his sale, Sotheby\'s, 5 April 1810, lot 4283 to Richard Heber. Heber\'s price annotations of the Gough and Askew sale are on the front pastedown and flyleaf; his sale, pt. XI by Evans, 10 February 1836, lot 1088 to Thorpe possibly for Sir Thomas Phillipps; Phillipps MS 8252. In modern pencil on the front flyleaf, the Phillipps shelfmark "B3b.550" corrected to "a.25.550." Acquired by Henry E. Huntington through A. S. W. Rosenbach in 1923.','English, Middle (1100-1500) [enm]','325 leaves : paper ; 215 x 140 (165 x 100) mm.','https://hdl.huntington.org/iiif/2/p15150coll7:31197/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:40589/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/31197',679,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3041,9,'mssHM 29','Huntington Manuscripts','1547',1547,1547,'Portolan atlas : [cartographic material] : [manuscript], 1547.','On title page, f. 1, under an armillary sphere is written "Nicolas Vallard de Dieppe, 1547." Vallard was probably not the cartographer, but the first owner, whose coat of arms may be those in the center of the border illustrations on chart 11: argent on a saltire sable (or gules?) five besants, in chief a mullet sable pierced of the field. Owned by Charles Maurice de Talleyrand-Périgord, Prince de Bénévent (1754-1838). His sale, London, 8 May 1816, n. 3464 to Robert Triphook. His sale, Evans, 29 March 1833, n. 445 to Henry Bohn. David Steward Ker sale, London, 7 May 1849, pt. IV, n. 791 to Sir Thomas Phillipps. "Phillipps MS 13199" inscribed on flyleaves ii and iii and his Middle Hill bookplate on front pastedown along with date "1850" and note describing the manuscript.','Latin [lat]','34 leaves : parchment ; 280 x 390 mm','https://hdl.huntington.org/iiif/2/p15150coll7:53470/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:53367/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/53470',103,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3042,9,'mssHM 587','Huntington Manuscripts','Sept. 28 - Dec. 5, 1783',1783,1783,'Orderly book of the 4th Massachusetts Regiment, 1783, Sept. 28 - Dec. 4, West Point, N.Y., Brookline, Mass.','Purchased at the sale of the collection of Charles F. Gunther, Part III, 1919.','English [eng]','49 leaves, 23 cm., oblong octavo.','https://hdl.huntington.org/iiif/2/p15150coll7:8349/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:8251/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/8349',98,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3043,9,'mssHM 49','Huntington Manuscripts','[between 1500 and 1550]',1500,1550,'Traicté de peyne : [manuscript].','Written by"Tant brun" (author/copyist?) in eastern France in the first half of the sixteenth century, and dedicated to the Duke (presumably Antoine, 1489-1544) and the Duchess of Lorraine by the three"Penitens de vostre mayson d\'Arches" (near épinal, in the Vosges). Found in 1793 in the Château de Guise, according to a note on f. iii:"Guise, vu Desforges"; Desforges collection; given by Dollé to M. Robillard, président du Tribunal, Reims, who sold it to the Parisian book dealer Potier in 1866; Comte de Lignerolles sale, Paris, 1894, pt. I, n. 25 to Eugène Paillet (1829-1901), conseiller à la Cour d\'Appel de Paris; his sale, Paris, 1902, pt. I, n. 2; sale by Sotheby\'s, 17 June 1903, n. 106 to Quaritch. Belonged to Robert Hoe: Cat. (1909) pp. 173-74; his sale, Anderson, New York, 1911, pt. I, n. 2180 to G. D. Smith; his Cat. 3 (1911) n. 23 to Henry E. Huntington.','French [fre]','ff. 21 : parchment ; 111 x 167 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52325/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52308/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52325',17,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3044,9,'mssHM 607','Huntington Manuscripts','1776-1779',1776,1779,'The Journal of Cadwallader Colden, Esq. 1776-1779.',NULL,NULL,'1 volume, 196 pages.','https://hdl.huntington.org/iiif/2/p15150coll7:29474/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:29262/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/29474',212,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3045,9,'mssHM 195','Huntington Manuscripts','[between 1440 and 1460]',1440,1460,'Prayerbook from Germany : [manuscript].','Written in Bavaria on the basis of the dialect and the origin of the woodcuts, in the middle of the fifteenth century; the dates 1433 and 1435 on ff. 53 and 70 are thought to be the dates of translation of the texts rather than the dates of transcription. Belonged to the Benedictine abbey of Nonnbergin the diocese of Salzburg, where it apparently bore the pressmark 26.A*.11 (not in the book). Prayers occasionally use feminine forms. Inscriptions include: on the front pastedown,"1623L" and an erasure; on f. iii verso,"Auss der Nunbergerisch Librerei" (now partially erased); on f. 1, the date 1584, the motto"Mein vertrauen steet in Cristo all __cropped___," and erased name and the title, s. XVIII,"Beichtbüchlin __?___"; on f. 159v, a count of the leaves. The book remained in Nonnberg until at least 1913 when it was studied by Gugenbauer (see above). Schreiber\'s work, dated 1926, still places the book in Nonnberg; however, Huntington Library records show that the book, acquired by Henry E. Huntington from Maggs, was accessioned in February 1926.','German [ger]','ff. iii + 159 (1 = contemp. flyleaf) + iii : illustrations (woodcuts), parchment ; 74 x 109 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52132/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52126/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52132',6,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3046,9,'mssHM 218','Huntington Manuscripts','[19th century]',1800,1899,'Matheus da Gaio, Portolan chart, 19th or 20th century forgery : [manuscript].','Purchased by Henry Huntington in 1925 from Weymer Mills, London, who stated in a lettre preserved in Library files that the manuscripts [HM 217 and HM 218] "have been in the possession of an English family for 500 years."','Latin [lat]','f. 1 : parchment ; 483 x 371 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52900/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52899/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52900',1,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3047,9,'mssHM 33','Huntington Manuscripts','[between 1575 and 1599]',1575,1599,'Portolan atlas, Italian : [cartographic material] : [manuscript].','Back pastedown has"Tn[?]22" in an eighteenth century hand and"1761" on front pastedown. Also on the front pastedown,"CCCLXXXVI," probably from the library of Maffeo Pinelli (1736-85) since a note in Italian on the flyleaf identifies this volume as a nautical chart of the Pinelli library; see J. Morelli, La Libreria già raccolta con grande studio dal signor Maffeo Pinelli (Venice 1787) pt. V, n. 3906. James Edwards sale of the Bibliotheca Pinelliana, London, 1789, n. 4906. Pastedown also has the number"1031" which may have been from a London sale ca. 1855 to Guglielmo Libri (1803-69). His sale, Sotheby\'s, 28 March 1859, n. 826, with reproduction of chart 9 on pl. 32 to Bernard Quaritch for Sir Thomas Phillipps; his n. 16365. Phillipps\' sale, Sotheby\'s, 26 June 1919, n. 529, to Bradleigh (nom de guerre for Thomas Fitzroy Fenwick).','Italian [ita]','ff. 15 : parchment ; 180 x 243 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46182/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46167/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46182',15,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3048,9,'mssHM 137','Huntington Manuscripts','[between 1390 and 1410]',1390,1410,'Piers Plowman : [manuscript].','"John Meade" owned the book in the early sixteenth century. By the middle of the eighteenth century, it belonged to Sir Robert Smyth, Baronet, of Isfield, Sussex whose armorial bookplate is on the front pastedown (Rietstap, vol. 5, pl. 319); his sale, Sotheby\'s, 10 April 1809, lot 893 to Richard Heber (1773-1833). Heber\'s price annotations are written on Smyth\'s bookplate; notes regarding the authorship of Piers Plowman on f. i may also be Heber\'s. Heber sale, pt. XI by Evans, 10 February 1836, lot 973 to Payne for Sir Thomas Phillipps; Phillipps MS 8231. In modern pencil on the front pastedown, the Phillipps shelfmark, "a47.297." Acquired privately by Henry E. Huntington through A. S. W. Rosenbach in 1923. (CSmH)','English, Middle (1100-1500) [enm]','ff. 89 : parchment ; 185 x 286 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:50599/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:50421/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/50599',178,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3049,9,'mssHM 719 vol. 15','Huntington Manuscripts','1782, Oct. 15 - Dec. 9',1782,1782,'Orderly book of the 8th Massachusetts Regiment, 1782, Oct. 15 - Dec. 9, New Windsor.',NULL,NULL,'60 p., 1 chart, 30 cm, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:42920/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:42855/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/42920',66,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3050,9,'mssHM 38','Huntington Manuscripts','[1677]',1677,1677,'Portolan atlas, Italian : [cartographic material] : [manuscript].','Black circular stamp "MN " of the Niccolini Collection in Florence on front flyleaf. Sold ca. 1825 by John Cochran to Sir Thomas Phillipps whose n. 3020 and Middle Hill stamp are on the frontispiece.','Latin [lat]','ff. 7 : parchment ; 360 x 541 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46190/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46183/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46190',7,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3051,9,'mssHM 596','Huntington Manuscripts','February 6 - March 31, 1776',1776,1776,'Orderly book of Col. Robinson\'s Regiment of Massachusetts militia, 1776, Feb. 6 - Mar. 31.',NULL,'English [eng]','22 leaves, 32 cm.','https://hdl.huntington.org/iiif/2/p15150coll7:8748/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:8696/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/8748',52,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3052,9,'mssHM 501','Huntington Manuscripts','[between 1400 and 1450]',1400,1450,'Wycliffe materials : [manuscript].','Written in England in the first half of the fifteenth century. On the outside of the parchment wrapper,"Iste liber est meus possum producere testes __followed by 2 lines rendered illegible through use of a reagent___." Quaritch Cat. 344 (June 1916) n. 64. Acquired by Henry E. Huntington in April 1925.','English, Middle (1100-1500) [enm]','ff. 152 : parchment ; 93 x 144 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49454/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49435/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49454',19,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3053,9,'mssHM 606','Huntington Manuscripts','1759',1759,1759,'An Orderly Book of Samuel Grubb\'s Company, 1759.',NULL,NULL,'1 volume, 99 pages.','https://hdl.huntington.org/iiif/2/p15150coll7:54062/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:53944/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/54062',118,'2026-01-30 01:04:31');
