INSERT INTO manuscripts VALUES(3058,9,'mssHM 266','Huntington Manuscripts','[between 1440 and 1460]',1440,1460,'Scale of perfection : [manuscript].','Written in England in the middle of the fifteenth century by John Clerk (d. 1472). Sold by Taylor to Sir Thomas Phillipps; his MS 2180 and Middle Hill stamp on f. i. Acquired privately by Henry E. Huntington through A. S. W. Rosenbach in 1923.','Middle English','ff. 84 : parchment ; 150 x 219 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49459/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49455/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49459',4,'2026-01-30 01:04:31');
