INSERT INTO manuscripts VALUES(3063,9,'mssHM 932','Huntington Manuscripts','[1447]',1447,1447,'Statutes of the Archdeaconry of London : [manuscript].','Written in England in 1447 by Ricardus Franciscus. Apparently belonged to Thomas Rawlinson (1681-1725) for whom the volume was bound; his collection sold in 16 sales between 1721-1734. In 1876 sold by Quaritch to Henry Huth (1815-78); The Huth Library: a Catalogue of the Printed Books, Manuscripts, Autograph Letters, and Engravings Collected by Henry Huth (London 1880) 3:862-63. The collection passed to his son Alfred H. Huth (1850-1910); Huth sale, Sotheby\'s, 7 July 1914, pt. IV, n. 4442 with plate of f. 2v to Quaritch. Precise source and date of acquisition by Henry E. Huntington unknown.','Latin [lat]','ff. 14 : parchment ; 242 x 304 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:50813/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:50807/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/50813',6,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3064,9,'mssHM 680','Huntington Manuscripts',NULL,NULL,NULL,'Orderly book of Daniel Whiting\'s company of the 6th Massachusetts regiment, 1779, Sept. 15 - 1780, Apr. 21, Bedford, Groton, Peekskill, and Highlands, N.Y.',NULL,NULL,'118 leaves, 22 cm., oblong octavo','https://hdl.huntington.org/iiif/2/p15150coll7:24891/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:24626/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/24891',265,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3065,9,'mssHM 695','Huntington Manuscripts','Apr. 14 - May 20, 1778',1778,1778,'Orderly book of Alexander McDougall, 1778, Apr. 14 - May 20, Fishkill, N. Y.',NULL,NULL,'31 pages ; 19 cm., bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:25659/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:25625/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/25659',34,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3066,9,'mssHM 3','Huntington Manuscripts','[between 1540 and 1560]',1540,1560,'King Johan : [manuscript].','Discovered sometime between 1831-38 from among some old papers, probably once belonging to the Corporation of Ipswich (Collier, ed., p. vi) and transferred to the collection of the Duke of Devonshire, through the agency of Collier himself. Two leaves, ff. 21-22, were missing from the manuscript at that time and were only reunited with the rest in 1847; they had been found stitched in the copy of Collier\'s 1838 edition owned by a Mr. William Stevenson Fitch of Ipswich; through a friend of Mr. Fitch, one Mr. Pulman, they were acquired by Collier for the Duke of Devonshire; listed in the typescript Alphabetical Handlist of the Titles of the Kemble-Devonshire Collection of English Plays, compiled 1906-07, vol. 1, p. 292. The Duke of Devonshire collection of plays acquired by Henry E. Huntington in January 1914, through Sotheby\'s and G. D. Smith.','English [eng]','ff. 35 : paper ; 211 x 310 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:53307/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:53305/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/53307',72,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3067,9,'mssHM 681','Huntington Manuscripts','June 20, 1775 - Dec. 15, 1780',1775,1780,'Orderly books of William Moultrie, 1775, June 20 - 1780, Dec. 15.',NULL,NULL,'92 leaves, 23 cm., bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:25081/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:24892/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/25081',189,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3068,9,'mssHM 48','Huntington Manuscripts','[between 1500 and 1515]',1500,1515,'Book of Hours, use of Rome : [manuscript].','Written in France, possibly Tours, although the calendar and litany appear quite general, in the early sixteenth century. It has been suggested that the manuscript belonged to the Duchess of Namur on the basis of what was interpreted as a coat of arms in a roundel on f. 16, a ruby proper, in a lozenge or, surrounded by 4 pearls proper. However, this may simply be an ornamental Renaissance jewel, as is frequently found in Italian manuscripts of the time. Belonged to Herschel V. Jones of Minneapolis (1861-1928), and was obtained from him in February 1918 by Henry E. Huntington. (CSmH)','Latin [lat]','ff. 107 : parchment ; 135 x 214 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:45818/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:45775/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/45818',43,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3069,9,'mssHM 697','Huntington Manuscripts','1782',1782,1782,'Isaac Burnham His Book Drawn for the use of Capt. Emersons Company to keep account of arms ammunition clothing & camp equipage that may be Drawn in the 5th company 10th Massachusetts Regiment Commanded by Benjamin Tupper Esquire, 1782, Aug. 8.',NULL,NULL,'93 pages 19 cm., bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:25852/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:25709/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/25852',143,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3070,9,'mssHM 39','Huntington Manuscripts','[between 1625 and 1650]',1625,1650,'Portolan atlas, Portuguese : [cartographic material] : [manuscript].','The notations on f. 180v "De Gaspar Mĩz" [Martínez?], "K" on f. lv and "No 36" written on binding in seventeenth century hands may indicate early owners. Sold in 1863 by Bernard Quaritch to Henry Huth (1815-78). Huth ex libris on inside front cover. Notation "Portolano (5) p. 1171" pencilled on f. 1 indicates The Huth Library (1880) pt. 4, 1171 .','Portuguese [por]','ff. 181 : paper ; 270 x 355 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46211/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46210/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46211',20,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3071,9,'mssHM 127','Huntington Manuscripts','[between 1400 and 1425]',1400,1425,'Prose and poetry in English : [manuscript].','Three sixteenth century owner\'s notes: f. i,"Ihon wyllyamson" and"This is Iohn Whyttes Boke/ whoo so euer on yt dothe louke/ he that fydyth yt and brynges yt agayne/ I wyll geyfe him xl d. for his payene" (R. Hanna,"The Index of Middle English Verse and Huntington Library Collections: a Checklist of Addenda," Papers of the Bibliographical Society of America 74 (1980) 235-58, here nn. 66-69); f. 62,"Thomas wilbram I commende me unto you and woll and require you that you comm and be biffore me." The inscription"Thomas Wilbraham his Booke" occurs in London, Brit. Lib., Harley 266, a chronicle in English, on f. 151v; see C. E. Wright, Fontes Harleiani (London 1972) 354. Venn, Alumni Cantabrigienses, pt. 1, lists both a Thomas Wilbraham (1530/1-1573; of Peterhouse; Recorder of the City of London) and a Thomas Wilbram (b. 1555; of St. John\'s). Belonged to Edward, 1st Baron Herbert of Cherbury (1583-1648), whose calligraphic monogram,"E" superimposed on"H," appears on f. 1 (without annotation of price); see C. J. Fordyce and T. M. Knox,"The library of Jesus College, Oxford," Proceedings of the Oxford Bibliographical Society 5.2 (1937) 53-115; the plate following p. 72 shows Herbert\'s monogram. Passed by inheritance to George Charles Herbert, 4th Earl of Powis (1862-1952); his sale, Sotheby\'s, 20 March 1923, lot 327 to A. S. W. Rosenbach.','English, Middle (1100-1500) [enm] ; Latin [lat]','ff. 62 : parchment ; 190 x 265 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49283/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49276/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49283',7,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3072,9,'mssHM 100','Huntington Manuscripts','[between 1600 and 1650]',1600,1650,'The Psalmes of David done into English verse by the most noble & vertuous gent. Sr. Phillipp Sidney Knt. : [manuscript].','On f. ii, a note, s. XIX, quoting from the "Guardian vol. 1 p. 81" and presumably referring to this manuscript. Belonged to William Augustus White (1843-1927) of Brooklyn, New York; his name and the date 10 April 1922 in pencil on f. iii; not identified in his catalogues.','English [eng]','ff. 164 : paper ; 160 x 218 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:53312/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:53310/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/53312',2,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3073,9,'mssHM 43','Huntington Manuscripts','[between 1650 and 1675]',1650,1675,'Portolan chart, English : [cartographic material] : [manuscript].','Sold in 1868 from the library of Henry Stevens (1791-1867) to Henry Huth (1815-78); Huth\'s ex libris on pastedown and note"Portolano (7), p. 1171" indicating The Huth Library (1880) pt. 4, 1171 .','Latin [lat]','f. 1 : parchment ; 475 x 690 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:48323/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:48322/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/48323',1,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3074,9,'mssHM 906','Huntington Manuscripts','[between 1350 and 1399]',1350,1399,'Statutes : [manuscript].','On f. 164, s. XV, "Iste liber constat Iacobo Radcliffe __?___ Est de longley." W. H. Robinson, Cat. 12 (Newcastle 1925) n. 750.','Latin [lat] ; French [fre]','ff. i + 164 + i : parchment ; 80 x 117 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:51012/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:51008/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/51012',4,'2026-01-30 01:04:31');
