INSERT INTO manuscripts VALUES(3079,9,'mssHM 34','Huntington Manuscripts','[between 1590 and 1610]',1590,1610,'Portolan atlas, French : [cartographic material] : [manuscript].','First chart bears pencilled letters "MHC " and "Libri 475 " indicating the sale of Guglielmo Libri (1803-69), Sotheby\'s, 28 July 1862, n. 475 to Jackson. Sir Thomas Phillipps\' n. 16406 written on first chart.','Italian [ita] ; French [fre]','ff. 5 : parchment ; 211 x 310 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46219/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46212/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46219',7,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3080,9,'mssHM 719 vol. 14','Huntington Manuscripts','1782, July 20 - Aug. 28',1782,1782,'Orderly book of the 8th Massachusetts Regiment, 1782, July 20 - Aug. 28, West Point.',NULL,NULL,'86 p., 2 charts, 30 cm, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:43338/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:43245/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/43338',93,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3081,9,'mssHM 50','Huntington Manuscripts','[between 1485 and 1499]',1485,1499,'Satires of Juvenal and Persius : [manuscript].','The first owner,"Bernardinus" (his name on f. 69v), may possibly be identified with Bernardinus Carafa, bishop of Chieti from 1501 until his death in 1505. The coat of arms on f. 1, however, is azure a sheaf of wheat or, suggested to be that of the Formento family of Verona (Rietstap , vol. 2, pl. 345). L. S. Olschki, Bull. 2 (Venice 1892) to Robert Hoe: Bierstadt (1895) p. 16 with a plate of f. 70v; Cat. (1909) pp. 124-25; his sale, Anderson, New York, 1911, pt. 1, n. 2147 to G. D. Smith; his Cat. 3 (1911) n. 20 to Henry E. Huntington in April 1912.','Latin [lat]','ff. iii + 84 + ii : parchment ; 178 x 324 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:51018/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:51013/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/51018',5,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3082,9,'mssHM 740','Huntington Manuscripts','1781',1781,1781,'Orderly book of Colonel Drury\'s regiment of Massachusetts militia, 1781, Oct. 1 - Nov. 27, West Point (N. Y.)',NULL,NULL,'7 leaves, 31 cm., unbound','https://hdl.huntington.org/iiif/2/p15150coll7:25867/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:25853/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/25867',14,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3083,9,'mssHM 135','Huntington Manuscripts','[between 1450 and 1475]',1450,1475,'Regiment of princes : [manuscript].','Obvious wear and soil on ff. 1 and 82v suggest that the first text was once a separate volume. Pen trials throughout the volume include these names: s. XVI, f. 12,"Thomas Parrsie gent."; f. 25,"Noverint universi per presentes nos Thomam Catffieldes"; s. XVII, f. 1,"Henricus Smitheus" (rubbed); f. 6,"To the Right honourable the Ea[rl] of Essex at Chartley __cropped___"; f. 17,"William Wacker of Ifield in the"; f. 31,"Thomas Mid" and in the same hand, f. 32,"Johannes"; f. 36,"Noverint universi per present[es] Henricus Colse de Michem __cropped___ Commitat. Surrey gent. et __cropped___ Hother of Horsham in the __cropped___ Sussex." Seymour has suggested that this manuscript may be identified with one owned by Richard Heber, his sale, Evans, 10 February 1836, lot 1163 which"wants beginning and end and has been cruelly mutilated in the middle for the sake of the illumination"; however, there is no reason to suppose that HM 135 is mutilated at the beginning. Thorpe cat. (1836) lot 610 to Sir Thomas Phillipps; Phillipps n. 8980; his shelfmark in blue crayon on f. i verso,"B. 33.459." Acquired privately by Henry E. Huntington through A. S. W. Rosenbach in 1923.','Middle English','ff. 86 : paper ; 200 x 268 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:50636/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:50630/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/50636',6,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3084,9,'mssHM 140','Huntington Manuscripts','1475-1500',1475,1500,'[Prose and poetry]: manuscript, [between 1475 and 1500].','Belonged to Richard Gough (1735-1809); his sale, Sotheby\'s, 5 April 1810, lot 4197 to Richard Heber (1773-1833); Heber sale, by Evans, pt. XI, 10 February 1836, lot 1133 to Sir Thomas Phillipps; Phillipps n. 8299. Sold privately through A. S. W. Rosenbach to Henry E. Huntington in 1923.','English, Middle (1100-1500) [enm]','ff. ii + 170 + ii paper and parchment, bound; 288 x 204 (210 x 105-120) mm.','https://hdl.huntington.org/iiif/2/p15150coll7:19150/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:18797/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/19150',353,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3085,9,'mssHM 149','Huntington Manuscripts','[between 1440 and 1460]',1440,1460,'Here bygynneth þe proheme of þe boke þat men cleped þe mirrour of þe blessede lyfe of oure lord Ihesu criste et cetera : [manuscript].','Written in England in the middle of the fifteenth century by"Thomas Ad." Acquired by Sir Thomas Phillipps ca. 1820; Phillipps MS 282 and his Middle Hill stamp on the front pastedown; Phillipps sale, Sotheby\'s, 27 June 1919, lot 820 to Edwards. Acquired by Henry E. Huntington in 1924.','English, Middle (1100-1500) [enm]','ff. 108 : parchment ; 170 x 259 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49103/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49090/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49103',13,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3086,9,'mssHM 264','Huntington Manuscripts','[between 1450 and 1475]',1450,1475,'Genealogical chronicle of the Kings of England : [manuscript].','Written in England after the accession of Edward IV in March 1461 and perhaps before his marriage in May 1464 (a roundel with Elizabeth not included, as in other similar manuscripts). Sold in 1917 by J. and J. Leighton to Howard C. Levis whose armorial book plate is on the front pastedown; motto,"Deo Juvante." Source and date of acquisition by Henry E. Huntington unknown.','Latin [lat]','5 membranes : parchment ; 310 x 4420 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:53329/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:53327/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/53329',2,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3087,9,'mssHM 117','Huntington Manuscripts','[between 1600 and 1615]',1600,1615,'The Psalmes of David metaphrased into verse by the noble, learnead & famous gent. Sr. Philip Sidney Knight : [manuscript].','Belonged in 1789 to the poet William Hayley (1745-1820); his signature on f. iii verso, but not traced in his 1821 or 1844 sales. Owned by Benjamin Heywood Bright, although, due to rebinding (?), no ownership marks present; his sale, Sotheby\'s, 18 June 1844, pt. II, n. 242 to Wilson. Later owned by the Rev. Thomas Corser (1793-1876), although, again, no ownership marks survive; his sale, Sotheby\'s, 11 July 1870, pt. V, lot 556 to Ellis. Sold by W. C. Hazlitt to Henry Huth (1815-78); in The Huth Library (London 1880) 4:1196. Sale of Alfred H. Huth (1850-1910), Sotheby\'s, 11 July 1917, pt. VI, lot 6023 to Quaritch.','English [eng]','pp. 322 : paper ; 140 x 192 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:53332/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:53330/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/53332',2,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3088,9,'mssHM 505','Huntington Manuscripts','[between 1450 and 1475]',1450,1475,'Liber Uricrisiarum : [manuscript].','The book was apparently copied for Richard Dod (possibly the barber surgeon of London mentioned by C. H. Talbot, Medicine in Medieval England, London 1967, p. 187) whose name appears in the first rubric. The scribe was John Vynt, a ward and clerk for Richard Dod. On f. 60v, s. XV/XVI, "Richard Minne Pretium 5 s." Sold by John Denley, a London bookdealer, to Sir Thomas Phillipps in 1826. Phillipps n. 10603; Phillipps sales, Sotheby\'s, 15 June 1908, lot 199 to Madden; this same manuscript (?) resold, Sotheby\'s, 19 May 1913, lot 961 to Quaritch. Quaritch Cat. 344 (1916) n. 13 and Handlist (1923) n. 13. Acquired by Henry E. Huntington from Quaritch in April 1925. (CSmH)','Middle English','ff. 134 : paper ; 240 x 343 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49684/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49679/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49684',5,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3089,9,'mssHM 198','Huntington Manuscripts','[1595-1675]',1595,1675,'Commonplace book--poetry : manuscript, 1595-1675.','Part 1 includes scribblings and autographs by "Edw Denny" [presumably Edward Denny, 1569-1637], "Charles Cocks", "Edward Randolphe" and (on p. 162) "Thomas Cassy". Part 2 includes the name "Meriall Tracy". Parts 1 and 2 later owned by Joseph Haslewood, Edward King, Viscount Kingsborough, and Henry Huth. Sold at Sotheby\'s, 17 July 1917 (Huth sale), lot 5873.','English [eng]','2 parts in 1 one volume (256 leaves) : paper ; 30 x 43 cm','https://hdl.huntington.org/iiif/2/p15150coll7:77524/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:76955/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/77524',569,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3090,9,'mssHM 611','Huntington Manuscripts','1779',1779,1779,'Orderly book of Lieutenant Colonel Ely Kershaw, 1779, Feb. 26 - Apr. 23, Georgia and South Carolina',NULL,'English [eng]','32 leaves, 20 cm, stitched, paper wrappers','https://hdl.huntington.org/iiif/2/p15150coll7:9369/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:9300/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/9369',69,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3091,9,'mssHM 62','Huntington Manuscripts','[between 1050 and 1099]',1050,1099,'Bible : [manuscript].','In both volumes, f. 1, thirteenth century ex libris of the Rochester cathedral priory attributing early ownership to Gundulf, bishop of Rochester, 1077-1108. Marginal note in lead, vol. II, f. 134,"Dominus Gilbertus episcopus scit bene cantare, deus eum litera dicat" may refer to Gilbert Glanville, bishop of Rochester, 1185-1214; other notes in the same hand, f. 192v. Listed, ca. 1130, in the Rochester library catalogue which forms the second part of the Textus Roffensis, reproduced by P. Sawyer, Textus Roffensis Part II. Early English Manuscripts in Facsimile 11 (Copenhagen 1962) f. 225v; printed by R. P. Coates in Archaeologia Cantiana 6 (1864-65) p. 124. Also listed in the Rochester catalogue of 1202, London, Brit. Lib., Roy. 5.B.XII, f. 2, printed by W. B. Rye in Archaeologia Cantiana 3 (1861) n. 48. Ker, MLGB, p. 164 . First reappears in the library of John, Lord Lumley (1534?-1609); see S. Jayne and F. R. Johnson, eds., The Lumley Library: The Catalogue of 1609 (London 1956) p. 48, n. 111. At some time thereafter the book moved to the continent where it appears in the collection of the Amsterdam theologian Herman van de Wall (1672-1733), who owned another manuscript bible presumably of English origin, containing the letter of Senatus, prior of Worcester, to Master Alured; van de Wall\'s sale, Catalogus variorum et insignium librorum...quos...collegit et reliquit...Hermannus van de Wall...Minister Amstelodamensis; quorum publica auctio habebitur...ad diem 7 Septembris et sqq. Anno 1734...Amstelodami apud Salomonem Schouten, reported by F. L. Hoffmann in Serapeum 19 (1858) 225-28. Hereafter the bible passes through a number of private libraries and sales in the Low Countries: mentioned as"sold not many years ago by a bookseller at Louvain for 2000 florins" in John Thorpe, Customale Roffense (London 1788) p. 158. Sale of Jean-Baptiste Leplat (bookseller at Malines) in Malines, 2 May 1763, n. 3. Gasparoli sale, Antwerp, 3 September 1823, n. 2 to J. Schuylen. Belonged to the Rev. Theodore Williams who had the book rebound; his sale, by Steward, Wheatley and Adlard, London, 5 April 1827, n. 355 to Sir Thomas Phillipps. Phillipps n. 3504.','Latin [lat] ; French [fre]','Vol. I, ff. 241; Vol. II, ff. 262 : parchment ; 260 x 400 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:51611/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:51602/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/51611',9,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3092,9,'mssHM 635','Huntington Manuscripts','1781-1783',1781,1783,'Orderly book of the 8th Massachusetts Regiment, 1781-1783',NULL,'English (eng)','69 leaves, 30 cm, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:42582/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:42437/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/42582',145,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3093,9,'mssHM 663','Huntington Manuscripts','1775, June 28 - 1776, April 18.',1775,1776,'Orderly book of Philip John Schuyler, 1775, June 28 - 1776, April 18, New York, Fort Ticonderoga, Albany, Fort St. George.',NULL,NULL,'376 pages, 31 cm., bound volume','https://hdl.huntington.org/iiif/2/p15150coll7:24151/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:23770/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/24151',381,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3094,9,'mssHM 133','Huntington Manuscripts','[between 1450 and 1499]',1450,1499,'Brut chronicle, in English : [manuscript].','Possession notes in the volume are: s. XVIex, f. 18,"Rych__?___ P__?___; f. 76v,"John templar [?]" and"William [?] Jones"; f. 98v,"This is thomas Verney boke"; s. XVI/XVII, f. 69,"Edmund Francis." The note on f. 59 is not"Elyzabeth madre E. W.," as in the catalogue of the Hellman sale, but"Thys byll made." George S. Hellman (author and rare book dealer, 1878-1958) sale, Anderson, New York, 25 November 1919, lot 65 with a plate of f. 59 to G. D. Smith. Source and date of acquisition by Henry E. Huntington unknown.','Middle English','ff. 115 : paper ; 185, ca. x 264 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49688/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49685/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49688',3,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3095,9,'mssHM 660','Huntington Manuscripts',NULL,NULL,NULL,'Orderly book of the 3rd New Hampshire regiment, 1778, Jan. 13 - Feb. 4, Valley Forge, Pa.','The manuscript was part of the collection of Samuel W. Pennypacker sold at a Stan V. Henkels\'s sale in 1907. It was then acquired by Reinette L. McCrea; sold with the McCrea collection at the American Art Association sale in October 1919 (Sale 1437, Lot 721).',NULL,'36 leaves, 14 x 21 cm. oblong quarto, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:23769/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:23680/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/23769',89,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3096,9,'mssHM 41','Huntington Manuscripts','[between 1550 and 1575]',1550,1575,'Portolan atlas, Portuguese : [cartographic material] : [manuscript].','A. H. Huth sale catalogue, pt. VI, n. 5920 lists the manuscript as coming from the Library of the Archbishop of Toledo but CortesÃ£o and Teixeira da Mota in PMC, 3:13-14 feel that this atlas was in the Biblioteca Nacional in Madrid until 1866 but disappeared after being taken to the Paris Exhibition in 1867. Sold in 1874 by Quaritch to Henry Huth (1815-78), whose ex libris is on front pastedown; The Huth Library (1880) pt. 4, 1172.','Latin [lat]','ff. 40 : parchment ; 271 x 411 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46241/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46220/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46241',21,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3097,9,'mssHM 603','Huntington Manuscripts','August 18, 1776-May 18, 1777',1776,1777,'Orderly book of Peter Horry, 1776, Aug. 18 - 1777, May 18.',NULL,'English [eng]','117 leaves, 20 cm., oblong octavo, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:8988/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:8749/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/8988',239,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3098,9,'mssHM 30','Huntington Manuscripts','[1679]',1679,1679,'Portolan atlas, engraved, with manuscript additions : [cartographic material] : [manuscript].','From library of the Abate Luigi Celotti (ca. 1768-ca. 1846); his sale, Sotheby\'s, 14 March 1825, n. 208 to Thomas Thorpe; pencilled number "85 " on front pastedown; "200 " and "3/3/0 " pencilled on back pastedown probably refer to catalogue number and sale price of Thomas Thorpe; Sir Thomas Phillipps\' Middle Hill stamp on front pastedown and "Phillipps MS 4352 " written on front of chart 1. The portolan is listed under the Thorpe sale in the Middle Hill catalogue p. 69 with the notation "Ex Bibl. Celotti. "','Italian [ita]','ff. 8 : parchment ; 280 x 395 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46247/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46242/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46247',5,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3099,9,'mssHM 615','Huntington Manuscripts','August 14, 1776-September 20, 1776',1776,1776,'General orders &c. 1776, Aug. 14 - Sept. 20.',NULL,'English [eng]','48 leaves, 18 cm., bound volume, in a slip-case.','https://hdl.huntington.org/iiif/2/p15150coll7:9765/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:9664/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/9765',101,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3100,9,'mssHM 125','Huntington Manuscripts','[between 1290 and 1410]',1290,1410,'Pricke of conscience : [manuscript].','Written in England near the Gloucestershire/Worcestershire border at the turn of the fourteenth century. Miscellaneous sixteenth century pen trials, including the following names: f. 73v,"Thomas Jhone"; f. 95v,"In my begynynge god be my good spede In grace & vertue allways to prosed. Chrystefer Byrkheade" ( IMEV 430.5 ); f. 98v,"Rycharde mynstrelley." On f. 100v, an inscription, s. XIX (?), mostly torn away with only the last word remaining:"Male." Placed by G. D. Smith in a sale by Anderson, New York, 12 December 1917, lot 376 to G. D. Smith.','English, Middle (1100-1500) [enm] ; Latin [lat]','ff. ii + 100 : parchment.','https://hdl.huntington.org/iiif/2/p15150coll7:49322/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49316/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49322',6,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3101,9,'mssHM 696','Huntington Manuscripts','October 26 - Nov. 11, 1777',1777,1777,'Orderly book of Alexander McDougall\'s Division, 1777, October 26 - Nov. 11, Whitpain, Pa., Whitemarsh, Pa.',NULL,NULL,'77 leaves, 21 cm, bound volume.','https://hdl.huntington.org/iiif/2/p15150coll7:25708/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:25660/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/25708',48,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3102,9,'mssHM 162','Huntington Manuscripts','[between 1585 and 1599]',1585,1599,'Arcadia : [manuscript]','On f. 78v (formerly f. 86v), an otherwise blank leaf, the name Robert Walker; a man of this name was treasurer to Sir Henry Sidney, 1575-ca. 1581 and appears in the Sidney family records until 1583. Possibly to be identified with lot 259 in the sale of Thomas Martin of Palgrave, by Baker and Leigh, London, 18 May 1774. Belonged to the Earl of Ashburnham (1797-1878); in his "Appendix," n. CCXLVIII; that number in arabic numerals on the characteristic circular yellow label on the spine. The "Appendix" was sold privately to Henry Yates Thompson (1838-1928) in May 1897; he retained only select manuscripts and sold the rest; this manuscript, Sotheby\'s, 1 May 1899, lot 16 to Tregaskis. Belonged to C. W. Dyson Perrins (1864-1958); his sale, Sotheby\'s, 17 June 1907, lot 415 to Dobell; sold by Dobell to ___Dodd, Mead and Co. of New York. Acquired by William Augustus White (1843-1927) of Brooklyn, N.Y.; in the Hand-List of Early English Books. . .collected by W. A. White. . . from card catalogue made by Miss Henrietta C. Bartlett [New York 1914] p. 51. Precise source and date of acquisition by Henry E. Huntington unknown.','English [eng]','ff. 180 : paper ; 205 x 302 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:53357/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:53348/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/53357',9,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3103,9,'mssHM 826','Huntington Manuscripts','1777, April 5-18.',1777,1777,'Orderly Book No. 1 For Colo. Durkee, 1777, Apr. 5-18.',NULL,NULL,'35 leaves, 20cm. ff. 6 and 14-35 are blank; stitched notebook, original paper covers.','https://hdl.huntington.org/iiif/2/p15150coll7:25900/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:25868/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/25900',32,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3104,9,'mssHM 588','Huntington Manuscripts','March 12 - April 13, 1783',1783,1783,'Orderly book of the New Hampshire Battalion, 1783, Mar. 12 - Apr. 13, Newburgh, N. Y.','Purchased from Henry F. DePuy, 1919.','English [eng]','36 leaves, 24 cm., oblong octavo.','https://hdl.huntington.org/iiif/2/p15150coll7:8424/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:8350/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/8424',74,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3105,9,'mssHM 502','Huntington Manuscripts','[between 1400 and 1450]',1400,1450,'Devotional miscellany : [manuscript].','Numerous notes and pentrials, usually upside down in the lower margin, including on f. 56"John baker owe this boke wytnes John fuller Edmund baker damyd"; John Baker\'s name also appears on ff. 33, 41v, 48v, 52v, 53v, 57v. Owned, s. XVI, by John Wood, whose name is on ff. 34v, 86. On f. 59, s. XVII,"Joseph Beeston"; on f. 31v, s. XVIII,"Edwd. Beeston." According to a pencil note on the front pastedown, given (ca. 1780) by Richardson, of Leeds, to the museum of Dr. Richard Greene (1716-93) at Lichfield. Most of the collection sold after Greene\'s death to Walter Honeywood Yates of Bromsberrow Place, Gloucestershire. For mention of the catalogues printed by Greene in 1773, 1782 and 1786 and for the one printed by Yates in 1801, see DNB 23:509; the pencilled numbers 150, 375 and 44 on the endleaves may refer to entries in these catalogues (not available to us). T. Rodd\'s Catalogue (1838) n. 259 (that number also in pencil on the front pastedown), presumably to Sir Thomas Phillipps; his n. 11929; not traced in his sales. On the back pastedown, the initials of Thomas Fitzroy Fenwick and the date 1891. Obtained by Henry E. Huntington from Quaritch in April 1925.','English, Middle (1100-1500) [enm]','ff. 90 : parchment ; 150 x 145 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49132/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49112/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49132',20,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3106,9,'mssHM 35','Huntington Manuscripts','[1546]',1546,1546,'Portolan atlas, Portuguese : [cartographic material] : [manuscript].','Endpapers bear numbers "970, " "171, " "D. 1. 1563* "; atlas is first known in the library of Baron Taylor in 1841-42 (not in his 1848 sale). Sale of Guglielmo Libri (1803-69), Sotheby\'s, 28 March 1859, n. 827, with reproduction of chart 7 on pl. 33 to Quaritch. There is no Huth ex libris, as mentioned in this sequence in PMC 1:153 , nor are there any marks or signs that it ever existed in this volume. Sir Thomas Phillipps\' number "23856 " and shelfmark "a.61 181 " (altered from "449 ") are on flyleaf; Phillipps\' sale, Sotheby\'s, 26 June 1919, n. 528, to Campbell (nom de guerre of Thomas Fitzroy Fenwick).','Latin [lat]','ff. 7 : parchment ; 461 x 557 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46255/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46248/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46255',7,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3107,9,'mssHM 47','Huntington Manuscripts','[between 1600 and 1625]',1600,1625,'Portolan chart, French : [cartographic material] : [manuscript].','The only marking is the number "13" in a seventeenth century hand on verso (once in pencil and once in red ink), probably a page number in a volume of maps.','French [fre]','f. 1 : parchment ; 460 x 635 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46257/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46256/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46257',1,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3108,9,'mssHM 131','Huntington Manuscripts','[between 1450 and 1475]',1450,1475,'Brut chronicle, in English : [manuscript].','Possible possession notes are: s. XV, ff. 21v, 59v, 63 and 72, "Symon"; s. XVI first half, f. 36v "Robard Burke" in the same hand as "Ferns" on f. 37; also of the sixteenth century are: ff. 64 and 70, a monogram of the letters "ROSE"; f. 102, "To my welbelowed frend John peryne of Rykelly in" by the same person who jotted the sayings on f. 66; f. 125, "henry the viii by the grace of god [twice] domine dominus noster Parker [twice] knyght." Belonged to the 5th Duke of Buccleuch (1806-84) whose collection was inherited and sold by his son, William Montagu-Douglas-Scott, 6th Duke of Buccleuch (1831-1914), Sotheby\'s, 25 March 1889, lot 211 to Quaritch; Quaritch Catalogue 103 (1890) n. 417. Henry White sale, Sotheby\'s, 21 April 1902, lot 500 to Maggs; Maggs Catalogue 287 (1912) n. 1173 with plate of f. 102v. Sotheby\'s, 17 July 1913, lot 963 to Joyes. Belonged to Herschel V. Jones (1861-1928) of Minneapolis; his sale, Anderson, New York, 2 December 1918, pt. I, lot 242 with plate of f. 20 to G. D. Smith for Henry E. Huntington. (CSmH)','English, Middle (1100-1500) [enm]','ff. 154 : parchment ; 165 x 199 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:50865/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:50862/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/50865',3,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3109,9,'mssHM 58','Huntington Manuscripts','[between 1485 and 1499]',1485,1499,'Agnus castus with additional medical recipes : [manuscript].','Among the pentrials: s. XVI: f. 24, "...noverint universi per presentes nos Iohannes ashington in Comitatu Devon. yeoman teneri et firmeter obligari Iohan__cancelled___ de __cancelled___ ne in Comitatu predicto"; f. 28v, possibly in the same hand, "Iohannes de G.R.A."; s. XVII: f. 68v, "John Penrose"; on the leather turn-ins of the front cover, "George Pyne" and "Frances Pyne"; f. 41v, the note on "Master Whettons electuarie" by an owner presumably living in London to judge from the reference to Cheapside and to the Great Conduit. Sold by Rodd, ca. 1842, possibly n. 295 in one of his catalogues (that number, Rodd\'s name and the Phillipps shelfmark in pencil on the inside of the front cover) to Sir Thomas Phillipps; Phillipps MS 11077. (CSmH)','English [eng]','ff. 95 : parchment ; 145 x 200 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52593/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52576/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52593',17,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3110,9,'mssHM 28','Huntington Manuscripts','[between 1550 and 1599]',1550,1599,'Portolan atlas, Italian : [cartographic material] : [manuscript].','On flyleaf, "Hanrott 1328 letters 1833" in reference to Philip Augustus Hanrott sale, Evans, 1833, pt. I, n. 1328 to French; on verso of first flyleaf and on f. 1, Sir Thomas Phillipps\' notes "Phillipps MS 22796"; an unsigned, undated note in a British hand on end flyleaf states "This atlas is by the same hand as the one in Riccardiana Florence No 3140 which has verses at the end dedicated to Francesco Gisolfo the author of the work, circa 1553."','Latin [lat]','ff. 14 : parchment ; 410 x 277 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:46064/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:46051/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/46064',13,'2026-01-30 01:04:31');
