INSERT INTO manuscripts VALUES(3114,9,'mssHM 937','Huntington Manuscripts','[1462, May 15]',1462,1462,'De casibus vivorum illustrium in French : [manuscript].','Written in 1461-1462, according to the marginal notes and the colophon, f. 359v, by Haquinet le Pesquier. His monogram appears below his name on f. 359v and in the pen flourishes on ff. 247v and 248. The first owner of the manuscript was Jean de Croy, sieur de Chimay (d. 1473), whose coat of arms is in the initials at the beginning of each book; his motto, Souveingne vous, and device, an armoured merman, usually alternate in the chapter initials. On ff. 110v, and 196v, in the pen flourishes at the bottom of the text, the same coat of arms with the quarters reversed, encircled by the collar of the Order of the Golden Fleece."Messire Iean de Croy, seigneur de Tour-sur-Marne" was nominated to the Order by Philip the Good; see H. Kervyn de Lettenhove, La Toison d\'or (Brussels 1907) 91. Erased inscription f. 359v,"C\'est le livre de Jehan boccace en__?___1 est a mo__?___oy comte __?___," which may be that of Charles de Croy, comte de Chimay until 1486, thereafter prince de Chimay, known to have signed his books in this fashion; see A. Bayot, Martin Le Franc: L\'Estrif De Fortune et De Vertu (Paris 1928) 52-56, for a partial list of the manuscripts which belonged to the Croy de Chimay family; for the manuscripts in the 1614 sale of Charles de Croy (1560-1612), see E. van Even,"Notice sur la bibliothèque de Charles de Croy, duc d\'Aerschot," Bulletin du Bibliophile Belge 9 (1852) 380-93 and 436-51; HM 937 does not appear in either list. Belonged to Marc-Pierre de Voyer de Paulmy Comte d\'Argenson (1696-1764) whose arms are on the covers; see H. Martin, Catalogue des Manuscrits de la Bibliothèque de l\'Arsenal, (Paris 1899) t. VIII"Histoire de la Bibliothèque de l\'Arsenal" p. 116, where this manuscript appears on the inventory of the Comte d\'Argenson. It was inherited by his son, Marc-René, Marquis de Voyer (1722-82), and sold by him to his cousin, Antoine-René de Voyer d\'Argenson, marquis de Paulmy (1722-87) who listed it in his hand-written inventory, Paris, Arsenal, MS 6291, p. 99, before selling it to the book dealer Molini, evidently because he already had other finely illuminated copies of this text ("double moins beau que les autres," possibly in reference to Paris, Arsenal, MS 5193, with 150 miniatures). Belonged to Frederick William Brooke Thellusson, Baron of Rendlesham (1840-1911); his sale, Sotheby\'s, 27 February 1899, lot 1829 to Leighton. Owned by Charles Butler (1821-1910); his sale, Sotheby\'s, 5 April 1911, lot 183 to Edwards. Acquired by Herschel V. Jones of Minneapolis (1861-1928); his sale, Anderson, New York, 29 January 1919 pt. II, lot 1070C to G. D. Smith. Precise source and date of acquisition by Henry E. Huntington unknown.','French, Middle (ca. 1300-1600) [frm]','ff. 361 : parchment ; 330 x 420 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52023/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52018/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52023',5,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3115,9,'mssHM 115','Huntington Manuscripts','[between 1425 and 1450]',1425,1450,'The nativite of oure lady : [manuscript].','The Harvard manuscript (Cambridge MA, Harvard, Houghton Library, Richardson 44: Life of St. Catherine), the 2 St. John\'s manuscripts (Cambridge, St. John\'s College, N. 16 and N. 17: Lives of John the Baptist, John the Evangelist, Jerome) and HM 115 may have been bound together in one volume: they share the same scribe and same dimensions, and were sold together as lot 3597 in the sale of William Fletewode of Missenden Abbey, auction by Paterson, 5 December 1774, to the bibliographer, William Herbert (1718-95). Notes in Herbert\'s hand throughout the manuscript, collating it with the Caxton edition; his sale, by Arrowsmith and Bowley, 21 November 1798, lot 909. All 4 texts belonged to John Towneley (1731-1813) and may have been rebound at this time, all in blue morocco by Kalthoeber; his sale, by Evans, 8 June 1814, pt. I, where they were lots 879 (Life of Jerome), 880 (HM 115), 882 (Life of St. Catherine), 883 (Lives of John the Baptist and John the Evangelist). Belonged to William Bragge (1823-84); his sale, Sotheby\'s, 7 June 1876, lot 287 to Ellis and White. In the collection of Robert Hoe: Cat. (1909) p. 126; his sale, Anderson, New York, pt. I, 1911, lot 2148 to G. D. Smith.','English, Middle (1100-1500) [enm]','ff. 112 : parchment ; 150 x 220 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:49532/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:49522/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/49532',10,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3116,9,'mssHM 2','Huntington Manuscripts','[1591]',1591,1591,'Chester mystery cycle : [manuscript].','Written in England, the earliest known complete manuscript of this text, in 1591 according to the explicit on f. 150v. Art. 1, with the date "4 June 1600" on f. I and the name "Georgium Bellin" on f. IV verso, was copied from Harley 2013 in the nineteenth century. Below the explicit on f. 150v, in a more formal script, possibly by a different person, but difficult to see clearly due to discoloration from a reagent, another note with the same date of 1591 and the name of the copyist (?), "By me Edward Gregorie scholler at Bunburye the yeare of our lord god 1591." But see also Lumiansky and Mills, xi, xvi n. 18. Also on f. 150v, ca. 1600, the name "Richarde Gregorie" twice; on f. 41, s. XVII, "John Egerton esq.," probably not one of the first three Earls of Bridgewater, all of whom bore that name, but rather another member of the Egerton family, who possessed properties in Cheshire. J. Payne Collier in the 1831 edition of his History of English Dramatic Poetry, 2:227 states that the manuscript had been "only very recently" discovered and that it had come into the possession of J. B. Nichols, esq., F.S.A. (presumably John Bowyer Nichols, 1779-1863, of The Gentleman\'s Magazine) from an unnamed gentleman of Cheshire; Nichols\' name is omitted in the 1879 edition. It was first suggested by W. W. Greg, "Bibliographical and Textual Problems of the English Miracle Cycles," The Library 5 (1914) 170 that the modern transcription from Harley 2013 on ff. I-XII (paper watermarked 1829) was supplied by J. Payne Collier, presumably meaning that Collier obtained the transcription or had it done, rather than copying it himself, as the script does not resemble other examples of Collier\'s handwriting in the Huntington Library. By 1836, when Collier printed the Antichrist pageant (art. 23) in his Five Miracle Plays, the manuscript had passed into the collection of the Duke of Devonshire; it was temporarily mislaid and not available to H. Deimling for his 1892 edition. Listed in the typescript "Alphabetical Handlist of the Titles of the Kemble-Devonshire Collection of English Plays," compiled 1906-07, vol. 1, p. 92.','English, Middle (1100-1500) [enm]','ff. 145 (foliated 6-150) : paper ; 196 x 293 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:51070/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:70789/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/51070',329,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3117,9,'mssHM 605, v. 2','Huntington Manuscripts','September 1 to October 12, 1776',1776,1776,'Orderly book of the 4th Pennsylvania Battalion, 1776, Sept. 3 - Oct. 12, Ticonderoga (N.Y.)',NULL,NULL,NULL,'https://hdl.huntington.org/iiif/2/p15150coll7:30525/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:30376/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/30525',149,'2026-01-30 01:04:31');
INSERT INTO manuscripts VALUES(3118,9,'mssHM 1','Huntington Manuscripts','[between 1490 and 1510]',1490,1510,'Towneley cycle : [manuscript].','Among the pentrials: s. XVI: f. 13, "Iohn"; f. 73, "Spigart [?]"; f. 90, "James blake bowrn by"; ff. 101, 107v, "Iohn"; s. XVII: f. 35v, "Samuel" and "S. humer__?___"; f. 73v, "Thomas Hargraues"; f. 90, "Thomas Hargraues of Burnleye"; f. 97v, "William __?___"; f. 121v, "P. Haw [?]." Belonged to Christopher Towneley (1604-74) whose pressmark occurs twice on f. 1, "13 1/2:35" above "F:35." In the sale of John Towneley (1731-1813) of Towneley Hall, Lancashire, by Evans, pt. I, 8 June 1814, lot 894 to John Louis Goldsmid (second cousin to Sir Isaac Lyon Goldsmid); his sale, Evans, 11 December 1815, lot 287 to John North; his sale, Evans, pt. III, 25 May 1819, lot 457 to Peregrine Edward Towneley (son of the aforementioned John Towneley; d. 1846), whose name appears in pencil on f. ii verso. Sale of Col. John Towneley (nephew of Peregrine Edward Towneley; d. 1878), Sotheby\'s, 27 June 1883, lot 202 to Quaritch. Quaritch Cat. 355 (1884) n. 21885; Cat. 369 (1886) n. 35673; Cat. 124 (1892) n. 343; Cat. 138 (1893) n. 77; Cat. 176 (1898) n. 43; Cat. 193 (1899) n. 86. Sold in August 1900 to Sir Edward F. Coates (d. 1921); letter dated 16 August [1900] from A. W. Pollard to Mr. E. Almack tipped into the volume, regretting that the British Museum had not been able to acquire the manuscript. Coates sale, Sotheby\'s, 8 February 1922, lot 1 with plate of f. 111v to A. S. W. Rosenbach for Henry E. Huntington; letter dated 10 January 1922 from Rosenbach to Huntington tipped into the Library copy of the Sotheby catalogue.','English, Middle (1100-1500) [enm]','ff. 132 : parchment ; 210 x 305 mm.','https://hdl.huntington.org/iiif/2/p15150coll7:52988/manifest.json','https://cdm16003.contentdm.oclc.org/iiif/2/p15150coll7:52928/full/200,/0/default.jpg','https://hdl.huntington.org/digital/collection/p15150coll7/id/52988',60,'2026-01-30 01:04:31');
